INSERT INTO `books` VALUES (1,'','978-0-252-06950-5','Why art cannot be taught : a handbook for art students','EN','University of Illinois Press',213,2001,'Elkins, James, 1955-','','','EDU001','','why-art-cannot-be-taught-a-handbook-for-art-students','2016-12-23 22:01:22','2021-01-31 16:14:19',9,'51m__wsLsuL._SX313_BO1_204_203_200_.jpg','image/jpeg',39023,315,499,NULL,1,707.11730000,44926866,'N346.A1',1812,1808,0,'707.1173 E37',1,NULL,0,0,NULL),(2,NULL,'978-90-8728-167-0','The conflict of the faculties : perspectives on artistic research and academia','EN','Leiden University Press',275,2009,'Borgdorff, Henk','Perspectives on Artistic Research and Academia',NULL,'EDU002',NULL,'the-conflict-of-the-faculties','2016-12-23 22:01:22','2021-01-31 16:14:19',9,'411hewA8H_2BL.jpg','image/jpeg',21642,356,500,'&lt;div&gt;&lt;div&gt;&lt;I&gt;The Conflict of the Faculties &lt;/I&gt;looks at the emerging field of artistic research as a place of crossover between the artistic and academic worlds. Henk Borgdorff carefully examines how artistic research broadens and deepens traditional academic approaches to studying art, while observing the tension between the two disparate fields in terms of methods and practices.&lt;/div&gt;&lt;div&gt;“Well-written and well-argued, this book will probably become a reference for many studies to come and required reading for anyone active in this domain.”—Frans-Willem Korsten, Erasmus University Rotterdam and Leiden University, the Netherlands&lt;/div&gt;&lt;/div&gt;',1,707.00000000,786255528,'N85',153,164,0,'707 B732',1,NULL,0,0,NULL),(3,NULL,'978-0-415-96085-4','Rethinking Contemporary Art and Multicultural Education','EN','Routledge',432,2011,'Joo, Eungie; Ham-Roberts, Jenny; Keehn, Joseph',NULL,NULL,'EDU003',NULL,'rethinking-contemporary-art-and-multicultural-education','2016-12-23 22:01:22','2021-01-31 16:14:19',9,'51l0VvK8lkL.jpg','image/jpeg',58215,421,500,'&lt;P&gt;For over a decade, &lt;EM&gt;Contemporary Art and Multicultural Education&lt;/EM&gt; has served as the guide to multicultural art education, connecting everyday experience, social critique, and creative expression with classroom learning. The much-anticipated &lt;EM&gt;Rethinking Contemporary Art and Multicultural Education&lt;/EM&gt; continues to provide an accessible and practical tool for teachers, while offering new art, essays, and content to account for transitions and changes in both the fields of art and education. A beautifully-illustrated collaboration of over one hundred artists, writers, curators, and educators from in and around the contemporary art world, this volume offers thoughtful and innovative materials that challenge the normative practices of arts education and traditional art history.  &lt;EM&gt;Rethinking Contemporary Art and Multicultural Education&lt;/EM&gt; builds upon the pedagogy of the original to present new possibilities and modes of understanding art, culture, and their relationships to students and ourselves.&lt;BR&gt; &lt;BR&gt;The fully revised second edition provides new theoretical and practical resources for educators and students everywhere, including:     &lt;/P&gt; &lt;UL&gt; &lt;P&gt; &lt;LI&gt;Educators\' perspectives on contemporary art, multicultural education, and teaching in today’s classroom&lt;/LI&gt; &lt;P&gt;&lt;/P&gt; &lt;P&gt; &lt;LI&gt;Full-color reproductions and writings on over 50 contemporary artists and their works, plus an additional 150 black-and-white images throughout&lt;/LI&gt; &lt;P&gt;&lt;/P&gt; &lt;P&gt; &lt;LI&gt;Lesson plans for using art to explore topical issues such as activism and democracy, conflict: local and global, and history and historicism    &lt;/LI&gt; &lt;P&gt;&lt;/P&gt; &lt;P&gt; &lt;UL&gt;&lt;/UL&gt; &lt;LI&gt;A companion website offering over 250 color reproductions of artwork from the book, a glossary of terms, and links to the New Museum and G: Class websites---www.routledge.com/textbooks/9780415960854.&lt;/LI&gt;&lt;/UL&gt;',1,707.10730000,548660272,'N353',1013,1021,0,'707.1073 J62',1,NULL,1,0,NULL),(4,'3-86588-303-6',NULL,'A.C.A.D.E.M.Y','EN','Christoph Keller Revolver Verlag',279,2006,'Nollert, Angelika',NULL,NULL,'EDU004',NULL,'a-c-a-d-e-m-y','2016-12-23 22:01:22','2021-01-31 16:14:19',9,'41gTDanUU-L.jpg','image/jpeg',20507,409,500,NULL,1,701.00000000,82170416,'N6495.8',82,98,0,'701 N794',1,NULL,1,0,NULL),(5,'9955-624-72-8','null','Art studies : between method and fancy','EN','Acta Acadamiae Artium Vilnensis',214,2006,'Gelūnas, Arūnas','null','null','EDU005','null','art-studies-between-method-and-fancy','2016-12-23 22:01:22','2021-02-01 15:32:04',9,'515NmE648IL.jpg','image/jpeg',41540,348,500,'The majority of the essays in the volume originated in a conference Art Studies: between method and fancy held at Vilnius Academy of Fine Arts in April 2005. After officially joining the EU in May 2004, there has been general awareness in Lithuania of there being a lack of larger scale cooperation with European Institutions, art education sector being no exception. As readers will soon discover, what originated as merely a need to provide Lithuanian artists and art students with more information on and art education in Europe resulted in a highly intriguing discussion on the changes and challenges in European art education and the state of art in the present day. Tremendous new opportunities always arise together with new challenges and this collection of essays by sixteen authors from nine countries is proof that increasingly these opportunities and challenges are traversing the confines of one particular country or even region and are shared by much larger international communities than one could ever imagine.',1,707.10000000,226352085,'N241.L57',NULL,3,0,'707.1 G314',1,'undefined',1,0,NULL),(6,NULL,'978-0-262-13493-4','What is art education? : a twenty-first-century question','EN','The MIT Press',373,2009,'Steven Henry Madoff',NULL,NULL,'EDU006',NULL,'art-school-propositions-for-the-21st-century','2016-12-23 22:01:22','2021-01-31 16:14:19',9,'41BH7R79KfL.jpg','image/jpeg',24682,333,500,'&lt;DIV&gt;The last explosive change in art education came nearly a century ago, when the German Bauhaus was formed. Today, dramatic changes in the art world -- its increasing professionalization, the pervasive power of the art market, and fundamental shifts in art-making itself in our post-Duchampian era -- combined with a revolution in information technology, raise fundamental questions about the education of today\'s artists. &lt;I&gt;Art School&lt;/I&gt;&lt;I&gt;(Propositions for the 21st Century)&lt;/I&gt; brings together more than thirty leading international artists and art educators to reconsider the practices of art education in academic, practical, ethical, and philosophical terms. The essays in the book range over continents, histories, traditions, experiments, and fantasies of education. Accompanying the essays are conversations with such prominent artist/educators as John Baldessari, Michael Craig-Martin, Hans Haacke, and Marina Abramovic, as well as questionnaire responses from a dozen important artists -- among them Mike Kelley, Ann Hamilton, Guillermo Kuitca, and Shirin Neshat -- about their own experiences as students. A fascinating analysis of the architecture of major historical art schools throughout the world looks at the relationship of the principles of their designs to the principles of the pedagogy practiced within their halls. And throughout the volume, attention is paid to new initiatives and proposals about what an art school can and should be in the twenty-first century -- and what it shouldn\'t be. No other book on the subject covers more of the questions concerning art education today or offers more insight into the pressures, challenges, risks, and opportunities for artists and art educators in the years ahead.&lt;B&gt;Contributors&lt;/B&gt;Marina Abramovic, Dennis Adams, John Baldessari, Ute Meta Bauer, Daniel Birnbaum, Saskia Bos, Tania Bruguera, Luis Camnitzer, Michael Craig-Martin, Thierry de Duve, Clémentine Deliss, Charles Esche, Liam Gillick, Boris Groys, Hans Haacke, Ann Lauterbach, Ken Lum, Steven Henry Madoff, Brendan D. Moran, Ernesto Pujol, Raqs Media Collective, Charles Renfro, Jeffrey T. Schnapp, Michael Shanks, Robert Storr, Anton Vidokle&lt;/DIV&gt;',1,707.10000000,417024320,'N90',27,27,0,'707.1 S844',1,NULL,1,0,NULL),(7,NULL,'978-0-919616-49-3','Rethinking the contemporary art school : the artist, the PhD, and the academy','EN','The Press of the Nova Scotia College of Art and Design',229,2009,'Buckley, Brad; Conomos, John','The Artist,the PhD, and the Academy',NULL,'EDU007',NULL,'rethinking-the-contemporary-art-school','2016-12-23 22:01:22','2021-01-31 16:14:20',9,'51WBMaP0Y7L.jpg','image/jpeg',53227,333,500,'With great timeliness, &lt;I&gt;Rethinking the Contemporary Art School&lt;/I&gt; examines the very basis of the art school and its role in society. The book considers various art-school models―innovative graduate programs, independent stand-alone schools and art schools that are departments or schools of major research universities―and the problems that art schools face as academically marginalized institutions. &lt;I&gt;Rethinking the Contemporary Art School&lt;/I&gt; concludes with essays on new media, inquiring whether the contemporary art school offers the right context for this discipline. The anthology includes contributions by Su Baker, Bruce Barber, Mikkel Bogh, Juli Carson and Bruce Yonemoto, Edward Colless, Jay Coogan, Luc Courchesne, Sara Diamond, Lauren Ewing, Gary Pearson, Bill Seaman and Jeremy Welsh.',1,700.71100000,404610840,'N345',257,258,0,'700.711 B924',1,NULL,1,0,NULL),(8,'0-907738-78-8',NULL,'Starting at zero : Black Mountain College, 1933-57','EN','Arnolfini, Kettle\'s Yard',120,2005,'Harris, Mary Emma, 1943- | Kettle\'s Yard Gallery [Publisher] | Arnolfini Gallery',NULL,NULL,'EDU008',NULL,'starting-at-zero-black-mountain-college-1933-57','2016-12-23 22:01:22','2021-01-31 16:14:20',9,'41JXSEufKRL.jpg','image/jpeg',21494,477,500,NULL,1,707.11756880,62737568,'NX405.B55',91,90,0,'707.1175688 H315',1,NULL,0,0,NULL),(9,'null','978-0-8101-2594-0','Black Mountain : an exploration in community','EN','Northwestern Univ Press',578,2009,'Duberman, Martin B.','null','null','EDU009','null','black-mountain-an-exploration-in-community','2016-12-23 22:01:22','2021-02-04 19:22:30',9,'51xRsO7j7WL.jpg','image/jpeg',46750,334,500,'&lt;div&gt;&lt;p&gt;With faculty and alumni that included John Cage, Robert Creeley, Merce Cunningham, Buckminster Fuller, Charles Olson, Josef and Anni Albers, Paul Goodman, and Robert Rauschenberg, Black Mountain College ranked among the most important artistic and intellectual communities of the twentieth century. In his groundbreaking history, Martin Duberman uses interviews, anecdotes, and research to depict the relationships that made Black Mountain College what it was. &lt;I&gt;Black Mountain &lt;/I&gt;documents the college’s twenty-three-year tenure, from its most brilliant moments of self-reinvention to its lowest moments of petty infighting. It records the financial difficulties that beleaguered the community throughout its existence and the determination it took to keep the college in operation. Duberman creates a nuanced portrait of this community so essential to the development of American arts and counterculture.&lt;/P&gt;&lt;/div&gt;',1,707.11756880,507850,'LD451.B5682',1182,1247,0,'707.1175688 D814',1,'undefined',0,0,NULL),(10,'','978-9955-854-91-3','Migrating: Art: Academies','EN','European School of Visual Arts',296,2013,'Gapševičius, Mindaugas; Hopkins, John; Michelkevičius, Vytautas','','','EDU010','','migrating-art-academies','2016-12-23 22:01:22','2021-02-01 15:33:08',9,'migaa.jpg.330x330_q85.jpg','image/jpeg',38157,231,330,'',1,707.80000000,NULL,NULL,NULL,NULL,1,'707.8 G111',2,'undefined',1,0,NULL),(11,NULL,'978-0-9818654-5-4','Artists with PhDs : on the new doctoral degree in studio art','EN','New Academia Publishing',292,2009,'Elkins, James, 1955-',NULL,NULL,'EDU011',NULL,'artists-with-phds-on-the-new-doctoral-degree-in-studio-art','2016-12-23 22:01:22','2021-01-31 16:14:20',9,'51-4RWExukL.jpg','image/jpeg',49839,333,500,'\"A PhD in art is inevitable, Elkins argues, and so best to explore the implications of this seemingly inevitable development. Adopting that constructively critical approach surely is the best way to deal with change. By bringing in a variety of perspectives, Elkins provides a rich mosaic of opinions. His authors don\'t just express opinions, but offer nicely detailed argumentation and much information, with lots of good empirical evidence. And right now there is much concern with this change.\" David Carrier, Champney Family Professor, Case Western Reserve University/ Cleveland Institute of Art.   \"I find this book to be fascinating and thought-provoking material.  I also know  from my own experiences that many faculty have been thinking (and worrying) about  the idea of the Ph.D.\" Andrew E. Hershberger, Associate Professor of Contemporary Art History, Bowling Green State University.  \"It is inevitable that one form or another, or indeed a variety, of the studio PhD programs will be appearing in US art schools.  For this reason it is especially timely that a book addressing the many concerns regarding this degree, and the variety of possible forms it might take, should appear in the US market.\" Tom Huhn, Ph.D., Chair Visual &amp; Critical Studies, Art History School of Visual Arts, New York.  \"These essays represent breadth and depth in the field, and anchor the book in current knowledge not only about the visual arts but about the growing intersection between the university and the artistic world that has resulted from the loss of private and state patronage over the past two decades. The book is organized as a constructive debate that encourages people to engage with the issues, and is a new contribution that intervenes in a different manner in the nationwide discussion.\" Lynette Hunter, Professor of the History of Rhetoric and Performance and Director UC Multicampus Research Group in International Performance and Culture, University of California Davis.  \"This book furthers the debate by opening various windows on the discussion of studio art and the viability of a new level of artistic exploration as opposed to simply writing and the production of new knowledge through library research.\" Harold Linton, Chair Department of Art and Visual Technology, College of Visual and Performing Arts George Mason University.  \"This book deals with an issue  of importance both in terms of the education of the artist and academia. We are in the midst of a paradigm shift-new models are emerging-art is making the transit from being a media based practice to a knowledge based one. The range of viewpoints presented  in this collection will help spur the debate and contribute to clarifying what is at stake. If the issue is not properly debated an inappropriate model of the Phd and practice-based research will be imposed on the visual  arts by administrators as has been  done in the UK.\" Saul Ostrow, Chair, VisualArts and Technologies, Cleveland Institute of Art.',1,707.10000000,262509371,'N345',183,247,0,'707.1 E37',1,NULL,0,0,NULL),(12,NULL,'978-0-85488-205-2','Gerhard Richter : Atlas. The reader',NULL,'Whitechapel Gallery',248,2012,'Searle, John R.',NULL,NULL,'EDU012',NULL,'gallery-as-community-art-education-politics','2016-12-23 22:01:22','2021-02-01 20:23:13',9,'51Sm2PgG1nL.jpg','image/jpeg',36891,361,500,'Gerhard Richter’s ongoing, encyclopedic &lt;I&gt;Atlas&lt;/I&gt; project began in 1964, and now comprises more than 5,000 gridded photographs, diagrams, drawings and sketches. As an image archive, work tool and artist’s book, &lt;I&gt;Atlas&lt;/I&gt; sits at the very heart of Richter’s practice, offering a massive summation of his masterful explorations of the tensions between photography and painting, history and memory, perception and representation. As a publication, &lt;I&gt;Atlas&lt;/I&gt; has gone through numerous editions, each new volume expanding on the previous with elaborations of persistent themes. This book provides a critical tool for navigating &lt;I&gt;Atlas&lt;/I&gt;, bringing together Richter’s own writings alongside commentaries by the art historians and curators Armin Zweite, Jean-François Chevrier, Benjamin H.D. Buchloh, Lynne Cooke and Helmut Friedel. Originally published in 2003 to coincide with the Whitechapel Gallery’s exhibition &lt;I&gt;Gerhard Richter: Atlas&lt;/I&gt;, this updated edition also includes a review of the exhibition by Adrian Searle.',3,700.41100000,844234529,'N6490',1,1,0,'700.411 S439',1,NULL,0,0,NULL),(13,NULL,NULL,'On the Future of Art School','EN','Dexter Sinister',100,0,'Stark, Frances; ElDahab, Mai Abu; Bailey, Stuart; Singerman, Howard; Verwoert, Jan; Relyea, Lane; Linsey, Robert',NULL,NULL,'EDU014',NULL,'on-the-future-of-art-school','2016-12-23 22:01:22','2021-01-31 16:14:21',9,NULL,NULL,NULL,NULL,NULL,NULL,1,700.71100000,131602731,'N345',NULL,4,1,'700.711 S795',1,NULL,0,0,NULL),(14,'null','978-90-78088-53-0','See it again, say it again : the artist as researcher','EN','Antennae Valiz, Amsterdam',305,2011,'Wesseling, Janneke','null','null','EDU016','null','see-it-again-say-it-again-the-artist-as-researcher','2016-12-23 22:01:22','2021-02-05 17:26:33',9,'41w2R3oDFoL.jpg','image/jpeg',20575,319,500,'More often than not, a work of art is produced through a dialectic of action and reflection--a zooming into and out of the material at hand (be it physical or conceptual) that eventually arrives at a synthesis of the two drives. &lt;I&gt;See It Again, Say It Again&lt;/I&gt; explores this process of reflection and research within the making of an art work. Does it lead to better art? What do artists actually do when they engage in research? The book includes essays by artists and theorists Janneke Wesseling, Jeroen Boomgaard, Jeremiah Day, Stephan Dillemuth, Irene Fortuyn, Gijs Frieling, Henri Jacobs, W.J.M. Kok, Aglaia Konrad, Frank Mandersloot, Aernout Mik, Ruchama Noorda, Vanessa Ohlraun, Graeme Sullivan, Moniek Toebosch, Lonnie van Brummelen &amp; Siebren de Haan, Hilde Van Gelder, Philippe Van Snick, Barbara Visser, Kitty Zijlmans and Italo Zuffi.',1,700.72000000,701796938,'N85',177,205,0,'700.72 W515',1,'undefined',1,0,NULL),(15,'null','978-3-942-700-20-7','Perform a lecture! : a project in six parts at different sites in Berlin','EN','The Office',52,2011,'Blumenstein, Ellen','null','null','EDU018','null','perform-a-lecture','2016-12-23 22:01:22','2021-02-08 09:37:04',9,'514CljvX1ML.jpg','image/jpeg',38013,375,500,'null',1,709.43100000,838815743,NULL,7,NULL,0,'709.431 B658',1,'undefined',0,0,NULL),(16,'null','978-951-53-3009-3','An Artists\'s Text Book','EN','Finnish Academy of Fine Arts',84,2007,'Svenungsson, Jan','null','null','EDU020','null','an-artist-s-text-book','2016-12-23 22:01:22','2021-02-01 20:56:14',9,'41ZGfTMZnSL.jpg','image/jpeg',20499,351,500,'null',1,701.00000000,271828910,'N7093.S84',12,4,0,'701 S969',1,'undefined',0,0,NULL),(17,'951-558-132-x','null','Cumulus Kit 2004-2006 (Design Education and Research Network)','EN','Cumulus Secretariat',72,2006,'Sotamaa Yrjo','null','null','EDU021','null','cumulus-kit-2004-2006-design-education-and-research-network','2016-12-23 22:01:22','2021-02-01 15:31:20',9,NULL,NULL,NULL,NULL,NULL,'null',1,707.10000000,NULL,NULL,NULL,NULL,1,'707.1 S717',1,'undefined',0,0,NULL),(18,'','978-609-447-037-0','Dailėtyra: teorijos, metodai, praktikos','LT','VDA leidykla',406,2012,'Mickūnaitė, Giedrė','','','EDU022','','dailetyra-teorijos-metodai-praktikos','2016-12-23 22:01:22','2021-02-01 16:43:29',9,'s3_1339709349_26salt2.jpg','image/jpeg',29301,378,500,'',3,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(19,NULL,'978-1-4165-7233-6','Art-work : everything you need to know (and do) as you pursue your art career','EN','Free Press',292,2009,'Bhandari, Heather Darcy | Melber, Jonathan [Author]',NULL,NULL,'EDU023',NULL,'art-work-everything-you-need-to-know-and-do-as-you-pursue-your-art-career','2016-12-23 22:01:22','2021-01-31 16:14:23',9,'41pR-5mHK2L.jpg','image/jpeg',23311,398,500,'&lt;b&gt; Find Out What They Didn\'t Teach You in Art School &lt;/b&gt; &lt;BR&gt; &lt;BR&gt; The most comprehensive guide of its kind, Art/Work gives artists of every level the tools they need to make it in an art world so competitive one dealer likens it to \"The Sopranos, except nobody gets killed.\" Whether you\'re an art school grad looking for a gallery, a mid-career artist managing a busy studio, or someone just thinking about becoming a professional artist, this indispensable resource will help you build your career and protect yourself along the way. &lt;BR&gt; &lt;BR&gt; Unlike other creative professionals, visual artists don\'t have agents or managers. You have to do it all yourself, at least until you find gallery representation -- and even then, there are important business and legal issues you need to understand to stay in control of your career and ensure you\'re being treated fairly. Heather Darcy Bhandari, a gallery director, and Jonathan Melber, an arts lawyer, walk you through these issues so that you can essentially act as your own manager and agent. They show you, for example, how to tackle business basics such as tracking inventory and preparing invoices; how to take legal precautions like registering a copyright and drafting consignment forms; how to use promotional tools like websites and business cards; and how to approach career decisions such as choosing the right venue to show your work. &lt;BR&gt; &lt;BR&gt; In addition to drawing on their own experiences, Bhandari and Melber interviewed nearly one hundred curators, dealers, and other arts professionals, in cities across the country, about what they expect from and look for in artists. The authors also talked to a host of artists about their careers and the lessons they\'ve learned navigating the art world. The book is full of their entertaining anecdotes and candid advice. &lt;BR&gt; &lt;BR&gt; No matter what kind of artist you are -- or want to be -- this book will help you. Art/Work covers everything you need to know to succeed, saving you from having to learn it all the hard way -- and letting you spend more time making art.',1,702.30000000,232979478,'N8350',843,780,0,'702.3 B575',1,NULL,0,0,NULL),(20,'951-53-2879-9','null','The Artist\'s Knowledge: Research at the Finnish Academy of Fine Arts','EN','The Finnish Academy of Fine Arts  ',94,2006,'Kaila, Jan','null','null','EDU024','null','the-artist-s-knowledge-research-at-the-finnish-academy-of-fine-arts','2016-12-23 22:01:22','2021-02-01 15:29:15',9,NULL,NULL,NULL,NULL,NULL,'null',1,707.20000000,NULL,NULL,NULL,NULL,1,'707.2 K13',1,'undefined',0,0,NULL),(21,NULL,'978-0-14-025403-7','Pedagogy of the oppressed','EN','Penguin Books',164,1993,'Freire, Paulo (1921-1997) | Ramos, Myra Bergman [Translator] | Macedo, Donaldo P. 1950- [Writer of added commentary; Author of introduction] | Shor, Ira, 1945- | Mellado, Jorge [Translator] | Sŏng, Ch\'an-sŏng',NULL,NULL,'EDU025',NULL,'pedagogy-of-the-oppressed','2016-12-23 22:01:22','2021-01-31 17:36:59',9,'31qd_2BBKx0JL.jpg','image/jpeg',14769,326,500,'This text argues that the ignorance and lethargy of the poor are the direct result of the whole economic, social and political domination. The book suggests that in some countries the oppressors use the system to maintain a \"culture of silence\". Through the right kind of education, the book suggests, avoiding authoritarian teacher-pupil models and based on the actual experiences of students and on continual shared investigation, every human being, no matter how impoverished or illiterate, can develop a new awareness of self, and the right to be heard.',3,370.11500000,103959,'LB880.F73',2491,3378,0,'370.115 F866',1,NULL,0,0,NULL),(22,'null','978-951-53-3105-2','The Artist\'s Knowledge 2: Research at the Finnish Academy of Fine Arts','EN','The Finnish Academy of Fine Arts  ',118,2008,'Kaila, Jan','null','null','EDU026','null','the-artist-s-knowledge-2-research-at-the-finnish-academy-of-fine-arts','2016-12-23 22:01:22','2021-02-01 15:29:50',9,NULL,NULL,NULL,NULL,NULL,'null',1,707.20000000,NULL,NULL,NULL,NULL,1,'707.2 K13 Art',1,'undefined',0,0,NULL),(23,NULL,'978-3-86588-407-7','The great method','EN','Casco Office for Art, Design and Theory',160,2007,'Peio, Aguirre; Emily, Pethick',NULL,NULL,'EDU027',NULL,'the-great-method-casco-issues-x','2016-12-23 22:01:22','2021-01-31 16:14:23',9,'41VAA7GshDL.jpg','image/jpeg',21358,313,500,NULL,1,701.90000000,184990813,NULL,16,NULL,0,'701.9 P377',1,NULL,1,0,NULL),(24,NULL,'978-0-916365-86-8','Thinking contemporary curating','USA','Indep.Curators Intl.',272,2012,'Smith, Terry (Terry E.)',NULL,NULL,'EDU028',NULL,'thinking-contemporary-curating','2016-12-23 22:01:22','2021-01-31 18:52:46',9,'41tLWH5R1sL.jpg','image/jpeg',30129,344,500,'&lt;div&gt;What is contemporary curatorial thought? Current discourse on the topic is heating up with a new cocktail of bold ideas and ethical imperatives. these include: cooperative curating, especially with artists; the reimagination of museums; curating as knowledge production; the historicization of exhibitionmaking; and commitment to extra-artworld participatory activism. Less obvious, but increasingly of concern, are issues such as rethinking spectatorship, engaging viewers as co-curators and the challenge of curating contemporaneity itself. In these five essays, art historian and theorist Terry Smith surveys the international landscape of current thinking by curators; explores a number of exhibitions that show contemporaneity in recent, present and past art; describes the enormous growth world wide of exhibition infrastructure and the instability that haunts it; re-examines the contribution of artist-curators and questions the rise of curators utilizing artistic strategies; and, finally, assesses a number of key tendencies in curating as responses to contemporary conditions. &lt;I&gt;Thinking Contemporary Curating&lt;/I&gt; is the first book to comprehensively chart the variety of practices of curating undertaken today, and to think through, systematically, what is distinctive about contemporary curatorial thought.&lt;BR&gt;&lt;B&gt;This is the eBook edition of &lt;I&gt;Thinking Contemporary Curating&lt;/I&gt;, print form to be published in September 2012.&lt;/B&gt;&lt;/div&gt;',1,69.40000000,794365531,'AM151',318,395,0,'069.4 S662',1,NULL,0,0,NULL),(25,'0-9773680-0-9',NULL,'Letters to a young artist','EN','Darte Publishing, LLC',96,2006,'Amenoff, Gregory, 1948- | Amenoff, Gregory, 1948-',NULL,NULL,'EDU029',NULL,'letters-to-a-young-artist','2016-12-23 22:01:22','2021-01-31 16:14:24',9,'51KD3HGR7PL.jpg','image/jpeg',34123,364,500,'This pocket-sized book contains a collection of two dozen letters all commissioned from established artists to a fictitious \"young artist,\" a recent art-school graduate who is struggling with the moral and practical implications of being an artist in New York. The \"young artist\" asked a selection of his heroes, \"Is it possible to maintain one\'s integrity and freedom of thought and still participate in the art world?\" Responding artists--including Gregory Amenoff, Jo Baer, John Baldessari, Jimmie Durham, Joan Jonas, Adrian Piper, William Pope Lawrence Weiner and Richard Tuttle wrote back with advice (Gregory Amenoff: \"Keep away from art fairs.\"); encouragement (Joan Jonas: \"The answer is the Work. To Work. To care about the Work.\"); and cautionary tales (Adrian Piper: \"Young artist, it is highly unlikely that you will be rewarded professionally for reaching this point. Nor will it make you popular. On the contrary: you will develop a reputation for being \'difficult,\' \'uncooperative,\' \'inflexible,\' or even \'self-destructive;\' and treated [or mistreated, or ostracized, or blacklisted] accordingly.\"). Twelve of these letters were originally published in &lt;I&gt;Art on Paper&lt;/I&gt;. This book expands considerably upon that project.',1,700.23000000,71338078,'N8350',169,181,0,'700.23 A511',1,NULL,0,0,NULL),(26,'null','978-951-53-3223-3','Secret Identities of a Psychoanalyst: Viewpoints on the work of Friedl Kubelka','EN','Finnish academy of fine art',76,2010,'Saloranta, Elina','null','null','EDU030','null','secret-identities-of-a-psychoanalyst','2016-12-23 22:01:22','2021-02-01 22:33:11',9,NULL,NULL,NULL,NULL,NULL,'null',1,709.20000000,NULL,NULL,NULL,NULL,1,'709.2 S173',1,'undefined',1,0,NULL),(27,NULL,'978-951-53-3405-3','Everything but an Island','EN','Finnish academy of fine art',86,2012,'Sarje, Kimmo; Wegelius, Henri',NULL,NULL,'EDU031',NULL,'everything-but-an-island','2016-12-23 22:01:22','2021-01-31 16:14:24',9,NULL,NULL,NULL,NULL,NULL,NULL,1,111.85000000,904540302,'NX280',NULL,4,0,'111.85 S243',1,NULL,0,0,NULL),(28,'','978951533343','The pleasure of research','EN','Finnish academy of fine art',88,2012,'Slager, Henk','','','EDU032','','the-pleasure-of-research','2016-12-23 22:01:22','2021-02-01 21:19:38',9,'00003976.jpg','image/jpeg',60666,990,1400,'',3,707.20000000,767860905,'N85',13,13,0,'707.2 S631',1,NULL,0,0,NULL),(29,'null','null','Expanded Art School (Learning Together)','DE/TR','Ortak Mufredat, Uqbar',90,2012,'Cetinkaya, Asli; Sorbello, Marina','null','null','EDU033','null','expanded-art-school-learning-together','2016-12-23 22:01:22','2021-02-01 15:27:20',9,NULL,NULL,NULL,NULL,NULL,'null',1,707.10000000,NULL,NULL,NULL,NULL,1,'707.1 C423',1,'undefined',1,0,NULL),(30,'null','null','FINAL-LY unPUBLISHED','Dutch / EN','Sint-Lucas Visual Arts Ghent ; YellowPress Publicatie Platform/',239,2012,'Rosmalen, Ad van','null','null','EDU034','null','final-ly-unpublished','2016-12-23 22:01:22','2021-02-06 12:38:12',9,NULL,NULL,NULL,NULL,NULL,'null',1,707.40000000,0,NULL,NULL,NULL,1,'707.4 S615',1,'undefined',1,1,NULL),(31,NULL,'978-1-7809-3781-6','Education for critical consciousness','EN','BLOOMSBURY',145,2013,'Freire, Paulo, 1921-1997',NULL,NULL,'EDU035',NULL,'education-for-critical-conciousness','2016-12-23 22:01:22','2021-01-31 16:14:24',9,'51AX3Su-6-L.jpg','image/jpeg',41285,319,500,'&lt;p&gt;Famous for his advocacy of \'critical pedagogy\', Paulo Freire was Latin America\'s foremost educationalist, a thinker and writer whose work and ideas continue to exert enormous influence in education throughout the world today. &lt;i&gt;Education for Critical Consciousness&lt;/i&gt; is the main statement of Freire\'s revolutionary method of education. It takes the life situation of the learner as its starting point and the raising of consciousness and the overcoming of obstacles as its goals. For Freire, man\'s striving for his own humanity requires the changing of structures which dehumanize both the oppressor and the oppressed.&lt;/p&gt;',1,370.19098000,524152,'LC191',971,1440,0,'370.19098 F866',1,NULL,0,0,NULL),(32,NULL,'978-1-4725-8135-8','The aesthetics of education : theatre, curiosity, and politics in the work of Jacques Rancière and Paulo Freire','EN','BLOOMSBURY',192,2012,'Lewis, Tyson E.',NULL,NULL,'EDU036',NULL,'the-aesthetics-of-education','2016-12-23 22:01:22','2021-01-31 16:14:24',9,'51N0OrZKjxL.jpg','image/jpeg',38756,333,500,'&lt;div&gt;&lt;font face=\"Times New Roman\" size=\"3\"&gt;&lt;div&gt;This innovative book examines the aesthetic event of education.Â Â  Extending beyond the pedagogy of art or art appreciation, Tyson E. Lewis takes a much broader view of aesthetics and argues that teaching and learning are themselves aesthetic performances.Â  As Jacques Ranciere has recently argued, there is an inherent connection between aesthetics and politics, both of which disrupt conventional distributions of who can speak and think.Â  Here, Lewis extends Ranciere\'s general thesis to examine how there is not only an aesthetics of politics but also an aesthetics of education.Â  In particular, Lewis\' analysis focuses on several questions: What are the possibilities and limitations of building analogies between teachers and artists, education and specific aesthetic forms? WhatÂ  is the relationship between democracy and aesthetic sensibilities?Â  Lewis examines these questions by juxtaposing Ranciere\'s work on universal teaching, democracy, and aesthetics with Paulo Freire\'s work on critical pedagogy, freedom, and literacy.Â  The result is an extension and problematization of Ranciere\'s project as well as a new appreciation for the largely ignored aesthetic dimension of Freire\'s pedagogy of the oppressed.&lt;/div&gt;&lt;br /&gt;&lt;/font&gt;&lt;/div&gt;',1,370.11500000,757480614,'LC196',291,288,0,'370.115 L674',1,NULL,0,0,NULL),(33,'','978-3-88609-763-0','Black Mountain : an interdisciplinary experiment 1933-1957','EN','Staatliche Museen zu Berlin',463,2015,'Blume, Eugen','','','EDU038','','black-mountain-an-interdisciplinary-experiment-1933-1957','2016-12-23 22:01:22','2021-02-04 19:22:20',9,'T2A7527.jpg','image/jpeg',162730,700,467,'',1,707.11756880,1057746179,'NX405.B55',36,30,0,'707.1175688 B658',1,'undefined',0,0,NULL),(34,NULL,'978-1-933128-25-2','Everything you always wanted to know about curating but were afraid to ask','EN ','Sternberg Press',208,2011,'Obrist, Hans Ulrich',NULL,NULL,'CUR001',NULL,'everything-you-always-wanted-to-know-about-curating-but-were-too-afraid-to-ask','2016-12-23 22:01:22','2021-01-31 16:14:24',10,'51ZE-rh6hSL.jpg','image/jpeg',40207,320,500,'Everything you ever wanted to know about Hans Ulrich Obrist but were afraid to ask has now been asked, revealing the truth from the beginning of his career as a young curator in his Zurich kitchen to his recent position as co-director of the Serpentine in London. This book is a \'\'production of reality conversations,\'\' otherwise known as interviews. It undertakes the impossible: pinning down this peripatetic curator, and affirming the wisdom of an artist who told Obrist \'\'don\'t go\'\' when he contemplated leaving the art world for other fields. Interviews by Jean Max Colard, Robert Fleck, Jefferson Hack, Nav Haq, Sophia Krzys Acord, Brendan McGetrick, Ingo Niermann, Paul O\'Neill, Philippe Parreno &amp; Alex Poots, Juri Steiner, Gavin Wade, et al.',1,708.00920000,725875825,'N406.O27',215,240,0,'708.0092 O13',1,NULL,0,0,NULL),(35,NULL,'978-0-949004-18-5','Curating and the educational turn','EN ','Open Editions / de Appel',342,2010,'O\'Neill, Paul; Wilson, Mick',NULL,NULL,'CUR002',NULL,'curating-and-the-educational-turn','2016-12-23 22:01:22','2021-01-31 16:14:25',10,'4125buHFG7L.jpg','image/jpeg',28942,361,500,'In recent years there has been increased debate on the incorporation of pedagogy into curatorial practice―on what has been termed “the educational turn” (“turn” in the sense of a paradigmatic reorientation, within the arts). In this new volume, artists, curators, critics and academics respond to this widely recognized turn in contemporary art. Consisting primarily of newly commissioned texts, from interviews and position statements to performative text and dialogue, &lt;I&gt;Curating and the Educational Turn&lt;/I&gt; also includes a number of previously published writings that have proved primary in the debate so far. Companion to the critically acclaimed &lt;I&gt;Curating Subjects&lt;/I&gt;, this anthology presents an essential question for anyone interested in the cultural politics of production at the intersections of art, teaching and learning. Contributors include David Aguirre, Dave Beech, Cornford &amp; Cross, Charles Esche, Liam Gillick, Tom Holert and Emily Pethick.',1,708.00000000,495778937,'N410',252,244,0,'708 O58',1,NULL,0,0,NULL),(36,NULL,'978-3-86560-618-1','A manual for the 21st century art institution','EN','Koenig Books ',183,2009,'Sharmacharja, Shamita | Altshuler, Bruce [Contributor] | Sharmacharja, Shamita [Editor]',NULL,NULL,'CUR003',NULL,'a-manual-for-the-21st-century-art-institution','2016-12-23 22:01:22','2021-01-31 16:14:25',10,'41ux-cRylOL.jpg','image/jpeg',24046,351,500,'&lt;I&gt;A Manual For the 21st Century Art Institution&lt;/I&gt; invites 12 writers-artists, academics, curators and gallery and museum directors-to assess the present trajectory of arts institutions by explicating various issues, each of which is associated with an imaginary room. Readers journey from the reception to the roof terrace via rooms dedicated to temporary exhibitions, site-specific commissions and collections displays, taking in the bookshop, café, auditorium and education spaces along the way. Bruce Altshuler, Iwona Blazwick, Chris Dercon, Maria Fusco, Caro Howell, Charles Merewether, Mark Nash, Brian O\'Doherty, Niru Ratnam, Sukhdev Sandhu, Adam Szymczyk and Nayia Yiakoumaki are our guides to this inviting theater. The result is an indispensable handbook for art professionals, students and anyone curious about today\'s art world.',1,708.00000000,312626944,'AM151',175,160,0,'708 S531',1,NULL,1,0,NULL),(37,'1-894773-13-6',NULL,'Aboriginal perspectives on art, art history, critical writing and community','EN','The Banff Centre',238,2003,'Martin, Lee-Ann',NULL,NULL,'CUR004',NULL,'making-a-noise-aboriginal-perspectives-on-art-art-history-critical-writing-and-community','2016-12-23 22:01:22','2021-01-31 16:14:25',10,'41VwAejeCUL.jpg','image/jpeg',27480,333,500,NULL,1,704.03970710,265903385,'N6549.5.A54',4,1,0,'704.0397071 M381',1,'Jim Logan, Catherine Mattes, Nika Collison, Lee-Ann Martin, Brenda L. Croft, Guy Sioui Durand, Jim Vivieaere, Megan Tamati-Quennell, Vincent Collison, Candice Hopkins, Marie Bouchard, Kathleen Ash-Milby, Richard Hill, Anthony Kiendl, Joane Cardinal-Schubert',1,0,NULL),(38,NULL,'978-0-9708346-1-4','What makes a great exhibition?','EN','Philadelphia Exhibitions Initiative',184,2011,'Marincola, Paula | Marincola, Paula [Editor] | Philadelphia Exhibitions Initiative [Issuing body] | Basualdo, Carlos, 1964- | Blazwick, Iwona | Cooke, Lynne | Golden, Thelma',NULL,NULL,'CUR005',NULL,'what-makes-a-great-exhibition-questions-of-practice','2016-12-23 22:01:22','2021-02-03 16:09:40',10,'512y0ZKJzrL.jpg','image/jpeg',45818,352,500,'Rising attendance at museums, along with increased press coverage in the age of the international biennial and the ‘blockbuster’ exhibition, has translated into a growing interest in how exhibitions are made. The new curatorial studies programmes springing up across Europe and North America often deal with theoretical issues, yet one of the central questions of curating frequently remains unframed: What makes an exhibition great? In this book, fourteen essays by active curators and historians address the issue head-on.&lt;br /&gt;Focusing on the curation of contemporary art in North America and Europe, What Makes a Great Exhibition? includes essays by the prolific curator Robert Storr on the meaning of ‘exhibition’ and ‘exhibition-maker’; Studio Museum in Harlem director Thelma Golden writes on ethnically specific exhibitions; Dia Foundation curator Lynne Cooke shows how to firmly ground rarified aims; Iwona Blazwick details a century of trailblazing at London’s Whitechapel Art Gallery, where she is director; and curator Carlos Basualdo reflects on the need to establish a meaningful critical context for international biennials. Other writers address such issues as the labelling of exhibits, group exhibitions, exhibiting design, video and craft, as well as the way a venue’s architecture can influence the exhibitions it houses. What Makes a Great Exhibition? contains carefully considered answers to numerous questions of practice even as it raises more questions about exhibition-making today.&lt;br /&gt;Stimulating thought about how curatorial objectives mesh with on-the-ground practicalities, this book is vital reading for arts professionals, students of art and curatorial studies, art historians, practising artists and anyone curious about exhibition-making today.',1,707.50000000,76171390,'N4395',527,548,0,'707.5 M337',1,NULL,1,0,NULL),(39,NULL,'978-0-262-01388-8','Rethinking curating : art after new media','EN','The MIT Press',354,2010,'Graham, Beryl',NULL,NULL,'CUR006',NULL,'rethinking-curating-art-after-new-media','2016-12-23 22:01:22','2021-01-31 16:14:25',10,'41SAC_2BveyDL.jpg','image/jpeg',32518,389,500,'&lt;P&gt;As curator Steve Dietz has observed, new media art is like contemporary art -- but different. New media art involves interactivity, networks, and computation and is often about process rather than objects. New media artworks are difficult to classify according to the traditional art museum categories determined by medium, geography, and chronology and present the curator with novel challenges involving interpretation, exhibition, and dissemination. This book views these challenges as opportunities to rethink curatorial practice. It helps curators of new media art develop a set of flexible tools for working in this fast-moving field, and it offers useful lessons from curators and artists for those working in such other areas of art as distributive and participatory systems.&lt;/P&gt;&lt;P&gt;The authors, both of whom have extensive experience as curators, offer numerous examples of artworks and exhibitions to illustrate how the roles of curators and audiences can be redefined in light of new media art\'s characteristics. Rethinking Curating offers curators a route through the hype around platforms and autonomous zones by following the lead of current artists\' practice.&lt;/P&gt;',1,709.04070750,907512819,'NX456.5.N49',14,14,0,'709.0407075 G739',1,NULL,0,0,NULL),(40,'0-920159-84-2',NULL,'Naming a practice : curatorial strategies for the future','EN','Walter Phillips Gallery Editions, Banff Centre Press',278,1996,'Banff Centre for the Arts',NULL,NULL,'CUR007',NULL,'naming-a-practice-curatorial-strategies-for-the-future','2016-12-23 22:01:22','2021-01-31 16:14:25',10,'41FDD9ZCBQL.jpg','image/jpeg',23617,314,475,'This publication features the proceedings of the Naming a Practice: Curatorial Strategies for the Future seminar that originated as an independent project within the Canadian curatorial community to provide a forum on curating in the visual arts. Organized in cooperation with the Walter Phillips Gallery and The Banff Centre, the event took place in November 1994. This publication documents the seminar, following the format of the event itself, and features transcripts of the formal presentations of each of the 29 participants, portions of the general discussion, as well as brief commentaries by each of the seminar organizers. The essays are grouped to address such topics as:  \"Methodologies,\" \"Negotiations\" and \"Ethics,\" as well as \"Local Knowledge and New Internationalism.\"',1,708.00753000,37580077,'N470',102,102,0,'708.00753 B212',1,NULL,0,1,NULL),(41,'0-920159-99-0',NULL,'Beyond the box : diverging curatorial practices','EN','Banff Centre Press',187,2003,'Townsend, Melanie A. 1968- [Editor]',NULL,NULL,'CUR008',NULL,'beyond-the-box-diverging-curatorial-practices','2016-12-23 22:01:22','2021-01-31 16:14:25',10,'41aBTySpUjL.jpg','image/jpeg',27699,331,500,'Published in association with the Banff International Curatorial Institute and the Walter Phillps Gallery. The white cube -- it\'s a vision of the gallery museum that has dominated thinking and practice in the art world for decades. Beyond the Box: Diverging Curatorial Practices is a collection of essays by leading Canadian and international curators and artists that explores regions of practice outside this \"cube,\" delving into contemporary challenges to traditional ideas about art and curating. With four main topics of inquiry--Publications, New Media, Biennials and Art Museums Today--Beyond the Box captures groundbreaking thinking and writing from some of the world\'s top curator\'s and artists. It exposes the passion, creativity and determination behind successes such as the publications of the Hoopoe-Curatorial, and installations like The Universal Lab, as well as critical commentary documenting the collapse of the 2000 Sao Paulo Biennial. The third in a series of books about curatorship published by the Banff Centre Press in association with the Walter Phillps Gallery and the Banff International Curatorial Institute, Beyond the Box will be a touchstone for artists and curators alike. Other books in the series include Naming a Practice: Curatorial Strategies for the Future (collected by Peter White, 1996) and The Edge of Everything: Reflections on Curatorial Practice (edited by Catherine Thomas, 2002).',1,708.00753000,51799365,'N408',146,138,0,'708.00753 T749',1,NULL,1,0,NULL),(42,NULL,'978-3-86560-918-2','Raising Frankenstein : curatorial education and its discontents','EN','Koenig Books/The Banff Centre',112,2011,'Fischer, Barbara, 1956-',NULL,NULL,'CUR009',NULL,'raising-frankenstein-curatorial-education-and-its-discontents','2016-12-23 22:01:22','2021-01-31 16:14:26',10,'41qVwpCfVcL.jpg','image/jpeg',21485,326,500,'The postwar ascent of the curator as both cultural broker and creative participant in the work of art has seen the discipline acquire a brief but rich history of its own, peopled with names that already seem the stuff of legend (Johannes Cladders, Pontus Hulten, Harald Szeemann). &lt;I&gt;Raising Frankenstein: Curatorial Education and Its Discontents&lt;/I&gt; unites curatorial studies with the increasingly debated subject of \"the educational turn.\" Edited by Kitty Scott, whose own career as a curator of contemporary art has taken her from the National Gallery in Ottawa to the Serpentine Gallery in London and the Banff Centre in Alberta, it presents a collection of essays that explores the education and formation of curators. Writings on curatorial pedagogy by Barbara Fischer, Teresa Gleadowe, Francesco Manacorda, Cuauhtémoc Medina and Lourdes Morales offer an overview of recent thought on curatorial pedagogy, elucidating, defining and building on current debates surrounding this subject.',1,708.00230000,694828419,'N408',115,151,0,'708.0023 F529',1,NULL,0,0,NULL),(43,'null','978-88-7490-060-2','Just another exhibition : storie e politiche delle biennali = histories and politics of biennials','IT/EN','Postmedia Books, Milano',160,2011,'Martini, Federica, 1976-','null','null','CUR010','null','just-another-exhibition-histories-and-politics-of-biennials','2016-12-23 22:01:22','2021-02-05 19:46:26',10,'31SDcaGZ-eL.jpg','image/jpeg',10888,200,269,'null',1,709.04000000,757462261,'N4396',34,27,0,'709.04 M386',1,'undefined',0,0,NULL),(44,'null','978-3-86588-451-0','Curating Critique','EN','ICE (Institute for Curatorship and Education), Frankfurt am Main',374,2007,'Eigenheer, Marianne','null','null','CUR011','null','curating-critique','2016-12-23 22:01:22','2021-02-01 17:22:00',10,'418UA8FduFL.jpg','image/jpeg',19748,362,500,'null',1,708.00920000,254921909,'N4397',NULL,20,0,'708.0092 E34',1,'undefined',1,0,NULL),(45,NULL,'978-3-86859-064-7','ARTocracy : art, informal space, and social consequence : a curatorial handbook in collaborative practice','EN','Jovis',191,2010,'Sacramento, Nuno | Zeiske, Claudia [Author]',NULL,NULL,'CUR012',NULL,'artocracy-art-informal-space-and-social-consequence-a-curatorial-handbook-in-collaborative-practice','2016-12-23 22:01:22','2021-02-01 21:14:51',10,'51Cj1sYEzbL.jpg','image/jpeg',35585,358,500,'Kunst im öffentlichen Raum - das kann weit mehr sein als die Aufwertung von Straßen und Plätzen durch Plastiken und Skulpturen. ARTocracy stellt eine autonome Welt der Kunst vor, die - zielgerichtet im Dialog mit den Künstlern - ebenso die Geschichte wie die gegenwärtige Gesellschaft und den Alltag der Menschen einbezieht. Dieses Handbuch gewährt dabei Einblicke in die komplexe Organisation von Gemeinschaftsprojekten und zeigt, wie öffentliche Kunstprojekte im Dialog erfolgreich in die Tat umgesetzt werden können: und zwar von der Idee über die Beauftragung eines Künstlers, von der Finanzierung und dem Marketing bis hin zur Rezeption.',3,706.00000000,679932663,'N420',163,154,0,'706 S123',1,NULL,0,0,NULL),(46,NULL,'978-0-262-01772-5','The culture of curating and the curating of culture(s)','EN','The MIT Press',180,2012,'O\'Neill, Paul, 1970-',NULL,NULL,'CUR013',NULL,'the-culture-of-curating-and-the-curating-of-culture-s','2016-12-23 22:01:22','2021-01-31 16:14:27',10,'41e7FfRQnwL.jpg','image/jpeg',16481,389,500,'&lt;p&gt;Once considered a mere caretaker for collections, the curator is now widely viewed as a globally connected auteur. Over the last twenty-five years, as international group exhibitions and biennials have become the dominant mode of presenting contemporary art to the public, curatorship has begun to be perceived as a constellation of creative activities not unlike artistic praxis. The curator has gone from being a behind-the-scenes organizer and selector to a visible, centrally important cultural producer. In  &lt;i&gt;The Culture of Curating and the Curating of Culture(s)&lt;/i&gt;, Paul O\'Neill examines the emergence of independent curatorship and the discourse that helped to establish it.&lt;/p&gt;&lt;p&gt;O\'Neill describes how, by the 1980s, curated group exhibitions -- large-scale, temporary projects with artworks cast as illustrative fragments -- came to be understood as the creative work of curator-auteurs. The proliferation of new biennials and other large international exhibitions in the 1990s created a cohort of high-profile, globally mobile curators, moving from Venice to Paris to Kassel. In the 1990s, curatorial and artistic practice converged, blurring the distinction between artist and curator. &lt;/p&gt;&lt;p&gt;O\'Neill argues that this change in the understanding of curatorship was shaped by a curator-centered discourse that effectively advocated -- and authorized -- the new independent curatorial practice. Drawing on the extensive curatorial literature and his own interviews with leading curators, critics, art historians, and artists, O\'Neill traces the development of the curator-as-artist model and the ways it has been contested.  &lt;i&gt;The Culture of Curating and the Curating of Culture(s)&lt;/i&gt; documents the many ways in which our perception of art has been transformed by curating and the discourses surrounding it.&lt;/p&gt;',1,707.50000000,769232509,'N4396',584,576,0,'707.5 O58',1,NULL,0,0,NULL),(47,NULL,'978-1-934105-97-9','Cultures of the curatorial','EN','Sternberg Press',376,2012,'Bismarck, Beatrice von; Schafaff, Jorn; Weski, Thomas',NULL,NULL,'CUR014',NULL,'cultures-of-the-curatorial','2016-12-23 22:01:22','2021-01-31 18:54:31',10,'41ht8s5N0VL.jpg','image/jpeg',20932,332,500,'The curatorial has developed as a field of overlapping and intertwining activities, tasks, and roles that formerly were more clearly attributed to different professions, institutions, and disciplines. This development has affected the notion of curating principally an activity of putting together and widened its scope beyond presenting to include enabling, making public, educating, analyzing, criticizing, theorizing, editing and staging. Embedded in the globalization of the art field, on the one hand, and the conditions of labor in the 21st century, on the other, the curatorial has also gained a specific socio political relevance within contemporary society. Contributions from Beatrice von Bismarck, Gabriele Brandstetter, Helmut Draxler, among others.',3,69.50100000,815379839,'N410',93,94,0,'069.501 B621',1,NULL,0,0,NULL),(48,NULL,'978-3-943365-00-9','Paper exhibition : selected writings','EN','Stenberg, Sandberg, Kunstverein, The Baltic Notebooks of Anthony Blunt',240,2012,'Malašauskas, Raimundas',NULL,NULL,'CUR015',NULL,'paper-exhibition-ask-salad-amass-uranium','2016-12-23 22:01:22','2021-02-01 18:00:21',10,'31K_2BRfUh9OL.jpg','image/jpeg',13713,308,500,'The what if runs through Raimundas s writing like the Woody Allen runs through Woody Allen effective and contagious, writes Maxine Kopsa about writer/curator Raimundas Malasauskas works. This engaging, unexpected anthology of 16 essays by Malasauskas has been edited&lt;br&gt;by and commented on in the margins or in the back by 16 equally illustrious art world collaborators. And the reader, too, can participate, the even numbered pages are left blank for that purpose. With contributions by Dexter Sinister, Sofia Hernandez Chong Cuy and Tirdad Zolghadr, among others.',3,820.00000000,792796378,'N7445.2',36,36,0,'820 M237',1,NULL,0,0,NULL),(49,NULL,'978-3-932865-76-3','Öffentlichkeit herstellen. Präsenz als Strategie? : [Übers.-H.]','DE/EN/RU','Cultures of the Curatorial, Goethe-Institut, Institute for Book Design, Museum of Contemporary Art Leipzig',59,2013,'Vera Lauf',NULL,NULL,'CUR016',NULL,'well-connected-on-curatorial-processes','2016-12-23 22:01:22','2021-01-31 16:14:27',10,NULL,NULL,NULL,NULL,NULL,NULL,1,25.50000000,890010016,NULL,1,NULL,0,'25.5 V475',1,NULL,1,0,NULL),(50,NULL,'978-0262633383','The archive','EN','MIT Press',208,2006,'Merewether, Charles',NULL,NULL,'CUR017','John W. Fail','the-archive','2016-12-23 22:01:22','2021-01-31 16:14:27',10,'51i-RvcIGOL.jpg','image/jpeg',32791,348,500,'&lt;p&gt;In the modern era, the archive -- official or personal -- has become the most significant means by which historical knowledge and memory are collected, stored, and recovered. The archive has thus emerged as a key site of inquiry in such fields as anthropology, critical theory, history, and, especially, recent art. Traces and testimonies of such events as World War II and ensuing conflicts, the emergence of the postcolonial era, and the fall of communism have each provoked a reconsideration of the authority given the archive -- no longer viewed as a neutral, transparent site of record but as a contested subject and medium in itself.&lt;/p&gt;&lt;p&gt;This volume surveys the full diversity of our transformed theoretical and critical notions of the archive -- as idea and as physical presence -- from Freud\'s \"mystic writing pad\" to Derrida\'s \"archive fever\"; from Christian Boltanski\'s first autobiographical explorations of archival material in the 1960s to the practice of artists as various as Susan Hiller, Ilya Kabakov, Thomas Hirshhorn, Renée Green, and The Atlas Group in the present.&lt;/p&gt;&lt;p&gt;Not for sale in the UK and Europe.&lt;/p&gt;',3,27.00000000,65400604,'CD971',665,686,0,'27 M558',1,NULL,0,0,NULL),(51,'9986-16-050-2','null','Tylusis modernizmas Lietuvoje : 1962-1982 = Quiet modernism in Lithuania','LT/EN','Tyto Alba',269,1997,'Lubytė, Elona, 1964-','null','null','LT.A001','null','tylusis-modernizmas-lietuvoje-1962-1982-quiet-modernism-in-lithuania-1962-1982','2016-12-23 22:01:22','2021-02-01 21:56:35',4,NULL,NULL,NULL,NULL,NULL,'null',1,709.47930000,43859747,'N7255.L57',NULL,10,0,'709.4793 L927',1,'undefined',0,0,NULL),(52,'9986-957-09-5','null','Lithuanian art 1989-1999 = Lietuvos daile 1989-1999 : the ten years : desmit metu : Contemporary Art centre Vilnius, 10.09.-24.10.1999','LT/EN','ŠMC/CAC',278,1999,'Lithuanian art 1989-1999','null','null','LT.A002','null','lietuvos-daile-1989-1999-desimt-metu-lithuanian-art-1989-1999-the-ten-years','2016-12-23 22:01:22','2021-02-04 18:28:21',4,NULL,NULL,NULL,NULL,NULL,'null',1,709.04800000,984054896,NULL,1,NULL,0,'709.048 M478',1,'undefined',0,1,NULL),(53,'null','978-9986-957-47-8','Lithuanian art : 2000-2010 : ten years','EN','ŠMC/CAC',195,2010,'Contemporary Art Centre (Vilnius)','null','overview lithuanian','LT.A003','null','lithuanian-art-2000-2010-ten-years','2016-12-23 22:01:23','2021-02-01 21:44:25',4,NULL,NULL,NULL,NULL,NULL,'null',1,709.47930000,727332232,'N7255.L57',NULL,5,0,'709.4793 C761',1,'undefined',0,1,NULL),(54,'null','978-9986-957-46-1','Lietuvos dailė 2000-2010: dešimt metų','LT','ŠMC/CAC',189,2010,'Dovydaitytė, Linara; Dubinskaitė, Renata; Vaičiulytė, Asta','null','overview lithuanian','LT.A004','null','lietuvos-daile-2000-2010-desimt-metu','2016-12-23 22:01:23','2021-02-01 21:44:46',4,NULL,NULL,NULL,NULL,NULL,'null',1,709.479300