16-12-23 22:01:23','2021-02-03 09:55:58',1,'31X2gFA2-yL.jpg','image/jpeg',8555,170,230,'Siame leidinyje skaitytojas gales susipazinti su visa 15 metu tapybos pleneru kronika, bei su 92 - dvejomis surengtomis tapybos parodomis Lietuvoje ir uzsienyje. Knygoje taip pat pristatoma XIX a. pabaigoje Kursiu nerija visoje Europoje garsinusi, Nidoje isikurusi menininku kolonija. Tuomet Kursiu nerijos krastovaizdi savo meno kuriniuose vaizdavo daugiau nei 200 skirtingu stiliu ir zandru meninininku, tarp kuriu buvo ir pasaulinio garso izymybes. Kursiu nerijoje tape ekspresionistai Maxas Pechsteinas bei Karlas Schmidt-Rotluffas, tuo metu priklause Vokietijos moderniojo meno grupei \"Brucke\" (1905-1913), bei menininku mecenato Hermanno Blodes zentas, ekspresionistas Ernstas Mollenhaueris.',1,709.47930000,778125190,NULL,1,NULL,0,'709.4793 K94',2,'undefined',0,0,NULL),(103,'null','null','Creative Klaipeda: a Map of Creative Industries','LT/EN','Klaipėda Economic Development Agency (KEPA)',84,2011,'null','null','null','LOC002','null','creative-klaipeda-a-map-of-creative-industries','2016-12-23 22:01:23','2021-02-09 09:35:01',1,NULL,NULL,NULL,NULL,NULL,'null',1,914.79300000,0,NULL,NULL,NULL,1,'914.793 N969 Cre',1,'undefined',0,0,NULL),(104,NULL,'978-609-404-047-4','Das versunkene Memel = : Nugrimzdusi Klaipėda','LT/DE','Druka',431,2009,'Saulėnienė, Jovita | Saulėnienė, Jovita [Contributor] | Tarik, Rasa [Contributor]',NULL,NULL,'LOC003',NULL,'das-versunkene-memel-nugrimzdusi-klaipeda','2016-12-23 22:01:23','2021-01-31 16:14:34',1,NULL,NULL,NULL,NULL,NULL,NULL,1,947.93000000,706677417,'DK505.95.K57',2,6,0,'947.93 S256',1,NULL,0,0,NULL),(105,NULL,'978-9955-544-88-3','Klaipėdos Bauhauzas : modernizmo architektūra','LT','Libra Memelensis',96,2011,'Demereckas, Kęstutis; Bachitovas, Jurijus',NULL,NULL,'LOC004',NULL,'klaipedos-bauhauzas-modernizmo-architektura','2016-12-23 22:01:23','2021-01-31 16:14:35',1,NULL,NULL,NULL,NULL,NULL,NULL,1,720.94793090,879623387,NULL,4,NULL,0,'720.9479309 D