thuanian Seaside at a Glance','EN','null',23,0,'null','null','Informative catalogue','LOC019','null','lithuanian-seaside-at-a-glance','2016-12-23 22:01:23','2021-02-09 09:23:40',1,NULL,NULL,NULL,NULL,NULL,'null',1,914.79300000,0,NULL,NULL,NULL,1,'914.793 N969',1,'undefined',0,0,NULL),(121,'null','978-3-7774-2951-9','Max Pechstein : ein Expressionist aus Leidenschaft : Retrospektive','LT','Hirmer Verlag',357,40543,'Pechstein, Max, 1881-1955','null','null','LOC020','null','max-pechstein-ein-expressionist-aus-leidenschaft-retrospektive','2016-12-23 22:01:23','2021-02-01 22:33:12',1,'61WU4NWPuuL.jpg','image/jpeg',79951,394,500,'English summary:  Max Pechstein (1881-1955) is one of the most successful yet unconventional representatives of German expressionism. This catalog for the retrospective at the Kunsthalle Kiel shows a comprehensive selection of works from this outstanding artist, including spectacular new discoveries.  Max Pechstein, growing up in close relationship to and showing a life-long interest in nature, is the only Brucke artist who received a university education at the Dresden Art School. He is also the only one among the Expressionists who stayed true to his style past the \"Brucke\" years of 1906 -1912 and for the remainer of his life. Again and again he drew on the great inspirations of Vincent van Gogh, Paul Gauguin and Edvard Munch in order to fit them to his interpretation and to his own style. His late work especially gains in dramatization and luminosity.  In addition to the well-known masterpieces, this catalog presents the unknown sides of Pechstein, such as the earliest and latest works of the artist, as well a series of spectacular discoveries. Other documentary material completes the examination and provides a vivid picture of this outstanding artist. German text.  German description: Max Pechstein (1881-1955) gehort zu den erfolgreichsten und zugleich eigenwilligsten Vertretern des deutschen Expressionismus. Das Katalog-Buch zur Retrospektive in der Kunsthalle Kiel zeigt eine umfassende Auswahl an Werken dieses herausragenden Kunstlers, darunter auch spektakulare Neuentdeckungen.  Max Pechstein, in enger Beziehung zur Natur aufgewachsen und zeitlebens an ihr interessiert, ist zugleich der einzige Brucke-Kunstler, der - an der Dresdener Kunstgewerbeschule - eine akademische Vorbildung erhalten hat. Er ist auch derjenige unter den Expressionisten, der seinem Stil uber die \"Brucke\"-Jahre 1906 -1912 hinaus lebenslang treu geblieben ist. Immer wieder greift er auf die grossen Vorbilder Vincent van Gogh, Paul Gauguin und Edvard Munch zuruck, um sie seiner Interpretation und seinem eigenen Stil anzupassen. Besonders die Bilder seines Alterswerks verzeichnen dabei einen weiteren Zugewinn an Dramatisierung und Leuchtkraft.  Die Kunsthalle zu Kiel nimmt die Erscheinung des Pechstein Werkverzeichnisses zum Anlass, in Zusammenarbeit mit der Familie und der Verfasserin des Werkverzeichnisses eine umfassende Retrospektive zu zeigen. Das begleitende Katalog-Buch gibt neben den bekannten Meisterwerken auch die unbekannten Seiten Pechsteins wieder wie beispielsweise das fruheste und das letzte Bild des Kunstlers sowie eine Reihe von spektakularen Neuentdeckungen. Weiteres dokumentarisches Material vervollstandigt die Betrachtung und liefert ein lebendiges Bild von diesem herausragenden Kunstler.',1,709.20000000,647901176,'N6888.P38',73,73,0,'709.2 P364',1,'undefined',0,0,NULL),(122,NULL,'978-1-86189-431-1','Hare','EN','REAKTION books',232,2010,'Carnell, Simon, 1962-',NULL,'Animal series','LOC021',NULL,'hare','2016-12-23 22:01:23','2021-01-31 16:14:36',1,'31Od5RhrrCL.jpg','image/jpeg',14634,356,500,'Colourfully described by early natural historians as the ‘fastest, hairiest, most lascivious, and most melancholy’ of mammals, the hare is no less remarkable for its actual behaviour and capacities than for the intriguing ways in which it has been imagined and exploited throughout history. Hare examines how this animal has been described, symbolized and visually depicted, as well as utilized for its fur, flesh and exceptional speed.&lt;br /&gt;Tracking the hare from ancient Egypt, where a hieroglyph of the animal signified existence itself, to the serial hare works of artist Joseph Beuys, who once notoriously declared that ‘I am not a human being, I am a hare’, Hare finds its subject in many surprising places and forms: from Crucifixion scenes, Buddhist lore and Algonquin creation myths, to witch trials, treatises on logic, contempor­ary poetry and an art installation in a Dutch brothel. It is the principal subject of the first ever hunting treatise, ‘king of all venery’, for Renaissance theorists of the hunt; and it appears in the first known description of a still-life painting, in the ﬁrst signed and dated picture of a single animal, and in early medicine, where it was credited with having the most curative properties of any ‘beaste’.&lt;br /&gt;The first monograph on the subject for 35 years, and richly illustrated, Hare combines the most recent natural history with an eclectic account of the animal’s symbolic values. Hare will be of interest to art historians and literary critics; to those for and opposed to hunting; and to both the general and the lagophile reader alike.',1,591.50000000,262883612,'QL737.L32',704,707,0,'591.5 C289',1,NULL,0,0,NULL),(123,NULL,'978-1-86189-194-5','Crow','EN','REAKTION books',184,2003,'Boria Sax',NULL,'Animal series','LOC022',NULL,'crow','2016-12-23 22:01:23','2021-01-31 16:14:36',1,'31zrFds6nFL.jpg','image/jpeg',9404,400,430,NULL,1,598.86400000,731330925,'QL696',4,1,0,'598.864 B726',1,NULL,0,0,NULL),(124,NULL,'978-1-86189-423-6','Eel','EN','REAKTION books',184,2009,'Schweid, Richard, 1946-',NULL,'Animal series','LOC023',NULL,'eel','2016-12-23 22:01:23','2021-01-31 16:14:36',1,NULL,NULL,NULL,NULL,NULL,NULL,1,597.43200000,320828276,'QL638.A55',700,701,0,'597.432 S413',1,NULL,0,0,NULL),(125,NULL,'9781-86189-297-3','Fox','EN','REAKTION books',208,2006,'Wallen, Martin',NULL,'Animal series','LOC024',NULL,'fox','2016-12-23 22:01:23','2021-01-31 16:14:36',1,'41d7GFuy0nL.jpg','image/jpeg',19361,356,500,'Foxes live throughout the world in widely different habitats from forest to desert to the Arctic. What is surprising, though, is that scientists admit that very little is actually known about the lives and habits of foxes. The reason, which this book explores in depth, is that foxes are almost universally despised as being wicked. From the time of Aristotle, naturalists have succumbed to the general bias against foxes, either openly asserting that foxes are barely worthy of consideration or worrying about the health threat they pose. While this low regard is understandable, since foxes steal chickens and have a strong odour, they are strikingly beautiful animals possessed of a startling intelligence.Throughout Europe and Asia, folk tales and myths have built up around the fox, depicting it variously as unrepentant thief and seducer, shapeshifter and deceiver, as an outlaw whose primary purpose is to disrupt human social order. The fear and loathing people feel (paradoxically mixed with fascination) toward foxes are reflected in the many fox-terms that have entered different languages. In Japan, for example, various plants are identified with fox-names to indicate how they are supposedly used by foxes in an alternate universe. The contradictory attitudes toward foxes are exemplified in America and Europe by their classification as vermin at the same time as they are preserved and propagated by foxhunters and fur trappers, and depicted as loveable furry creatures in the movies.',1,599.77500000,67375486,'QL737.C22',306,255,0,'599.775 W197',1,NULL,0,0,NULL),(126,NULL,'978-1-86189-396-3','Moose','EN','REAKTION books',200,2008,'Jackson, Kevin, 1955-',NULL,'Animal series','LOC025',NULL,'moose','2016-12-23 22:01:23','2021-01-31 16:14:36',1,'31PudMjEa5L.jpg','image/jpeg',11394,356,500,'Its hooves were supposedly a cure for epilepsy, it is the mascot of the clothing company Abercrombie and Fitch, and its meat is a delicacy. The moose is a fascinating but elusive animal of the north, and its little-known natural history is the focus of Kevin Jackson’s engaging new book. &lt;br /&gt;Moose explains the animal\'s behaviour, evolution and diet, and describes its natural environments around the world, including in the USA, Canada and Scandinavia, where the moose is the national animal of Sweden and of Norway. Jackson considers why the moose is really an elk and an elk is a wapiti, and he also discusses the controversy behind the naming of the Irish Elk. The moose has been a quarry for humans since the Stone Age, and the book does not stint on the animal’s role in human history, including the \'alces\' in Julius Caesar’s history of the Gallic Wars and figures such as Thomas Jefferson, poet Ted Hughes, and Theodore Roosevelt with his Bull Moose Party. The Rocky and Bullwinkle Show, a 150-foot statue being built in Sweden, and colourful moose lore all appear in this wide-ranging study, making this an essential read for naturalists and moose lovers alike.',1,599.65700000,225875995,'QL737.U55',254,251,0,'599.657 J13',1,NULL,0,0,NULL),(127,NULL,'978-1-86189-923-1','Mosquito','EN','REAKTION books',216,2012,'Jones, Richard, 1958 July 14-',NULL,'Animal series','LOC026',NULL,'mosquito','2016-12-23 22:01:23','2021-01-31 16:14:36',1,'31TtJsVf-FL.jpg','image/jpeg',12440,356,500,'﻿Lots of insects suck blood, but one species above all others has a reputation for this, out of all proportion to its size: the mosquito. Due to the diseases they carry and inject, mosquitoes are responsible for more human deaths than any other animal. The most deadly of these diseases is malaria, which although eradicated from much of the northern hemisphere, continues to pose a mortal threat in developing countries. Two billion people a year are exposed to malarial infection, of which over 350 million succumb and nearly 700,000 die, the majority in sub-Saharan Africa.&lt;br /&gt;In Mosquito, Richard Jones recounts the history of mosquitoes’ relationship with mankind, and their transformation from a trivial gnat into a serious disease-carrying menace. Drawing on scientific fact, historical evidence, and literary evocation, the book provides a colourful portrait of this tiny insect and the notorious diseases it carries. &lt;br /&gt;Mosquito offers a compelling warning against the contemporary complacency surrounding malaria and other diseases in western society, whilst also exploring the sinister reputation of the insect in general. Written in an accessible style for a broad readership, the title will appeal to all those with an interest in tropical medicine and disease, as well as anyone pestered in the night by the annoying, familiar whine of this diminutive air-borne adversary.',3,595.77200000,760973109,'QL536',360,360,0,'595.772 J77',1,NULL,0,0,NULL),(128,NULL,'978-9955-847-47-2','Praeitis kaip konflikto šaltinis : tapatybės ideologijų konkurencija XX amžiaus Klaipėdoje : monografija','LT','LII leidykla',448,2011,'Safronovas, Vasilijus',NULL,NULL,'LOC027',NULL,'praeitis-kaip-konflikto-saltinis-tapatybes-ideologiju-konkurencija-xxa-klaipedoje','2016-12-23 22:01:23','2021-01-24 17:43:07',1,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,793418650,'DK505.9.K54',NULL,6,0,NULL,1,NULL,0,0,NULL),(129,NULL,'978-1-85153-843-0','A key to plants common on sand dunes','EN','FSC',NULL,2002,'Edmondson, S. E. (Sally E.)',NULL,NULL,'LOC030',NULL,'a-key-to-plants-common-on-sand-dunes','2016-12-23 22:01:23','2021-01-31 16:14:36',1,'51wW8AoHLuL.jpg','image/jpeg',60768,353,500,NULL,3,581.75830000,40803859,'QK938.D9',12,1,0,'581.7583 E24',1,NULL,0,0,NULL),(130,'null','978-3-00-024345-5','The Art Of Summer','EN','VDA leidykla',0,2008,'null','null','null','LOC031','null','the-art-of-summer','2016-12-23 22:01:23','2021-02-09 09:51:21',1,NULL,NULL,NULL,NULL,NULL,'null',1,707.80000000,0,NULL,NULL,NULL,1,'707.8 N969',1,'unde