ULL,NULL,NULL,1,'779.994793 M637',1,'undefined',0,0,NULL),(158,NULL,'978-1-84511-548-7','Lacan reframed : a guide for the arts student','EN','I.B.TAURIS',150,2008,'Levine, Steven Z.','Interpreting Key Thinkers for the Arts',NULL,'TH001',NULL,'lacan-reframed','2016-12-23 22:01:23','2021-01-31 16:36:48',14,'41lycl_2BvqOL.jpg','image/jpeg',32549,357,500,'Are your students baffled by Baudrillard? Dazed by Deleuze? Confused by Kristeva? &lt;br /&gt;&lt;br /&gt;Other beginners’ guides can feel as impenetrable as the original texts to students who ‘think in images’. Contemporary Thinkers Reframed instead uses the language of the arts to explore the usefulness in practice of complex ideas. &lt;br /&gt;Short, contemporary and accessible, these lively books utilise actual examples of artworks, films, television shows, works of architecture, fashion and even computer games to explain and explore the work of the most commonly taught thinkers. Conceived specifically for the visually minded, the series will prove invaluable to practitioners an students right across the visual arts.&lt;br /&gt;&lt;br /&gt;Single-handedly responsible for the influential and ominous notion of ‘the gaze’, quoted by everybody yet fully understood by few, Lacan’s work can be difficult to grasp. Going back to basics, this introduction guides the reader through Lacan’s key concepts by looking at art from the Mona Lisa through to Bridget Riley’s paintings, and by looking afresh at key works &lt;br /&gt;discussed by Lacan himself, from Holbein’s famous \'The Ambassadors\' to Velazquez’s \'Las &lt;br /&gt;Meninas\'. Making sense of Lacan’s sometimes convoluted style, this highly readable introduction to one of the most frequently quoted thinkers also explores the reasons why human beings make - and look at - art.',3,150.19509200,170922165,NULL,829,NULL,0,'150.195092 L665',1,NULL,0,0,NULL),(159,NULL,'978-1-84511-660-6','Kristeva Reframed : A Guide for the Arts Student','EN','I.B.TAURIS',165,2011,'Barrett, Estelle','Interpreting Key Thinkers for the Arts',NULL,'TH002',NULL,'kristeva-reframed','2016-12-23 22:01:23','2021-01-31 16:51:53',14,'41jAREFjQYL.jpg','image/jpeg',21207,358,500,'For Kristeva, in a world immersed in readymade images, art or aesthetic experience is a practice that constitutes both a subject (a sense of self) and an object that is able to transform meaning and consciousness. Kristeva Reframed examines key ideas in Kristeva\'s work to show how they are most relevant to artists, and how they can be applied in interpreting artworks. With examples from the paintings of van Gogh and Picasso, the work of contemporary  eminist painters, the photography of Bill Henson and the film and animation work of Van Sowerine, Estelle Barrett demonstrates how Kristeva can  lluminate the relationships between artist and art object, between artists, artworks and audiences, and between art and knowledge. Through these relationships she explores what Kristeva’s work reveals about the role and function of art in society and offers a smooth passage through Kristeva\'s ideas and her relevance to visual culture.',3,194.02470000,773255116,'B2430.K7544',3,3,0,'194.0247 B274',1,NULL,0,0,NULL),(160,NULL,'978-1-78076-233-3','Guattari reframed : interpreting key thinkers for the arts','EN','I.B.TAURIS',155,2012,'Elliott, Paul, 1972-','Interpreting Key Thinkers for the Arts',NULL,'TH003',NULL,'guattari-reframed','2016-12-23 22:01:23','2021-01-31 16:14:38',14,'41_2BJrApVh1L.jpg','image/jpeg',22101,355,500,'Guattari Reframed presents a timely and urgent rehabilitation of one of the twentieth century’s most engaged and engaging cultural philosophers. Best known as an activist and practicing psychiatrist, Guattari’s work is increasingly understood as both eerily prescient and vital in the context of contemporary culture. Employing the language of visual culture and concrete examples drawn from it, this book introduces and reassesses the major concepts developed throughout Guattari’s writings, asserting his significance as a revolutionary philosopher and cultural theorist and invites the reader to transform both their understanding of Guattari, and their lives through his ideas.',1,194.00000000,761381234,'B2430.G784',379,139,0,'194 E46',1,NULL,0,0,NULL),(161,NULL,'978-1-84511-678-1','Baudrillard reframed : interpreting key thinkers for the arts','EN','I.B.TAURIS',140,2011,'Toffoletti, Kim','Interpreting Key Thinkers for the Arts',NULL,'TH004',NULL,'baudrillard-reframed','2016-12-23 22:01:23','2021-01-31 16:14:38',14,'41n4hW-M9wL.jpg','image/jpeg',26453,355,500,'Jean Baudrillard has been a unique intellectual voice in many of the key debates and issues facing an increasingly globalised, media-driven world. Baudrillard Reframed offers those working with Baudrillard’s ideas an accessible overview of his better-known arguments, as well as extending beyond them to critically engage with his radical notions of illusion, singularity and the fatal. Kim Toffoletti surveys the ideas of this influential - often provocative - French thinker as they relate to today’s image-saturated environment. She demonstrates their relevance to analysing contemporary visual phenomena such as advertising, photography, reality TV, fashion, art, pornography and virtual reality. Baudrillard’s key themes and arguments are illustrated through a range of visual works, from the graffiti art of Banksy, Katharine Hanett’s protest t-shirts, to Sophie Calle’s photography.',1,194.02470000,694227068,'B2430',945,1,0,'194.0247 T644',1,NULL,0,0,NULL),(162,NULL,'978-1-84511-546-3','Derrida reframed','EN','I.B.TAURIS',149,2008,'Richards, Kevin Malcolm, 1966-','Interpreting Key Thinkers for the Arts',NULL,'TH005',NULL,'derrida-reframed','2016-12-23 22:01:23','2021-01-31 16:14:38',14,'413Tep6a1cL.jpg','image/jpeg',27486,357,500,'Are your students baffled by Baudrillard? Dazed by Deleuze? Confused by Kristeva? &lt;br /&gt;&lt;br /&gt;Other beginners’ guides can feel as impenetrable as the original texts to students who ‘think in images’. Contemporary Thinkers Reframed instead uses the language of the arts to explore the usefulness in practice of complex ideas. &lt;br /&gt;Short, contemporary and accessible, these lively books utilise actual examples of artworks, films, television shows, works of architecture, fashion and even computer games to explain and explore the work of the most commonly taught thinkers. Conceived specifically for the visually minded, the series will prove invaluable to practitioners an students right across the visual arts.&lt;br /&gt;&lt;br /&gt;‘Deconstruction’ is touted in every visual area from architecture to fashion, yet few really understand what Derrida’s notorious concept means, much less his elusive idea of ‘différance’. In fact Derrida’s work can seem almost impenetrable. This guide explains Derrida’s key concepts through examples from across the whole spectrum of the arts, looking at the work of architects such as Bernard Tschumi and Daniel Libeskind, fashion designers such as Ann Demeulemeister and at the work of artists as varied as Kara Walker, Yinka Shonibare MBE, Rachel Whiteread and Jeff Wall. Showing what Derrida’s work really ‘means’ in practice, this short guide makes this thinker’s complex work accessible to a wider public.',1,194.00000000,772844782,'B2430.D484',31,30,0,'194 R515',1,NULL,0,0,NULL),(163,NULL,'978-1-84511-547-0','Deleuze reframed : interpreting key thinkers for the arts','EN','I.B.TAURIS',NULL,2008,'Sutton, Damian | Martin-Jones, David',NULL,NULL,'TH006',NULL,'deleuze-reframed','2016-12-23 22:01:23','2021-01-31 16:14:39',14,'41Q8jbdx7ZL.jpg','image/jpeg',20139,353,500,'Are your students baffled by Baudrillard? Dazed by Deleuze? Confused by Kristeva? &lt;br /&gt;&lt;br /&gt;Other beginners’ guides can feel as impenetrable as the original texts to students who ‘think in images’. Contemporary Thinkers Reframed instead uses the language of the arts to explore the usefulness in practice of complex ideas. &lt;br /&gt;Short, contemporary and accessible, these lively books utilise actual examples of artworks, films, television shows, works of architecture, fashion and even computer games to explain and explore the work of the most commonly taught thinkers. Conceived specifically for the visually minded, the series will prove invaluable to practitioners an students right across the visual arts.&lt;br /&gt;&lt;br /&gt;Deleuze disdains easy answers. Yet easy answers to Deleuze are what students need. Without reducing Deleuze’s complex body of thought to simplistic solutions, this very contemporary guide leads the reader into the world of Deleuze’s spiralling thought through concrete examples from art, film, TV and even computer games. From \'Eternal Sunshine of the Spotless Mind\' and \'The Cell\' to \'Pac Man\' and \'Doom\' and from the work of \'Robert Mapplethorpe\', \'Coco Fusco\' and \'Rachel Whiteread\' to \'Lost\' and \'Doctor Who\', this easily digestible introduction looks at the key ideas promoted by Deleuze, both in his own work and in his notoriously difficult collaborations with Felix Guattari, to make them both fresh and relevant to the visual arts today.',1,194.00000000,772844779,'B2430.D454',15,15,0,'194 S967',1,NULL,0,0,NULL),(164,NULL,'978-9955-34-300-4','Galia, vaizduotė ir atmintis : politikos ir literatūros etiudai','LT','Versus Aureus',256,2011,'Donskis, Leonidas',NULL,NULL,'TH007',NULL,'galia-vaizduote-ir-atmintis','2016-12-23 22:01:23','2021-01-24 17:44:35',14,'11gXGn4XiYL.jpg','image/jpeg',3675,139,200,'Politikos ir literaturos sasajos daug glaudesnes, negu atrodytu is pirmo zvilgsnio. Pamatine moderniosios politines filosofijos problematika iskele rasytojai, plunksnos neatskyre nuo viesuju reikalu sferos (Niccolo Machiavellis, Thomas More\'as etc.). Didieji anglu dramaturgai analizavo problemas, kuriu siandien negaletu aplenkti joks rimtas politikos teoretikas. Shakespeare\'o istorines pjeses leidzia ne tik pajusti istoriniu saltiniu, kuriuos studijavo visu laiku didziausias dramaturgas, dvasia, bet ir susivokti politinese jo pavaizduotuju epochu dramose, perprasti ano meto politikos instituciju ir praktiku logika. Tai - puikus ivadas i politikos mokslus, kurio niekada nepakeis jokie vadoveliai. O ka jau kalbeti apie garsiasias Shakespeare\'o tragedijas, is kuriu galima studijuoti ne tik dorybiu etika ir klasikine politikos samprata, bet ir visa politines galios lauka, jo itaka zmogaus sielai. Literatura ne tik numate didziasias moderniojo pasaulio itampas tarp moralinio autoriteto ir valdzios mechanikos, pasleptos galios ir apnuogintos jegos, tradicijos ir reformos, individualios sazines ir socialinio ritualo (sykiu paprocio ir jo etoso), fakto ir vertybes, laisves ir kontroles, kalbos ir veiksmo, ji virto socialines kritikos prototipu ir pirmaprade jos erdve. Ne filosofija, ne sociologija ir juolab ne politikos mokslai, o grozine literatura ispejo zmonija apie artejanti totalitarizma. Kas pasauliui leido suvokti XX amziaus politine patirti geriau, nei sita padare didzioji literatura - Czeslawas Miloszas, Heinrichas Bollis, Gunteris Grassas, Milanas Kundera? Ar gali politikos mokslai ir apskritai socialiniai mokslai bei teorine humanistika kokiais nors metodais, analitinemis prieigomis ir ypac organizuota mokslo kalba autentiskai kalbeti apie tai, apie ka pasauliui iki siol kalba Primo Levi, Balys Sruoga? Grozine literatura jau seniai tapo neatsiejama nuo socialines teorijos ir kritikos, ideju istorijos ir politines filosofijos. Apie visa tai ir daugybe k',3,NULL,775811518,'PN51',NULL,4,0,NULL,1,NULL,0,0,NULL),(165,NULL,'978-1-85669-899-3','Methods &amp; theories of art history','EN','Laurence King Publishing',186,2004,'D\'Alleva, Anne','Second Edition',NULL,'TH008',NULL,'methods-and-theories-of-art-history','2016-12-23 22:01:23','2021-01-31 16:14:39',14,'514gJw7lF1L.jpg','image/jpeg',39420,336,500,'Art historical theory is a forum of intense, often passionate debate. This book provides an accessible introduction to the range of critical theories used in analyzing art. It covers a broad range of approaches, presenting individual arguments, controversies, and divergent perspectives. This second edition has been updated to reflect recent scholarship in contemporary art. Clearly written, this book is ideal for the undergraduate student or anyone interested in the world of ideas.',1,701.18000000,56649493,'N380',427,689,0,'701.18 D146',1,NULL,0,0,NULL),(166,'null','978-0-415-46920-3','Contemporary art and the cosmopolitan imagination','EN','Routledge',120,2011,'Meskimmon, Marsha','null','null','TH009','null','contemporary-art-and-the-cosmopolitan-imagination','2016-12-23 22:01:23','2021-02-03 21:55:28',14,'41XHaBZDezL.jpg','image/jpeg',25968,324,500,'&lt;P&gt;&lt;EM&gt;Contemporary Art and the Cosmopolitan Imagination&lt;/EM&gt; explores the role of art in conceiving and reconfiguring the political, ethical and social landscape of our time. Understanding art as a vital form of articulation, Meskimmon argues that artworks do more than simply reflect and represent the processes of transnational and transcultural exchange typical of the global economy. Rather, art can change the way we imagine, understand and engage with the world and with others very different than ourselves. In this sense, art participates in a critical dialogue between cosmopolitan imagination, embodied ethics and locational identity. &lt;/P&gt; &lt;P&gt;&lt;/P&gt; &lt;P&gt;The development of a cosmopolitan imagination is crucial to engendering a global sense of ethical and political responsibility. By materialising concepts and meanings beyond the limits of a narrow individualism, art plays an important role in this development, enabling us to encounter difference, imagine change and make possible the new. This book asks what it means to inhabit a globalized world – how we might literally and figuratively make ourselves cosmopolitans, ‘at home’ everywhere. Contemporary art provides a space for this enquiry. &lt;/P&gt; &lt;P&gt;&lt;EM&gt;Contemporary Art and the Cosmopolitan Imagination&lt;/EM&gt; is structured and written through four ‘architectonic figurations’ – foundation, threshold, passage and landing – which simultaneously reference the built environment and the transformative structure of knowledge-systems. It offers a challenging new direction in the current literature on cosmopolitanism, globalisation and art.&lt;/P&gt;',1,709.05100000,299711141,'N72.G55',797,1099,0,'709.051 M578',1,'undefined',0,0,NULL),(167,'951-53-2742-3',NULL,'Everything or nothing : critical theory, contemporary art and visual culture','EN','Academy of fine art',184,2003,'Hannula, Mika',NULL,NULL,'TH010',NULL,'everything-or-nothing-critical-theory-contemporary-art-and-visual-culture','2016-12-23 22:01:23','2021-01-31 16:14:39',14,NULL,NULL,NULL,NULL,NULL,NULL,1,111.85000000,71003479,'NX280',NULL,2,0,'111.85 H243',1,NULL,0,0,NULL),(168,NULL,'978-1-58435-091-0','Neither sun nor death','EN','Semiotext(e)',368,2011,'Sloterdijk, Peter, 1947-',NULL,NULL,'TH011',NULL,'neither-sun-nor-death','2016-12-23 22:01:23','2021-01-31 16:14:39',14,'41ulKT3YUrL.jpg','image/jpeg',26880,333,500,'&lt;p&gt;Peter Sloterdijk first became known in this country for his late 1980s Critique of Cynical Reason, which confronted headlong the \"enlightened false consciousness\" of Habermasian critical theory. Two decades later, after spending seven years in India studying Eastern philosophy, he is now attracting renewed interest for his writings on politics and globalization and for his magnum opus Spheres, a three-volume archaeology of the human attempt to dwell within spaces, from womb to globe: Bubbles, 1998; Globes, 1999; Foam, 2004, all forthcoming from Semiotext(e). In Neither Sun nor Death, Sloterdijk answers questions posed by German writer Hans-Jürgen Heinrichs, commenting on such issues as technological mutation, development media, communication technologies, and his own intellectual itinerary.Iconoclastic and provocative, alternatively sparkling and bombastic, a child of \'68 and a libertarian, Sloterdijk is the most exciting and controversial German philosopher to appear on the world scene since Nietzsche and Heidegger. Like Nietzsche, Sloterdijk remains convinced that contemporary philosophers have to think dangerously and let themselves be \"kidnapped\" by contemporary \"hypercomplexities\"; they must forsake our present humanist and nationalist world for a wider horizon at once ecological and global.Neither Sun nor Death is the best introduction available to Sloterdijk\'s philosophical theory of globalization. It reveals a philosophe extraordinaire, encyclopedic and provocative, as much at ease with current French Theory (Gilles Deleuze, Paul Virilio, Gabriel Tarde) as with Heidegger and Indian mystic Osho Rajneesh.&lt;/p&gt;',1,193.00000000,649803719,'B3332.S254',166,155,0,'193 S634',1,NULL,0,0,NULL),(169,'null','978-951-53-2975-2','Darkness visible: essays on art, philosophy and politics','EN','Kuva',446,2005,'Mäki, Teemu','null','null','TH012','null','darkness-visible-essays-on-art-philosophy-and-politics','2016-12-23 22:01:23','2021-02-01 12:20:05',14,NULL,NULL,NULL,NULL,NULL,'null',1,700.10000000,NULL,NULL,NULL,NULL,1,'700.1 M685',1,'undefined',0,0,NULL),(170,NULL,'978-184831059-9','Introducing critical theory','EN','Icon Books',176,2009,'Sim, Stuart | Van Loon, Borin, 1951- [Artist; Illustrator; Author] | Appignanesi, Richard [Editor]',NULL,NULL,'TH013',NULL,'critical-theory-a-graphic-guide','2016-12-23 22:01:23','2021-01-31 16:14:39',14,'51icsfBgsTL.jpg','image/jpeg',41812,351,500,'What might a \'theory of everything\' look like? Is science an ideology? Who were Adorno, Horkheimer or the Frankfurt School? The decades since the 1960s have seen an explosion in the production of critical theories. Deconstructionists, poststructuralists, postmodernists, second-wave feminists, new historicists, cultural materialists, postcolonialists, black critics and queer theorists, among a host of others, all vie for our attention. Stuart Sim and Borin Van Loon\'s incisive graphic guide provides a route through the tangled jungle of competing ideas and provides an essential historical context, situating these theories within tradition of critical analysis going back to the rise of Marxism. They present the essential methods and objectives of each theoretical school in an incisive and accessible manner, and pay special attention to recurrent themes and concerns that have preoccupied a century of critical theoretical activity.',1,301.01000000,47638258,'B809.3',763,378,0,'301.01 S588',1,NULL,0,0,NULL),(171,NULL,'978-184831207-4','Introducing Baudrillard','EN','Icon Books',175,2011,'Horrocks, Chris (Associate professor in art history) | Jevtic, Zoran [Artist; Illustrator; Author] | Appignanesi, Richard [Editor] | Horrocks, Chris',NULL,NULL,'TH014',NULL,'introducing-baudrillard-a-graphic-guide','2016-12-23 22:01:23','2021-01-31 16:14:39',14,'51a8-WqtLML.jpg','image/jpeg',53370,351,500,'Illustrated guide to the controversial sociologist Jean Baudrillard, who died in 2007. Did the Gulf War take place? Is it possible to fake a bank robbery? Was sexual liberation a disaster? Jean Baudrillard has been hailed as one of France\'s most subtle and powerful theorists. But his provocative style and assaults on sociology, feminism and Marxism have exposed him to accusations of promoting a dangerous new orthodoxy - of being the \'pimp\' of postmodernism. Introducing Baudrillard cuts beneath the controversy of this misunderstood intellectual to present his radical claims that reality has been replaced by a simulated world of images and events ranging from TV news to Disneyland. It provides a clear account of Baudrillard\'s work on obesity, pornography and terrorism and traces his development from critic of mass consumption to prophet of the apocalypse. Chris Horrocks\' text and Zoran Jevtic?s artwork invite us to decide whether Baudrillard was a cure for the vertigo of contemporary culture - or one of its symptoms',3,301.00000000,36466978,'HM22.F8',188,215,0,'301 H811',1,NULL,0,0,NULL),(172,'null','978-609-427-123-6','Anarchizmas ir kitos esė','LT','Kitos knygos',190,2013,'Goldman, Emma','null','null','TH015','null','anarchizmas-ir-kitos-ese','2016-12-23 22:01:23','2021-02-03 17:13:29',14,NULL,NULL,NULL,NULL,NULL,'null',1,335.83000000,0,NULL,NULL,NULL,1,'335.83 E54',2,'undefined',0,0,NULL),(173,NULL,'978-0-8047-3406-6','Of hospitality','EN','Stanford University Press',160,2000,'Derrida, Jacques | Dufourmantelle, Anne [Author]',NULL,NULL,'TH016',NULL,'of-hospitality','2016-12-23 22:01:23','2021-01-31 16:51:11',14,'41lGo_2BDHMWL.jpg','image/jpeg',21355,237,500,'&lt;div&gt;These two lectures by Jacques Derrida, \"Foreigner Question\" and \"Step of Hospitality/No Hospitality,\" derive from a series of seminars on \"hospitality\" conducted by Derrida in Paris, January 1996. His seminars, in France and in America, have become something of an institution over the years, the place where he presents the ongoing evolution of his thought in a remarkable combination of thoroughly mapped-out positions, sketches of new material, and exchanges with students and interlocutors.&lt;BR&gt;&lt;BR&gt;As has become a pattern in Derrida\'s recent work, the form of this presentation is a self-conscious enactment of its content. The book consists of two texts on facing pages. \"Invitation\" by Anne Dufourmantelle appears on the left (an invitation that of course originates in a response), clarifying and inflecting Derrida\'s \"response\" on the right. The interaction between them not only enacts the \"hospitality\" under discussion, but preserves something of the rhythms of teaching.&lt;BR&gt;&lt;BR&gt;The volume also characteristically combines careful readings of canonical texts and philosophical topics with attention to the most salient events in the contemporary world, using \"hospitality\" as a means of rethinking a range of political and ethical situations. \"Hospitality\" is viewed as a question of what arrives at the borders, in the initial surprise of contact with an other, a stranger, a foreigner. For example, Antigone is revisited in light of the question of impossible mourning; &lt;I&gt;Oedipus at Colonus&lt;/I&gt; is read via concerns that also apply to teletechnology; the trial of Socrates is brought into conjunction with the televised funeral of François Mitterrand.&lt;BR&gt;&lt;BR&gt;&lt;/div&gt;',3,177.10000000,44676000,'B2430.D483',451,449,0,'177.1 D438',1,NULL,0,0,NULL),(174,NULL,'978-0-85488-196-3','Nature','EN','Whitechapel Gallery',240,2012,'Kastner, Jeffrey',NULL,NULL,'TH017',NULL,'nature-documents-of-contemporary-art','2016-12-23 22:01:23','2021-01-31 16:37:01',14,'51J2gdzHGWL.jpg','image/jpeg',39857,344,500,'Nature, as both subject and object, has repeatedly been rejected and reclaimed by artists over the last half century. With the dislocation of disciplinary boundaries in visual culture, art that is engaged with nature has also forged connections with a new range of scientific, historical and philosophical ideas. Developing technologies make our interventions into natural systems both increasingly refined and profound. And advances in biological and telecommunication technology continually modify the way we \'present\' ourselves. So too are artistic representations of nature (human and otherwise) being transformed. This anthology addresses these issues by considering how the rise of transdisciplinary practices in the postwar era allowed for new kinds of artistic engagement with nature. These include the post-minimalist inscriptions associated with Land art; environmentally engaged practices designed to propose novel forms of stewardship; and more recent projects concerned with relationships between the most subtle and minute components of life and the large-scale appearance of the world. These problematize and unsettle the most basic operations of \'natural\' personhood and identity.Including a wide range of writings by and about artists, juxtaposed with influential texts from diverse theoretical bases, this collection provides an overview of the eclectic scientific and philosophical sources that inform contemporary art\'s investigations of nature. Writers and artists surveyed include: Giorgio Agamben, Jesse Ashlock, Michael Auping, Aziz + Cucher, Gaston Bachelard, Brandon Ballengee, Gregory Bateson, Jane Bennett, Henri Bergson, Joseph Beuys, Claire Bishop, Suzaan Boettger, Roger Caillois, Oron Catts, Mel Chin, Emma Cocker, Steven Connor, Lynne Cooke, Critical Art Ensemble, Walter De Maria, Jacques Derrida, herman de vries, Mark Dion, Vilem Flusser, George Gessert, Oliver Grau, Tim Griffin, Felix Guattari, Hans Haacke, Henrik Hakansson, Peter Halley, Donna Haraway, Helen &amp; Newton Harrison, David Harvey, Pierre Huyghe, Eduardo Kac, Bruno Latour, Pamela M.Lee, Jean-Francois Lyotard, Tom McDonough, Denise Markonish, Mary Mattingly, Ana Mendieta, Laurent Mignonneau, Jacques Monod, Robert Morris, Arne Naess, Thomas Nagel, Trevor Paglen, Jane Prophet, Ingeborg Reichle, Alexis Rockman, Nikolas Rose, Andrew Ross, Tomas Saraceno, Mark Sheerin, Bonnie Sherk, Robert Smithson, Christa Sommerer, Alan Sonfist, Stelarc, Paul Tebbs, Rirkrit Tiravanija, Mierle Laderman Ukeles, Vladimir Vernadsky, Victoria Vesna, Carl Zimmer, Andrea Zittel and Ionat Zurr.',1,111.85000000,747713052,'BH301.N3',487,485,0,'111.85 K19',1,NULL,0,0,NULL),(175,'ISSN 1407-2858',NULL,'Art as Research. Acoustic Space #9','LV/EN','RIXC',288,2011,'Smite, Rasa; Mey, Kerstin; Smits, Raitis',NULL,NULL,'TH018',NULL,'art-as-research-acoustic-space-9','2016-12-23 22:01:23','2021-01-26 18:17:31',14,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(176,NULL,'978-9955-834-03-8','Naujųjų medijų kalba','LT','Mene',472,2009,'Manovich, Lev',NULL,NULL,'TH019',NULL,'naujuju-mediju-kalba','2016-12-23 22:01:23','2021-02-04 22:42:36',14,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(177,NULL,'978-0-521-43773-8','The Invention of tradition','EN','Cambridge University Press',322,2010,'Hobsbawm, Eric J',NULL,NULL,'TH021',NULL,'the-invention-of-tradition','2016-12-23 22:01:23','2021-01-31 18:15:09',14,'41wsAgGIkSL.jpg','image/jpeg',31594,296,500,'Many of the traditions which we think of as very ancient in their origins were not in fact sanctioned by long usage over the centuries, but were invented comparatively recently. This book explores examples of this process of invention - the creation of Welsh and Scottish \'national culture\'; the elaboration of British royal rituals in the nineteenth and twentieth centuries; the origins of imperial rituals in British India and Africa; and the attempts by radical movements to develop counter-traditions of their own. It addresses the complex interaction of past and present, bringing together historians and anthropologists in a fascinating study of ritual and symbolism which poses new questions for the understanding of our history.',3,390.00000000,8763782,'GT95',2650,2745,0,'390 H684',1,NULL,1,0,NULL),(178,NULL,'978-0262-60074-3','The everyday','EN','Whitechapel Gallery',240,2008,'Johnstone, Stephen [Redactor; Editor]',NULL,NULL,'TH022',NULL,'the-everyday-documents-of-contemporary-art','2016-12-23 22:01:23','2021-01-31 16:14:40',14,'41AAlJkDxkL.jpg','image/jpeg',25755,346,500,'&lt;p&gt;Numerous international exhibitions and biennials have borne witness to the range of contemporary art engaged with the everyday and its antecedents in the work of Surrealists, Situationists, the Fluxus group, and conceptual and feminist artists of the 1960s and 1970s. This art shows a recognition of ordinary dignity or the accidentally miraculous, an engagement with a new kind of anthropology, an immersion in the pleasures of popular culture, or a meditation on what happens when nothing happens. The celebration of the everyday has oppositional and dissident overtones, offering a voice to the silenced and proposing possibilities for change. This collection of writings by artists, theorists, and critics assembles for the first time a comprehensive anthology on the everyday in the world of contemporary art.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Artists surveyed include&lt;/b&gt;Chantal Akerman, Francis Alÿs, Vladimir Arkhipov, Ian Breakwell, Stanley Brouwn, Sophie Calle, Marcel Duchamp, Fischli &amp; Weiss, Nan Goldin, Dan Graham, Mona Hatoum, Susan Hiller, Ilya and Emilia Kabakov, Mary Kelly, Lettrist International, Jonas Mekas, Annette Messager, Aleksandra Mir, Roman Ondák, Yoko Ono, Gabriel Orozco, Martha Rosler, Allen Ruppersberg, Daniel Spoerri, Wolfgang Tillmans, Mierle Laderman Ukeles, Andy Warhol, Richard Wentworth, Stephen Willats.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Writers include&lt;/b&gt;Paul Auster, Maurice Blanchot, Geoff Dyer, Hal Foster, Suzy Gablik, Ben Highmore, Henri Lefebvre, Lucy R. Lippard, Michel Maffesoli, Ivone Margulies, Helen Molesworth, Nikos Papastergiadis, Georges Perec, John Roberts, David Ross, Nicholas Serota, Michael Sheringham, Alison and Peter Smithson, Abigail Solomon-Godeau, Jeff Wall, Jonathan Watkins.&lt;/p&gt;',1,701.03000000,174040210,'N72.S6',634,628,0,'701.03 J73',1,NULL,1,0,NULL),(179,NULL,'978-1-934105-63-4','The future of art : a manual','EN','Sternberg Press',320,2011,'Niermann, Ingo, 1969-',NULL,'+ CD','TH020',NULL,'the-future-of-art-a-manual','2016-12-23 22:01:23','2021-01-31 16:14:41',14,'41DU1duXZrL.jpg','image/jpeg',18580,356,500,'In this book/DVD combo, Niermann, everybody\'s favorite kindacomic provocateur asks, \'\'Could a single object transform the future of art? Could an artist succeed in merely creating this one object?\'\' With artist Erik Niedling, Niermann starts asking art-world figures for advice on his quest to create an artwork of epochal importance; the results, on paper and video, will surprise you. With guidance by Thomas Bayrle, Lady Jaye and Genesis Breyer P-Orridge, Olafur Eliasson, Boris Groys, Damien Hirst, Gregor Jansen, Terence Koh, Marcos Lutyens, Philomene Magers, Antje Majewski, Hans Ulrich Obrist, Thomas Olbricht and Tobias Rehberger; and commentary by Chus Martinez. Including the DVD The Future of Art by Erik Niedling and Ingo Niermann (HD, 157 min.)',1,709.00000000,904534288,'N6497',2,2,0,'709 N675',1,NULL,0,0,NULL),(180,'0-385-19248-7',NULL,'The dance of life : the other dimension of time','EN','Anchor',250,1983,'Hall, Edward T. (Edward Twitchell), 1914-2009',NULL,NULL,'TH023',NULL,'the-dance-of-life-the-other-dimension-of-time','2016-12-23 22:01:23','2021-01-31 16:14:41',14,'51mKGphWBCL.jpg','image/jpeg',36211,324,500,'\"Hall, whose &lt;i&gt;Beyond Culture&lt;/i&gt; and &lt;i&gt;The Silent Language &lt;/i&gt;won a wider readership, has written a ground-breaking investigation of the ways we use and abuse time, rich in insights applicable to our lives. Business readers will enjoy the cross-cultural comparison of American know-how with practices of compartmentalized German, centralized French, and ceremonious Japanese firms.\"  —&lt;i&gt;Publishers Weekly&lt;br&gt;&lt;br&gt;&lt;/i&gt;In his pioneering work &lt;i&gt;The Hidden Dimension, &lt;/i&gt;Edward T. Hall spoke of different cultures\' concepts of space. Now &lt;i&gt;The Dance of Life&lt;/i&gt; reveals the ways in which individuals in culture are tied together by invisible threads of rhythm and yet isolated from each other by hidden walls of time. Hall shows how time is an organizer of activities, a synthesizer and integrator, and a special langauge that reveals how we really feel about each other.&lt;br&gt;&lt;br&gt;Time plays a central role in the diversity of cultures such as the American and the Japanese, which Hall shows to be mirror images of each other. He also deals with how time influences relations among Western Europeans, Latin Americans, Anglo-Americans, and Native Americans.',1,115.00000000,8826076,'BD638',1528,1610,0,'115 H175',1,NULL,0,0,NULL),(181,'0-7456-1522-8',NULL,'Free exchange','EN','Polity Press',144,2005,'Bourdieu, Pierre | Haacke, Hans, 1936- [Author]',NULL,NULL,'TH024',NULL,'free-exchange','2016-12-23 22:01:24','2021-01-31 16:14:41',14,'51ClrWCwrML.jpg','image/jpeg',41916,350,500,NULL,1,700.10309040,31609958,'NX180.S6',378,554,0,'700.1030904 B769',1,NULL,0,0,NULL),(182,'9986-745-31-4','null','Padorus Pasiūlymas: Klinikinių Tyrimų Etikos Priežiūra / A Decent Proposal: Ethical Review of Clinical Research','LT','Charibdė, Vilnius',256,1999,'Evans, Donald; Evans, Martyn','null','null','TH025','null','padorus-pasiulymas-klinikiniu-tyrimu-etikos-prieziura-a-decent-proposal-ethical-review-of-clinical-research','2016-12-23 22:01:24','2021-02-04 22:43:03',14,NULL,NULL,NULL,NULL,NULL,'null',1,174.28000000,0,NULL,NULL,NULL,1,'174.28 E92',1,'undefined',0,0,NULL),(183,NULL,'978-0262-681346','From margin to center : the spaces of installation art','EN','The MIT Press',208,2000,'Reiss, Julie H.',NULL,NULL,'TH027',NULL,'from-margin-to-center-the-spaces-of-installation-art','2016-12-23 22:01:24','2021-01-31 16:14:41',14,'51T990MMZ7L.jpg','image/jpeg',34570,436,500,'&lt;p&gt;Unlike traditional art works, installation art has no autonomous existence. It is usually created at the exhibition site, and its essence is spectator participation. Installation art originated as a radical art form presented only at alternative art spaces; its assimilation into mainstream museums and galleries is a relatively recent phenomenon. The move of installation art from the margin to the center of the art world has had far-reaching effects on the works created and on museum practice.&lt;/p&gt;&lt;p&gt;This is the first book-length study of installation art. Julie Reiss concentrates on some of the central figures in its emergence, including artists, critics, and curators. Her primary focus is installations created in New York City -- which has a particularly rich history of installation art -- beginning in the late 1950s. She takes us from Allan Kaprow\'s 1950s\' environments to examples from minimalism, performance art, and process art to establish installation art\'s autonomy as well as its relationship to other movements. Recent years have seen a surge of interest in the effects of exhibition space, curatorial practice, and institutional context on the spectator. The history of installation art -- of all art forms, one of the most defiant of formalist tenets -- sheds considerable light on the issues raised by this shift of critical focus from isolated art works to art experienced in a particular context.&lt;/p&gt;',1,709.04074000,39615925,'N6512.5.I56',791,621,0,'709.04074 R378',1,NULL,0,0,NULL),(184,NULL,'978-0-571-21538-6','The secret of scent : adventures in perfume and the science of smell','EN','Faber and Faber',214,2006,'Turin, Luca',NULL,NULL,'TH028',NULL,'the-secret-of-scent-adventures-in-perfume-and-the-science-of-smell','2016-12-23 22:01:24','2021-01-31 16:14:41',14,'419lDsPLBnL.jpg','image/jpeg',22541,326,500,'\"Meet Luca Turin, a renegade scientist and perfume critic with an extraordinary sense of smell.\" (Newsday). Funny, irreverent and passionate, The Secret of Scent opens the lid on two worlds - the glamorous and highly lucrative realm of the perfume makers, and the equally rivalrous domain of smell science. Smell is our forgotten sense. Long neglected by science in favour of more prestigious areas of research, it\'s also barely understood in general life. At the core of our sense of smell lies an enigma: why do things smell the way they do? How is smell written into the molecules? This book is the story of the quest to solve this puzzle.  Luca Turin has been described in The Economist as \'a man with a powerful nose and a bizarre obsession with perfume.\' Starting with a tour of the great perfumes and their gifted makers, he shows how few people have an idea of what perfume is or how it is made, let alone how smell works and what part it plays in other pleasures like food. But not everyone has ignored this powerful sense. A small band of mavericks has been trying to crack the code of smell for seventy years. Building on their work, Turin thinks he has succeeded. And like all good mysteries, the solution was all the while hidden in plain sight - in this case, right under our noses.',1,668.54000000,68712450,'TP983',938,939,0,'668.54 T938',1,NULL,0,0,NULL),(185,'1-894773-09-8',NULL,'Transference, tradition, technology : native new media exploring visual &amp; digital culture','EN','Walter Phillips Gallery Editions',223,2005,NULL,NULL,NULL,'TH029',NULL,'transference-tradition-technology-native-new-media-exploring-visual-and-digital-culture','2016-12-23 22:01:24','2021-01-31 16:14:41',14,'51bLc2TatdL.jpg','image/jpeg',50734,374,500,'Transference, Tradition, Technology explores Canadian Aboriginal new media and references the work of artists within a political, cultural and aesthetic milieu. The book constructs a Native art history relating to these disciplines, one that is grounded in the philosophical and cosmological foundations of Aboriginal concepts of community and identity within the rigour of contemporary arts discourse. Approachable in nature but scholarly in content, this book is the first of its kind. A text book for students and teachers of Canadian Aboriginal history and visual and media art, and a source for writers, scholars and historians, Transference, Tradition, Technology is co-produced with the Art Gallery of Hamilton, Hamilton; and Indigenous Media Arts Group, Vancouver.',1,704.03970710,55105991,'N6549.5.A54',70,66,0,'704.0397071 Tr',1,'WPG, AGH, IMAG, Melanie Townsend, Dana Claxton, Puhipau, Zacharias Kunuk, Steven Loft, Monika Kin Gagnon, Shawna Dempsey, Loretta Todd, Candice Hopkins, Marjorie Beaucage, Victor Masayesva, Greg Young-Ing, Ahasiw Maskegon-Iskwew',0,0,NULL),(186,'0-92015-972-9','null','Queues, rendezvous, riots : questioning the public in art and architecture','EN','Walter Phillips Gallery, Banff Centre Press',166,1994,'Baird, George; Lewis, Mark','null','null','TH030','null','queues-rendezvous-riots','2016-12-23 22:01:24','2021-02-05 16:53:52',14,NULL,NULL,NULL,NULL,NULL,'null',1,306.47000000,31517927,'N8825.Q84',119,119,0,'306.47 B163',1,'Machado, Rodolfo; Silvetti, Jorge; Adams, Dennis; Lewis, Mark; Frenkel, Vera; Payne, Andrew; Boudreau, Marik; Fleming, Martha; Lapointe, Lyne; Robin, Regine; Diller, Elizabeth; Scofidio, Ricardo; Hermant, Daniel; Wall, Jeff; Graham, Dan; Lamoureux, Johanne',0,0,NULL),(187,NULL,'978-9986-16-934-5','Pokalbiai apie esmes','LT','Tyto Alba',360,2013,'Šliogeris, Arvydas',NULL,NULL,'TH031',NULL,'pokalbiai-apie-esmes','2016-12-23 22:01:24','2021-01-24 17:45:51',14,'417TBXoIF_2BL.jpg','image/jpeg',23696,335,500,NULL,1,NULL,842912284,'B4745.S55',NULL,2,0,NULL,1,NULL,0,0,NULL),(188,'','978-5-94620-073-8','Evolution haute couture : art and science in the post-biological age','RUS/EN','The National Centre for Contemporary Art, Baltic Branch, Kaliningrad',560,2013,'Bulatov, Dmitry','Part 2','','TH086','','evolution-haute-couture-art-and-science-in-the-post-biological-age','2016-12-23 22:01:24','2021-02-03 16:18:53',14,NULL,NULL,NULL,NULL,NULL,'',1,700.10500000,740405918,'N72.S3',NULL,4,0,'700.105 B933 Evo',1,'undefined',1,0,NULL),(189,NULL,'978-951-53-3312-4','Denise Ziegler : features of the poetic','EN','Finnish Academy of the Fine Arts',99,2010,'Denise Ziegler',NULL,NULL,'TH026',NULL,'features-of-the-poetic','2016-12-23 22:01:24','2021-02-03 16:21:50',14,NULL,NULL,NULL,NULL,NULL,NULL,1,709.20000000,983814397,NULL,1,NULL,0,'709.2 D395',1,NULL,0,0,NULL),(190,NULL,'978-1-84467-761-0','The emancipated spectator','EN','Verso',134,2011,'Rancière, Jacques | Elliott, Gregory [Translator]',NULL,NULL,'TH034',NULL,'the-emancipated-spectator','2016-12-23 22:01:24','2021-02-04 22:40:44',14,'41nG3QUIW9L.jpg','image/jpeg',23141,333,500,'The theorists of art and film commonly depict the modern audience as aesthetically and politically passive. In response, both artists and thinkers have sought to transform the spectator into an active agent and the spectacle into a communal performance.&lt;br /&gt;&lt;br /&gt;In this follow-up to the acclaimed &lt;i&gt;The Future of the Image&lt;/i&gt;, Rancière takes a radically different approach to this attempted emancipation. First asking exactly what we mean by political art or the politics of art, he goes on to look at what the tradition of critical art, and the desire to insert art into life, has achieved. Has the militant critique of the consumption of images and commodities become, ironically, a sad affirmation of its omnipotence?&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;i&gt;From the Hardcover edition.&lt;/i&gt;',1,700.10000000,277194969,'NX220',743,655,0,'700.1 R185',1,NULL,0,0,NULL),(191,'','978-1-84467-297-4','The future of the image','EN','Verso',147,2009,'Rancière, Jacques | Elliott, Gregory [Translator]','','','TH035','','the-future-of-the-image','2016-12-23 22:01:24','2021-02-01 22:22:41',14,'51G6OdOV2oL.jpg','image/jpeg',41925,324,500,'In &lt;i&gt;The Future of the Image&lt;/i&gt;, Jacques Rancière develops a fascinating new concept of the image in contemporary art, showing how art and politics have always been intrinsically intertwined. Covering a range of art movements, filmmakers such as Godard and Bresson, and thinkers such as Foucault, Deleuze, Adorno, Barthes, Lyotard and Greenberg, Rancière shows that contemporary theorists of the image are suffering from religious tendencies.&lt;br&gt;&lt;br&gt;He argues that there is a stark political choice in art: it can either reinforce a radical democracy, or create a new reactionary mysticism. For Rancière there is never a pure art: the aesthetic revolution must always embrace egalitarian ideals.',3,709.05010000,123114526,'B105.I47',400,427,0,'709.0501 R185',1,NULL,0,0,NULL),(192,'','978-609-459-126-6','Įnirtingas miegas Vaizduotė ir fenomenologija','LT','Vilniaus Universitetas',279,2012,'Kristupas Sabolius','','','TH036','','inirtingas-miegas-vaizduote-ir-fenomenologija','2016-12-23 22:01:24','2021-01-23 17:13:22',14,NULL,NULL,NULL,NULL,NULL,'',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(193,'0-262-13374-1',NULL,'The language of new media','EN','The MIT Press',354,2001,'Manovich, Lev',NULL,NULL,'TH037',NULL,'the-language-of-new-media','2016-12-23 22:01:24','2021-01-31 16:14:42',14,'512yI3ioUKL.jpg','image/jpeg',39519,389,500,'In this book Lev Manovich offers the first systematic and rigorous theory of new media. He places new media within the histories of visual and media cultures of the last few centuries. He discusses new media\'s reliance on conventions of old media, such as the rectangular frame and mobile camera, and shows how new media works create the illusion of reality, address the viewer, and represent space. He also analyzes categories and forms unique to new media, such as interface and database.&lt;br /&gt; &lt;br /&gt; Manovich uses concepts from film theory, art history, literary theory, and computer science and also develops new theoretical constructs, such as cultural interface, spatial montage, and cinegratography. The theory and history of cinema play a particularly important role in the book. Among other topics, Manovich discusses parallels between the histories of cinema and of new media, digital cinema, screen and montage in cinema and in new media, and historical ties between avant-garde film and new media.',1,302.20000000,44509405,'P96.T42',1397,1513,0,'302.2 M266',1,NULL,0,0,NULL),(194,NULL,'9780226713427','Memory, history, forgetting','LT','University Of Chicago Press',642,38944,'RicÅ (3C (Bur, Paul',NULL,NULL,'TH038',NULL,'memory-history-forgetting','2016-12-23 22:01:24','2021-01-31 16:14:42',14,'31xtuDWBqbL.jpg','image/jpeg',16165,333,500,'&lt;div&gt;Why do major historical events such as the Holocaust occupy the forefront of the collective consciousness, while profound moments such as the Armenian genocide, the McCarthy era, and France\'s role in North Africa stand distantly behind? Is it possible that history \"overly remembers\" some events at the expense of others? A landmark work in philosophy, Paul Ricoeur\'s &lt;i&gt;Memory, History, Forgetting&lt;/i&gt; examines this reciprocal relationship between remembering and forgetting, showing how it affects both the perception of historical experience and the production of historical narrative.&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;i&gt;Memory, History, Forgetting&lt;/i&gt;, like its title, is divided into three major sections. Ricoeur first takes a phenomenological approach to memory and mnemonical devices. The underlying question here is how a memory of present can be of something absent, the past. The second section addresses recent work by historians by reopening the question of the nature and truth of historical knowledge. Ricoeur explores whether historians, who can write a history of memory, can truly break with all dependence on memory, including memories that resist representation. The third and final section is a profound meditation on the necessity of forgetting as a condition for the possibility of remembering, and whether there can be something like happy forgetting in parallel to happy memory. Throughout the book there are careful and close readings of the texts of Aristotle and Plato, of Descartes and Kant, and of Halbwachs and Pierre Nora.&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;A momentous achievement in the career of one of the most significant philosophers of our age, &lt;i&gt;Memory, History, Forgetting&lt;/i&gt; provides the crucial link between Ricoeur\'s &lt;i&gt;Time and Narrative&lt;/i&gt; and &lt;i&gt;Oneself as Another&lt;/i&gt; and his recent reflections on ethics and the problems of responsibility and representation.&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;div&gt;“His success in revealing the internal relations between recalling and forgetting, and how this dynamic becomes problematic in light of events once present but now past, will inspire academic dialogue and response but also holds great appeal to educated general readers in search of both method for and insight from considering the ethical ramifications of modern events. . . . It is indeed a master work, not only in Ricoeur’s own vita but also in contemporary European philosophy.”—&lt;i&gt;Library Journal &lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;/i&gt;“Ricoeur writes the best kind of philosophy—critical, economical, and clear.”— &lt;i&gt;New York Times Book Review&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;/i&gt;&lt;/div&gt;&lt;br /&gt;&lt;/div&gt;',1,128.30000000,785565031,'B2430.R553',23,26,0,'128.3 R489',1,NULL,0,1,NULL),(195,NULL,'978-1-78023-372-7','Staging the archive : art and photography in the age of new media','EN','Reaktion Books',301,2015,'Alphen, Ernst van',NULL,NULL,'TH039',NULL,'staging-the-archive','2016-12-23 22:01:24','2021-02-04 22:43:14',14,'51DKk9-2IiL.jpg','image/jpeg',55936,376,500,'Dedicated to art practices that mobilize the model of the archive, this book demonstrates the ways in which such ‘archival artworks’ probe the possibilities of what art is and what it can do. Through a variety of media, methodologies and perspectives, the artists surveyed here also challenge the principles on which the notions of organization, evidence and documentation are built.&lt;br /&gt;The earliest examples of the modern archival artwork were made in the 1930s, but it is since the 1960s that archival principles have increasingly been used by artists to inform, structure and shape their works. This includes practices that consist of archive construction, archaeological investigation, record keeping or the use of archived materials; however, they also interrogate the principles, claims and effects of the archive. Staging the Archive shows how artists read the concept of the archive against the grain, questioning not only what the archive is and can be but what materials, images or ideas can be archived.&lt;br /&gt;In this book Ernst van Alphen examines these archival artists and artworks in detail, setting them within their social, political and aesthetic contexts. Exploring the work of Marcel Duchamp, Marcel Broodthaers, Christian Boltanski, Annette Messager, Fiona Tan and Sophie Calle, among others, this book reveals how modern and contemporary artists have used and contested the notion of the archive to establish new relationships to history, information and data.',1,709.05100000,889522549,'N7433.94',521,729,0,'709.051 A456',1,NULL,0,0,NULL),(196,'9-781607-852810',NULL,'New materialism : interviews &amp; cartographies','EN','Open Humanities Press',196,2012,'Dolphijn, Rick | Tuin, Iris van der [Author; Contributor] | Dolphijn, Rick [Author]',NULL,NULL,'TH040',NULL,'new-materialism-interviews-cartographies','2016-12-23 22:01:24','2021-01-31 16:14:42',14,'51V7xXjsm5L.jpg','image/jpeg',55198,333,500,'This book is the first monograph on the theme of “new materialism,” an emerging trend in 21st century thought that has already left its mark in such fields as philosophy, cultural theory, feminism, science studies, and the arts. The first part of the book contains elaborate interviews with some of the most prominent new materialist scholars of today: Rosi Braidotti, Manuel DeLanda, Karen Barad, and Quentin Meillassoux. The second part situates the new materialist tradition in contemporary thought by singling out its transversal methodology, its position on sexual differing, and by developing the ethical and political consequences of new materialism.',1,146.30000000,813250375,'B825',59,216,0,'146.3 D659',1,NULL,0,0,NULL),(197,NULL,'978-0-9905050-5-1','The chimera principle : an anthropology of memory and imagination','EN','Hau Books Chicago',365,2015,'Severi, Carlo | Lloyd, Janet, 1934- [Translator] | Graeber, David [Author of introduction]',NULL,NULL,'TH041',NULL,'the-chimera-principle-an-anthropology-of-memory-and-imagination','2016-12-23 22:01:24','2021-01-31 16:14:43',14,'51HnS4rYWOL.jpg','image/jpeg',34871,333,500,'&lt;div&gt;&lt;P&gt;Available in English for the first time, anthropologist Carlo Severi’s &lt;I&gt;The Chimera Principle&lt;/I&gt; breaks new theoretical ground for the study of ritual, iconographic technologies, and oral traditions among non-literate peoples. Setting himself against a tradition that has long seen the memory of people “without writing”—which relies on such ephemeral records as ornaments, body painting, and masks—as fundamentally disordered or doomed to failure, he argues strenuously that ritual actions in these societies pragmatically produce religious meaning and that they demonstrate what he calls a “chimeric” imagination.&lt;/P&gt;&lt;P&gt;Deploying philosophical and ethnographic theory, Severi unfolds new approaches to research in the anthropology of ritual and memory, ultimately building a new theory of imagination and an original anthropology of thought. This English-language edition, beautifully translated by Janet Lloyd and complete with a foreword by David Graeber, will spark widespread debate and be heralded as an instant classic for anthropologists, historians, and philosophers.&lt;/P&gt;&lt;/div&gt;&lt;BR&gt;',1,306.00000000,891618295,'GN357',617,618,0,'306 S498',1,NULL,0,0,NULL),(198,'9-780813-518084',NULL,'Sadomasochism in everyday life : the dynamics of power and powerlessness','EN','Rutgers University Press',238,1994,'Chancer, Lynn S., 1954-',NULL,NULL,'TH042',NULL,'sadomasochism-in-everyday-life-the-dynamics-of-power-and-powerlessness','2016-12-23 22:01:24','2021-01-31 17:10:59',14,'51cx2lTX5NL.jpg','image/jpeg',34268,326,500,'&lt;DIV&gt;&lt;p&gt;Lynn Chancer  advances the provocative thesis that sadomasochism is far more prevalent  in contemporary societies like the United States than we realize.  According to Chancer, sexual sadomasochism is only the best-known  manifestation of what is actually a much more broadly based social  phenomenon. Moving from personal relationships to school, the workplace,  and other interactions, Chancer uses a variety of examples that are  linked by a recurrent pattern of behavior. She goes beyond the  predominantly individualistic and psychological explanations generally  associated with sadomasochism (including those popularized in the \"how  to\" literature of the recent Women Who Love Too Much genre) toward a  more sociological interpretation. Chancer suggests that the structure of  societies organized along male-dominated and capitalistic lines  reflects and perpetuates a sadomasochistic social psychology, creating a  culture steeped in everyday experiences of dominance and subordination.&lt;/p&gt;&lt;p&gt;    &lt;/p&gt;&lt;p&gt;In  the first part of the book, Chancer discusses the prevalence of  sadomasochistic cultural imagery in contemporary America and examines  sadomasochism through several perspectives. She develops a set of  definitional traits both through existential analysis of an instance of  S/M sex and by incorporating a number of Hegelian and psychoanalytic  concepts. In the second part of the book, she places sadomasochism in a  broader context by exploring whether and how it appears in the workplace  and how it relates to gender and race.&lt;/p&gt;&lt;/div&gt;',3,303.30000000,24590193,'HQ79',507,506,0,'303.3 C454',1,NULL,0,0,NULL),(199,NULL,'978-0-231-17090-1','Planetary modernisms : provocations on modernity across time','EN','Columbia Univeristy Press',451,2015,'Friedman, Susan Stanford',NULL,NULL,'TH043',NULL,'planetary-modernisms-provocations-on-modernity-across-time','2016-12-23 22:01:24','2021-01-31 16:14:43',14,'414lrAwePHL.jpg','image/jpeg',31348,331,500,'&lt;div&gt;&lt;P&gt;Drawing on a vast archive of world history, anthropology, geography, cultural theory, postcolonial studies, gender studies, literature, and art, Susan Stanford Friedman recasts modernity as a networked, circulating, and recurrent phenomenon producing multiple aesthetic innovations across millennia. Considering cosmopolitan as well as nomadic and oceanic worlds, she radically revises the scope of modernist critique and opens the practice to more integrated study.&lt;/P&gt;&lt;P&gt;Friedman moves from large-scale instances of pre-1500 modernities, such as Tang Dynasty China and the Mongol Empire, to small-scale instances of modernisms, including the poetry of Du Fu and Kabir and Abbasid ceramic art. She maps the interconnected modernisms of the long twentieth century, pairing Joseph Conrad with Tayeb Salih, E. M. Forster with Arundhati Roy, Virginia Woolf with the Tagores, and Aimé Césaire with Theresa Hak Kyung Cha. She reads postcolonial works from Sudan and India and engages with the idea of Négritude. Rejecting the dominant modernist concepts of marginality, othering, and major/minor, Friedman instead favors rupture, mobility, speed, networks, and divergence, elevating the agencies and creative capacities of all cultures not only in the past and present but also in the century to come.&lt;/P&gt;&lt;/div&gt;',1,809.91120000,897946309,'PN56.M54',1313,1296,0,'809.9112 F911',1,NULL,0,0,NULL),(200,NULL,'978-0-12-385502-2','Design research through practice : from the lab, field, and showroom','EN','Elsevier',204,2011,'Koskinen, Ilpo Kalevi | Koskinen, Ilpo Kalevi [Author; Other] | Binder, Thomas, 1960- [Author] | Redström, Johan [Author] | Wensveen, Stephan [Author] | Zimmerman, John [Author]',NULL,NULL,'TH044',NULL,'design-research-through-practice-from-the-lab-field-and-showroom','2016-12-23 22:01:24','2021-02-03 16:22:02',14,'41tDSIS9XEL.jpg','image/jpeg',30966,405,500,'&lt;p&gt;&lt;i&gt;Design Research Through Practice: From the Lab, Field, and Showroom&lt;/i&gt; focuses on one type of contemporary design research known as constructive design research. It looks at three approaches to constructive design research: Lab, Field, and Showroom. The book shows how theory, research practice, and the social environment create commonalities between these approaches. It illustrates how one can successfully integrate design and research based on work carried out in industrial design and interaction design.&lt;/p&gt; &lt;p&gt;The book begins with an overview of the rise of constructive design research, as well as constructive research programs and methodologies. It then describes the logic of studying design in the laboratory, design ethnography and field work, and the origins of the Showroom and its foundation on art and design rather than on science or the social sciences. It also discusses the theoretical background of constructive design research, along with modeling and prototyping of design items. Finally, it considers recent work in Lab that focuses on action and the body instead of thinking and knowing.&lt;/p&gt; &lt;p&gt;Many kinds of designers and people interested in design will find this book extremely helpful. &lt;/p&gt;&lt;br /&gt;&lt;br /&gt;&lt;ul&gt;&lt;li&gt;Gathers design research experts from traditional lab science, social science, art, industrial design, UX and HCI to lend tested practices and how they can be used in a variety of design projects&lt;/li&gt;&lt;li&gt;Provides a multidisciplinary story of the whole design process, with proven and teachable techniques that can solve both academic and practical problems&lt;/li&gt;&lt;li&gt;Presents key examples illustrating how research is applied and vignettes summarizing the key how-to details of specific projects&lt;/li&gt;&lt;/ul&gt;',1,745.20000000,714729504,'TS170',1391,1378,0,'745.2 K86',1,NULL,0,0,NULL),(201,NULL,'978-0-8223-5744-5','Beautiful data : a history of vision and reason since 1945','EN','Duke University Press',342,2014,'Halpern, Orit, 1972-',NULL,NULL,'TH045',NULL,'beautiful-data-a-history-of-vision-and-reason-since-1945','2016-12-23 22:01:24','2021-01-31 16:14:43',14,'516SaOV9VcL.jpg','image/jpeg',37374,333,500,'&lt;div&gt;&lt;I&gt;Beautiful Data&lt;/I&gt; is both a history of big data and interactivity, and a sophisticated meditation on ideas about vision and cognition in the second half of the twentieth century. Contending that our forms of attention, observation, and truth are contingent and contested, Orit Halpern historicizes the ways that we are trained, and train ourselves, to observe and analyze the world. Tracing the postwar impact of cybernetics and the communication sciences on the social and human sciences, design, arts, and urban planning, she finds a radical shift in attitudes toward recording and displaying information. These changed attitudes produced what she calls communicative objectivity: new forms of observation, rationality, and economy based on the management and analysis of data. Halpern complicates assumptions about the value of data and visualization, arguing that changes in how we manage and train perception, and define reason and intelligence, are also transformations in governmentality. She also challenges the paradoxical belief that we are experiencing a crisis of attention caused by digital media, a crisis that can be resolved only through intensified media consumption.&lt;BR&gt;&lt;/div&gt;',3,3.54000000,898325444,'Q310',19,14,0,'3.54 H195',1,NULL,0,0,NULL),(202,'','978-9934-8509-5-0','Revisiting footnotes : footprints of the recent past in the post-socialist region','EN/LV','Latvian Centre for Contemporary Art',355,2015,'Astahovska, Ieva; Lāce, Inga','','','TH046/TH138','','revisiting-footnotes-traces-of-the-recent-past-in-the-post-socialist-region-tulkojot-atsauces-nesenas-pagatnes-nospiedumi-postsocialisma-regiona','2016-12-23 22:01:24','2021-02-01 20:00:11',14,NULL,NULL,NULL,NULL,NULL,'',1,700.10309040,1081299054,'NX180.S6',NULL,2,0,'700.1030904 A852',2,'undefined',0,0,NULL),(203,NULL,'978-609-467-170-8','Komunikuoti kultūrą : institucijos, strategijos, auditorijos : kolektyvinė monografija','LT','Vytauto didžiojo universitetas VERSUS AUREUS',422,2015,'Citvarienė, Daiva',NULL,NULL,'TH047',NULL,'komunikuoti-kultura-institucijos-strategijos-auditorijos','2016-12-23 22:01:24','2021-01-24 17:46:53',14,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,1100425185,'P94.6',NULL,1,0,NULL,1,NULL,0,0,NULL),(204,NULL,'978-1849940764','100 diagrams that changed the world : from the earliest cave paintings to the innovation of the iPod','EN','BATSFORD',224,2014,'Christianson, Scott | You, Huiting, [Translator]',NULL,NULL,'TH048',NULL,'100-diagrams-that-changed-the-world','2016-12-23 22:01:24','2021-01-31 16:14:43',14,'51ecIqGYQQL.jpg','image/jpeg',44196,384,500,'A fascinating collection of the most significant plans, sketches, drawings and illustrations that have changed the way we think about the world. From primitive cave paintings to the complicated DNA double helix drawn by Crick and Watson, they chart dramatic breakthroughs in our understanding of the world and its history. This fascinating book encompasses everything from the triple spirals found on prehistoric megalithic tombs dating right up to the drawings sent out on the side of space exploration probes. Discover Leonardo da Vinci\'s beautiful technical drawings, pre-empting the invention of manned flight, Copernicus\'s bold diagrams that dared to tell us that Earth was not at the centre of the Universe, as well as the history of the more everyday diagrams that we now take for granted. Every diagram is clearly illustrated and placed into context with very accessible text even for the lay reader. Diagrams include: Egyptian Book of the Dead, Chauvet cave drawings, Aztec Calendar, sheet music, Vitruvian Man, Galileo\'s telescope, Hooke\'s Micrographia, the Porphyrian Tree, Dunhuang Star Map, Newcomen\'s steam engine, the Morse Code, Brooks Slave Ship, William Playfair\'s bar chart, Thomas Edison\'s light bulb, Nazi propaganda map, sewing patterns, Feynman Diagrams, the DNA double helix, IKEA flat-pack furniture instructions, the World Wide Web schematic, Carl Sagan\'s Pioneer Plaque.',1,604.20000000,778419237,'T353',520,535,0,'604.2 C555',1,NULL,0,0,NULL),(205,NULL,'978-0-674-94839-6','We have never been modern','EN','Harvard University Press',157,1993,'Latour, Bruno',NULL,NULL,'TH049',NULL,'we-have-never-been-modern','2016-12-23 22:01:24','2021-02-03 09:22:23',14,'41Gcd_2BEnClL.jpg','image/jpeg',30915,334,500,'With the rise of science, we moderns believe, the world changed irrevocably, separating us forever from our primitive, premodern ancestors. But if we were to let go of this fond conviction, Bruno Latour asks, what would the world look like? His book, an anthropology of science, shows us how much of modernity is actually a matter of faith. What does it mean to be modern? What difference does the scientific method make? The difference, Latour explains, is in our careful distinctions between nature and society, between human and thing, distinctions that our benighted ancestors, in their world of alchemy, astrology, and phrenology, never made. But alongside this purifying practice that defines modernity, there exists another seemingly contrary one: the construction of systems that mix politics, science, technology, and nature. The ozone debate is such a hybrid, in Latour’s analysis, as are global warming, deforestation, even the idea of black holes. As these hybrids proliferate, the prospect of keeping nature and culture in their separate mental chambers becomes overwhelming—and rather than try, Latour suggests, we should rethink our distinctions, rethink the definition and constitution of modernity itself. His book offers a new explanation of science that finally recognizes the connections between nature and culture—and so, between our culture and others, past and present. Nothing short of a reworking of our mental landscape. We Have Never Been Modern blurs the boundaries among science, the humanities, and the social sciences to enhance understanding on all sides. A summation of the work of one of the most influential and provocative interpreters of science, it aims at saving what is good and valuable in modernity and replacing the rest with a broader, fairer, and finer sense of possibility.',1,303.48300000,474088602,'Q175.5',2,2,0,'303.483 L359',1,NULL,0,0,NULL),(206,NULL,'978-1-78478-079-1','The shock of the Anthropocene : the earth, history, and us','EN','VERSO',306,2016,'Bonneuil, Christophe | Fressoz, Jean-Baptiste [Author] | Fernbach, David [Translator]',NULL,NULL,'TH050',NULL,'the-shock-of-the-anthropocene','2016-12-23 22:01:24','2021-01-31 16:14:43',14,'51c_2BvGJtpXL.jpg','image/jpeg',37974,333,500,'&lt;b&gt;Dissecting the new theoretical buzzword of the “Anthropocene”&lt;/b&gt;&lt;br /&gt;&lt;br /&gt;The Earth has entered a new epoch: the Anthropocene. What we are facing is not only an environmental crisis, but a geological revolution of human origin. In two centuries, our planet has tipped into a state unknown for millions of years.&lt;br /&gt;&lt;br /&gt;How did we get to this point? Refuting the convenient view of a “human species” that upset the Earth system, unaware of what it was doing, this book proposes the first critical history of the Anthropocene, shaking up many accepted ideas: about our supposedly recent “environmental awareness,” about previous challenges to industrialism, about the manufacture of ignorance and consumerism, about so-called energy transitions, as well as about the role of the military in environmental destruction. In a dialogue between science and history, &lt;i&gt;The Shock of the Anthropocene&lt;/i&gt; dissects a new theoretical buzzword and explores paths for living and acting politically in this rapidly developing geological epoch.',1,304.20000000,931226789,'GF75',461,449,0,'304.2 B717',1,NULL,0,0,NULL),(207,NULL,'978-0-8166-6740-6','Insect media : an archaeology of animals and technology','EN','University of Minnesota Press',281,2010,'Parikka, Jussi, 1976- | Parikka, Jussi, 1976-',NULL,NULL,'TH051',NULL,'insect-media-an-archaeology-of-animals-and-technology','2016-12-23 22:01:24','2021-01-31 18:34:28',14,'41dpZU80yYL.jpg','image/jpeg',31594,324,500,'&lt;DIV&gt;Since the early nineteenth century, when entomologists first popularized the unique biological and behavioral characteristics of insects, technological innovators and theorists have proposed insects as templates for a wide range of technologies. In &lt;i&gt;Insect Media&lt;/i&gt;, Jussi Parikka analyzes how insect forms of social organization-swarms, hives, webs, and distributed intelligence-have been used to structure modern media technologies and the network society, providing a radical new perspective on the interconnection of biology and technology.&lt;/DIV&gt;&lt;DIV&gt;&lt;BR&gt;Through close engagement with the pioneering work of insect ethologists, including Jakob von Uexküll and Karl von Frisch, posthumanist philosophers, media theorists, and contemporary filmmakers and artists, Parikka develops an insect theory of media, one that conceptualizes modern media as more than the products of individual human actors, social interests, or technological determinants. They are, rather, profoundly nonhuman phenomena that both draw on and mimic the alien lifeworlds of insects.&lt;BR&gt; &lt;/DIV&gt;&lt;DIV&gt;Deftly moving from the life sciences to digital technology, from popular culture to avant-garde art and architecture, and from philosophy to cybernetics and game theory, Parikka provides innovative conceptual tools for exploring the phenomena of network society and culture. Challenging anthropocentric approaches to contemporary science and culture, &lt;i&gt;Insect Media&lt;/i&gt; reveals the possibilities that insects and other nonhuman animals offer for rethinking media, the conflation of biology and technology, and our understanding of, and interaction with, contemporary digital culture.&lt;/DIV&gt;',3,595.70900000,617508611,'Q337.3',975,976,0,'595.709 P231',1,NULL,0,0,NULL),(208,NULL,'978-1-60785-241-4','Immersion into noise','EN','Open Humanities Press',267,2011,'Nechvatal, Joseph',NULL,NULL,'TH052',NULL,'immersion-into-noise','2016-12-23 22:01:24','2021-01-31 16:14:43',14,'513fFN6m-3L.jpg','image/jpeg',49506,333,500,'The noise factor is the ratio of signal to noise of an input signal to that of the output signal. Noise can block or interfere with the meaning of a message in both human and electronic communication. But in Information Theory, noise is still considered to be information.  &lt;p&gt; By refining the definition of noise as that which addresses us outside of our preferred comfort zone, Joseph Nechvatal\'s Immersion Into Noise investigates multiple aspects of cultural noise by applying the audio understanding of noise to the visual, architectural and cognitive domains. Nechvatal expands and extends our understanding of the function of cultural noise by taking the reader through the immersive and phenomenal aspects of noise into algorithmic and network contexts, beginning with his experience in the Abside of the Grotte de Lascaux.  &lt;p&gt; Immersion Into Noise is intended as a conceptual handbook useful for the development of a personal-political-visionary art of noise. On a planet that is increasingly technologically linked and globally mediated, how might noises break and re-connect in distinctive and productive ways within practices located in the world of art and thought? Joseph Nechvatal explores this intriguing question in Immersion Into Noise.',1,363.74010000,770669125,'M9233.N57',31,156,0,'363.7401 N364',1,NULL,0,0,NULL),(209,NULL,'978-0-8223-4825-2','On the modern cult of the factish gods','EN','Duke University Press',157,2010,'Latour, Bruno',NULL,NULL,'TH053',NULL,'on-the-modern-cult-of-the-factish-gods','2016-12-23 22:01:24','2021-01-31 16:14:43',14,'41BT6h4RA9L.jpg','image/jpeg',27636,332,500,'&lt;div&gt;&lt;I&gt;On the Modern Cult of the Factish Gods&lt;/I&gt; continues the project that the influential anthropologist, philosopher, and science studies theorist Bruno Latour advanced in his book &lt;I&gt;We Have Never Been Modern&lt;/I&gt;. There he redescribed the Enlightenment idea of universal scientific truth, arguing that there are no facts separable from their fabrication. In this concise work, Latour delves into the “belief in naive belief,” the suggestion that fetishes—objects invested with mythical powers—are fabricated and that facts are not. Mobilizing his work in the anthropology of science, he uses the notion of “factishes” to explore a way of respecting the objectivity of facts and the power of fetishes without forgetting that both are fabricated. While the fetish-worshipper knows perfectly well that fetishes are man-made, the Modern icon-breaker inevitably erects new icons. Yet Moderns sense no contradiction at the core of their work. Latour pursues his critique of critique, or the possibility of mediating between subject and object, or the fabricated and the real, through the notion of “iconoclash,” making productive comparisons between scientific practice and the worship of visual images and religious icons.&lt;/div&gt;',1,201.65000000,503828079,'BL240.3',331,316,0,'201.65 L359',1,NULL,0,0,NULL),(210,NULL,'978-1-85343-139-5','Simians, cyborgs, and women : the reinvention of nature','EN','Free Association Books',287,1991,'Haraway, Donna Jeanne',NULL,NULL,'TH054',NULL,'simians-cyborgs-and-women-the-reinvention-of-nature','2016-12-23 22:01:24','2021-01-31 17:15:52',14,'410NW0BENPL.jpg','image/jpeg',26629,319,475,'Donna Haraway analyses accounts, narratives, and stories of the creation of nature, living organisms, and cyborgs (cybernetic components); showing how deeply cultural assumptions penetrate into allegedly value-neutral medical research.',3,304.50000000,21081854,'GN365.9',1224,1240,0,'304.5 H254',1,NULL,0,0,NULL),(211,NULL,'978-0-8166-9552-2','A geology of media','EN','University of Minnesota Press',206,2015,'Parikka, Jussi, 1976-',NULL,NULL,'TH055',NULL,'a-geology-of-media','2016-12-23 22:01:24','2021-01-31 17:08:49',14,'61FD-p5FvrL.jpg','image/jpeg',68204,322,500,'&lt;DIV&gt;&lt;P&gt;Media history is millions, even billions, of years old. That is the premise of this pioneering and provocative book, which argues that to adequately understand contemporary media culture we must set out from material realities that precede media themselves—Earth’s history, geological formations, minerals, and energy. And to do so, writes Jussi Parikka, is to confront the profound environmental and social implications of this ubiquitous, but hardly ephemeral, realm of modern-day life.&lt;/P&gt;&lt;P&gt;Exploring the resource depletion and material resourcing required for us to use our devices to live networked lives, Parikka grounds his analysis in Siegfried Zielinski’s widely discussed notion of deep time—but takes it back millennia. Not only are rare earth minerals and many other materials needed to make our digital media machines work, he observes, but used and obsolete media technologies return to the earth as residue of digital culture, contributing to growing layers of toxic waste for future archaeologists to ponder. He shows that these materials must be considered alongside the often dangerous and exploitative labor processes that refine them into the devices underlying our seemingly virtual or immaterial practices. &lt;/P&gt;&lt;P&gt;&lt;I&gt;A Geology of Media&lt;/I&gt; demonstrates that the environment does not just surround our media cultural world—it runs through it, enables it, and hosts it in an era of unprecedented climate change. While looking backward to Earth’s distant past, it also looks forward to a more expansive media theory—and, implicitly, media activism—to come. &lt;BR /&gt;&lt;/P&gt;&lt;/DIV&gt;',3,302.23000000,890011347,'P90',1136,1127,0,'302.23 P231',1,NULL,0,0,NULL),(212,NULL,'978-0-8264-6990-8','Abstract sex : philosophy, bio-technology and the mutations of desire','EN','continuum',227,2004,'Parisi, Luciana | Parisi, Luciana [Editor]',NULL,NULL,'TH056',NULL,'abstract-sex-philosophy-bio-technology-and-the-mutations-of-desire','2016-12-23 22:01:24','2021-01-31 16:14:44',14,'31XuCY1JylL.jpg','image/jpeg',14458,333,500,'Astract Sex investigates the impact of advances in contemporary science and information technology on conceptions of sex. &lt;br /&gt;Evolutionary theory and the technologies of viral information transfer, cloning and genetic engineering are changing the way we think about human sex, reproduction and the communication of genetic information. &lt;br /&gt;&lt;br /&gt;Abstract Sex presents a philosophical exploration of this new world of sexual, informatic and capitalist multiplicity, of the accelerated mutation of nature and culture.',1,306.70100000,53912626,'HQ16',1377,1360,0,'306.701 P234',1,NULL,0,0,NULL),(213,NULL,'978-0-262-701167','The global genome : biotechnology, politics, and culture','EN','The MIT Press',416,2006,'Thacker, Eugene | Thacker, Eugene [Contributor]',NULL,NULL,'TH062',NULL,'the-global-genome-biotechnology-politics-and-culture','2016-12-23 22:01:24','2021-01-31 16:14:44',14,'41kjc6Un4FL.jpg','image/jpeg',19597,392,500,'&lt;DIV&gt;In the age of global biotechnology, DNA can exist as biological material in a test tube, as a sequence in a computer database, and as economically valuable information in a patent. In &lt;I&gt;The Global Genome&lt;/I&gt;, Eugene Thacker asks us to consider the relationship of these three entities and argues that -- by their existence and their interrelationships -- they are fundamentally redefining the notion of biological life itself.Biological science and the biotech industry are increasingly organized at a global level, in large part because of the use of the Internet in exchanging biological data. International genome sequencing efforts, genomic databases, the development of World Intellectual Property policies, and the \"borderless\" business of biotech are all evidence of the global intersections of biology and informatics -- of genetic codes and computer codes. Thacker points out the internal tension in the very concept of biotechnology: the products are more \"tech\" than \"bio,\" but the technology itself is fully biological, composed of the biomaterial labor of genes, proteins, cells, and tissues. Is biotechnology a technology at all, he asks, or is it a notion of \"life itself\" that is inseparable from its use in the biotech industry?The three sections of the book cover the three primary activities of biotechnology today: the encoding of biological materials into digital form -- as in bioinformatics and genomics; its recoding in various ways -- including the \"biocolonialism\" of mapping genetically isolated ethnic populations and the newly pervasive concern over \"biological security\"; and its decoding back into biological materiality -- as in tissue engineering and regenerative medicine. Thacker moves easily from science to philosophy to political economics, enlivening his account with ideas from such thinkers as Georges Bataille, Georges Canguilhem, Michel Foucault, Antonio Negri, and Paul Virilio. The \"global genome,\" says Thacker, makes it impossible to consider biotechnology without the context of globalism.&lt;/DIV&gt;',1,338.47660600,56950610,'HD9999.B442',1987,1978,0,'338.476606 T363',1,NULL,0,0,NULL),(214,'null','null','Selected writings (1996-2007)','EN','ŠMC/CAC',120,2007,'McKee, Francis','null','null','TH070','null','selected-writings-1996-2007','2016-12-23 22:01:24','2021-02-03 16:24:15',14,NULL,NULL,NULL,NULL,NULL,'null',3,700.41100000,NULL,NULL,NULL,NULL,1,'700.411 M478',1,'undefined',0,0,NULL),(215,NULL,'978-0-85488-182-6','Failure','EN','Whitechapel Gallery',238,2010,'Le Feuvre, Lisa',NULL,NULL,'TH077',NULL,'failure-documents-of-contemporary-art','2016-12-23 22:01:24','2021-02-01 22:22:47',14,'51DXUaFv97L.jpg','image/jpeg',46182,352,500,'Amidst current global uncertainty failure has become a central subject of investigation in recent art. Artists have actively claimed the space of failure to propose a resistant view of the world. Here success is deemed overrated, doubt embraced, experimentation encouraged and risk considered a viable position. Between the poles of success and failure lies a productive space where paradox rules and dogma is refused. This anthology establishes failure as a core concern in contemporary cultural production. Artists surveyed include Bas Jan Ader, Francis Alys, John Baldessari, Chris Burden, Phil Collins, Martin Creed, David Critchley, Fischli &amp; Weiss, Ceal Floyer, Isa Genzken, Dominique Gonzalez-Foerster, Felix Gonzalez-Torres, Wade Guyton, International Necronautical Society, Ray Johnson, Mike Kelley, Martin Kippenberger, Michael Krebber, Bruce Nauman, Simon Patterson, Janette Parris, Yvonne Rainer, Robert Rauschenberg, Dieter Roth, Allen Ruppersberg, Roman Signer, Annika Strom, Paul Thek and William Wegman.Writers include Giorgio Agamben, Samuel Beckett, Daniel Birnbaum, Bazon Brock, Johanna Burton, Emma Cocker, Gilles Deleuze, Russell Ferguson, Ann Goldstein, Jorg Heiser, Jennifer Higgie, Richard Hylton, Jean-Yves Jouannais, Lisa Lee, Stuart Morgan, Hans-Joachim Muller, Karl Popper, Edgar Schmitz and Coosje van Bruggen.',1,709.04000000,540644017,'NX650.F33',565,567,0,'709.04 L492',1,NULL,0,0,NULL),(216,NULL,'978-0-262-01734-3','Living as form : socially engaged art from 1991-2011','EN ','Creative Time Books',259,2012,'Thompson, Nato [Editor]',NULL,NULL,'TH078',NULL,'living-as-form-socially-engaged-art-from-1991-2011','2016-12-23 22:01:24','2021-01-31 16:14:45',14,'51Fqv5xx7_2BL.jpg','image/jpeg',40249,375,500,'&lt;p&gt;Over the past twenty years, an abundance of art forms have emerged that use aesthetics to affect social dynamics. These works are often produced by collectives or come out of a community context; they emphasize participation, dialogue, and action, and appear in situations ranging from theater to activism to urban planning to visual art to health care. Engaged with the texture of living, these art works often blur the line between art and life. This book offers the first global portrait of a complex and exciting mode of cultural production--one that has virtually redefined contemporary art practice.   &lt;i&gt;Living as Form&lt;/i&gt; grew out of a major exhibition at Creative Time in New York City. Like the exhibition, the book is a landmark survey of more than 100 projects selected by a thirty-person curatorial advisory team; each project is documented by a selection of color images. The artists include the Danish collective Superflex, who empower communities to challenge corporate interest; Turner Prize nominee Jeremy Deller, creator of socially and politically charged performance works; Women on Waves, who provide abortion services and information to women in regions where the procedure is illegal; and Santiágo Cirugeda, an architect who builds temporary structures to solve housing problems. &lt;/p&gt;&lt;p&gt; &lt;i&gt;Living as Form&lt;/i&gt; contains commissioned essays from noted critics and theorists who look at this phenomenon from a global perspective and broaden the range of what constitutes this form.&lt;/p&gt;&lt;p&gt;Contributing authorsClaire Bishop, Carol Becker, Teddy Cruz, Brian Holmes, Shannon Jackson, Maria Lind, Anne Pasternak, Nato Thompson&lt;/p&gt;',1,701.03000000,758387852,'N8243.S65',668,677,0,'701.03 T469',1,NULL,0,0,NULL),(217,NULL,'978-0-226-79372-6','After life','EN','The University of Chicago press',295,2010,'Thacker, Eugene',NULL,NULL,'TH079',NULL,'after-life','2016-12-23 22:01:24','2021-01-31 16:14:45',14,'51kz_2BkPhHnL.jpg','image/jpeg',45649,333,500,'&lt;p&gt;Life is one of our most basic concepts, and yet when examined directly it proves remarkably contradictory and elusive, encompassing both the broadest and the most specific phenomena. We can see this uncertainty about life in our habit of approaching it as something at once scientific and mystical, in the return of vitalisms of all types, and in the pervasive politicization of life. In short, life seems everywhere at stake and yet is nowhere the same.&lt;/p&gt;&lt;br /&gt;&lt;p&gt;In &lt;i&gt;After Life,&lt;/i&gt; Eugene Thacker clears the ground for a new philosophy of life by recovering the twists and turns in its philosophical history. Beginning with Aristotle’s originary formulation of a philosophy of life, Thacker examines the influence of Aristotle’s ideas in medieval and early modern thought, leading him to the work of Immanuel Kant, who notes the inherently contradictory nature of “life in itself.” Along the way, Thacker shows how early modern philosophy’s engagement with the problem of life affects thinkers such as Gilles Deleuze, Georges Bataille, and Alain Badiou, as well as contemporary developments in the “speculative turn” in philosophy.&lt;/p&gt;&lt;br /&gt;&lt;p&gt;At a time when life is categorized, measured, and exploited in a variety of ways, &lt;i&gt;After Life&lt;/i&gt; invites us to delve deeper into the contours and contradictions of the age-old question, “what is life?”&lt;/p&gt;',1,113.80000000,540644056,'BD311',1292,1290,0,'113.8 T363',1,NULL,0,0,NULL),(218,NULL,'978-0-674-03485-3','Ecology without nature : rethinking environmental aesthetics','EN','Harvard University Press',NULL,2007,'Morton, Timothy, 1968-',NULL,NULL,'TH080',NULL,'ecology-without-nature-rethinking-environmental-aesthetics','2016-12-23 22:01:24','2021-02-01 18:01:10',14,'51yWT2x8GXL.jpg','image/jpeg',45070,332,500,'&lt;p&gt;In &lt;i&gt;Ecology without Nature&lt;/i&gt;, Timothy Morton argues that the chief stumbling block to environmental thinking is the image of nature itself. Ecological writers propose a new worldview, but their very zeal to preserve the natural world leads them away from the \"nature\" they revere. The problem is a symptom of the ecological catastrophe in which we are living. Morton sets out a seeming paradox: to have a properly ecological view, we must relinquish the idea of nature once and for all.&lt;/p&gt;&lt;p&gt;&lt;i&gt;Ecology without Nature&lt;/i&gt; investigates our ecological assumptions in a way that is provocative and deeply engaging. Ranging widely in eighteenth-century through contemporary philosophy, culture, and history, he explores the value of art in imagining environmental projects for the future. Morton develops a fresh vocabulary for reading \"environmentality\" in artistic form as well as content, and traces the contexts of ecological constructs through the history of capitalism. From John Clare to John Cage, from Kierkegaard to Kristeva, from &lt;i&gt;The Lord of the Rings&lt;/i&gt; to electronic life forms, &lt;i&gt;Ecology without Nature&lt;/i&gt; widens our view of ecological criticism, and deepens our understanding of ecology itself. Instead of trying to use an idea of nature to heal what society has damaged, Morton sets out a radical new form of ecological criticism: \"dark ecology.\"&lt;/p&gt;',3,820.93600000,72161936,'PR448.E58',690,699,0,'820.936 M891',1,NULL,0,0,NULL),(219,NULL,'978-0-674-06422-5','The ecological thought','EN','Harvard University Press',163,2010,'Morton, Timothy, 1968-',NULL,NULL,'TH081',NULL,'the-ecological-thought','2016-12-23 22:01:24','2021-01-31 16:14:45',14,'41BgxIs0L8L.jpg','image/jpeg',19694,329,500,'In this passionate, lucid, and surprising book, Timothy Morton argues that all forms of life are connected in a vast, entangling mesh. This interconnectedness penetrates all dimensions of life. No being, construct, or object can exist independently from the ecological entanglement, Morton contends, nor does “Nature” exist as an entity separate from the uglier or more synthetic elements of life.',1,577.01000000,454363020,'QH540.5',1837,1813,0,'577.01 M891',1,NULL,0,0,NULL),(220,NULL,'978-0-399-53197-2','Art as experience','EN','Pengouin group/ The Berkley publishing group',371,1934,'Dewey, John, 1859-1952 | Yi, Chae-ŏn',NULL,NULL,'TH082',NULL,'art-as-experience','2016-12-23 22:01:24','2021-01-31 16:14:45',14,'41NXLi4K-YL.jpg','image/jpeg',24983,266,420,'Based on John Dewey\'s lectures on esthetics, delivered as the first William James Lecturer at Harvard in 1932, &lt;i&gt;Art as Experience&lt;/i&gt; has grown to be considered internationally as the most distinguished work ever written by an American on the formal structure and characteristic effects of all the arts: architecture, sculpture, painting, music, and literature.',3,701.00000000,378279,'N66',2463,2762,0,'701 D519',1,NULL,0,0,NULL),(221,NULL,'978-1-841-93002-2','Lucid dreaming and the art of dreaming creatively','EN','Acturus',390,2000,'Ball, Pamela, 1940-',NULL,NULL,'TH083',NULL,'lucid-dreaming-the-art-of-dreaming-creatively','2016-12-23 22:01:24','2021-01-31 16:14:45',14,'51055s_2ByEYL.jpg','image/jpeg',48187,325,500,'Make sense of your dreams',3,135.30000000,53654820,'BF1099.L82',33,32,0,'135.3 B187',1,NULL,0,0,NULL),(222,NULL,'978-91-978476-6-7','I hear voices in everything! : step by step','EN','Art Monitor',288,2014,'Gedin, Andreas, 1958-',NULL,NULL,'TH084',NULL,'i-hear-voices-in-everything','2016-12-23 22:01:24','2021-01-31 16:14:45',14,NULL,NULL,NULL,NULL,NULL,NULL,1,701.00000000,896816067,'N7093.G43',1,4,0,'701 G296',1,NULL,0,0,NULL),(223,NULL,'978-609-95059-8-5','Nuobodulio visuomenė : kasdienybė ir ideologija vėlyvuoju sovietmečiu (1964-1984)','LT','LIETUVIŲ KATALIKŲ MOKSLO AKADEMIJA. Naujasis židinys-aidai',499,2014,'Vaiseta, Tomas, 1984-',NULL,NULL,'TH087',NULL,'nuobodulio-visuomene-kasdienybe-ir-ideologija-velyvuoju-sovietmeciu-1964-1984','2016-12-23 22:01:24','2021-01-31 16:14:46',14,NULL,NULL,NULL,NULL,NULL,NULL,1,306.09479309,893856741,'DK504.77',6,5,0,'306.09479309 V132',1,NULL,0,0,NULL),(224,NULL,'978-609-459-246-1','Įsivaizduojamybė','LT','Vilniaus Universiteto leidykla',264,2013,'Kristupas Sabolius',NULL,NULL,'TH088',NULL,'isivaizduojamybe','2016-12-23 22:01:24','2021-01-23 17:13:44',14,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(225,NULL,'978-0942299755','War in the age of intelligent machines','EN','Zone',280,1991,'De Landa, Manuel',NULL,NULL,'TH092','John W. Fail','war-in-the-age-of-intelligent-machines','2016-12-23 22:01:24','2021-01-31 16:14:46',14,'51CBBP6G9XL.jpg','image/jpeg',48786,336,500,'&lt;P&gt;In the aftermath of the methodical destruction of Iraq during the Persian                 Gulf War, the power and efficiency of new computerized weapons and surveillance                 technology have become chillingly apparent. For Manuel DeLanda, however, this new                 weaponry has a significance that goes far beyond military applications; he shows how                 it represents a profound historical shift in the relation of human beings both to                 machines and to information. The recent emergence of intelligent and autonomous                 bombs and missiles equipped with artificial perception and decision-making                 capabilities is, for Delanda, part of a much larger transfer of cognitive structures                 from humans to machines in the late twentieth century.War in the Age of Intelligent                 Machines provides a rich panorama of these astonishing developments; it details the                 mutating history of information analysis and machinic organization from the mobile                 siege artillery of the Renaissance, the clockwork armies of the Thirty Years War,                 the Napoleonic campaigns, and the Nazi blitzkrieg up to present-day cybernetic                 battle-management systems and satellite reconnaissance networks. Much more than a                 history of warfare, DeLanda\'s account is an unprecedented philosophical and                 historical reflection on the changing forms through which human bodies and materials                 are combined, organized, deployed, and made effective.Manuel DeLanda has published                 essays on philosophy and film theory. He is a computer programmer and a film                 artist.A Swerve Edition, distributed for Zone Books&lt;/P&gt;',1,355.00285630,20392094,'UG478',491,480,0,'355.0028563 D337',1,NULL,0,0,NULL),(226,NULL,'978-1584350408','Speed and politics : an essay on dromology','EN','Semiotext(e)',174,2006,'Virilio, Paul, 1932-',NULL,NULL,'TH101','John W. Fail','speed-and-politics','2016-12-23 22:01:24','2021-01-31 16:14:46',14,'51fMBpPKSZL.jpg','image/jpeg',44536,333,500,'&lt;p&gt;Speed and Politics (first published in France in 1977) is the matrix of Virilio\'s entire work. Building on the works of Morand, Marinetti, and McLuhan, Virilio presents a vision more radically political than that of any of his French contemporaries: speed as the engine of destruction. Speed and Politics presents a topological account of the entire history of humanity, honing in on the technological advances made possible through the militarization of society. Paralleling Heidegger\'s account of technology, Virilio\'s vision sees speed--not class or wealth--as the primary force shaping civilization. In this \"technical vitalism,\" multiple projectiles--inert fortresses and bunkers, the \"metabolic bodies\" of soldiers, transport vessels, and now information and computer technology--are launched in a permanent assault on the world and on human nature. Written at a lightning-fast pace, Virilio\'s landmark book is a split-second, overwhelming look at how humanity\'s motivity has shaped the way we function today, and what might come of it.&lt;/p&gt;',1,303.43000000,5430653,'HM283',196,329,0,'303.43 V818',1,NULL,0,0,NULL),(227,NULL,'978-1584350590','Pure war : twenty-five years later','EN','Semiotext(e)',256,2008,'Virilio, Paul | Lotringer, Sylvère [Author]',NULL,NULL,'TH102','John W. Fail','pure-war','2016-12-23 22:01:24','2021-01-31 16:14:46',14,'41OdnfcCu8L.jpg','image/jpeg',25255,302,500,'&lt;p&gt;In June 2007, Paul Virilio and Sylvère Lotringer met in La Rochelle, France to reconsider the premises they developed twenty-five years before in their frighteningly prescient classic, Pure War. Pure War described the invisible war waged by technology against humanity, and the lack of any real distinction since World War II between war and peace. Speaking with Lotringer in 1982, Virilio noted the \"accidents\" that inevitably arise with every technological development: from car crashes to nuclear spillage, to the extermination of space and the derealization of time wrought by instant communication. In this new and updated edition, Virilio and Lotringer consider how the omnipresent threat of the \"accident\"--both military and economic--has escalated. With the fall of the Soviet bloc, the balance of power between East and West based on nuclear deterrence has given way to a more diffuse multi-polar nuclear threat. Moreover, as the speed of communication has increased exponentially, \"local\" accidents--like the collapse of the Asian markets in the late 1980s--escalate, with the speed of contagion, into global events instantaneously. \"Globalization,\" Virilio argues, is the planet\'s ultimate accident.Paul Virilio was born in Paris in 1932 to an immigrant Italian family. Trained as an urban planner, he became the director of the École Speciale d\'Architecture in the wake of the 1968 rebellion. He has published twenty-five books, including Pure War (1988) (his first in English) and The Accident of Art (2005), both with Sylvère Lotringer and published by Semiotext(e). Sylvère Lotringer, general editor of Semiotext(e), lives in New York and Baja California. He is the author of Overexposed: Perverting Perversions (Semiotext(e), 2007) and other books.&lt;/p&gt;',3,300.10000000,11123574,'U21.2',159,326,0,'300.1 V818',1,NULL,0,0,NULL),(228,NULL,'978-0674007840','The emergence of cinematic time : modernity, contingency, the archive','EN','Harvard University Press',304,2002,'Doane, Mary Ann','Modernity, Contingency, the Archive',NULL,'TH093','John W. Fail','the-emergence-of-cinematic-time','2016-12-23 22:01:24','2021-01-31 16:14:46',14,'41K0KVH5SXL.jpg','image/jpeg',27585,315,475,'&lt;p&gt;Hailed as the permanent record of fleeting moments, the cinema emerged at the turn of the nineteenth century as an unprecedented means of capturing time--and this at a moment when disciplines from physics to philosophy, and historical trends from industrialization to the expansion of capitalism, were transforming the very idea of time. In a work that itself captures and reconfigures the passing moments of art, history, and philosophy, Mary Ann Doane shows how the cinema, representing the singular instant of chance and ephemerality in the face of the increasing rationalization and standardization of the day, participated in the structuring of time and contingency in capitalist modernity.&lt;/p&gt;&lt;p&gt;At this book\'s heart is the cinema\'s essential paradox: temporal continuity conveyed through \"stopped time,\" the rapid succession of still frames or frozen images. Doane explores the role of this paradox, and of notions of the temporal indeterminacy and instability of an image, in shaping not just cinematic time but also modern ideas about continuity and discontinuity, archivability, contingency and determinism, and temporal irreversibility. A compelling meditation on the status of cinematic knowledge, her book is also an inquiry into the very heart and soul of modernity.&lt;/p&gt;',1,791.43684000,49625651,'PN1995.9.T55',540,532,0,'791.43684 D631',1,NULL,0,0,NULL),(229,NULL,'978-1861892638','Death 24x a second : stillness and the moving image','EN','Reaktion',216,2006,'Mulvey, Laura','Stillness and the Moving Image',NULL,'TH097','John W. Fail','death-24x-a-second','2016-12-23 22:01:24','2021-02-04 22:44:08',14,'41gP68yaH_2BL.jpg','image/jpeg',30759,320,500,'In \"Death 24 x a Second\", Laura Mulvey addresses some of the key questions of film theory, spectatorship and narrative. New media technologies, such as video and DVD, have transformed the way we experience film, and the viewers\' relationship to film image and cinema\'s narrative structure has also been fundamentally altered. These technologies give viewers the means to control both image and story, so that films produced to be seen collectively and followed in a linear fashion may be found to contain unexpected (even unintended) pleasures. The tension between the still frame and the moving image coincides with the cinema\'s capacity to capture the appearance of life and preserve it after death. Mulvey proposes that with the arrival of new technologies and new ways of experiencing the cinematic image, film\'s hidden stillness comes to the fore, thereby acquiring a new accessibility and visibility. The individual frame, the projected film\'s best-kept secret, can now be revealed, by anyone, at the simple touch of a button. As Mulvey argues, easy access to repetition, slow motion and the freeze-frame may well shift the spectator\'s pleasure to a fetishistic rather than a voyeuristic investment in the cinematic object. The manipulation of the cinematic image by the viewer also makes visible cinema\'s material and aesthetic attributes. By exploring how new technologies can give new life to old\' cinema, \"Death 24 x a Second\" offers an original re-evaluation of film\'s history and also its historical usefulness.',1,791.43010000,61529345,'PN1995',503,465,0,'791.4301 M954',1,NULL,0,0,NULL),(230,NULL,'978-0914386063','The mirror of production','EN','Telos',167,1975,'Baudrillard, Jean, 1929-2007',NULL,NULL,'TH089','John W. Fail','the-mirror-of-production','2016-12-23 22:01:24','2021-01-31 16:14:46',14,'51K0cWNL61L.jpg','image/jpeg',39073,291,500,'Are the concepts of labor and of production adaptable to a developing industrial society? What is the meaning of \"pre-industrial organization\"? In attempting to answer these questions, Jean Baudrillard examines the lessons of Marxism, which has created a productivist model and a fetishism of labor. He argues that we must break the mirror of production, which \"reflects all of Western metaphysics,\" and free the Marxist logic from the restrictive context of political economy whence it was born.',1,335.41200000,2192359,'HB97.5',513,489,0,'335.412 B342',1,NULL,0,0,NULL),(231,NULL,'978-1584350743','The aesthetics of disappearance','EN','Semiotext(e)',128,1991,'Virilio, Paul | Beitchman, Philip, 1939- [Translator]',NULL,NULL,'TH100','John W. Fail','the-aesthetics-of-disappearance','2016-12-23 22:01:24','2021-01-31 16:14:46',14,'4143_2BcZJ5iL.jpg','image/jpeg',30008,317,500,'&lt;p&gt;Virilio himself referred to his 1980 work The Aesthetics of Disappearance as a \"juncture\" in his thinking, one at which he brought his focus onto the logistics of perception -- a logistics he would soon come to refer to as the \"vision machine.\" If Speed and Politics established Virilio as the inaugural -- and still consummate -- theorist of \"dromology\" (the theory of speed and the society it defines), The Aesthetics of Disappearance introduced his understanding of \"picnolepsy\" -- the epileptic state of consciousness produced by speed, or rather, the consciousness invented by the subject through its very absence: the gaps, glitches, and speed bumps lacing through and defining it. Speed and Politics defined the society of speed; The Aesthetics of Disappearance defines what it feels like to live in the society of speed.\"I always write with images,\" Virilio has claimed, and this statement is nowhere better illustrated than with The Aesthetics of Disappearance. Moving from the movie theater to the freeway, and from Craig Breedlove\'s attainment of terrifying speed in a rocket-power car to the immobility of Howard Hughes in his dark room atop the Desert Inn, Virilio himself jump cuts from such disparate reference points as Fred Astaire, Franz Liszt, and Adolf Loos to Dostoyevsky, Paul Morand, and Aldous Huxley. In its extension of the \"aesthetics of disappearance\" to war, film, and politics, this book paved the way to Virilio\'s follow-up: the celebrated study, War and Cinema.This edition features a new introduction by Jonathan Crary, one of the leading theorists of modern visual culture.Foreign Agents seriesDistributed for Semiotext(e)&lt;/p&gt;',1,111.85000000,7945153,'BH39',347,275,0,'111.85 V818',1,NULL,0,0,NULL),(232,'null','null','The Marx-Engels Reader','EN','Norton',670,1972,'Tucker, Robert C.','null','null','TH096','John W. Fail','the-marx-engels-reader','2016-12-23 22:01:24','2021-02-01 12:16:10',14,NULL,NULL,NULL,NULL,NULL,'null',1,335.40000000,NULL,NULL,NULL,NULL,1,'335.4 T892',1,'Marx, Karl; Engels, Frederick',1,0,NULL),(233,NULL,'978-1584350972','This is not a program','EN','Semiotext(e)',204,2011,'Tiqqun (Collective)',NULL,NULL,'TH099','John W. Fail','this-is-not-a-program','2016-12-23 22:01:24','2021-01-31 16:14:46',14,'31tquLQkw-L.jpg','image/jpeg',8857,321,500,'&lt;p&gt;Historical conflict no longer opposes two massive molar heaps, two classes—the exploited and the exploiters, the dominant and dominated, managers and workers—between which, in each individual case, it would be possible to differentiate. The front line no longer cuts through the middle of society; it now runs through each one of us... \"—from This Is Not a ProgramTraditional lines of revolutionary struggle no longer hold. Rather, it is ubiquitous cybernetics, surveillance, and terror that create the illusion of difference within hegemony. Configurations of dissent and the rhetoric of revolution are merely the other face of capital, conforming identities to empty predicates, ensuring that even \"thieves,\" \"saboteurs,\" and \"terrorists\" no longer exceed the totalizing space of Empire. This Is Not a Program offers two texts, both originally published in French by Tiqqun with Introduction to Civil War in 2001. In \"This Is Not a Program,\" Tiqqun outlines a new path for resistance and struggle in the age of Empire, one that eschews the worn-out example of France\'s May \'68 in favor of what they consider to be the still fruitful and contemporary insurrectionary movements in Italy of the 1970s. \"As a Science of Apparatuses\" examines the way Empire has enforced on the subject a veritable metaphysics of isolation and pacification, \"apparatuses\" that include chairs, desks, computers; surveillance (security guards, cameras); disease (depression); crutch (cell phone, lover, sedative); and authority. Tiqqun\'s critique of the biopolitical subject and omnipresent Empire is all the more urgent as we become inured to the permanent state of exception that is the War on Terror and to other, no less intimate forms of pacification. But all is not lost. In its unrelenting production of the Same, Empire itself creates the conditions necessary for the insurrection to come. &lt;/p&gt;',1,300.10000000,676725799,'HX828',99,96,0,'300.1 T551',1,NULL,0,0,NULL),(234,'null','978-0826458223','Desert screen : war at the speed of light','EN','Continuum',192,2002,'Virilio, Paul','War at the Speed of Light','null','TH103','John W. Fail','desert-screen','2016-12-23 22:01:24','2021-02-09 14:16:06',14,'31CPWF1J9FL.jpg','image/jpeg',15512,312,475,'\"One of the most original thinkers of our time.\" - Liberation \"Virilio writes on the edge of physics, philosophy, politics and urbanism\" - New Statesman Desert Screen is a vision of future war. Paul Virilio identifies the Gulf War as a turning point in history, the last industrial and the first information war. Virilio argues that we live in a world of global spatio-temporal collapse, a world still exhausted from the geopolitics of the Cold War, a world in which the politics  of military and media technology seem to preclude the possibility of negotiation and diplomacy.',1,355.00285630,47062975,NULL,328,NULL,0,'355.0028563 V818',1,'undefined',0,0,NULL),(235,NULL,'978-0803261204','The writing of the disaster = : (L\'ecriture du désastre)','EN','University of Nebraska',153,1994,'Blanchot, Maurice | Smock, Ann, 1944- [Translator; Contributor]',NULL,NULL,'TH090','John W. Fail','the-writing-of-the-disaster','2016-12-23 22:01:24','2021-02-04 14:26:50',14,'5158KxakNQL.jpg','image/jpeg',50856,328,500,'&lt;DIV&gt;Modern history is haunted by the disasters of the century—world wars, concentration camps, Hiroshima, and the Holocaust—grief, anger, terror, and loss beyond words, but still close, still impending. How can we write or think about disaster when by its very nature it defies speech and compels silence, burns books and shatters meaning?&lt;/DIV&gt;&lt;DIV&gt;&lt;I&gt;&lt;/I&gt; &lt;/DIV&gt;&lt;DIV&gt;&lt;I&gt;The Writing of the Disaster&lt;/I&gt; reflects upon efforts to abide in disaster’s infinite threat. First published in French in 1980, it takes up the most serious tasks of writing: to describe, explain, and redeem when possible, and to admit what is not possible. Neither offers consolation.&lt;/DIV&gt;&lt;DIV&gt; &lt;/DIV&gt;&lt;DIV&gt;Maurice Blanchot has been praised on both sides of the Atlantic for his fiction and criticism. The philosopher Emmanuel Levinas once remarked that Blanchot\'s writing is a \"language of pure transcendence, without correlative.\" Literary theorist and critic Geoffrey Hartman remarked that Blanchot\'s influence on contemporary writers \"cannot be overestimated.\"&lt;/DIV&gt;',3,848.91207000,7207417,'PQ2603.L3343',846,917,0,'848.91207 B639',1,NULL,0,0,NULL),(236,NULL,'978-0674535817','Lipstick traces : a secret history of the twentieth century','EN','Harvard University Press',512,1990,'Marcus, Greil','A Secret History of the Twentieth Century',NULL,'TH095','John W. Fail','lipstick-traces','2016-12-23 22:01:24','2021-01-31 16:14:47',14,'316gNtUS_2BOL.jpg','image/jpeg',14656,151,187,'&lt;p&gt; Greil Marcus, author of &lt;i&gt;Mystery Train&lt;/i&gt;, widely acclaimed as the best book ever written about America as seen through its music, began work on this new book out of a fascination with the Sex Pistols: that scandalous antimusical group, invented in London in 1975 and dead within two years, which sparked the emergence of the culture called punk. \"I am an antichrist!\" shouted singer Johnny Rotten--where in the world of pop music did that come from? Looking for an answer, with a high sense of the drama of the journey, Marcus takes us down the dark paths of counterhistory, a route of blasphemy, adventure, and surprise. &lt;/p&gt;&lt;p&gt; This is no mere search for cultural antecedents. Instead, what Marcus so brilliantly shows is that various kinds of angry, absolute demands--demands on society, art, and all the governing structures of everyday life--seem to be coded in phrases, images, and actions passed on invisibly, but inevitably, by people quite unaware of each other. Marcus lets us hear strange yet familiar voices: of such heretics as the Brethren of the Free Spirit in medieval Europe and the Ranters in seventeenth-century England; the dadaists in Zurich in 1916 and Berlin in 1918, wearing death masks, chanting glossolalia; one Michel Mourre, who in 1950 took over Easter Mass at Notre-Dame to proclaim the death of God; the Lettrist International and the Situationist International, small groups of Paris--based artists and writers surrounding Guy Debord, who produced blank-screen films, prophetic graffiti, and perhaps the most provocative social criticism of the 1950s and \'60s; the rioting students and workers of May \'68, scrawling cryptic slogans on city walls and bringing France to a halt; the Sex Pistols in London, recording the savage \"Anarchy in the U.K.\" and \"God Save the Queen.\" &lt;/p&gt;&lt;p&gt; Although the Sex Pistols shape the beginning and the end of the story, &lt;i&gt;Lipstick Traces&lt;/i&gt; is not a book about music; it is about a common voice, discovered and transmitted in many forms. Working from scores of previously unexamined and untranslated essays, manifestos, and filmscripts, from old photographs, dada sound poetry, punk songs, collages, and classic texts from Marx to Henri Lefebvre, Marcus takes us deep behind the acknowledged events of our era, into a hidden tradition of moments that would seem imaginary except for the fact that they are real: a tradition of shared utopias, solitary refusals, impossible demands, and unexplained disappearances. Written with grace and force, humor and an insistent sense of tragedy and danger, &lt;i&gt;Lipstick Traces&lt;/i&gt; tells a story as disruptive and compelling as the century itself. &lt;/p&gt;',1,306.40904000,18496517,'CB428',1002,1527,0,'306.40904 M322',1,NULL,0,0,NULL),(237,NULL,'978-0879231835','On being blue : a philosophical inquiry','EN','Carcanet',91,1975,'Gass, William H., 1924-2017','A Philosophical Inquiry',NULL,'TH094','John W. Fail','on-being-blue','2016-12-23 22:01:24','2021-01-31 16:14:47',14,'41qfHRkRH_2BL.jpg','image/jpeg',28854,329,500,'Second printing. A philosophical essay on blue as a color and state of mind, \'blue\' as a word, and Blue as a Platonic idea. The presentation note reads, \"For Doris[Grumbach], who lives in the country of no blue, Bill Gass.\" Minimal shelf wear. ii , 91, 3 pages. cloth, dust jacket. 8vo..',1,117.00000000,2545525,'BH301.C6',801,1009,0,'117 G251',1,NULL,0,0,NULL),(238,'9772342488006',NULL,'Rab-Rab Issue 01','EN','Rab-Rab',289,2014,'Boynik, Sezgin; Rousseau, Gregoire','Journal for Political and Formal Inquiries in Art',NULL,'TH091','John W. Fail','rab-rab-issue-01','2016-12-23 22:01:24','2021-01-26 18:13:57',14,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(239,NULL,'978-0674541375','Madness and modernism : insanity in the light of modern art, literature, and thought','EN','Harvard University Press',595,1994,'Sass, Louis Arnorsson','Insanity in the Light of Modern Art, Literature, and Thought',NULL,'TH098','John W. Fail','madness-and-modernism','2016-12-23 22:01:24','2021-01-31 16:14:47',14,'51X9Y19KA8L.jpg','image/jpeg',43394,313,475,'The similarities between madness and modernism are striking: defiance of authority, nihilism, extreme relativism, distortions of time, strange transformations of self, and much more. In this book, Louis Sass, a clinical psychologist, offers a new vision of schizophrenia, comparing it with the works of such artists and writers as Kafka, Beckett, and Duchamp and philosophers including Nietzsche, Heidegger, Foucault and Derrida. It provides a portrait of the world of the madman, along with a commentary on modernist and postmodernist culture.',1,616.89830000,25369923,'RC514',688,777,0,'616.8983 S252',1,NULL,0,0,NULL),(240,'null','978-1905636846','$20,000 : a book','EN','Beautiful',156,2011,'Drummond, Bill','null','null','TH105','John W. Fail','20-000','2016-12-23 22:01:24','2021-02-06 13:31:02',14,'51Dd6NIA6jL.jpg','image/jpeg',33431,326,500,'&lt;DIV&gt;&lt;DIV&gt;&lt;DIV&gt;&lt;B&gt;An investigation into the meaning and value of one art item, from a provocateur of the art and music worlds&lt;/B&gt;&lt;/DIV&gt;&lt;DIV&gt; &lt;/DIV&gt;&lt;DIV&gt;&lt;B&gt;&lt;/B&gt;&lt;/DIV&gt;&lt;/B&gt;&lt;/DIV&gt;&lt;DIV&gt;Celebrated musician and artist Bill Drummond turns his attention to the world of modern art. Several years ago he bought a photograph by the Turner Prizewinning artist Richard Long for $20,000. After owning it for some time, he decided to cut it up into 20,000 individual pieces, and then sell them off at a dollar a piece. This book tells the whole story of Drummond’s relationship with modern art, and in particular how this process changed it, in a typically fascinating and discursive way. In his numerous musical incarnations, Drummond has combined global success with a fiercely independent slant. As an artist, his work, over the past 30 years, has examined the cultural landscape through a diverse array of forms.&lt;/div&gt;&lt;/DIV&gt;',1,701.10000000,496952451,'NX163',22,20,0,'701.1 D795',1,'undefined',0,0,NULL),(242,NULL,'978-0949004178','Self-organised','EN','Open Editions/Hordaland Art Centre',168,2013,'Hebert, Stine; Karlsen, Anne Szefer',NULL,NULL,'TH107','John W. Fail','self-organised','2016-12-23 22:01:24','2021-02-01 20:55:01',14,'41F8YHSctpL.jpg','image/jpeg',17925,364,500,'The current economic situation and society’s low confidence in its institutions demands that artists become more imaginative in their self-organization. If labels such as ‘alternative,’ ‘non-profit’ and ‘artist-run’ dominated the self-organized art scene of the late nineties, the separatist position implied by the use of these terms has been moderated during the intervening years. This new anthology of accounts from the frontline includes contributions by artist practitioners as well as their institutional counterparts providing a fascinating account of the art world as a matrix of positions where the balance of power and productivity constantly shifts. Artists, curators and critics discuss empirical and theoretical approaches from Europe, Africa and South and North America on how self-organization today oscillates between the self and the group, self-imposed bureaucratization and flexibility, aestheticization and activism.',3,701.00000000,845234936,'NX798',108,109,0,'701 H446',1,NULL,1,0,NULL),(243,NULL,'978-9986-957-66-9','Proteus and the Radical Imaginary','EN','CAC, Vilnius & Bunkier Sztuki Gallery for Contemporary Art, Krakow',180,2016,'Kristupas Sabolius',NULL,NULL,'TH108',NULL,'proteus-and-the-radical-imaginary','2016-12-23 22:01:24','2021-02-01 12:17:42',14,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(244,NULL,'978-1-78279-903-0','Homemade academic circus','EN','John Hunt Publishing',224,2016,'Damkjær, Camilla',NULL,NULL,'TH109',NULL,'homemade-academic-circus','2016-12-23 22:01:24','2021-01-31 16:14:47',14,'41kJ8rBFATL.jpg','image/jpeg',21842,324,500,'&lt;span&gt;&lt;span&gt;This book takes its starting point in a rare experiment, that of an academic researcher attempting to learn to do circus. What happens to the knowledge of the performance theoretician when physically engaging with the circus arts? One of the (im)material outcomes of this experiment is what the author calls \"homemade academic circus” - a series of lecture-performances on performance-related academic questions, presented and discussed through circus disciplines. The interest of homemade academic circus, and the analysis of it presented in this book, lies not only in the fact that it is a form of curiosity within academic research. It is also worth noting that the main character in this experiment (sometimes known as the “professional amateur” or the “academic freak”, the alter egos of the researcher) goes through the opposite process of what many artists within artistic and practice-based research experience today. What happens if, rather than going from art to academia, one would go from academia to art? Which cultural and paradigmatic shocks would that produce, and how would that influence the researcher’s understanding of knowledge and thinking?&lt;/span&gt;&lt;/span&gt;',1,796.47000000,938390708,'GV552',22,21,0,'796.47 D154',1,NULL,0,0,NULL),(245,NULL,'978-0-262-02957-5','The stack : on software and sovereignty','EN','The MIT Press',528,2016,'Bratton, Benjamin H., 1968-',NULL,NULL,'TH110',NULL,'the-stack-on-software-and-sovereignty-software-studies','2016-12-23 22:01:24','2021-01-31 18:15:48',14,'51018UWJ0eL.jpg','image/jpeg',47562,391,500,'&lt;DIV&gt;What has planetary-scale computation done to our geopolitical realities? It takes different forms at different scales -- from energy and mineral sourcing and subterranean cloud infrastructure to urban software and massive universal addressing systems; from interfaces drawn by the augmentation of the hand and eye to users identified by self -- quantification and the arrival of legions of sensors, algorithms, and robots. Together, how do these distort and deform modern political geographies and produce new territories in their own image?In &lt;I&gt;The Stack&lt;/I&gt;, Benjamin Bratton proposes that these different genres of computation -- smart grids, cloud platforms, mobile apps, smart cities, the Internet of Things, automation -- can be seen not as so many species evolving on their own, but as forming a coherent whole: an accidental megastructure called The Stack that is both a computational apparatus and a new governing architecture. We are inside The Stack and it is inside of us. In an account that is both theoretical and technical, drawing on political philosophy, architectural theory, and software studies, Bratton explores six layers of The Stack: &lt;I&gt;Earth&lt;/I&gt;,&lt;I&gt; Cloud&lt;/I&gt;,&lt;I&gt; City&lt;/I&gt;,&lt;I&gt; Address&lt;/I&gt;,&lt;I&gt; Interface&lt;/I&gt;,&lt;I&gt; User&lt;/I&gt;. Each is mapped on its own terms and understood as a component within the larger whole built from hard and soft systems intermingling -- not only computational forms but also social, human, and physical forces. This model, informed by the logic of the multilayered structure of protocol \"stacks,\" in which network technologies operate within a modular and vertical order, offers a comprehensive image of our emerging infrastructure and a platform for its ongoing reinvention. &lt;I&gt;The Stack&lt;/I&gt; is an interdisciplinary design brief for a new geopolitics that works with and for planetary-scale computation. Interweaving the continental, urban, and perceptual scales, it shows how we can better build, dwell within, communicate with, and govern our worlds.thestack.org&lt;/DIV&gt;',3,4.00000000,906294522,NULL,972,NULL,0,'4 B824',1,NULL,0,0,NULL),(246,NULL,'978-0-7456-4158-4','The posthuman','EN','Polity',180,2013,'Braidotti, Rosi',NULL,NULL,'TH111',NULL,'the-posthuman','2016-12-23 22:01:24','2021-01-31 16:14:48',14,'613a0-szdHL.jpg','image/jpeg',65681,312,500,'&lt;p&gt;&lt;i&gt;The Posthuman&lt;/i&gt; offers both an introduction and major contribution to contemporary debates on the posthuman. Digital \'second life\', genetically modified food, advanced prosthetics, robotics and reproductive technologies are familiar facets of our globally linked and technologically mediated societies. This has blurred the traditional distinction between the human and its others, exposing the non-naturalistic structure of the human. &lt;i&gt;The Posthuman&lt;/i&gt; starts by exploring the extent to which a post-humanist move displaces the traditional humanistic unity of the subject. Rather than perceiving this situation as a loss of cognitive and moral self-mastery, Braidotti argues that the posthuman helps us make sense of our flexible and multiple identities.&lt;br /&gt;&lt;br /&gt;Braidotti then analyzes the escalating effects of post-anthropocentric thought, which encompass not only other species, but also the sustainability of our planet as a whole. Because contemporary market economies profit from the control and commodification of all that lives, they result in hybridization, erasing categorical distinctions between the human and other species, seeds, plants, animals and bacteria. These dislocations induced by globalized cultures and economies enable a critique of anthropocentrism, but how reliable are they as indicators of a sustainable future?&lt;br /&gt;&lt;br /&gt;&lt;i&gt;The Posthuman&lt;/i&gt; concludes by considering the implications of these shifts for the institutional practice of the humanities. Braidotti outlines new forms of cosmopolitan neo-humanism that emerge from the spectrum of post-colonial and race studies, as well as gender analysis and environmentalism. The challenge of the posthuman condition consists in seizing the opportunities for new social bonding and community building, while pursuing sustainability and empowerment.&lt;/p&gt;',1,128.00000000,768101497,'BD450',608,540,0,'128 B814',1,NULL,0,0,NULL),(247,NULL,'978-0-520-27417-4','Archaeology : the discipline of things','EN','University of California Press',256,2012,'Olsen, Bjørnar | Shanks, Michael [Author] | Webmoor, Timothy [Author] | Witmore, Christopher [Author] | Olsen, Bjørnar [Author]',NULL,NULL,'TH112',NULL,'archaeology','2016-12-23 22:01:24','2021-01-31 16:14:48',14,'519GDOzxUzL.jpg','image/jpeg',42604,337,500,'&lt;div&gt;Archaeology has always been marked by its particular care, obligation, and loyalty to things. While archaeologists may not share similar perspectives or practices, they find common ground in their concern for objects monumental and mundane. This book considers the myriad ways that archaeologists engage with things in order to craft stories, both big and small, concerning our relations with materials and the nature of the past. &lt;br&gt;&lt;BR&gt;Literally the science of old things,” archaeology does not discover the past as it was but must work with what remains. Such work involves the tangible mediation of past and present, of people and their cultural fabric, for things cannot be separated from society. Things are us. This book does not set forth a sweeping new theory. It does not seek to transform the discipline of archaeology. Rather, it aims to understand precisely what archaeologists do and to urge practitioners toward a renewed focus on and care for things.&lt;/div&gt;',3,930.10000000,788263891,'CC72',1886,241,0,'930.1 O42',1,NULL,0,0,NULL),(248,NULL,'978-1-78093-537-9','A thousand plateaus : rhizomes','EN','Berg Pub Ltd',720,2013,'Deleuze, Gilles, (1925-1995) | Guattari, Félix',NULL,NULL,'TH113',NULL,'a-thousand-plateaus-bloomsbury-revelations','2016-12-23 22:01:24','2021-01-31 16:14:48',14,'41J_2B5vQbxKL.jpg','image/jpeg',27462,319,500,'A Thousand Plateaus is the second part of Deleuze and Guattari\'s landmark philosophical project, Capitalism and Schizophrenia - a project that still sets the terms of contemporary philosophical debate. Written over a seven year period, A Thousand Plateaus provides a compelling analysis of social phenomena and offers fresh alternatives for thinking about philosophy and culture. Its radical perspective provides a toolbox for \'nomadic thought\' and has had a galvanizing influence on today\'s anti-capitalist movement.',1,194.00000000,484072354,'B77',2,2,0,'194 D348',1,NULL,0,0,NULL),(249,'2342-4885',NULL,'Rab-Rab Issue 02 Volume A','EN','Rab-Rab',214,2015,'Boynik, Sezgin; Rousseau, Gregoire',NULL,NULL,'TH114','John W. Fail','rab-rab-issue-02-volume-a','2016-12-23 22:01:24','2021-02-01 12:17:40',14,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(250,'2342-4885',NULL,'Rab-Rab Issue 02 Volume B','EN','Rab-Rab',280,2015,'Boynik, Sezgin; Rousseau, Gregoire',NULL,NULL,'TH115','John W. Fail','rab-rab-issue-02-volume-b','2016-12-23 22:01:24','2021-01-26 18:14:24',14,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(251,'0-471-29145-5',NULL,'The arts and human development; : a psychological study of the artistic process','EN','John Wiley and Sons',395,1973,'Gardner, Howard, 1943-',NULL,NULL,'TH116',NULL,'the-arts-and-human-development','2016-12-23 22:01:24','2021-01-31 16:14:48',14,'417FSfEtogL.jpg','image/jpeg',23790,333,500,'&lt;DIV&gt;A revised edition of Gardnerâ€™s classic on the development of creativity. Illustrated throughout with childrenâ€™s art, this book is a systematic examination of the relation between youthful participation in the arts and the ultimate craftsmanship attained by gifted artists.&lt;/Div&gt;',1,701.15000000,532266,'NX165',831,1191,0,'701.15 G227',1,NULL,0,0,NULL),(252,'0-19-289164','null','Aesthetics: an introduction to the philosophy of art','EN','Oxford Paperbacks',172,1988,'Sheppard, Anne','null','null','TH117','null','aesthetics-an-introduction-to-the-philosophy-of-art','2016-12-23 22:01:24','2021-02-01 12:20:33',14,NULL,NULL,NULL,NULL,NULL,'null',1,700.10000000,NULL,NULL,NULL,NULL,1,'700.1 S549',1,'undefined',0,0,NULL),(253,'0-7486-1179-7',NULL,'Media and everyday life in modern society','EN','Edinburgh University Press',166,2000,'Moores, Shaun',NULL,NULL,'TH118',NULL,'media-and-everyday-life-n-modern-society','2016-12-23 22:01:24','2021-01-31 17:09:03',14,'51W409cY3GL.jpg','image/jpeg',39364,334,500,'What position have television, radio and other electronic media like telephones and computers come to occupy in people\'s day-to-day lives and social relationships?How do these communication and information technologies get used and made sense of in local settings such as the household and the urban neighbourhood?How have they helped to construct new arrangements of time, space and place in a culture with globalising tendencies?What types of identity, experience and interaction do the electronic media make available to their different audiences or users?In this accessibly written book, Shaun Moores offers a particular set of answers to these general questions for media and cultural studies, drawing on a range of his investigations and reflections on media and everyday life in modern society. Combining theory with empirical research, he engages with the ideas of key thinkers - such as Giddens, Goffman, Hall and Williams - whilst also referring to detailed ethnographic and historical data. Specific top&lt;br&gt;',1,302.23000000,44404383,'P95.54',1638,1623,0,'302.23 M821',1,NULL,0,0,NULL),(254,'0-947757-62-7',NULL,'Dada Almanack','EN','Atlas',174,1998,'Huelsenbeck, Richard, 1892-1974',NULL,NULL,'TH057','John W. Fail','dada-almanac','2016-12-23 22:01:24','2021-01-31 16:14:48',14,NULL,NULL,NULL,NULL,NULL,NULL,1,709.04062000,42625206,'NX600.D3',1,1,0,'709.04062 H887',1,NULL,0,0,NULL),(255,'0-947757-81-3',NULL,'An anthology of French symbolist &amp; decadent writing based upon The book of masks by Remy de Gourmont','EN','Atlas',300,1994,'Gourmont, Rémy de, | Mangravite, Andrew [Translator; Editor; Other] | Vallotton, Félix, 1865-1925 [Illustrator] | White, Iain, 1929-',NULL,NULL,'TH058','John W. Fail','the-book-of-masks','2016-12-23 22:01:24','2021-02-01 18:08:02',14,'617Y5M755JL.jpg','image/jpeg',70079,403,475,'Number Two in \'Documents of the Avant-Garde\'',3,840.80150000,32075851,'PQ1138',121,121,0,'840.8015 G713',1,NULL,0,0,NULL),(256,'0-947757-86-4',NULL,'Blago bung, blago bung, bosso fataka! : first texts of German Dada','EN','Atlas',176,1995,'Ball, Hugo, 1886-1927 | Green, Malcolm R. [Translator; Other] | Huelsenbeck, Richard, 1892-1974 [Contributor] | Ball, Hugo, 1886-1927 [Contributor] | Serner, Walter, 1889-1942 [Contributor]',NULL,NULL,'TH059','John W. Fail','blago-bung-blago-bung-bosso-fataka','2016-12-23 22:01:24','2021-01-31 16:14:48',14,'518HG2J1XBL.jpg','image/jpeg',35848,431,475,'The German contribution to the Dada movement (\"DADA MEANS NOTHING!\" proclaimed Tristan Tzara) as it unfolded in Zurich during the first World War is not widely known.This collection brings together three texts translated into English for the first time, which were essential for the very creation of the movement, and which influenced all its future developments in France, Germany, the USA and many other countries. &lt;P&gt;Included is the only Dada novel, Tenderenda the Fantast, written by the movement’s founder Hugo Ball. sections of which he performed at the celebrated Cabaret Voltaire. It is partially a roman à clef recounting the birth of Dada and the author’s subsequent love-hate relationship with his monstrous creation, and yet is much more besides. Richard Huelsenbeck’s Fantastic Prayers was the first Dada poetry collection, and these precocious \"Bruitist\" poems clearly illustrate how the absurd elements in early Expressionism evolved into the bizarre eloquence of Dada. Finally, Walter Serner’s Last Loosening manifesto, the first major German manifesto written in Zurich, which provoked numerous brawls at its various performances and yet is hardly known. In fact it was the source for many of Tzara’s future literary provocations and seems to have been deliberately suppressed for this reason. &lt;P&gt;Three vital texts from one of the most extraordinary manifestations of the avant-garde of this century.',1,831.91208012,33115325,'PT1160.E7',163,163,0,'831.91208012 B187',1,NULL,0,0,NULL),(257,NULL,'978-1-78168-040-0','Anywhere or Not At All: Philosophy of Contemporary Art','EN','Verso',282,2013,'Peter Osborne',NULL,NULL,'TH060','John W. Fail','anywhere-or-not-at-all-philosophy-of-contemporary-art','2016-12-23 22:01:24','2021-01-23 17:14:18',14,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(258,NULL,'978-0-9766054-0-9','Works of heart : building village through the arts','EN','New Village Pr',144,2006,'Young, Suzanne, 1953- | Elizabeth, Lynne [Editor] | Young, Suzanne, 1953- [Author; Editor]',NULL,NULL,'COMPT001',NULL,'works-of-heart-building-village-through-the-arts','2016-12-23 22:01:24','2021-01-31 16:14:48',17,'511v1n9RqQL.jpg','image/jpeg',52342,385,500,'&lt;DIV&gt;&lt;p&gt;This full-color celebration of citizen artists revitalizing their communities profiles 10 exemplary grass-roots arts projects. Stories range from children building a mud façade on their Oregon school to an annual blessing procession and festival in north Philadelphia that brings to life dozens of the most derelict blocks in urban America.&lt;/p&gt;&lt;p&gt;This collection of human-interest stories and resources about grass-roots community building offers a rare and appealing counterbalance to the clinical policy reports common to the field. Profiles are written in language that inspires and informs both community development professionals and citizen activists.&lt;/p&gt;&lt;p&gt;Lead editor &lt;b&gt;Lynne Elizabeth&lt;/b&gt; is director of New Village Press and former editor of &lt;i&gt;New Village Journal&lt;/i&gt; and &lt;i&gt;Earthword Journal&lt;/i&gt;.&lt;/p&gt;&lt;/DIV&gt;',1,700.97000000,65187344,'HN49.C6',750,761,0,'700.97 Y76',1,NULL,0,0,NULL),(259,'null','9780976605430','Beginner\'s guide to community-based arts','EN','New Village Pr',171,2009,'Knight, Keith | Schwarzman, Mat [Author]','null','Comics','COMPT002','null','beginner-s-guide-to-community-based-arts','2016-12-23 22:01:24','2021-02-04 19:14:36',17,'41QMOFpHaNL.jpg','image/jpeg',26236,350,350,'null',1,307.14000000,62333840,'NX180.A77',187,213,0,'307.14 K71',1,'undefined',0,0,NULL),(260,NULL,'978-0-500-23858-5','The art of participation : 1950 to now','EN','SF MoMA / Thames and Hudson',212,2008,'Frieling, Rudolf',NULL,NULL,'COMPT003',NULL,'the-art-of-participation-1950-to-now','2016-12-23 22:01:24','2021-01-31 16:14:49',17,'51hRAUG7AeL.jpg','image/jpeg',40318,387,500,'&lt;p&gt;&lt;strong&gt;The first fully illustrated survey of participatory art and its key practitioners, published in association with the San Francisco Museum of Modern Art.&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;This new survey covers the rich and varied history of participatory art, from early happenings and performances to current practices that demand audience interaction. As the hallmarks of Web 2.0--browsing, sharing, collecting, producing--increasingly permeate every aspect of society, this timely project reveals the ways in which artists and viewers have approached the creation of open works of art. The featured artists include Marina Abramovic and Ulay, Vito Acconci, Joseph Beuys, John Cage, Janet Cardiff, Lygia Clark, Kit Galloway and Sherrie Rabinowitz, Dan Graham, Hans Haacke, Allan Kaprow, Lynn Hershman Leeson, Antoni Muntadas, Yoko Ono, Nam June Paik, and Erwin Wurm.&lt;/p&gt;&lt;p&gt;Original essays by Rudolf Frieling, Boris Groys, Robert Atkins, and Lev Manovich identify seminal moments in participatory practice from the 1950s to the present day. A rich array of plates introduce work by all the artists in the accompanying exhibition, with reproductions of significant projects by other major figures--from Helio Oiticica, Joan Jonas, and Gordon Matta-Clark to Rirkrit Tiravanija and SUPERFLEX--rounding out the survey.&lt;/p&gt;',1,702.81000000,270881990,NULL,670,NULL,0,'702.81 F899',1,NULL,1,0,NULL),(261,'null','978-1-906155-18-6','Taking the matter into common hands : on contemporary art and collaborative practices','EN','Black Dog Pub Ltd',143,2007,'Johanna Billing,Maria Lind,Lars Nilsson','on contemporary art and collaborative practices','null','COMPT004','null','taking-the-matter-into-common-hands-on-contemporary-art-and-collaborative-practices','2016-12-23 22:01:24','2021-02-03 21:55:09',17,'51-txGJX_2BvL.jpg','image/jpeg',41410,349,500,'In recent years, the art world has shown a renewed interest in collective work and activity. Collaborations between artists and artists, artists and curators, and artists and outside professionals have begun to rival the traditional focus on the individual artist. This type of collaboration has called into question how we view works of art that are not the voice of a single individual, and how that impacts on the concept of art as a means of self-expression. \"Taking the Matter into Common Hands\" maps out the issues surrounding collaborative art from a practitioner\'s perspective. With contributions from Marion von Osten, Nav Haq, 16 Beaver, Copenhagen Free University, Maria Lind and Lars Nilsson, it examines the working relations between artists and other producers of culture, and explores the future of collective action in the art world. \"Taking the Matter Into Common Hands\" is essential for both academics, practitioners and lay audiences alike.',1,709.05100000,153560473,'N6497',241,227,0,'709.051 J65',1,'undefined',0,0,NULL),(262,NULL,'978-0-940069-47-3','The creative community builder\'s handbook : how to transform communities using local assets, art, and culture','EN','Fieldstone Alliance',261,2009,'Borrup, Tom, 1954- | Partners for Livable Communities | McKnight Foundation',NULL,NULL,'COMPT005',NULL,'the-creative-community-builder-s-handbook-howtotransform-communities-using-local-assets-art-and-culture','2016-12-23 22:01:24','2021-01-31 16:14:49',17,'61djGhwRx4L.jpg','image/jpeg',82880,386,500,'&lt;DIV&gt;Put the power of arts and culture to work in your community Part 1 of this unique guide distills research and emerging ideas behind culturally driven community development and explains key underlying principles. You\'ll understand the arts impact on community well-being and have the rationale for engaging others.   Find inspiration and ideas from twenty case studies Part 2 gives you ten concrete strategies for building on the unique qualities of your own community. Each strategy is illustrated by two case studies taken from a variety of cities, small towns, and neighborhoods across the United States. You\'ll learn how people from all walks of life used culture and creativity as a glue to bind together people, ideas, enterprises, and institutions to make places more balanced and healthy.   These examples are followed in Part 3 with six steps to assessing, planning, and implementing creative community building projects: 1. Assess Your Situation and Goals; 2. Identify and Recruit Effective Partners; 3. Map Values, Strengths, Assets, and History; 4. Focus on Your Key Asset, Vision, Identity, and Core Strategies; 5. Craft a Plan That Brings the Identity to Life;  6. Secure Funding, Policy Support, and Media Coverage.   Detailed guidance, hands-on worksheets, and a hypothetical community sample walk you through the entire process. Each section includes additional resources as well as an appendix listing books, web sites, organizations, and research studies.  By understanding the theoretical context (Part 1), learning from case studies (Part 2), and following the six steps (Part 3), you\'ll be able to build a more vibrant, creative, and equitable community.&lt;/div&gt;',1,307.14068000,66526969,'HN90.C6',238,253,0,'307.14068 B737',1,NULL,0,0,NULL),(263,NULL,'978-1-84467-690-3','Artificial hells : participatory art and the politics of spectatorship','EN','Verso Books',382,2012,'Bishop, Claire | American Council of Learned Societies',NULL,NULL,'COMPT006',NULL,'artificial-hells-participatory-art-and-the-politics-of-spectatorship','2016-12-23 22:01:24','2021-01-31 16:14:49',17,'51bv9GoKEaL.jpg','image/jpeg',42330,327,500,'Since the 1990s, critics and curators have broadly accepted the notion that participatory art is the ultimate political art: that by encouraging an audience to take part an artist can promote new emancipatory social relations. Around the world, the champions of this form of expression are numerous, ranging from art historians such as Grant Kester, curators such as Nicolas Bourriaud and Nato Thompson, to performance theorists such as Shannon Jackson.&lt;br /&gt;&lt;br /&gt;&lt;i&gt;Artificial Hells&lt;/i&gt; is the first historical and theoretical overview of socially engaged participatory art, known in the US as “social practice.” Claire Bishop follows the trajectory of twentieth-century art and examines key moments in the development of a participatory aesthetic. This itinerary takes in Futurism and Dada; the Situationist International; Happenings in Eastern Europe, Argentina and Paris; the 1970s Community Arts Movement; and the Artists Placement Group. It concludes with a discussion of long-term educational projects by contemporary artists such as Thomas Hirschhorn, Tania Bruguera, Pawe? Althamer and Paul Chan.&lt;br /&gt;&lt;br /&gt;Since her controversial essay in &lt;i&gt;Artforum&lt;/i&gt; in 2006, Claire Bishop has been one of the few to challenge the political and aesthetic ambitions of participatory art. In &lt;i&gt;Artificial Hells&lt;/i&gt;, she not only scrutinizes the emancipatory claims made for these projects, but also provides an alternative to the ethical (rather than artistic) criteria invited by such artworks. Artificial Hells calls for a less prescriptive approach to art and politics, and for more compelling, troubling and bolder forms of participatory art and criticism.',3,709.04070000,668194693,'N6494.I57',1105,1190,0,'709.0407 B622 Art',1,NULL,0,0,NULL),(264,'null','978-1-84150-311-0','Searching for art\'s new publics','EN','Intellect Ltd. Bristol, UK',224,2010,'Walwin, Jeni | Walwin, Jeni [Editor]','null','null','COMPT007','null','searching-for-art-s-new-publics','2016-12-23 22:01:24','2021-02-05 15:53:42',17,'51Y5Ab3EMXL.jpg','image/jpeg',33764,378,500,'Drawing on contributions from practicing artists, writers, curators and academics, Searching for Art’s New Publics explores the ways in which artists seek to involve, create and engage with new and diverse audiences: from passers-by encountering and participating in the work unexpectedly, to professionals from other disciplines and members of particular communities who bring their own agendas to the work. Bridging the gap between practice and theory, this exciting book touches on issues of relational aesthetics, but also offers an illustrated artist-based approach. Searching for Art’s New Publics will appeal to students studying fine art (especially those with an interest in cross-disciplinary work and public art) and those studying curating.',1,306.47000000,457149149,'NX220',1660,1660,0,'306.47 W242',1,'undefined',0,0,NULL),(265,NULL,'978-1-934105-07-8','The nightmare of participation : [crossbench praxis as a mode of criticality]','EN','Sternberg Press',305,2010,'Miessen, Markus',NULL,NULL,'COMPT008',NULL,'the-nightmare-of-participation','2016-12-23 22:01:24','2021-01-31 16:14:50',17,'41jBD-OoOeL.jpg','image/jpeg',32102,310,500,'Welcome to Harmonistan! Berlin-based architect/writer Markus Miessen tackles the pervasive contemporary overuse of the concept of \'\'participation\'\' in the final part of his paradigm-changing trilogy. Supported by a nostalgic veneer of worthiness, phony solidarity and political correctness, participation has become the default of politicians withdrawing from responsibility. Miessen argues for an urgent inversion of participation, reflecting cogently on the limits and traps of its real motivations. He dreads breeding the next generation of facilitators and mediators, insisting on conflict as an enabling, instead of disabling, force. With refreshing candor, this internationally known architect and professor outlines a format for acting as uninvited irritant, forcing entry into fields of knowledge that arguably benefit from exterior thinking. Sometimes, Miessen writes, democracy has to be avoided at all costs!',1,307.12160000,697777507,'HT166',71,106,0,'307.1216 M631',1,NULL,0,0,NULL),(266,'0-920159-74-5','null','Questions of community : artists, audiences, coalitions','EN','Walter Phillips Gallery, Banff Centre Press',242,1995,'Banff Centre for the Arts | Augaitis, Daina','null','null','COMPT009','null','questions-of-community-artists-audiences-coalitions','2016-12-23 22:01:24','2021-02-01 20:02:18',17,'41k9GpL20qL.jpg','image/jpeg',27642,370,500,'Stronger artist alliances, skepticism about institutions, and awareness of new audiences have all contributed to a reevaluation of what works and what doesn\'t for artists striving towards social change. In this timely anthology, over twenty writers and artists share their experiences in a range of Canadian contexts. From First Nations coalitions to artist mentoring programs, important art projects are analyzed. Several theorists offer additional insights into the broader issues shaping activist art practices. Offering years of collective experience, this book is essential reading for understanding arts activism in Canada.',1,700.10309710,32016142,'NX180.A77',81,78,0,'700.1030971 B212',1,'undefined',0,1,NULL),(267,NULL,'978-0-7190-8747-9','The \'do-it-yourself\' artwork : participation from fluxus to new media','EN','Manchester University Press',312,2010,'Dezeuze, Anna | Dezeuze, Anna [Editor]',NULL,NULL,'COMPT010',NULL,'the-do-it-yourself-artwork-participation-from-fluxus-to-new-media','2016-12-23 22:01:24','2021-01-31 16:14:50',17,'41gKyjtx9kL.jpg','image/jpeg',20899,357,500,'Viewers of contemporary art are often invited to involve themselves actively in artworks, by entering installations, touching objects, performing instructions or clicking on interactive websites. Why have artists sought to engage spectators in these new forms of participation? In what ways does active participation affect the viewer\'s experience and the status of the artwork? Spanning a range of practices including kinetic art, happenings, environments, performance, installations, relational and new media art from the 1950s to the present, this critical anthology sheds light on the history and specificity of artworks that only come to life when you - the viewer - are invited to \'do it yourself.\'&lt;br&gt; &lt;br&gt;The volume consists of fifteen essays by art historians, critics and curators, which are divided into three sections. Part I addresses the emergence of spectator participation in the 1960s, while Part II brings together in-depth case studies of specific participatory practices in the 1960s, 1970s and 1990s, analysing the issues that they raise in their very modes of operation. The more general critical essays in Part III map out a range of theoretical approaches to the \'do-it-yourself\' artwork. Together, the three sections provide invaluable historical perspectives and theoretical tools for scholars, students, artists and readers interested in contemporary art. Rather than a specialist topic in the history of twentieth- and twenty-first century art, the \'do-it-yourself\' artwork raises broader issues concerning the role of the viewer in art, the status of the artwork and the socio-political relations between art and its contexts.&lt;br&gt;',1,702.81000000,449857512,NULL,357,NULL,0,'702.81 D532',1,NULL,0,0,NULL),(268,'null','978094471261','Dalyvavimo praktikos Lietuvos šiuolaikiniame mene: analizės kriterijų ir vertinimo problema / Participatory Pactices in Lithuanian Contemporary Art: The Problem of Criteria for Analysis and Evaluation','LT / EN','Vilniaus dailės akademija',0,2014,'Michelkevičė, Lina','null','null','COMPT011','null','dalyvavimo-praktikos-lietuvos-siuolaikiniame-mene-analizes-kriteriju-ir-vertinimo-problema-participatory-pactices-in-lithuanian-contemporary-art-the-problem-of-criteria-for-analysis-and-evaluation','2016-12-23 22:01:24','2021-02-03 12:17:05',17,NULL,NULL,NULL,NULL,NULL,'null',1,700.10000000,NULL,NULL,NULL,NULL,1,'700.1 M623',1,'undefined',0,0,NULL),(269,'null','null','Miesto Tyrimai/ Viesumo patirtys','LT','null',0,2013,'Carroll, Ed; Geluniene, Vita','null','4 leaflets','COMPT012','null','miesto-tyrimai-viesumo-patirtys','2016-12-23 22:01:24','2021-02-06 13:51:32',17,NULL,NULL,NULL,NULL,NULL,'null',1,709.05100000,0,NULL,NULL,NULL,1,'709.051 C319',1,'undefined',0,0,NULL),(270,'null','null','City (RE)Searches experiences of publicness',' EN','null',0,2013,'Carroll, Ed; Geluniene, Vita','null','10 leaflets','COMPT013','null','city-re-searches-experiences-of-publicness','2016-12-23 22:01:24','2021-02-06 13:51:39',17,NULL,NULL,NULL,NULL,NULL,'null',1,709.05100000,0,NULL,NULL,NULL,1,'709.051 C319 Cit',1,'undefined',0,0,NULL),(271,'null','null','Lines in the city, Belfast','EN','null',0,2013,'Bosche, Susanne; Woods, Fiona','null','1 poster','COMPT014','null','lines-in-the-city-belfast-research-action-by-suzanne-bosch-and-fiona-woods-for-city-re-searches-experience-of-publicness-20th-23rd-february-2013','2016-12-23 22:01:24','2021-02-01 14:48:48',17,NULL,NULL,NULL,NULL,NULL,'null',1,709.41600000,NULL,NULL,NULL,NULL,1,'709.416 B742',1,'undefined',0,0,NULL),(272,'','978-9163385230','ak28 revisited and three parallel visions','EN','Mount Analogue',96,2010,'Kaur, Diana','','','COMPT015','John W. Fail','ak28-revisited-and-three-parallel-visions','2016-12-23 22:01:24','2021-02-01 14:46:36',17,'MG_3467-kopia-1024x770.jpg','image/jpeg',105235,434,600,'',1,709.05100000,NULL,NULL,NULL,NULL,1,'709.051 K21',1,'undefined',1,0,NULL),(273,NULL,'978-0262524643','Le Pillage par les Allemands des oeuvres d\'art et des bibliothèques appartenant à des juifs en France : recueil de documents','EN','Whitechapel Gallery',208,2006,'Cassou, Jean, 1897-1986, | Cassou, Jean, 1897-1986 [Director]',NULL,NULL,'COMPT016','John W. Fail','participation','2016-12-23 22:01:24','2021-01-31 19:56:44',17,'51Ky22xKSmL.jpg','image/jpeg',44918,348,500,'&lt;p&gt;The desire to move viewers out of the role of passive observers and into the role of producers is one of the hallmarks of twentieth-century art. This tendency can be found in practices and projects ranging from El Lissitzky\'s exhibition designs to Allan Kaprow\'s happenings, from minimalist objects to installation art. More recently, this kind of participatory art has gone so far as to encourage and produce new social relationships. Guy Debord\'s celebrated argument that capitalism fragments the social bond has become the premise for much relational art seeking to challenge and provide alternatives to the discontents of contemporary life. This publication collects texts that place this artistic development in historical and theoretical context. &lt;/p&gt;&lt;p&gt; &lt;i&gt;Participation&lt;/i&gt; begins with writings that provide a theoretical framework for relational art, with essays by Umberto Eco, Bertolt Brecht, Roland Barthes, Peter Bürger, Jen-Luc Nancy, Edoaurd Glissant, and Félix Guattari, as well as the first translation into English of Jacques Rancière\'s influential \"Problems and Transformations in Critical Art.\" The book also includes central writings by such artists as Lygia Clark and Hélio Oiticica, Joseph Beuys, Augusto Boal, Felix Gonzalez-Torres, Thomas Hirschhorn, and Rirkrit Tiravanija. And it features recent critical and curatorial debates, with discussions by Lars Bang Larsen, Nicolas Bourriaud, Hal Foster, and Hans-Ulrich Obrist. &lt;/p&gt;&lt;p&gt; &lt;i&gt;Copublished with Whitechapel Art Gallery, London&lt;/i&gt;&lt;/p&gt;',3,940.53187000,1043420,'N8795.3.F8',104,114,0,'940.53187 C343',1,NULL,0,0,NULL),(274,NULL,'978-1844676903','Artificial hells : participatory art and the politics of spectatorship','EN','Verso',390,2012,'Bishop, Claire | American Council of Learned Societies','Participatory Art and the Politics of Spectatorship',NULL,'COMPT017','John W. Fail','artificial-hells','2016-12-23 22:01:24','2021-01-31 16:14:50',17,'51bv9GoKEaL.jpg','image/jpeg',42330,327,500,'Since the 1990s, critics and curators have broadly accepted the notion that participatory art is the ultimate political art: that by encouraging an audience to take part an artist can promote new emancipatory social relations. Around the world, the champions of this form of expression are numerous, ranging from art historians such as Grant Kester, curators such as Nicolas Bourriaud and Nato Thompson, to performance theorists such as Shannon Jackson.&lt;br /&gt;&lt;br /&gt;&lt;i&gt;Artificial Hells&lt;/i&gt; is the first historical and theoretical overview of socially engaged participatory art, known in the US as “social practice.” Claire Bishop follows the trajectory of twentieth-century art and examines key moments in the development of a participatory aesthetic. This itinerary takes in Futurism and Dada; the Situationist International; Happenings in Eastern Europe, Argentina and Paris; the 1970s Community Arts Movement; and the Artists Placement Group. It concludes with a discussion of long-term educational projects by contemporary artists such as Thomas Hirschhorn, Tania Bruguera, Pawe? Althamer and Paul Chan.&lt;br /&gt;&lt;br /&gt;Since her controversial essay in &lt;i&gt;Artforum&lt;/i&gt; in 2006, Claire Bishop has been one of the few to challenge the political and aesthetic ambitions of participatory art. In &lt;i&gt;Artificial Hells&lt;/i&gt;, she not only scrutinizes the emancipatory claims made for these projects, but also provides an alternative to the ethical (rather than artistic) criteria invited by such artworks. Artificial Hells calls for a less prescriptive approach to art and politics, and for more compelling, troubling and bolder forms of participatory art and criticism.',1,709.04070000,668194693,'N6494.I57',1105,1190,0,'709.0407 B622 Arti',1,NULL,0,0,NULL),(275,'null','978-0-520-27594-2','Conversation pieces : community and communication in modern art','EN','(University of California Press)',262,2013,'Kester, Grant H.','null','null','COMPT018','null','conversation-pieces-community-and-communication-in-modern-art','2016-12-23 22:01:24','2021-02-04 10:39:49',17,'51yXxVluK7L.jpg','image/jpeg',32781,333,500,'&lt;div&gt;Some of the most innovative art of the past decade has been created far outside conventional galleries and museums. In a parking garage in Oakland, California; on a pleasure boat on the Lake of Zurich in Switzerland; at a public market in Chiang Mai, Thailand—artists operating at the intersection of art and cultural activism have been developing new forms of collaboration with diverse audiences and communities. Their projects have addressed such issues as political conflict in Northern Ireland, gang violence on Chicago\'s West Side, and the problems of sex workers in Switzerland. Provocative, accessible, and engaging, this book, one of the first full-length studies on the topic, situates these socially conscious projects historically, relates them to key issues in contemporary art and art theory, and offers a unique critical framework for understanding them.&lt;br&gt;&lt;BR&gt;Grant Kester discusses a disparate network of artists and collectives—including The Art of Change, Helen and Newton Harrison, Littoral, Suzanne Lacy, Stephen Willats, and WochenKlausur—united by a desire to create new forms of understanding through creative dialogue that crosses boundaries of race, religion, and culture. Kester traces the origins of these works in the conceptual art and feminist performance art of the 1960s and 1970s and draws from the writings of Mikhail Bakhtin, Jürgen Habermas, and others as he explores the ways in which these artists corroborate and challenge many of the key principles of avant-garde art and art theory.&lt;/div&gt;',1,701.03000000,814137298,'N6494.I57',37,40,0,'701.03 K13',1,'undefined',0,0,NULL),(276,'1-86154-224-0',NULL,'Zines','LT','Booth-Clibborn',265,2001,'Farrelly, Liz [Editor]',NULL,NULL,'DES001',NULL,'zines','2016-12-23 22:01:24','2021-01-31 16:14:51',13,'41dKt0aIANL.jpg','image/jpeg',28299,404,500,'Zines are the maverick inhabitants of publishing\'s Wild West, where the obsessional, the idiosyncratic and the wilfully obscure roam free across pages unbounded by the constraints of mainstream agendas. This book offers a highly-visual analysis of this phenomenon, assembled with expert fanaticism by the team of Pop theorists who created Highflyers and Scrawl. It showcases a huge, international range of current zines, put into context by historical examples from the hoardings of die-hard collectors. Graphic devices and macro photography inject the reader straight into the world of each, with thorough dissections of their format, writing and visual content.',1,741.60000000,48551838,'NC997',296,296,0,'741.6 F245',1,NULL,1,0,NULL),(278,'951-1-16006-0',NULL,'Visions du Finnish design moderne','FR','Otava',163,1999,'Stenros Anne',NULL,NULL,'DES003',NULL,'visions-du-finnish-design-moderne','2016-12-23 22:01:24','2021-01-31 16:14:51',13,NULL,NULL,NULL,NULL,NULL,NULL,1,745.40948970,58299054,NULL,4,NULL,0,'745.4094897 S825',1,NULL,1,0,NULL),(279,'','978-1-56898-760-6','Graphic design thinking : how to define problems, get ideas &amp; create form','','Princeton Architectural Press / Maryland Institute College of Art',NULL,2008,'Lupton Ellen','','','DES020','','indie-publishing-how-to-design-and-produce-your-own-book','2016-12-23 22:01:24','2021-01-31 16:14:51',13,'51y6Ly-1zYL.jpg','image/jpeg',54724,393,500,'Once referred to derisively as \"vanity publishing,\" self-published books are finally taking their place alongside moreaccepted indie categories such as music, film, and theater. &lt;em&gt;Indie Publishing&lt;/em&gt; is a practical guide to creating and distributing printed books regardless of your background, skill set, or ambition. It will help you realize projects of every scale and budget, from the traditional bookmaking techniques used to create zines to the more ambitious industrial production methods required to produce hardcover books in large quantity.&lt;br&gt;&lt;br&gt;&lt;em&gt;Indie Publishing&lt;/em&gt;\'s special focus on the visual design of books makes it unique among publish-it-yourself manuals. Readers are taken step-by-step through the process of designing a book to give it personal style as well as visual coherence and authority. Design principles such as scale, cropping, pacing, and typography are explored in relation to each example, along with commentary on how to create effective title pages, tables of contents, captions, and more. &lt;em&gt;Indie Publishing&lt;/em&gt; aims to inspire readers with examples of print projects similar to those they might undertake on their own. Sample designs include a picture book, artist\'s portfolio, exhibition catalog, poetry chapbook, novel, and zine. &lt;em&gt;Indie Publishing&lt;/em&gt; addresses the important business aspects of independentpublishingfrom how and why you should get an isbn number to creating promotional materials and using the internet to market your book. This comprehensive, illustrated guide concludes with a curated portfolio of the most exciting examples of independent publishing from the contemporary scene, reproduced in full color. If you have content to share and you want to give it a fresh and orderly form, this book will kick-start your project and keep you motivated until the ink dries. &lt;em&gt;Indie Publishing&lt;/em&gt; is the eighth title in our best-selling Design Briefs series, which has sold more than 100,000 copies worldwide.',1,741.60000000,751965767,'NC997',1,1,0,'741.6 L966',1,NULL,1,0,NULL),(280,'','','Card board book','','Gingko Press',NULL,2010,'Yabuka, Narelle','','','DES005','','card-board-book','2016-12-23 22:01:24','2021-01-31 16:14:51',13,'covernew.jpg','image/jpeg',282039,818,873,'',3,745.54000000,456181915,'NB1270.P3',81,91,0,'745.54 Y11',1,NULL,1,0,NULL),(281,'0-486-20084-1','null','Design motifs of ancient Mexico','EN','Dover',0,1953,'Enciso, Jorge, 1879-1969','null','null','DES006','null','design-motifs-of-ancient-mexico','2016-12-23 22:01:24','2021-02-09 14:20:30',13,'51Cu5IfIdIL.jpg','image/jpeg',37225,331,500,'Here is an unusual collection of pictorial material for artists, commercial designers, handicraft workers, and at-home hobbyists — 766 vigorous primitive designs that will add color and strong, rhythmic lines to textile work, leather craft, wood and metalwork, advertising art, and other areas where novel decorative ideas are at a premium. More than 90 percent of this material has never before been printed; all of it is royalty free. You may use up to 10 items for any single use without fee or special permission.&lt;BR&gt;The book reproduces plumed serpents, calendrical elements, wind gods, insects, toads, lizards, birds, real and mythological animals, flowers, demons, the human head and figure, and hundreds of abstract ornamental designs derived from carved seals of the Aztec, Maya, Totonac, Zapotec, Olmec, Toltec, and other early Mexican cultures. This book is the finest inexpensive collection of such motifs to be found anywhere.&lt;BR&gt;\"A rich source of inspiration.\" — &lt;I&gt;San Francisco Examiner.&lt;/I&gt; \"Couldn\'t be more practical . . . meets the highest standard.\" — &lt;I&gt;Interior Design and Decoration.&lt;BR&gt;&lt;/I&gt;',1,745.10000000,493265,'F1219.3.A7',1372,1500,0,'745.1 E56',1,'undefined',0,0,NULL),(282,'','978-951-558-259-9','Finnish Design. A Concise History','EN','University of Art and Design Helsinki',336,2010,'Korvenmaa, Pekka','','','DES007','','finnish-design-a-concise-history','2016-12-23 22:01:24','2021-02-03 18:17:56',13,'__58.JPG','image/jpeg',18052,407,500,'',1,745.20948970,0,NULL,NULL,NULL,1,'745.2094897 K84',1,'undefined',0,0,NULL),(283,'','978-90-72076-78-6','On Continuous and Systematic Nutrition Improvement','EN','Jan van Eyck Academie ',160,2013,'Indrė Klimaitė','','','DES008','','on-continuous-and-systematic-nutrition-improvement','2016-12-23 22:01:24','2021-01-23 17:31:55',13,'ON_CONTINIUOUS_menu.jpg','image/jpeg',69998,300,412,'',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(284,'','978-9955-854-32-6','Dizainas šalia mūsų','LT','VDA leidykla',136,2011,'Per Mollerup','','','DES009','','dizainas-salia-musu','2016-12-23 22:01:24','2021-02-03 18:02:24',13,'trnsfr-199bf502545094e7592ae6faf6a13e8d.jpg','image/jpeg',64739,300,505,'',1,745.20000000,NULL,NULL,NULL,NULL,1,'745.2 P426',1,'undefined',0,0,NULL),(285,NULL,'978-0-615-69498-6','Design, design, design, design, design the poor','EN','Notice Notice, Brooklyn NY',108,2012,'Karisa Senavitis, Kevin O\'Neill',NULL,NULL,'DES010',NULL,'design-design-design-design-design-the-poor','2016-12-23 22:01:24','2021-01-26 16:17:12',13,'41Ef9lAT0YL.jpg','image/jpeg',26737,500,336,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(287,'','978-609-95464-4-5','čiabùkai  ir kt. (dizaino ir spaudos darbai)','LT/EN','vario burnos',87,2014,'Butkus, Tomas S.','','','DES016','','ciabukai-ir-kt-dizaino-ir-spaudos-darbai','2016-12-23 22:01:24','2021-02-03 18:53:48',13,'Ciabukai-ir-kt.-dizaino-ir-spaudos-darbai_medium.jpg','image/jpeg',20538,200,280,'',1,741.64000000,0,NULL,NULL,NULL,1,'741.64 B983',1,'undefined',0,0,NULL),(288,NULL,'978-0-500-51676-8','Things come apart : a teardown manual for modern living','EN','Thames & Hudson',125,NULL,'McLellan, Todd',NULL,NULL,'DES017',NULL,'things-come-apart-a-teardown-manual-for-modern-living','2016-12-23 22:01:24','2021-01-31 16:14:51',13,'51Jin_2B_2BaCqL.jpg','image/jpeg',42813,356,500,'&lt;p&gt;&lt;strong&gt;Inspiring and unique photographs capture mechanical and electronic objects of past and present in a dismantled, meticulously arranged form&lt;/strong&gt;&lt;/p&gt; Welcome to Todd McLellan’s unique photographic vision of the material world: fifty design classics―arranged first by size and then by intricacy―are beautifully displayed, piece by piece, exploding in midair and dissected in real-time, frame-by-frame video stills.&lt;br /&gt;&lt;br /&gt; This book makes visible the inner workings of some of the world’s most iconic designs. From SLR camera to mantel clock to espresso machine, from iPad to bicycle to grand piano, every single component of each object is revealed. These disassembled objects show that even the most intricate of modern technologies can be broken down and understood, while beautifully illustrating the quality and elegance of older designs. Stunning photography is interspersed with essays by notable figures from the worlds of restoration, DIY, and design innovation who discuss historical examples of teardowns, disassembly, and reverse-engineering.&lt;br /&gt;&lt;br /&gt; Each photograph is itself a work of art and offers a reinterpretation of our familiar world. They connect people with the child-like joy of taking something apart to see how it works and will appeal to anyone with a curiosity about the material world.&lt;br /&gt; 181 color illustrations',1,670.22200000,826658905,'TR655',501,430,0,'670.222 M478',1,NULL,0,0,NULL),(289,'1-894773-20-9',NULL,'Bungalow blitz','EN','Banff Centre Press',176,2006,'Mac Namara, Aoife | Antick, Paul, 1962- [Other] | Walter Phillips Gallery [Other] | Grant, Jim [Other] | Kearney, Andrew [Other]',NULL,NULL,'ARC001',NULL,'bungalow-blitz-another-history-of-irish-architecture','2016-12-23 22:01:24','2021-01-31 16:14:51',12,NULL,NULL,NULL,NULL,NULL,NULL,1,704.94441693,68401917,'NA7572.5.I7',74,76,0,'704.94441693 M169',1,NULL,0,0,NULL),(290,'979-90-78088-46-2','null','Game Urbanism: Manual for Cultural Spatial Planning','EN','Valiz, Amsterdam',223,2010,'Venhuizen, Hans','null','null','ARC002','null','game-urbanism-manual-for-cultural-spatial-planning','2016-12-23 22:01:24','2021-02-04 10:28:14',12,NULL,NULL,NULL,NULL,NULL,'null',1,711.40000000,0,NULL,NULL,NULL,1,'711.4 V447',1,'undefined',0,0,NULL),(291,NULL,'978-1-56898-625-8','100% evil','EN','Princeton Architectural Press',80,2007,'Blechman, Nicholas | Niemann, Christoph [Author]',NULL,NULL,'ARC004',NULL,'pamphlet-architecture-28-augmented-langscapes','2016-12-23 22:01:24','2021-01-31 16:14:51',12,'51GpjUbQ3iL.jpg','image/jpeg',61848,413,500,'In 1977 Steven Holl and William Stout created a grittier alternative to mainstream architectural publishing called Pamphlet Architecture. With Holl\'s Bridges, the landmark series was born, and for 30 years Pamphlet has served as soapbox and laboratory for such notable architects and theorists as Lebbeus Woods, Zaha Hadid, Lars Lerup, and Michael Sorkin. With its twenty-eighth installment, Pamphlet Architecture celebrates its thirtieth anniversary no less bold than when it began. Augmented Landscapes features a landscape architecture practice for the first time in Pamphlet history. London\'s Smout Allen presents five projects that respond to the way in which man has enlarged the landscape through architecture and infrastructure, manipulating and blurring perceptions of what is natural and what is artificial.',1,743.99170000,56591560,'N8012.G66',276,272,0,'743.9917 B646',1,NULL,0,0,NULL),(292,NULL,'978-1-61689-031-5','Resilience','EN','Princeton Architectural Press',80,2012,'Craig, James A., 1984- | Ozga-Lawn, Matt, 1984- [Author]',NULL,NULL,'ARC005',NULL,'pamphlet-architecture-32-resilience','2016-12-23 22:01:24','2021-01-31 16:14:51',12,'412Br_2BFfDZL.jpg','image/jpeg',28002,402,500,'The competition for Pamphlet Architecture 32 centered on the theme of resilience. By addressing the capacity to cope, the ability to bounce back, and the mitigation and management of risk, participants were asked to showcase a fresh understanding of the architectural opportunities found in resilience. The winning entry successfully takes on the topic through an investigation of the ravaged city of Warsaw, Poland. By identifying, interrogating, and ultimately reinforcing both the physical and immaterial conditions of the landscape, the project allows the space to become something new and yet hold on to what it is, truly exhibiting resilience.',1,729.00000000,868824179,'NA997.S77',7,4,0,'729 C886',1,NULL,0,0,NULL),(293,'','978-609-447-061-5','Vilniaus paminklai : kaitos istorija = Vilnius monuments : a story of change','LT/EN','Lietuvos da