-and-design-review-of-estonia-finland-latvia-lithuania-and-north-west-russia','2016-12-23 22:01:24','2021-01-26 16:17:12',12,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(299,'','978-80-260-6127-4','2x100 mil.m2/ Martin hejl §Coll: How to grasp one hundred years of Architecture in Czechoslovakia? And Why? Is this ambition inevitably condemned to forced generalization or, by contrast, to a banal description?','EN','KOLMO.eu',403,2014,'Hejl, Martin; Hejlova, Lenka','','','ARC013','','2x100-mil-m2-martin-hejl-coll-how-to-grasp-one-hundred-years-of-architecture-in-czechoslovakia-and-why-is-this-ambition-inevitably-condemned-to-forced-generalization-or-by-contrast-to-a-banal-description','2016-12-23 22:01:24','2021-02-04 10:24:14',12,'2x100-milm2.jpg','image/jpeg',24939,279,400,'',1,720.94370000,0,NULL,NULL,NULL,1,'720.9437 H432',1,'undefined',0,0,NULL),(300,'','','LAISVĖS ARCHITEKTŪRA','LT ','baltos lankos',383,2012,'Grunskis, Tomas','','','ARC014','','laisves-architektura','2016-12-23 22:01:24','2021-01-31 16:14:52',12,'9789955235804.jpg','image/jpeg',216449,500,652,'',1,720.94793000,816553812,'NA1455.L57',NULL,5,0,'720.94793 G888',1,NULL,0,0,NULL),(301,'','978-609-95484-3-2','Kaunas 1918-2015 : architektūros gidas','LT','VšĮ Architektūros fondas, Leidykla LAPAS',338,2015,'Leitanaitė, Rūta','','','ARC016','','kaunas-1918-2015-architekturos-gidas','2016-12-23 22:01:24','2021-02-04 10:37:47',12,'9786099548432.jpg','image/jpeg',730286,575,652,'',1,720.94793000,908933856,'NA1455.L572',NULL,7,0,'720.94793 L533',1,'undefined',0,0,NULL),(302,NULL,'978-3-86922-356-8','Architekturführer Vilnius : Bauten ab 1900 bis heute','DE','DOM Publishers',252,2015,'Reklaitė, Julija; Leitanaitė, Rūta',NULL,NULL,'ARC017',NULL,'architekturfuhrer-vilnius','2016-12-23 22:01:24','2021-01-31 16:14:52',12,'31jhHUiF1NL.jpg','image/jpeg',12922,275,500,NULL,1,720.94793000,896747202,NULL,43,NULL,0,'720.94793 R281',1,NULL,1,0,NULL),(303,NULL,'978-0-615-52823-6','Piecing together Los Angeles : an Esther McCoy reader','EN','east of borneo books',391,2012,'McCoy, Esther',NULL,NULL,'ARC018','John W. Fail ','piecing-together-los-angeles-an-esther-mccoy-reader','2016-12-23 22:01:24','2021-02-03 10:14:13',12,'419_2B-jZzSgL.jpg','image/jpeg',26760,364,500,'Esther McCoy (1904–1989) is one of the twentieth century’s foremost architecture historians, and one of the greatest chroniclers of the architecture of midcentury southern California. Her 1960 book &lt;I&gt;Five California Architects&lt;/I&gt; has long been acknowledged as an indispensable classic, and as Reyner Banham famously observed of her, “no one can write about architecture in California without acknowledging her as the mother of us all.” &lt;I&gt;Piecing Together Los Angeles: An Esther McCoy Reader&lt;/I&gt; is the first anthology of McCoy’s writing. It features a selection of some 70 pieces--ranging from her 1945 article “Schindler, Space Architect” to “Arts &amp; Architecture: Case Study Houses,” a 1989 essay commissioned by the Museum of Contemporary Art, Los Angeles. From fiction for &lt;I&gt;The New Yorker&lt;/I&gt; to seminal essays on new architectural forms, McCoy charts the progressive edge of American idealism, from the collective utopian spirit of Jazz Age Greenwich Village, through the Depression and the war years, to the optimism of the 1950s and 1960s. In preparing this volume, writer and editor Susan Morgan extensively researched the McCoy papers at the Archives of American Art. Her editorial decisions were based, in part, on McCoy’s original selections for an unrealized anthology solicited by W. W. Norton in 1968. Expanding on that project, Morgan has included essays, articles, lectures, correspondence, memoirs and short stories that illuminate the breadth and complexity of McCoy’s writing and the southern California region that inspired her groundbreaking work.',3,720.10000000,779971391,'NA2599.5',106,106,0,'720.1 M478',1,NULL,1,0,NULL),(304,'','978-3-03747-056-5','Learning from Warsaw','EN','Centre of Contemporary Art Ujazdowski Castle/Kodojhi Press',96,2013,'Dechmann, Nele; Ruffo, Nicola; Sosnowska, Agnieszka','','','ARC019','','learning-from-warsaw','2016-12-23 22:01:24','2021-02-04 10:17:12',12,'Learning-cover_2070.jpg','image/jpeg',31354,285,400,'',1,711.40000000,879520094,'N6496.3.P6',NULL,7,0,'711.4 D293',1,'undefined',1,0,NULL),(305,'null','978-90-810733-0-1','Open Sauces','EN','FoAM',95,2009,'Kuzmanovic, Maja; Engelen, Sara; Chipperfield, Alkan;, ','null','null','FSUS001','null','open-sauces','2016-12-23 22:01:24','2021-02-01 13:59:51',15,NULL,NULL,NULL,NULL,NULL,'null',1,641.56000000,NULL,NULL,NULL,NULL,1,'641.56 K95',1,'undefined',1,0,NULL),(306,NULL,'978-1-56898-777-4','Subnature : architecture\'s other environments : atmospheres, matter, life','EN','Princeton Architectural Press',224,2009,'Gissen, David',NULL,NULL,'FSUS002',NULL,'subnature-architecture-s-other-environments','2016-12-23 22:01:24','2021-01-31 16:14:52',15,'510tF_2BMml9L.jpg','image/jpeg',51405,387,500,'We are conditioned over time to regard environmental forces such as dust, mud, gas, smoke, debris, weeds, and insects as inimical to architecture. Much of today\'s discussion about sustainable and green design revolves around efforts to clean or filter out these primitive elements. While mostly the direct result of human habitation, these \'subnatural forces\' are nothing new. In fact, our ability to manage these forces has long defined the limits of civilized life. From its origins, architecture has been engaged in both fighting and embracing these so-called destructive forces. In &lt;em&gt;Subnature&lt;/em&gt;, David Gissen, author of our critically acclaimed Big and Green, examines experimental work by today\'s leading designers, scholars, philosophers, and biologists that rejects the idea that humans can somehow recreate a purely natural world, free of the untidy elements that actually constitute nature. Each chapter provides an examination of a particular form of subnature and its actualization in contemporary design practice.&lt;br /&gt;&lt;br /&gt;The exhilarating and at times unsettling work featured in &lt;em&gt;Subnature&lt;/em&gt; suggests an alternative view of natural processes and ecosystems and their relationships to human society and architecture. R&amp;Sie(n)\'s Mosquito Bottleneck house in Trinidad uses a skin that actually attracts mosquitoes and moves them through the building, while keeping them separate from the occupants. In his building designs the architect Philippe Rahm draws the dank air from the earth and the gasses and moisture from our breath to define new forms of spatial experience. In his Underground House, Mollier House, and Omnisport Hall, Rahm forces us to consider the odor of soil and the emissions from our body as the natural context of a future architecture. [Cero 9]\'s design for the Magic Mountain captures excess heat emitted from a power generator in Ames, Iowa, to fuel a rose garden that embellishes the industrial site and creates a natural mountain rising above the city\'s skyline. &lt;em&gt;Subnature&lt;/em&gt; looks beyond LEED ratings, green roofs, and solar panels toward a progressive architecture based on a radical new conception of nature.',1,720.47000000,314113421,'NA2542.35',187,277,0,'720.47 G531',1,NULL,0,0,NULL),(307,NULL,'978-0-06-091587-2','The secret life of plants','EN','Harper Perennial',402,2002,'Tompkins, Peter | Bird, Christopher, 1928- [Author]',NULL,NULL,'FSUS003',NULL,'the-secret-life-of-plants','2016-12-23 22:01:24','2021-01-31 18:33:47',15,'312lQ46i8_2BL.jpg','image/jpeg',9881,125,200,NULL,3,581.00000000,700297,'QK50',2228,2165,0,'581 T662',1,NULL,0,0,NULL),(308,NULL,'978-0-7475-9297-6','On guerrilla gardening : a handbook for gardening without boundaries','EN ','Bloomsbury',205,2009,'Reynolds, Richard',NULL,NULL,'FSUS004',NULL,'on-guerrilla-gardening-a-handbook-for-gardening-without-boundaries','2016-12-23 22:01:24','2021-01-31 16:14:52',15,'517-LyjkWHL.jpg','image/jpeg',59229,326,500,'&lt;i&gt;On Guerrilla Gardening&lt;/i&gt; is an activist\'s call to arms to all citizens - green-fingered, green-thinking or curious - to join the revolution of guerrilla gardening: transforming public space into oases of colour and life. The enemy: neglect, apathy and the disintegration of community spirit. The arsenal: daring, a packet of seeds and a passionate commitment to social change. &lt;br /&gt;&lt;br /&gt;When Richard Reynolds first embarked on guerrilla gardening, growing flowers by moonlight outside his tower block, he had no idea it was part of a growing global movement committed to cultivating the potential in the land regardless of all obstacles. Charting the battles fought across thirty different countries and the revolutionary history of this subculture, &lt;i&gt;On Guerrilla Gardening&lt;/i&gt; is an inspirational take on gardening in the 21st century.',1,635.09173200,230481810,'SB453',434,415,0,'635.091732 R463',1,NULL,0,0,NULL),(309,'0-7914-6194-7',NULL,'Art nature dialogues : interviews with environmental artists','EN',' Suny press',251,2004,'Grande, John K. | Lucie-Smith, Edward [Author of introduction] | Grande, John K.',NULL,NULL,'FSUS006',NULL,'art-nature-dialogues-interviews-with-environmental-artists','2016-12-23 22:01:24','2021-01-31 16:14:52',15,'51IUJ8KY2wL.jpg','image/jpeg',33610,333,500,'Art Nature Dialogues offers interviews with artists working with, in, and around nature and the environment. The interviews explore art practices, ecological issues, and values as they pertain to the siting of works, the use of materials, and the ethics of artmaking. John K. Grande includes interviews with Hamish Fulton, David Nash, Bob Verschueren, herman de vries, Alan Sonfist, Nils-Udo, Michael Singer, Patrick Dougherty, Ursula von Rydingsvard, and others.',1,709.04076000,54529440,'N6494.E6',2141,1722,0,'709.04076 G752',1,NULL,0,0,NULL),(310,NULL,'978-3-89955-334-5','My green city : back to nature with attitude and style','EN','Gestalten',235,2011,'Bolhöfer, Kitty','Back to Nature with Attitude and Style',NULL,'FSUS007',NULL,'my-green-city-back-to-nature-with-attitude-and-style','2016-12-23 22:01:24','2021-01-31 16:14:52',15,'61CvIyTgTsL.jpg','image/jpeg',83186,404,500,'This book presents inspiring work from around the world that is bringing nature back into our cities: from urban farming initiatives, guerilla gardening, and architectural visions, to furniture, products, and other everyday objects that use plants in a functional or aesthetic way. Some of the included projects are changing the landscapes of our cities as a whole, while others can make our own streets and homes greener most importantly, all are trying to get people to think differently. For everyone who has an interest in a more responsible and environmentally friendly lifestyle, this entertaining and socially relevant book makes it clear that we can design our urban future in a way that\'s green, innovative, vibrant, and constructive.',1,711.40000000,694829393,'GE196',151,151,0,'711.4 B687',1,NULL,0,0,NULL),(311,NULL,'978-1-4053-4441-8','PRACTICAL SELF-SUFFICIENCY : the complete guide to sustainable living today','EN','Dorling Kindersley',303,2010,'Strawbridge, Dick | Strawbridge, James [Author]',NULL,NULL,'FSUS008',NULL,'practical-self-sufficiency-the-complete-guide-to-sustainable-living','2016-12-23 22:01:24','2021-01-31 16:14:52',15,'61ZTLvGanzL.jpg','image/jpeg',66498,413,500,'Everything you need to know about modern-day self-sufficient living from stars of the BBC series - It\'s Not Easy Being Green - Dick &amp; James Strawbridge  Want to save on your fuel bills, ready to grow your own, reduce your carbon footprint, and take the self-sufficient plunge?  Dick and James Strawbridge show how to make the practical changes that will have a big impact on your life - without having to transform your lifestyle.  Sharing their experiences, tips and techniques, the Strawbridges provide all the step-by-step advice you need for successful eco projects, large and small. Learn to grow your own fruit &amp; veg, make a wormery, build a chicken ark, install solar panels and more.  Each undertaking is realistic, achievable and sustainable. You won\'t need to go the whole hog - just pick and mix to suit your needs, for long-lasting dividends.',1,640.00000000,660657154,'GF78',85,18,0,'640 S913',1,NULL,0,0,NULL),(312,NULL,'978-84-92861-21-7','On farming','EN','Actar',NULL,2010,'White, Mason',NULL,NULL,'FSUS009',NULL,'bracket-on-farming-almanac-1','2016-12-23 22:01:25','2021-01-31 16:14:53',15,'41ZpeW7Ca0L.jpg','image/jpeg',20546,233,300,'Seeking new voices and design talent, the new Bracket book series is structured around an open call for entries. Conceived as an almanac, the series looks at emerging thematics in our global age that are shaping the built environment in radically significant, yet often unexpected ways. Bracket 1: On Farming looks at the capacity for architecture to address ideas and issues of productive landscapes and urbanisms. Entries were selected by an international jury including Nathalie de Vries, Charles Waldheim and Michael Speaks. Once merely understood in terms of agriculture, today information, energy, labour, and landscape, among others, can be farmed. Farming harnesses the efficiency of collectivity and community. Whether cultivating land, harvesting resources, extracting energy or delegating labor, farming reveals the interdependencies of our globalized world. Simultaneously, farming represents the local gesture, the productive landscape, and the alternative economy. The processes of farming are mutable, parametric, and effi cient. Farming is the modifi cation of infrastructure, urbanisms, architectures, and landscapes toward a privileging of production.',1,712.01000000,648103352,'SB472',121,117,0,'712.01 W586',1,NULL,0,0,NULL),(313,'ISSN 1407-2858',NULL,'Networks and Sustainability (Acoustic Space #10)','EN/LV','Acoustic Space',287,2011,'Smite, Rasa; Medosch, Armin; Smits, Raitis','Peer-reviewed Journal for Transdisciplinary Research on Art, Science, Technology and Society','2 copies','FSUS010',NULL,'networks-and-sustainability-acoustic-space-10','2016-12-23 22:01:25','2021-01-26 18:25:18',15,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(314,NULL,'978-3-7757-2799-0','(Re)Designing nature : aktuelle Positionen der Naturgestaltung in Kunst und Landschaftsarchitektur = current concepts for shaping nature in art and landscape architecture','EN/DE','Hatje Cantz',200,2011,'Witzgall, Susanne; Matzner, Florian; Meder, Iris; Kuenstlerhaus, Wien;, ',NULL,NULL,'FSUS011',NULL,'re-designing-nature-current-concepts-for-shaping-nature-in-art-and-landscape-architecture','2016-12-23 22:01:25','2021-01-31 16:14:53',15,'31evUBUjQxL.jpg','image/jpeg',13201,420,500,'Zones in which nature can offset the tyranny of the built environment are an essential part of any satisfying urban experience, aesthetically and ecologically. (&lt;I&gt;Re)Designing Nature&lt;/I&gt; presents innovative design concepts for enhancing the presence and presentation of nature in cities. Inspiring its readers to contemplate our current relationship to nature, it animates debates about ecologically sustainable and aesthetically intelligent environmental design. In particular, the twin phenomena of rapidly shrinking cities and rapidly expanding megacities call for new models for the intercession and housing of urban nature. Artists and landscape architects offer proposals for alternative uses of empty city lots and old industrial areas, designing parasitical gardens in the middle of the city or utopian visions for a greater symbiosis of culture and nature. Maria Auböck, Susanne Hauser, Florian Matzner, Iris Meder, Bruno De Meulder, Kelly Shannon and Susanne Witzgall discuss various aspects of the project.',1,712.07400000,911262509,'SB469.75',1,1,0,'712.074 W833',1,NULL,1,0,NULL),(315,NULL,'978-1-906155-68-1','Growing stuff : an altrnative to gardening','EN ','black dog publishing',141,2009,'Aimee Selby',NULL,NULL,'FSUS012',NULL,'growing-stuff-an-alternative-guide-to-gardening','2016-12-23 22:01:25','2021-01-31 18:42:51',15,'51TIz93PnnL.jpg','image/jpeg',42492,379,500,'&lt;div&gt;&lt;I&gt;Growing Stuff: An Alternative Guide to Gardening&lt;/I&gt; is a vibrant and quirky guide for anyone wishing to transform their minimal outdoor space.&lt;br&gt;&lt;BR&gt;With easy-to-follow instructions on the basics of growing flowers, herbs, vegetables and more, &lt;I&gt;Growing Stuff&lt;/I&gt; provides an excellent introduction to the world of horticulture. A wide selection of creative recipes’ will help you take growing plants to the next level by making use of them with craft and culinary projects. The book shows you that things can be grown in even the most unexpected places, and with minimum prior knowledge or skill.&lt;BR&gt;&lt;BR&gt;Written in an engaging and informal way, the book is an ideal introduction to green-fingered activity, and is sure to convert even wary or novice gardeners to this creative and wide-ranging practice.&lt;BR&gt;&lt;BR&gt;Includes a foreword by Richard Reynolds author of &lt;I&gt;On Guerilla Gardening&lt;/I&gt;.&lt;/div&gt;',3,635.00000000,300404690,'SB453',21,21,0,'635 A294',1,NULL,1,0,NULL),(316,NULL,'978-616-7339-06-1','Rirkrit Tiravanija : cook book : just smile and don\'t talk','EN','River Books',191,2010,'Tiravanija, Rirkrit, 1961-',NULL,NULL,'FSUS013',NULL,'rirkrit-tiravanija-cook-book','2016-12-23 22:01:25','2021-01-31 16:14:53',15,'61P77-dzpGL.jpg','image/jpeg',75189,340,500,'International award winning artist Rirkrit Tiravanija has collected in this lavishly illustrated book, 23 classic recipes that he has reinterpreted in galleries all over the world, including the Guggenheim in New York and the Serpentine, London Unique commentary and record of one of the world\'s most popular and best-selling avant-garde artists Extended interview with the author about his work and how it fits in to the world art market Born in Buenos Aires in 1961, contemporary artist Rirkrit Tiravanija resides in New York, Berlin and Chiang Mai, Thailand. His installations often take the form of stages or rooms for sharing meals, cooking, reading or playing music; architecture or structures for living and socializing are core elements in his work. In 2004 he was awarded the Hugo Boss Prize by the Guggenheim Museum, in recognition of his profound contribution to contemporary art and is a Professor at the School of the Arts at Columbia University. Tiravanija\'s work has been presented widely at museums and galleries throughout the world, including solo exhibitions at Musee d\'Art Moderne de la Ville de Paris (2005); Serpentine Gallery, London (2005); Secession, Vienna (2002); The Museum of Modern Art, New York (1997), Galerie fur Zeitgenossische Kunst, Leipzig (2003); Ikon Gallery, Birmingham, UK (2003-04); and Gavin Brown\'s Enterprise (1999). He has participated in such notable group exhibitions as the Sharjah Biennial 8, United Arab Emirates (2007); 27th Sao Paulo Biennial, Brazil (2006); Whitney Biennial 2006: Day for Night, New York (2005), and was the co-curator with Hans Ulrich Obrist and Molly Nesbit of the Station Utopia Project at the 50th Venice Biennale (2003). Most recently he has exhibited at Tang Contemporary Beijing (2010) and Kunsthalle Bielefeld (2010). Cook Book contains 23 recipes, previously performed in museums and galleries throughout the world. All were cooked once more in his Chiang Mai kitchen and documented in the photographs by Antoinette Aurell. An essay by Thomas Kellein of the Kunsthalle Bielefeld and an extended interview between him and the artist shed additional light on Rirkrit\'s work. Through this book the reader will understand more of what moves the artist as well as being able to cook such Thai staples from Pad Thai to Flaming Morning Glory, as well as new interpretations of Swedish, German and Spanish classics such as meatballs, Fladlesoup and paella.',1,641.59593000,659772584,'TX724.5.T5',68,68,0,'641.59593 T596',1,NULL,0,0,NULL),(317,NULL,'9780415839570 / ISSN 0952-8822','Third Text : Contemporary Art and the Politics of Ecology. Number 120, January 2013','EN','Routledge',176,2013,'Demos, TJ',NULL,NULL,'FSUS014',NULL,'third-text-contemporary-art-and-the-politics-of-ecology-number-120-january-2013','2016-12-23 22:01:25','2021-01-26 17:48:59',15,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(318,NULL,'978-1-86189-854-8','Bread : a global history','EN','REAKTION books',160,2011,'Rubel, William','The  Edible Series',NULL,'FSUS015',NULL,'bread-a-global-history','2016-12-23 22:01:25','2021-01-31 16:14:53',15,'31uCX-Osi2L.jpg','image/jpeg',11605,303,500,'What food is more basic, more essential and more universal than bread? Common to the diets of both rich and poor, bread is one of our oldest foods. Loaves and rolls have been found in ancient Egyptian tombs, and excavated from ovens in Pompeii that were buried when Vesuvius erupted in AD 79. From the sixteenth-century English peasants’ bread made with pea flour and rye, to the grain-wasting, pure white bread of the French court, from the crusty sourdough loaf made by artisan bakers to the doughy ‘sliced white’ found in every supermarket, there is a bread for every time and place in history.William Rubel takes us on a journey to discover breads around the world, from Mexican pan dulce to French baguettes and German pumpernickel, and shows how the kind of bread you eat reveals who you are. He also describes the techniques of bread-making, from ancient recipes leavened with brewers’ yeast to the factory-made sandwich loaf. Containing a glossary of over one hundred different breads from around the world, Bread will be an inspiration for all bakers, as well as anyone who enjoys a simple slice.',1,641.81500000,712117475,'TX769',431,425,0,'641.815 R895',1,NULL,0,0,NULL),(319,NULL,'978-1-86189-648-3','Cake : a global history','EN','REAKTION books',144,2010,'Humble, Nicola','The Edible Series',NULL,'FSUS016',NULL,'cake-a-global-history','2016-12-23 22:01:25','2021-01-31 16:14:53',15,'317pgETbfnL.jpg','image/jpeg',11741,303,500,'Let them eat cake! What birthday, wedding or children’s party would be complete without it? It is the ultimate food of celebration in many cultures throughout the world, but how did it come to be so? Cake: A Global History explores the origin of modern cake and its development from sweet bread to architectural flight of fancy, together with the meanings, legends and rituals attached to cake throughout the world.&lt;br /&gt;Nicola Humble reviews the many national differences in cake-making techniques and customs – the French, for example, have the gâteau Paris-Brest, named after the cycle race and designed to imitate the form of a bicycle wheel; in America there is New England’s Election Day cake or the Southern favourite, Lady Baltimore cake – and what they reveal about the nations that make them. From Proust’s madeleine to Miss Havisham’s decaying wedding cake, the symbol of her betrayal in Dickens’s Great Expectations, Humble also relates the food’s place in literature, art and film, and what it can symbolize: indulgence, gender, motherhood and guilt.&lt;br /&gt;With a large selection of mouthwatering images, Cake will appeal to the many readers with an interest in food history, social, cultural, literary and art history – or, indeed, just in cake.',1,641.86530000,457149291,'TX771',306,223,0,'641.8653 H919',1,NULL,0,0,NULL),(320,NULL,'978-1-86189-523-3','Cheese : a global history','EN','REAKTION books',152,2009,'Dalby, Andrew, 1947-','The  Edible Series',NULL,'FSUS017',NULL,'cheese-a-global-history','2016-12-23 22:01:25','2021-01-31 18:47:12',15,'31wjpS2zJnL.jpg','image/jpeg',12487,303,500,'Cheese is one of the most ancient of civilized foods and one of the most nourishing. Despite its many uses and variations, there has never been a global history of cheese, but here at last is a succinct, authoritative account, revealing how cheese was invented and where, when and even why.In bite-sized chapters well-known food historian Andrew Dalby tells the true and savoury story of cheese, from its prehistoric invention to its modern rebirth. Here you will find the most ancient cheese appellations, the first written description of the cheese-making process, a list of the luxury cheeses of classical Rome, the medieval rule-of-thumb for identifying good cheese, and the story of how loyal cheese lover Samuel Pepys saved his parmesan from the Great Fire of London. Dalby reveals that cheese is one of the most ancient of civilized foods. He suggests that our passion for cheese may even lie behind the early establishment of global trade, and asks in conclusion whether real cheese can survive the current imperative to globalize, pasteurize and sterilize our food. .Packed with entertaining cheese facts, anecdotes and images, Cheese also features a selection of historic recipes. For those who crave a stinky Stilton, a creamy Brie or a salty pecorino, Cheese is the perfect snack.',1,641.37309000,318874054,'SF270.4',320,317,0,'641.37309 D137',1,NULL,0,0,NULL),(321,NULL,'978-1-86189-925-5','Herbs : a global history','EN','REAKTION books',168,2012,'Allen, Gary (Gary J.)','The Edible Series',NULL,'FSUS018',NULL,'herbs-a-global-history','2016-12-23 22:01:25','2021-01-31 16:14:53',15,'31f7PFuwBxL.jpg','image/jpeg',14369,303,500,'You can’t make pesto alla Genovese without basil or a Mojito without mint. You can use peppermint to settle an upset stomach, ease arthritis pain with stinging nettles, and heal burns and wounds with aloe vera. And then there is cannabis, perhaps the most notorious herb of all. Despite the fact that herbs are often little more than weeds, cultures around the globe have found hundreds of uses for them, employing them in everything from ancient medicines to savoury dishes. While much has been written on cooking and healing with herbs, little has been told about the history of the plants themselves and the incredible journeys they have made.&lt;br /&gt;These often overlooked plants have become a staple in our lives. Unlike spices that quickly traversed the globe through trade, herbs were often hoarded by their cultivators and were central to distinctive regional dishes. This book examines herbs in new ways, making it essential reading for any serious foodie. Filled with beautiful illustrations and delicious recipes, this book will complete the kitchen library.',1,641.65709000,760291977,'TX819.H4',304,304,0,'641.65709 A426',1,NULL,0,0,NULL),(322,'0-85546-290-6',NULL,'Pollution monitoring with lichens','EN','The Richmond Publishing Co.Ltd.',76,1992,'Richardson, D. H. S. (David H. S.)',NULL,NULL,'FSUS019',NULL,'pollution-monitoring-with-lichens','2016-12-23 22:01:25','2021-01-31 18:41:27',15,'5122WSFyYhL.jpg','image/jpeg',45076,334,500,'&lt;p&gt;Lichens make excellent material for field studies throughout the year and are valuable for the detection and mapping of pollution. This book provides an overview of the value of lichens for monitoring a range of potentially harmful substances including sulphur dioxide, fluorides, PCBs, metals and radioactive elements.&lt;/p&gt;&lt;p&gt;In each section background information is provided and case studies briefly described to enable the reader to appreciate the potential applications of lichens for monitoring each type of environmental pollutant. To help with the problems of identifying lichens, coloured illustrations are provided of species that commonly grow on trees together with an identification key and direction to more advanced texts for lichens growing on other surfaces.&lt;/p&gt;',3,628.50287000,27664465,'QK583',127,129,0,'628.50287 R522',1,NULL,0,0,NULL),(323,NULL,'978-1-86189-809-8','The sea : a cultural history','EN','REAKTION books',272,2011,'Mack, John, 1949- | Mack, John, 1949- | ebrary, Inc',NULL,'2 copies','FSUS020',NULL,'the-sea-a-cultural-history','2016-12-23 22:01:25','2021-02-04 11:00:36',15,'31tkyAXNphL.jpg','image/jpeg',14072,320,500,'‘There is nothing more enticing, disenchanting, and enslaving than the life at sea’, wrote Joseph Conrad. There is certainly nothing more integral to the development of the modern world. In The Sea, John Mack considers those great expanses that both unite and divide us, and the ways in which human beings interact because of the sea, from navigation to colonization to trade.Much of the world’s population lives on or near the coast, and people inhabit and engage with the sea in a variety of ways. The Sea explores the diversity of seas themselves, maritime technologies, especially the practice of navigation, and different cultures surrounding the sea. Seafarers have characteristic social and technical practices, as well as having distinctive language and customs. Many cultures have created a society of the sea, which is usually all-male, often cosmopolitan and always hierarchical. The separation of sea and land is evident in the use of different vocabularies on land and on sea for the same things, the change in a mariner’s behaviour when on land, and in the liminal status of points uniting the two realms, like beaches and ports. Ships are also deployed in symbolic contexts on land, from ship burials to ecclesiastical and public architecture. The two realms – land and sea – are never completely separate.Casting a wide net, The Sea uses histories, maritime archaeology, anthropology, art history, biography and literature to provide an innovative and experiential account of the waters that surround us.',1,551.46000000,670480440,'CB465',929,363,0,'551.46 M153',1,NULL,0,0,NULL),(324,'987-0-486-43931-0',NULL,'The Physics of Blown Sand and Desert Dunes','EN','DOVER',265,2005,'R.A.Bagnold','Science/Earth Sciences',NULL,'FSUS021',NULL,'the-physics-of-blown-sand-and-desert-dunes','2016-12-23 22:01:25','2021-01-23 17:32:47',15,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(325,NULL,'978-0-141-01001-4','Wildwood : a journey through trees','EN','Penguin Books',402,2007,'Deakin, Roger',NULL,NULL,'FSUS022',NULL,'wildwood-a-journey-through-trees','2016-12-23 22:01:25','2021-01-31 18:31:04',15,'51_2BaGgNiE1L.jpg','image/jpeg',36621,322,500,'Roger Deakin\'s Wildwood is a much loved classic of nature writing  Wildwood is about the element wood, as it exists in nature, in our souls, in our culture and our lives.  From the walnut tree at his Suffolk home, Roger Deakin embarks upon a quest that takes him through Britain, across Europe, to Central Asia and Australia, in search of what lies behind man\'s profound and enduring connection with wood and with trees.  Meeting woodlanders of all kinds, he lives in shacks and cabins, travels in search of the wild apple groves of Kazakhstan, goes coppicing in Suffolk, swims beneath the walnut trees of the Haut-Languedoc, and hunts bush plums with Aboriginal women in the outback.  Perfect for fans of Robert Macfarlane and Colin Tudge, Roger Deakin\'s unmatched exploration of our relationship with trees is autobiography, history, traveller\'s tale and incisive work in natural history. It will take you into the heart of the woods, where we go \'to grow, learn and change\'  \'Enthralling\'  Will Self, New Statesman  \'Extraordinary . . . some of the finest naturalist writing for many years\' Independent  \'Masterful, fascinating, excellent\'  Guardian  \'An excellent read - lyrical and literate and full of social and historical insights of all kinds\'  Colin Tudge, Financial Times  \'Enchanting, very funny, every page carries a fascinating nugget. Should serve to make us appreciate more keenly all that we have here on earth . . . one of the greatest of all nature writers\'  Craig Brown, Mail on Sunday  \'Breathtaking, vividly written . . . reading Wildwood is an elegiac experience\'  Sunday Times  Roger Deakin, who died in August 2006, shortly after completing the manuscript for Wildwood, was a writer, broadcaster and film-maker with a particular interest in nature and the environment. He lived for many years in Suffolk, where he swam regularly in his moat, in the river Waveney and in the sea, in between travelling widely through the landscapes he writes about in Wildwood. He is the author of Waterlog, Wildwood and Notes from Walnut Tree Farm.',3,508.31520000,85828879,'QK475',491,766,0,'508.3152 D279',1,NULL,0,0,NULL),(326,NULL,'978-9934-8379-0-6','The Pig Funeral. A Notebook of Traditions','EN','SERDE',84,2013,'Pucena, Signe; Vitola, Ieva',NULL,'2 copier','FSUS024',NULL,'the-pig-funeral-a-notebook-of-traditions','2016-12-23 22:01:25','2021-02-01 13:57:29',15,NULL,NULL,NULL,NULL,NULL,NULL,1,398.20940000,NULL,NULL,NULL,NULL,1,'398.2094 P977',2,NULL,0,0,NULL),(327,'ISSN 1407-2858',NULL,'Energy / Energija (Acoustic Space #8)','LV/EN','Acoustic Space',255,2011,'Smite, Rasa; Medosch, Armin; Mey, Kerstin; Smits, Raitis','Peer-reviewed Journal for Transdisciplinary Research on Art, Science, Technology and Society','2 copies','FSUS026',NULL,'energy-energija-acoustic-space-8','2016-12-23 22:01:25','2021-01-26 18:26:13',15,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(328,NULL,'978-1-84476-931-5','Vegetarian &amp; wholefoods bible : a fabulous collection of over 300 delicious recipes from around the world, all shown step by step in over 1600 easy-to-follow photographs','EN','Southwater',512,2009,'Graimes, Nicola',NULL,NULL,'FSUS029',NULL,'vegetarian-and-wholefoods-bible','2016-12-23 22:01:25','2021-01-31 16:14:53',15,'51C-wJfNAjL.jpg','image/jpeg',60635,384,500,'The enticing recipe collection includes over 300 dishes from around the world. Step-by-step photographs guide you through each tested recipe to help you achieve perfect results. With easy-to-read, informative text and mouthwatering dishes, this is an essential book for every cook.',3,641.56360000,406158768,'TX837',55,21,0,'641.5636 G743',1,NULL,1,0,NULL),(329,'null','978-1-4088-2882-3','Survival of the beautiful : art, science, and evolution','EN','Bloomsbury',311,2011,'Rothenberg, David, 1962-','null','null','FSUS030','FSUS059','survival-of-the-beautiful-art-science-and-evolution','2016-12-23 22:01:25','2021-02-04 10:43:19',15,'51huggkDzqL.jpg','image/jpeg',33278,329,500,'\"The peacock\'s tail,\" said Charles Darwin, \"makes me sick.\" That\'s because the theory of evolution as adaptation can\'t explain why nature is so beautiful. It took the concept of sexual selection for Darwin to explain that, a process that has more to do with aesthetics than the practical. Survival of the Beautiful is a revolutionary new examination of the interplay of beauty, art, and culture in evolution. Taking inspiration from Darwin\'s observation that animals have a natural aesthetic sense, philosopher and musician David Rothenberg probes why animals, humans included, have innate appreciation for beauty-and why nature is, indeed, beautiful. Sexual selection may explain why animals desire, but it says very little about what they desire. Why will a bowerbird literally murder another bird to decorate its bower with the victim\'s blue feathers? Why do butterfly wings boast such brilliantly varied patterns? The beauty of nature is not arbitrary, even if random mutation has played a role in evolution. What can we learn from the amazing range of animal aesthetic behavior-about animals, and about ourselves? Readers who enjoyed the bestsellers The Art Instinct and The Mind\'s Eye will find Survival of the Beautiful an equally stimulating and profound exploration of art, science, and the creative impulse.',3,700.10500000,707329321,'N72.S3',686,744,0,'700.105 R846',1,'undefined',0,0,NULL),(330,NULL,NULL,'Perfect preserves','DE',NULL,NULL,1980,'Walden, Hilaire',NULL,NULL,'FSUS031',NULL,'kochen','2016-12-23 22:01:25','2021-01-31 16:14:54',15,NULL,NULL,NULL,NULL,NULL,NULL,3,641.40000000,49727359,'TX612.J3',193,180,0,'641.4 W162',1,NULL,0,0,NULL),(331,NULL,'978-1-60606-032-2','The tree in photographs','EN','Getty Publications',111,2010,'Reynaud, Françoise',NULL,NULL,'FSUS032',NULL,'the-tree-in-photographs','2016-12-23 22:01:25','2021-01-31 16:14:54',15,'51G0LE2QnyL.jpg','image/jpeg',46092,421,500,'&lt;div&gt;&lt;P&gt;Visual artists as well as writers have long extolled the presence of the tree. From the origins of photography to the present day, photographers have considered the tree, with its strong graphic form and evocative power, to be a popular subject. Through the works of artists such as Robert Adams, Eugène Atget, Anne Brigman, William Eggleston, P. H. Emerson, Gustave Le Gray, Eliot Porter, Alfred Stieglitz, Paul Strand, William Henry Fox Talbot, and Carleton Watkins, this book spans the history of photography from the mid-nineteenth to early-twenty-first century to address the image of the tree in its many connotations—as graphic form, symbolic icon, and role model for the beauty of nature.&lt;/P&gt;&lt;P&gt;The selection of eighty-one images carefully culled from the J. Paul Getty Museum’s permanent collection of photographs and reproduced in color presents the tree in various contexts: the single tree; trees in the urban landscape; uses of trees; tree reflections and shadows; and details, abstractions, and conceptual views of trees as conceived by contemporary artists.&lt;/P&gt;&lt;/DIV&gt;',1,779.34000000,634739747,'TR726.T7',231,230,0,'779.34 R459',1,NULL,0,0,NULL),(332,NULL,'978-9955-624-99-8','Pagrindiniai augalai Lietuvos želdynams','LT','VDA leidykla',74,2008,'Regimantas Pilkauskas',NULL,NULL,'FSUS033',NULL,'pagrindiniai-augalai-lietuvos-zeldynams','2016-12-23 22:01:25','2021-01-23 17:32:57',15,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(333,'null','978-609-8010-15-5','Miškuose prie Baltijos / In the Forests Around the Baltic','LT/EN','Ex Arte',304,2011,'Danauskas, Jonas; Ozolinčius, Remigijus','null','null','FSUS034'