itional Lithuanian cooking, unique recipes, or who simply wish to expand their culinary horizons.  English text with 23 color photographs.',3,641.59479300,43510373,'TX723.5.L8',26,27,0,'641.594793 I32',1,NULL,0,0,NULL),(338,NULL,'978-981-275-004-4','500 pies &amp; tarts : the only pies &amp; tarts compendium you\'ll ever need','EN','Page One',288,2009,'Baugniet, Rebecca',NULL,NULL,'FSUS039',NULL,'500-pies-and-tarts','2016-12-23 22:01:25','2021-01-31 16:14:54',15,NULL,NULL,NULL,NULL,NULL,NULL,3,641.86520000,144596737,'TX773',141,131,0,'641.8652 B346',1,NULL,0,0,NULL),(339,NULL,'978-1-84477-627-6','Simple organic kitchen &amp; garden : a complete guide to growing and cooking perfect natural produce, with over 150 step-by-step recipes','EN','Hermes House',NULL,2010,'Spevack, Ysanne',NULL,NULL,'FSUS040',NULL,'simple-organic-kitchen-and-garden','2016-12-23 22:01:25','2021-01-31 16:14:54',15,'516fpDAz7BL.jpg','image/jpeg',44981,375,500,'A complete guide to growing and cooking perfect natural produce, with over 150 step-by-step recipes. Hundreds of color illustrations.',1,641.56370000,56989872,'TX741',38,18,0,'641.5637 S741',1,NULL,0,0,NULL),(340,NULL,'978-3-8331-5497-3','Ingredients','EN','H. F. Ullmann',384,2005,'Werle, Loukie',NULL,NULL,'FSUS041',NULL,'ingredients','2016-12-23 22:01:25','2021-01-31 16:14:54',15,'51SbVA5oZDL.jpg','image/jpeg',60106,382,500,'The well structured and highly informative reference book Ingredients identifies approximately 2000 ingredients by name an describes their composition and uses. This&lt;br&gt;&lt;br&gt;book will help cooks - and everyone who likes to eat - find their way through the world\'s jungle of ingredients.',3,641.30000000,45670234,'TX357',208,116,0,'641.3 W489',1,NULL,0,0,NULL),(341,'null','978-609-410-040-6','Pasimatykime virtuvėje','LT','Baltos lankos',208,2010,'Jagelavičiūtė, Agnė','null','null','FSUS042','null','pasimatykime-virtuveje','2016-12-23 22:01:25','2021-02-01 13:46:50',15,'31SYO30pA4L.jpg','image/jpeg',13573,170,267,'Autorine Agnes Jagelaviciutes knyga, kurioje ji atsiskleidzia kaip gera kulinare, megstanti gaminti mylimajam, sau, draugams. Agne pateikia ir apraso receptus, kurie nepadarytu gedos ir diplomuotam kulinarui. \"Gaminti mylimajam, gaminti geriausiai draugei, gaminti mamai, biciuliams ar su jais, rasti laiko susirinkti prie vieno stalo, ji puosti, serviruoti, ragauti, skanauti, dalytis mintimis - nesvarbu, apie triusienos ragu ar sezono madas, apie Pauli Cezanne\'a ar Oskaro spektakli - man tai didziausia svente\", - sako garsi moteris. Knyga parasyta lengvai ir paprastai, pilna graziu valgiu ir gyvenimo budo nuotrauku, o autore su skaitytoju kalbasi kaip su geriausiu draugu ir kviecia prie stalo pasimegauti skaniu maistu. \"Pasimatykim virtuveje\" - puikiai subalansuota knyga: receptai - lengvi gaminti, tekstai - smagus skaityti, nuotraukos - grazios paziureti.',1,641.50000000,NULL,NULL,NULL,NULL,1,'641.5 J24',1,'undefined',0,0,NULL),(342,'null','null','Data Ecologies \'09','EN','gRig',30,2009,'Time\'s Up','null','null','FSUS043','null','data-ecologies-09','2016-12-23 22:01:25','2021-02-01 13:45:58',15,NULL,NULL,NULL,NULL,NULL,'null',1,330.12000000,NULL,NULL,NULL,NULL,1,'330.12 T582',1,'undefined',0,1,NULL),(343,'ISSN 2323-3907',NULL,'Mustarinda: Art and Ecological Transition ','EN','Mustarinda Association',53,2012,'Jarvensivu, Paavo; Majava, Antti',NULL,NULL,'FSUS044',NULL,'mustarinda-art-and-ecological-transition','2016-12-23 22:01:25','2021-01-26 18:26:23',15,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(344,NULL,'978-0198150046','Sympotica : a symposium on the symposium','EN','Oxford University Press',351,1990,'Oswyn Murray',NULL,NULL,'FSUS045',NULL,'sympotica-a-symposium-on-the-symposion','2016-12-23 22:01:25','2021-01-31 16:14:54',15,'318cWsr9_2BTL.jpg','image/jpeg',11512,385,500,'The &lt;em&gt;symposion&lt;/em&gt; or male drinking group of archaic and classical Greece was an institution whose influence can be detected in many areas of ancient Greek life, from politics and warfare, to painted pottery and poetry, to sexual attitudes and conceptions of pleasure.  This is the first book to be published on the &lt;em&gt;symposion&lt;/em&gt; as a whole.  The papers discuss a wide range of topics from the importance of Greek drinking customs to anthropology, archaeology, art history, literary studies, history, and philosophy.  In addition, Murray includes a useful historical introduction to the field of sympotic studies and a general bibliography.&lt;br&gt;',1,394.26938000,42761285,'DF100',22,28,0,'394.26938 O86',1,NULL,0,0,NULL),(345,'','','500 casseroles &amp; stews','','Page One',NULL,2009,'Baugniet, Rebecca','','','FSUS046','','500-casseroles-and-stews','2016-12-23 22:01:25','2021-01-31 16:14:54',15,NULL,NULL,NULL,NULL,NULL,'',3,641.82100000,416274989,'TX693',28,7,0,'641.821 B346',1,NULL,0,0,NULL),(346,'','','Condiment: Adventures in Food and Form, issue 02','','Food & Form',NULL,2010,'Barton Chris, Brent Jessica','','','FSUS047','','condiment-adventures-in-food-and-form-issue-02','2016-12-23 22:01:25','2021-01-26 18:29:30',15,NULL,NULL,NULL,NULL,NULL,'',3,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(347,'','','Kaip pasėti mišką / how to sow a forest','LT/EN','Šklėriai',66,2014,'Garbštienė, Laura','','','FSUS048','','kaip-paseti-miska-how-to-sow-a-forest','2016-12-23 22:01:25','2021-02-01 18:12:47',15,NULL,NULL,NULL,NULL,NULL,'',1,634.90000000,NULL,NULL,NULL,NULL,1,'635.09 G213',4,'undefined',0,0,NULL),(348,'ISBN 978-83-61587-54-5','','Towards the Third Culture','PL/EN','Laznia Centre for Contemporary Art',192,2011,'Kluszczynski, Rushard W.','','','FSUS049','','towards-the-third-culture','2016-12-23 22:01:25','2021-02-01 13:38:20',15,NULL,NULL,NULL,NULL,NULL,'',1,700.10500000,NULL,NULL,NULL,NULL,1,'700.105 K63',1,'undefined',1,0,NULL),(349,'','978-9934-8434-0-2f','Talk to me : exploring human-plant communication','EN','RIXC',144,2014,'Šmite, Rasa','','','FSUS050','','talk-to-me-exploring-human-plant-communication','2016-12-23 22:01:25','2021-02-01 13:36:20',15,'512XdJeRtsL.jpg','image/jpeg',52847,398,500,'Everyone wants someone to talk to. Perhaps ancient Latvians, like Prince Charles, who in a 1986 television interview stated I just come and talk to the plants, may be right after all. Recent scientific studies have proved that talking to plants may encourage their growth. RIXC artists were keen on testing this concept by developing Talk to Me, an online interface which allows people to talk to their plants while away from home. The Talk to Me book introduces the process and results of our artistic research project on human-plant communication. The networked installations with live growing bean-plants were set up and presented in Helsinki, Riga, Tallinn, Ventspils, Basel, Lueneburg and Stavanger. Before the beans ripened they received over 13 000 online messages in different languages.',1,304.20000000,906810167,'QK46.5.H85',NULL,3,0,'304.2 M679',1,'undefined',0,0,NULL),(350,'','978-9934-8434-1-9','Techno-ecologies 2 : media art histories','EN','RIXC',311,2014,'Šmite, Rasa','','','FSUS051','','techno-ecologies-2-media-art-histories','2016-12-23 22:01:25','2021-01-24 18:22:22',15,'51Shg7qFpYL.jpg','image/jpeg',39263,405,500,'Techno-ecological perspectives have become now one of the key directions in contemporary discourses and are part of a larger paradigm shift from new media to post-media art. A range of practices which were once subsumed under terms such as media art, digital art, art and technology or art and science, have experienced such growth and diversification that no single term can work as as a label any more. Traditionally separated domains are brought together to become contextual seedbeds for ideas and practices that aim to overcome the crisis of the present and to invent new avenues for future developments. This is the 2nd volume in the Acoustic Space series that continues to build a \'techno-ecological\' perspective whereby new artistic practices are discussed that combine ecological, social, scientific and artistic inquiries. Edited and published in the context of the exhibition Fields, it makes a perspective its own that sees art as a catalyst for change and transformations. This volume gives various insights into research tactics and strategies which form the larger context of the FIELDS exhibition which takes place in Riga, Latvia, The Arsenals Exhibition Hall of the Latvian National Museum of Art (May 15 August 3, 2014) while the texts included here are mainly contributions from two earlier conferences, Media Art Histories 2013: RENEW, the 5th International Conference on the Histories of Media Art, Science and Technology held in Riga, Latvia, October 8-11, 2013, and the Art+Communication 2012 festival conference Art of Resilience , Riga, Latvia, October 5-6, 2012. Contributors: Armin Medosch, Douglas Kahn, Kevin Hamilton, Katja Kwastek, Lauren Fenton, Kuai Shen Auson, Vytautas Michelkevicius, Roberta Buiani, Erich Berger, Laura Beloff, Tega Brain, Brad Miller, Michel Bauwens, Claudia Roselli, Eric Kluitenberg, Heba Amin, Erandy Vergara, Gavin MacDonald, Conor McGarrigle, James Werner, Brian Reffin Smith, Saskia Korsten, Maryam Bolouri, Gabriela Galati, Amos Bianchi, Asa Stahl, Kristina Lindstrom, Eric Snodgrass, Takis Zourntos, Marjan Verstappen, Caroline Langill, Ebru Yetskin.',1,NULL,891376711,'N72.T4',NULL,5,0,NULL,1,NULL,0,0,NULL),(351,'','','Alpinarium','RU','Artija',223,1989,'Vodičkova, V.; Kaplickaja, I.','','','FSUS052','','alpinarium','2016-12-23 22:01:25','2021-01-26 18:26:27',15,NULL,NULL,NULL,NULL,NULL,'',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(352,NULL,'978-0-520-27611-6','How forests think : toward an anthropology beyond the human','EN','University of California Press',267,2016,'Kohn, Eduardo | Kohn, Eduardo',NULL,NULL,'FSUS053',NULL,'how-forests-think-toward-an-anthropology-beyond-the-human','2016-12-23 22:01:25','2021-01-31 20:00:21',15,'41UStF8mYWL.jpg','image/jpeg',22207,333,500,'Can forests think? Do dogs dream? In this astonishing book, Eduardo Kohn challenges the very foundations of anthropology, calling into question our central assumptions about what it means to be human—and thus distinct from all other life forms. Based on four years of fieldwork among the Runa of Ecuador’s Upper Amazon, Eduardo Kohn draws on his rich ethnography to explore how Amazonians interact with the many creatures that inhabit one of the world’s most complex ecosystems. Whether or not we recognize it, our anthropological tools hinge on those capacities that make us distinctly human. However, when we turn our ethnographic attention to how we relate to other kinds of beings, these tools (which have the effect of divorcing us from the rest of the world) break down. &lt;i&gt;How Forests Think&lt;/i&gt; seizes on this breakdown as an opportunity. Avoiding reductionistic solutions, and without losing sight of how our lives and those of others are caught up in the moral webs we humans spin, this book skillfully fashions new kinds of conceptual tools from the strange and unexpected properties of the living world itself. In this groundbreaking work, Kohn takes anthropology in a new and exciting direction–one that offers a more capacious way to think about the world we share with other kinds of beings.',3,986.60000000,827528818,'F2230.2.K4',1663,1632,0,'986.6 K79',1,NULL,0,0,NULL),(353,NULL,NULL,'The Laboratory Planet No5 Alien Capitalism','EN','Association PING',24,2016,'Ewen Chardronnet',NULL,NULL,'FSUS054',NULL,'the-laboratory-planet-no5-alien-capitalism','2016-12-23 22:01:25','2021-01-26 17:26:42',15,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(354,'null','978-0-262-52741-5','Textures of The Anthropocene: Grain Vapor Ray; [published in conjunction with \"The Anthropocene Project 2013/2014\"...]. Vapor','EN','The MIT Press',321,2015,'Klingan, Katrin; Sepahvand, Ashkan; Rosol, Christoph; Scherer, Bernd M.','4 books','null','FSUS055','null','grain-vapor-ray-textures-of-the-anthropocene','2016-12-23 22:01:25','2021-02-03 09:11:10',15,'51FXhRnca0L.jpg','image/jpeg',36048,348,500,'&lt;p&gt;We have entered the Anthropocene era -- a geological age of our own making, in which what we have understood to be nature is made by man. We need a new way to understand the dynamics of a new epoch. These volumes offer writings that approach the Anthropocene through the perspectives of grain, vapor, and ray -- the particulate, the volatile, and the radiant. The first three volumes -- each devoted to one of the three textures -- offer a series of paired texts, with contemporary writers responding to historic writings. A fourth volume offers a guide to the project as a whole.&lt;/p&gt;&lt;p&gt;Grain: Granular materials add up to concrete forms; insignificant specks accumulate into complex entities. The texts in this volume narrate some of the fundamental qualities of the granular. In one pairing of texts, Robert Smithson compares the accumulation of thoughts to the aggregation of sediment, and an environmental historian writes about the stakes for earthly knowledge today. Other authors include Alfred Russel Wallace, Denis Diderot, and Georges Bataille.&lt;/p&gt;&lt;p&gt; &lt;i&gt;Vapor&lt;/i&gt;: The vaporous represents matter\'s transformations. In this volume, a political scientist compares Kafka\'s haunting \"Odradek\" to \"vibrant matter\"; a media theorist responds to poems and diagrams by Buckminster Fuller; and more, including texts by Hippocrates, Italo Calvino, and James Clerk Maxwell.&lt;/p&gt;&lt;p&gt; &lt;i&gt;Ray&lt;/i&gt;: A ray is an act of propagation and diffusion, encompassing a chain of interdependencies between energy and matter. This volume includes texts by Spinoza (with a reconceptualization by a contemporary philosopher), Jacques Lacan (followed by an anthropologist\'s reflections on temporality), Thomas Pynchon (accompanied by an interpretation of Pynchon\'s \"electro-mysticism\"), and others. &lt;/p&gt;&lt;p&gt;These volumes constitute a unique experiment in design and composition as well as content. The mingling of texts and the juxtaposition of different areas of knowledge represented in a variety of forms express the dynamics of a world in change. &lt;/p&gt;',1,333.70000000,912228469,NULL,8,NULL,0,'333.7 K65',1,'undefined',1,0,NULL),(355,NULL,'978-1-987831-01-6','Hybrids : so you think you are human','EN','Wayshower Enterprises',184,2015,'Helliwell, Tanis, 1947-',NULL,NULL,'FSUS056',NULL,'hybrids-so-you-think-you-are-human','2016-12-23 22:01:25','2021-01-31 16:14:55',15,'41a1fHrWI7L.jpg','image/jpeg',28181,324,500,'Myths, religions and archeological discoveries around the world discuss the presence of intelligent non-human beings who have interbred with humans creating hybrids. Tanis Helliwell offers convincing evidence about the existence of 22 different human-hybrids (elementals, angels, dolphins, giants, dragons, centaurs, pan and many others).   People who discover they are hybrids report feeling more authentically themselves—more energized, powerful and self-loving—as a result of their discovery.    AM I A HYBRID?   If you answer “yes” to these statements, Hybrids will be of special interest to you:    • I often feel I don\'t fit in • I am hypersensitive to violence • I am deeply committed to helping the Earth  • I would describe myself as an independent thinker • I follow my own inner guidance about rightness, even if it goes against the norm   As with her ground-breaking work on elementals in the classic “Summer with the Leprechauns”, Tanis is, with Hybrids, once again at the forefront of an entire new genre of investigation.',1,133.14000000,904867124,NULL,7,NULL,0,'133.14 H476',1,NULL,0,0,NULL),(356,NULL,'978-0-8166-7998-0','Prismatic ecology : ecotheory beyond green','EN','University of Minnesota Press',349,2013,'Cohen, Jeffrey Jerome | Cohen, Jeffrey Jerome [Author; Editor; Editor of compilation] | Buell, Lawrence',NULL,NULL,'FSUS057',NULL,'prismatic-ecology-ecotheory-beyond-green','2016-12-23 22:01:25','2021-01-31 16:14:55',15,'51d0xC7VY5L.jpg','image/jpeg',33774,323,500,'&lt;DIV&gt;&lt;p&gt;&lt;BR&gt;Emphasizing sustainability, balance, and the natural, green dominates our thinking about ecology like no other color. What about the catastrophic, the disruptive, the inaccessible, and the excessive? What of the ocean’s turbulence, the fecundity of excrement, the solitude of an iceberg, multihued contaminations? &lt;I&gt;Prismatic Ecology&lt;/I&gt; moves beyond the accustomed green readings of ecotheory and maps a colorful world of ecological possibility.&lt;/p&gt;&lt;p&gt;In a series of linked essays that span place, time, and discipline, Jeffrey Jerome Cohen brings together writers who illustrate the vibrant worlds formed by colors. Organized by the structure of a prism, each chapter explores the coming into existence of nonanthropocentric ecologies. “Red” engages sites of animal violence, apocalyptic emergence, and activism; “Maroon” follows the aurora borealis to the far North and beholds in its shimmering alternative modes of world composition; “Chartreuse” is a meditation on postsustainability and possibility within sublime excess; “Grey” is the color of the undead; “Ultraviolet” is a potentially lethal force that opens vistas beyond humanly known nature.&lt;/p&gt;&lt;p&gt;Featuring established and emerging scholars from varying disciplines, this volume presents a collaborative imagining of what a more-than-green ecology offers. While highlighting critical approaches not yet common within ecotheory, the contributions remain diverse and cover a range of topics including materiality, the inhuman, and the agency of objects. By way of color, Cohen guides readers through a reflection of an essentially complex and disordered universe and demonstrates the spectrum as an unfinishable totality, always in excess of what a human perceives.&lt;/p&gt;&lt;p&gt;Contributors: Stacy Alaimo, U of Texas at Arlington; Levi R. Bryant, Collin College; Lowell Duckert, West Virginia U; Graham Harman, American U in Cairo; Bernd Herzogenrath, Goethe U of Frankfurt; Serenella Iovino, U of Turin, Italy; Eileen A. Joy; Robert McRuer, George Washington U; Tobias Menely, Miami U; Steve Mentz, St. John’s U, New York City; Timothy Morton, Rice U; Vin Nardizzi, U of British Columbia; Serpil Oppermann, Hacettepe U, Ankara; Margaret Ronda, Rutgers U; Will Stockton, Clemson U; Allan Stoekl, Penn State U; Ben Woodard; Julian Yates, U of Delaware.&lt;BR&gt;&lt;BR&gt;&lt;/p&gt;&lt;/div&gt;',1,304.20000000,840465541,'BD581',914,911,0,'304.2 C678',1,NULL,0,0,NULL),(357,NULL,'978-0692299302','Inhuman nature','EN','Oliphaunt Books',144,2014,'Bogost, Ian | Cohen, Jeffrey Jerome [Editor]',NULL,NULL,'FSUS058',NULL,'inhuman-nature','2016-12-23 22:01:25','2021-01-31 16:33:41',15,'51EMhnatItL.jpg','image/jpeg',54271,313,500,'Gathering into lively conversation scholars in medieval, early modern and object studies, Inhuman Nature explores the activity of the things, forces, and relations that enable, sustain and operate indifferently to us. Enamored by fictions of environmental sovereignty, we too often imagine “human” to be a solitary category of being. This collection of essays maps the heterogeneous and asymmetrical ecologies within which we are enmeshed, a material world that makes the human possible but also offers difficulties and resistance. Among the topics explored are the futurity that inheres in storms and wrecks, wood that resists its burning or offers art and dwelling, hymns that implant themselves like viruses, the ontology of everyday objects, the seep and flow of substance, the resistant nature of matter, the dependence of community upon making things public, and the interstices at which nature and culture become inseparable.  Tinker as you will.  TABLE OF CONTENTS // Jeffrey Jerome Cohen — Introduction: Ecostitial / Steve Mentz — Shipwreck / Anne Harris — Hewn / Alan Montroso — Human / Valerie Allen — Matter / Lowell Duckert — Recreation / Alfred Kentigern Siewers — Trees / James Smith — Fluid / Ian Bogost — Inhuman',3,128.00000000,892344841,'BD450',42,42,0,'128 B674',1,NULL,0,0,NULL),(358,NULL,'978-0-262-01999-6','Synthetic aesthetics : investigating synthetic biology\'s designs on nature','EN','The MIT Press',376,2014,'Ginsberg, Alexandra Daisy, | Calvert, Jane, [Author; Contributor] | Elfick, Alistair, [Author; Contributor] | Schyfter, Pablo, [Author; Contributor] | Endy, Andrew D., [Author; Contributor] | Endy, Drew [Author]',NULL,NULL,'FSUS060',NULL,'synthetic-aesthetics-investigating-synthetic-biology-s-designs-on-nature','2016-12-23 22:01:25','2021-01-31 18:37:33',15,'51Cr6fO1PaL.jpg','image/jpeg',51109,446,500,'&lt;p&gt;Synthetic biology manipulates the stuff of life. For synthetic biologists, living matter is programmable material. In search of carbon-neutral fuels, sustainable manufacturing techniques, and innovative drugs, these researchers aim to redesign existing organisms and even construct completely novel biological entities. Some synthetic biologists see themselves as designers, inventing new products and applications. But if biology is viewed as a malleable, engineerable, designable medium, what is the role of design and how will its values apply?&lt;/p&gt;&lt;p&gt;In this book, synthetic biologists, artists, designers, and social scientists investigate synthetic biology and design. After chapters that introduce the science and set the terms of the discussion, the book follows six boundary-crossing collaborations between artists and designers and synthetic biologists from around the world, helping us understand what it might mean to \'design nature.\' These collaborations have resulted in biological computers that calculate form; speculative packaging that builds its own contents; algae that feeds on circuit boards; and a sampling of human cheeses. They raise intriguing questions about the scientific process, the delegation of creativity, our relationship to designed matter, and, the importance of critical engagement. Should these projects be considered art, design, synthetic biology, or something else altogether?&lt;/p&gt;&lt;p&gt;Synthetic biology is driven by its potential; some of these projects are fictions, beyond the current capabilities of the technology. Yet even as fictions, they help illuminate, question, and even shape the future of the field. &lt;/p&gt;',3,610.28400000,835887515,'QP517.B56',1140,911,0,'610.284 G492',1,NULL,0,0,NULL),(359,'','9781451691597','Rust : the longest war','EN','Simon & Schuster',290,2015,'Waldman, Jonathan','','','FSUS063','John W. Fail ','rust','2016-12-23 22:01:25','2021-01-31 16:14:55',15,'41uJCQOttdL.jpg','image/jpeg',32234,331,500,'&lt;b&gt;Finalist for the &lt;i&gt;Los Angeles Times&lt;/i&gt; Book Prize ** A &lt;i&gt;Wall Street Journal &lt;/i&gt;Best Book of the Year&lt;/b&gt;&lt;BR&gt; &lt;BR&gt;It has been called “the great destroyer” and “the evil.” The Pentagon refers to it as “the pervasive menace.” It destroys cars, fells bridges, sinks ships, sparks house fires, and nearly brought down the Statue of Liberty. Rust costs America more than $400 billion per year—more than all other natural disasters combined.&lt;BR&gt;&lt;BR&gt;In a thrilling drama of man versus nature, journalist Jonathan Waldman travels from Key West, Florida, to Prudhoe Bay, Alaska, to meet the colorful and often reclusive people who are fighting our mightiest and unlikeliest enemy. He sneaks into an abandoned steelworks with a brave artist, and then he nearly gets kicked out of Ball Corporation’s Can School. Across the Arctic, he follows a massive high-tech robot that hunts for rust in the Alaska pipeline. On a Florida film set he meets the Defense Department’s rust ambassador, who reveals that the navy’s number one foe isn’t a foreign country but oxidation itself. At Home Depot’s mother ship in Atlanta, he hunts unsuccessfully for rust products with the store’s rust-products buyer—and then tracks down some snake-oil salesmen whose potions are not for sale at the Rust Store. Along the way, Waldman encounters flying pigs, Trekkies, decapitations, exploding Coke cans, rust boogers, and nerdy superheroes.&lt;BR&gt; &lt;BR&gt;The result is a fresh and often funny account of an overlooked engineering endeavor that is as compelling as it is grand, illuminating a hidden phenomenon that shapes the modern world. Rust affects everything from the design of our currency to the composition of our tap water, and it will determine the legacy we leave on this planet. This exploration of corrosion, and the incredible lengths we go to fight it, is narrative nonfiction at its very best—a fascinating and important subject, delivered with energy and wit.',1,620.11223000,883147999,'TA418.74',1136,1119,0,'620.11223 W164',1,NULL,0,0,NULL),(360,NULL,'978-0552151740','A short history of nearly everything','EN','Black Swan',686,2004,'Bryson, Bill',NULL,NULL,'FSUS062','John W. Fail ','a-short-history-of-nearly-everything','2016-12-23 22:01:25','2021-01-31 18:30:13',15,'51ufHqo3EPL.jpg','image/jpeg',36941,316,500,'This brand-new edition of the colossal bestseller is lavishly illustrated to convey, in pictures as in words, Bill Bryson\'s exciting, informative journey into the world of science.&lt;br&gt;&lt;br&gt;In this acclaimed bestseller, beloved author Bill Bryson confronts his greatest challenge yet: to understand — and, if possible, answer — the oldest, biggest questions we have posed about the universe and ourselves. Taking as territory everything from the Big Bang to the rise of civilization, Bryson seeks to understand how we got from there being nothing at all to there being us. The result is a sometimes profound, sometimes funny, and always supremely clear and entertaining adventure in the realms of human knowledge, as only Bill Bryson can render it.&lt;br&gt;&lt;br&gt;Now, in this handsome new edition, Bill Bryson\'s words are supplemented by full-colour artwork that explains in visual terms the concepts and wonder of science, at the same time giving face to the major players in the world of scientific study. Eloquently and entertainingly described, as well as lavishly illustrated, science has never been more involving or entertaining.',3,500.00000000,51496460,'Q162',6857,6480,0,'500 B915',1,NULL,0,0,NULL),(361,'ISSN 1822-3818','null','Acta Historiae Artium Balticae. Artistic Identity','EN/DE','VDA',184,2005,'Mickūnaitė, Giedrė','null','null','VDA002','null','acta-historiae-artium-balticae-artistic-identity','2016-12-23 22:01:25','2021-02-09 19:14:46',5,NULL,NULL,NULL,NULL,NULL,'null',1,700.10000000,0,NULL,NULL,NULL,1,'700.1 G454',1,'undefined',1,0,NULL),(362,NULL,'978-609-447-008-0','Vytautas Pakalnis : vytux','LT/EN','VDA',150,2011,'Brazauskaitė, Vaidilutė',NULL,NULL,'VDA003',NULL,'vytautas-pakalnis','2016-12-23 22:01:25','2021-02-09 19:15:00',5,NULL,NULL,NULL,NULL,NULL,NULL,1,760.00000000,855049210,'ND955.L573',NULL,3,0,'760 V128',1,NULL,0,0,NULL),(363,'ISSN 1392-8635',NULL,'Mare Nostrum','EN','VDA',140,1994,'Rowell, Stephen C.',NULL,NULL,'VDA005',NULL,'mare-nostrum','2016-12-23 22:01:25','2021-02-09 19:14:49',5,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(364,'null','978-9955-854-86-9','Meno celės: Vilniaus dailės akademijos magistrai 2010 / Vilnius Academy of Arts MFA Graduates 2010','LT','VDA',160,2010,'Pikelienė, Onutė','null','null','VDA006','null','meno-celes-vilniaus-dailes-akademijos-magistrai-2010-vilnius-academy-of-arts-mfa-graduates-2010','2016-12-23 22:01:25','2021-02-09 19:08:37',5,NULL,NULL,NULL,NULL,NULL,'null',1,707.40000000,0,NULL,NULL,NULL,1,'707.4 P636',1,'undefined',1,0,NULL),(365,'null','978-9955-854-16-6','Modernios Lietuvos dailės ištakos: Kauno meno mokykla','LT','VDA',183,2008,'Raimonda Kogelytė-Simanaitienė','null','null','VDA008','null','modernios-lietuvos-dailes-istakos-kauno-meno-mokykla','2016-12-23 22:01:25','2021-0