 Mikalojaus Vorobjovo monografijai Vilniaus menas, XIX-XX a. pradzios Vilniaus ikonografijai aptarti). Tesiama Acta Academiae Artium Vilnensis 55 numeryje pradeta Sapiegu rumu Antakalnyje inventoriu publikacija, papildyta issamiais komentarais.',1,709.47930000,794968614,'N7255.L572',NULL,4,0,'709.4793 B983',1,'undefined',1,0,NULL),(382,'null','978-9955-854-48-7','Dangiškieji globėjai, žemiškieji mecenatai','LT','VDA',227,2011,'Butrimas, RAdomas','null','null','VDA029','null','dangiskieji-globejai-zemiskieji-mecenatai','2016-12-23 22:01:25','2021-02-09 18:49:54',5,NULL,NULL,NULL,NULL,NULL,'null',1,201.67000000,0,NULL,NULL,NULL,1,'201.67 B983',1,'undefined',1,0,NULL),(383,'null','978-609-447-001-1','Menas kaip socialinis diskursas = : art as a social discourse','LT/EN','VDA',212,2010,'Narusyte, Agne','null','null','VDA030','null','menas-kaip-socialinis-diskursas','2016-12-23 22:01:25','2021-02-01 21:51:54',5,NULL,NULL,NULL,NULL,NULL,'null',1,709.47930000,794968616,'N7255.L57',NULL,3,0,'709.4793 N237',2,'undefined',1,0,NULL),(384,'null','978-609-447-003-5','Meno idėjų migracija XX a.pradžioje : M.K. Čiurlionio ir amžininkų kūryba = The migration of art ideas at the early 20th century : the creation of M.K. Čiurlionis and his contemporaries','LT/EN','VDA',151,2010,'Butrimas, RAdomas','null','null','VDA032','null','meno-ideju-migracija-xx-a-pradzioje-m-k-ciurlionio-ir-amzininku-kuryba','2016-12-23 22:01:25','2021-02-09 18:45:48',5,NULL,NULL,NULL,NULL,NULL,'null',1,759.79300000,794968617,'ND699.C6',NULL,1,0,'759.793 B983',1,'undefined',1,0,NULL),(385,NULL,'978-9955-854-98-2','Vytautas Edmundas Čekanauskas','LT','VDA',206,2011,'Mačiulis, Algimantas',NULL,NULL,'VDA033',NULL,'vytautas-edmundas-cekanauskas','2016-12-23 22:01:25','2021-01-31 17:25:18',5,NULL,NULL,NULL,NULL,NULL,NULL,1,307.09000000,775746046,'NA1455.L573',NULL,5,0,'307.09 M217 Vyt',2,NULL,0,0,NULL),(386,'9986-571-62-6','null','Literatūros filosofija','LT','VDA',151,2001,'Daujotytė, Viktorija','null','null','VDA