LL,NULL,NULL,'null',1,779.09479300,0,NULL,NULL,NULL,1,'779.094793 A366',2,'undefined',1,0,NULL),(396,'null','978-609-8032-03-1','Devynios fotografijos pamokos / Nine lessons of photography','LT/EN','Kaunas Photo festivalis',143,2009,'Kavaliauskas, Mindaugas','null','null','LT.MP007','null','devynios-fotografijos-pamokos-nine-lessons-of-photography','2016-12-23 22:01:25','2021-02-08 14:22:58',3,NULL,NULL,NULL,NULL,NULL,'null',1,771.00000000,0,NULL,NULL,NULL,1,'771 K11',1,'undefined',0,0,NULL),(397,'null','978-9955-854-96-8','The aesthetics of boredom : Lithuanian photography 1980-1990','EN','Vilniaus dailės akademijos leidykla',350,2010,'Narušytė, Agnė','null','null','LT.MP008','null','the-aesthetics-of-boredom-lithuanian-photoraphy-1980-1990','2016-12-23 22:01:25','2021-02-08 17:34:53',3,'51zPIqnN4OL.jpg','image/jpeg',58204,348,500,'This book discusses boredom as an aesthetic category that helps to explain a tendency in late 20th c. art to focus on everyday things, avoid definite meaning or create nothing . The aesthetics of boredom result from a paradoxical situation when aesthetic experiences are created from banality the very phenomenon that artists try to escape from. Such an attitude of indifferent detachment from Soviet reality formed into a strong artistic statement in Lithuanian photography of the 1980s when photographers not only represented the boring existence in the USSR, but also emphasised the banality of environment and emptiness of space through visual monotony. They replaced the decisive moment with chance and tried to slow the time of the photograph thus focusing on the value of the eventless present moment.',1,770.94793000,746763820,'TR647',1,8,0,'770.94793 N237',1,'undefined',0,0,NULL),(398,'null','null','Alfonsas Budvytis','LT/EN','Soros Center for Contemporary Arts – Lithuania',0,1997,'Jurėnaitė ,Raminta','null','null','LT.MP009','null','alfonsas-budvytis','2016-12-23 22:01:25','2021-02-08 14:22:29',3,NULL,NULL,NULL,NULL,NULL,'null',1,779.09200000,0,NULL,NULL,NULL,1,'779.092 B927',1,'undefined',1,0,'Budvytis, Alfonsas'),(400,'null','978-609-447-029-5','LTSR fotografijos meno draugija - vaizdų gamybos tinklas','LT','Vilniaus dailės akademijos leidykla',388,2011,'Michelkevičius, Vytautas','null','null','LT.MP011','null','ltsr-fotografijos-meno-draugija-vaizdu-gamybos-tinklas','2016-12-23 22:01:25','2021-02-09 14:35:19',3,NULL,NULL,NULL,NULL,NULL,'null',1,770.94793000,802458193,NULL,2,NULL,0,'770.94793 M623 Lts',5,'undefined',0,0,NULL),(402,NULL,'978-609-447-002-8','Žmogus Lietuvos fotografijoje : požiūrių kaita XX. ir XXI. a. sandūroje','LT','Vilniaus dailės akademijos leidykla',222,2010,'Pabedinskas, Tomas, 1980-',NULL,NULL,'LT.MP013',NULL,'zmogus-lietuvos-fotografijoje-poziuriu-kaita-xx-ir-xxi-a-sanduroje','2016-12-23 22:01:25','2021-01-31 16:14:59',3,'21kP1Dt37eL.jpg','image/jpeg',5315,170,228,'Knygoje analizuojami svarbus Lietuvos fotografijos pokyciai, isryskeje XX a. pabaigoje. Dalis tuomet sukurtos fotografijos netese humanistiniu Lietuvos fotografijos mokyklos tradiciju ir apskritai neatitiko iprastu fotografijos meniskumo kriteriju. Fotografai ir kiti menininkai eme kurti neisraiskinga fotografija, skatinancia refleksyvu poziuri i zmogu ir jo aplinka. Si poziuriu kaita monografijoje atskleidziama analizuojant ir lyginant skirtingu laikotarpiu bei stiliu lietuviu autoriu darbus. Daugiausia demesio skiriama amziu sanduroje isryskejusioms zmogaus traktuotes fotografijoje tendencijoms - jos aptariamos pasitelkiant tarpdisciplininius tyrimo metodus. Monografija suteikia teorini pagrinda, kurio reikia siuolaikines fotografijos supratimui, ir paaiskina kurybine praktika, kurioje skleidziasi ivairus zmogaus tapatybes ir jo fotografinio atvaizdo santykiai.http://issuu.com/fotografijosistorijos/docs/zmogus-lietuvos-fotografijoje',1,770.94793000,828101475,'TR95.L78',NULL,1,0,'770.94793 P111',1,NULL,0,0,NULL),(403,'','978-609-447-025-7','Nihil obstat : Lietuvos fotografija sovietmečiu','LT','Vilniaus dailės akademijos leidykla',282,2011,'Matulytė, Margarita','','','LT.MP014/LT.MP045','','nihil-obstat-lietuvos-fotografija-sovietmeciu','2016-12-23 22:01:25','2021-02-08 17:27:00',3,NULL,NULL,NULL,NULL,NULL,'',1,770.94793000,778957660,'TR642',2,3,0,'770.94793 M445',2,'undefined',0,0,NULL),(404,'null','978-609-447-033-2','The Lithuanian SSR Society of Art Photography (1969-1989) : an image production network','EN','Vilnius Academy of Arts Press',416,2011,'Michelkevičius, Vytautas','null','null','LT.MP016','null','the-lithuanian-ssr-society-of-art-photography-1969-1989-an-image-production-network','2016-12-23 22:01:25','2021-02-08 13:54:47',3,'41mYFmOVybL.jpg','image/jpeg',21511,323,500,'This book is about the power of photography and the network it formed in everyday life and art of Lithuania in 1969 1989.  The monograph reveals how a specific usage of the medium art photography emerged in Lithuania in the 1960s-1980s. It examines the way in which photography became established as a new artistic medium; identifies the dominant types of subject matter that existed at that time and provides reasons for their popularity, and examines the nature of the interaction between art photographers individual intentions and collective Socialist Realism principles. The monograph also looks at the factors that enabled the photography institution (the LSSR Society of Art Photography) to become a highly efficient laboratory for the production and distribution of images; an institution which was well-known throughout the Soviet Union, as well as th West. This book is not just an account of the way in which one could become an artist and a renowned photographer during Soviet times, or what was at play in the sphere of everyday media culture at that time, but also an engaging exhibition of both previously unpublished archive shots and famous art photography works, as well as posters that were produced to advertise the photography exhibitions of that era.',1,770.94793000,815723710,'TR95.L78',8,8,0,'770.94793 M623',2,'undefined',0,0,NULL),(405,'null','978-609-95146-5-9','Legendiniai Žalgirio vyrai / Legendary men of Žalgiris','LT/EN/RU','Lietuvos fotomenininkų sąjungos Kauno skyrius',0,2011,' Česonis, Gintaras','null','null','LT.MP018','null','legendiniai-zalgirio-vyrai','2016-12-23 22:01:25','2021-02-08 14:15:51',3,NULL,NULL,NULL,NULL,NULL,'null',1,779.09479300,0,NULL,NULL,NULL,1,'779.094793 P745',1,'undefined',1,0,'Požerskis, Romualdas; Rakauskas, Romualdas;'),(406,'null','978-9955-834-00-7','Mapping Lithuanian photography : histories and archives : photo- carto- historio-graphies = Fotografijos, istorijos, žemėlapiai : foto- karto- istorio-grafijos','LT/EN','MENE/ 3xpozicija.lt',223,2007,'Michelkevičius, Vytautas; Narušytė, Agnė; Michelkevičė, Lina','null','null','LT.MP019','null','fotografijos-istorijos-zemelapiai-foto-karto-istorio-grafijos','2016-12-23 22:01:25','2021-02-09 14:31:46',3,'41jwOYOmj4L.jpg','image/jpeg',32137,317,500,'This is a catalogue of two exhibitions and a collection of essays on photography, history, cinema and mapping. &lt;BR&gt; The event called photo/carto/historio/graphies is an artistic research project, which uses cartographic strategies to rethink the developments, ideas and stereotypes of Lithuanian photography. The essays published here discuss the re/creation of history and visual constructions of history in cinema, contemporary art and particularly photography. Everything that could not be included into the book (videos, internet comments, etc.) can be found in the project s blog 3xpozicija.lt/kartografija The book is billingual in English and Lithuanian. The reader will find in this volume not only theoretical and philosophical insights, but also many examples from the history of Lithuania, documentary cinema and television films, photography, contemporary and new media art. &lt;BR&gt; &lt;BR&gt; The book starts with the discussion of the curators about the project and issues it raises; the German art historian Rudolf Frieling has contributed his paper about the links between maps, media, art, archives and text and their representation in contemporary art. The historian Ruta Sermuksnyte discusses representations of the past in film and television and Vasilijus Safronovas analyses the role of power in the formation of history. The textual part of the book ends with a playful essay by the art critic Valentinas Klimasauskas who wanders between photography and reality. A very important component of the book consists of maps and schemes created by the participants of the project; also artists works and documentation of exhibitions. The first exhibition at the Prospekto Gallery included maps and other objects, documentation of the performance and artists works. The second exhibition at the Vilnius Photographic Gallery showed an installation by Milda Zabarauskaite and Robertas Narkus.',1,770.94793000,980318077,'TR95.L78',NULL,2,0,'770.94793 V996',3,'undefined',0,0,NULL),(407,'null','null','Gintautas Trimakas','LT/EN','Soros Center for Contemporary Arts – Lithuania',0,1997,'Jurėnaitė, Raminta','2 copies','null','LT.MP020','null','gintautas-trimakas','2016-12-23 22:01:25','2021-02-09 08:00:08',3,NULL,NULL,NULL,NULL,NULL,'null',1,779.09200000,0,NULL,NULL,NULL,1,'779.092 T831 Gin',1,'undefined',1,0,'Trimakas, Gintautas'),(409,'null','978-609-427-003-1','Žaliasis tiltas','LT','Kitos knygos',239,2009,'Šeškus, Algirdas, 1945-','null','Serija: Kita fotografija','LT.MP023','null','algirdas-seskus-zaliasis-tiltas','2016-12-23 22:01:25','2021-02-09 07:46:46',3,'11EaSorwJJL.jpg','image/jpeg',3985,170,190,'\"Zaliasis tiltas\" - vieno pirmuju lietuviskos fotografijos avangardistu Algirdo Seskaus knyga, kurioje santykiai su natura ir pati zmoniu natura atskleidziami 30-ies metu retrospektyvoje. Tai momentinio dabarties ispudzio aprasymas, apipavidalintas vaizdu ir vaizdiniu seka. Zaliojo tilto gyvenimas persipina judesiu is baleto scenu, ir nebudamas scena is spektaklio pasakoja gatves gyvenima, persmelkta kulturos. Zaliojo tilto baletas tarsi skraiste visam kam, kas romane vyksta. Vaizdai tarsi pasamones srautas byra ant Vilniaus ir sukuria astunto - devinto desimtmecio Vilniu, kuriame branginamas zmogus ir jo pasireiskimai. Cia, po trisdesimties metu atsakoma i klausima: \"kaip avangarde jauciasi zmogus?\"',1,779.09200000,727107241,'TR655',NULL,4,0,'779.092 S493 Ali',1,'undefined',0,0,NULL),(410,'null','978-9955-640-59-2','Alvydas Lukys. Būtasis tęstinis / Alvydas Lukys. Past continuous','LT/EN','Kitos knygos',143,2008,'Matulytė, Margarita','null','Serija: Kita fotografija','LT.MP024','null','alvydas-lukys-butasis-testinis-alvydas-lukys-past-continuous','2016-12-23 22:01:25','2021-02-08 14:14:31',3,NULL,NULL,NULL,NULL,NULL,'null',1,779.09200000,0,NULL,NULL,NULL,1,'779.092 L954',1,'undefined',1,0,'Lukys, Alvydas'),(411,'null','978-9955-659-40-2','Stasys Povilaitis. Aberacijos / Aberration','LT/EN','Amalkeros leidyba',71,2011,'Povilaitis, Stasys','null','null','LT.MP025','null','stasys-povilaitis-aberacijos-aberration','2016-12-23 22:01:25','2021-02-08 14:13:57',3,NULL,NULL,NULL,NULL,NULL,'null',1,779.09200000,0,NULL,NULL,NULL,1,'779.092 P739',1,'undefined',0,0,NULL),(412,'null','978-609-426-010-0','Archyvas (Pohulianka) : [1975 - 1983 metų fotografijos]','LT','Lietuvos Dailės Muziejus',311,2010,'Šeškus, Algirdas, 1945-','null','null','LT.MP026','null','algirdas-seskus-archyvas-pohulianka','2016-12-23 22:01:25','2021-02-09 07:46:46',3,NULL,NULL,NULL,NULL,NULL,'null',1,779.09200000,1185374142,NULL,1,NULL,0,'779.092 S493 Arc',1,'undefined',0,0,NULL),(413,'null','978-9955-438-53-3','Domiciele Tarabildiene : \"nosis\" laikui = challenge to time','LT/EN','Lietuvos fotomenininkų sąjunga',47,2012,'Tarabildienė, Domicelė, 1912-1985','null','null','LT.MP027','null','domicele-tarabildiene-nosis-laikui-challange-to-time','2016-12-23 22:01:25','2021-02-09 07:58:33',3,NULL,NULL,NULL,NULL,NULL,'null',1,779.09200000,976433869,'TR653',NULL,1,0,'779.092 T177',1,'undefined',0,0,NUL