terested in history, culture and nature of the country they are visiting. This book differs from other introductions to Lithuania in its broad historical and cultural context and careful selection of important sites and objects. Perfectly designed to present the diverse and copious amount of information in an easily readable style. \nThe text is well illustrated with numerous beautiful images of buildings, monuments, and landscapes. The guide can even be utilized as a valuable correspondence introduction to the interesting sights of Lithuania.\nThe book\'s 11 chapters encompass Lithuania\'s 10 regions, and the city of Vilnius. A concise history of Vilnius, Kaunas, Klaipeda, and important facts from the past of other cities and villages provide historical depth to their present-day form. Sections on the national parks of Aukštaitija, Dzūkija, Žemaitija, the Curonian Spit, and the Trakai reveal the diversity of their nature, history, and ethnography. Here you will find descriptions of the most interesting architectural monuments (religious sanctuaries, public buildings, estates, mills and bridges), works of art (sacral paintings, memorials, crosses and chapels), the wonders of nature (parks, lakes, rivers, rocks, hills and trees), museums, historical sites, etc. \n\nAbout the Author: Giedre Jankevichute is an art historian, a broad-minded academic and author of many publications in her field, who also happens to be a passionate and observant traveler.\nGraphic Designer: Isaac Zibuts\nPhotographers: A.Aleksandravicius, A. Baltenas, K. Driskius, V. Knya, A. Luksenas, Z. Nekrosius, R. Paknys, K. Stoskus, G. Treciokas, R. Urbakavicius.\nMaps: \'Briedis\' Publishers.',1,914.73000000,123434737,'DK505.22',NULL,11,0,'914.73 J33',1,'undefined',0,0,NULL),(449,NULL,NULL,'Kovo Vėjas','LT','Kovo',23,2011,'Vytautas Landsbergis',NULL,NULL,'LT023',NULL,'kovo-vejas','2016-12-23 22:01:26','2021-01-23 17:35:21',2,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0