nd 70s. Adopting as its starting point the postwar perception of Scandinavia as a socialist utopia of sexual freedom, it explores how the avant-garde artistic and cultural production of the time gravitated towards sexual and political liberation. &lt;I&gt;Whatever Happened to Sex in Scandinavia?&lt;/I&gt; is the conclusion of a four-year research project, and includes many texts published in English here for the first time, by philosophers, artists, psychologists and theorists such as Knut Ove Arntzen, Stan Brakhage, Norman O. Brown, Valie Export, Öyvind Fahlström, Herbert Marcuse, Jonas Mekas, Henry Miller, Juliet Mitchell, Katti Anker Møller, Jørgen Nash, Håvard Friis Nilsen, Claes Oldenburg, Elise Ottesen-Jensen, Wilhelm Reich, Yvonne Rainer, Jacqueline Rose, Barney Rosset, Barbara Rubin, Jens Jørgen Thorsen and Otto Weininger.',1,700.41100000,775736250,'N6490',2,5,0,'700.411 B724',1,'undefined',1,0,NULL),(624,NULL,'978-2906732919','Avec la Session 23 de l\'ecole du Magazin','EN/FR','Magasin – cnac',43,2014,'Astier, Claire; Bonino, Paolo; Bortoluzi, Giulia; Boskalio, Sema',NULL,NULL,'CAT',NULL,'avec-la-session-23-de-l-ecole-du-magazin','2016-12-23 22:01:27','2021-01-26 17:06:35',20,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,'Claire Astier, Paolo Bonino, Giulia Bortoluzzi, Selma Boskalio, Neringa Bumblienė, Anna Tomczak',0,0,NULL),(625,'null','978-1-9064412-6-5','Zone','EN','Artwords Press',63,2011,'Bate, David, 1956-','null','null','CAT195','null','zone','2016-12-23 22:01:27','2021-02-09 07:54:41',20,NULL,NULL,NULL,NULL,NULL,'null',1,779.09200000,797180551,NULL,10,NULL,0,'779.092 B329',1,'undefined',0,0,NULL),(626,NULL,NULL,'Wald','DE','The Hague',16,2012,'Körbes, Jan',NULL,NULL,'CAT196',NULL,'wald','2016-12-23 22:01:27','2021-01-31 18:42:32',20,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,858012307,'SD421',3,3,0,NULL,1,NULL,0,0,NULL),(627,'null','null','Public Art in Kaliningrad. Transformation of public spaces.','EN/RU','Baltic Branch of the Nati