trasbourg est enfin libérée par les alliés. La reconstruction est en marche. Au titre des dommages de guerre, elle recevra des bons d\'achat qui lui permettront d\'acquérir, dans les années 70, le fonds Soennecken - une collection particulière de calligraphie qui avait appartenu à l\'industriel allemand Friedrich Soennecken (fabricant de plumes et outils de bureau). Ce magnifiques fonds a dormi de longues années sur quelques étagères oubliées de la Bibliothèque Nationale Universitaire de Strasbourg avant d\'être remis en lumière par plusieurs projets initiés par la ville, dont celui d\'éditer, avec la complicité des éditions 2024, un abécédaire. Sous la direction de Guillaume Dégé, celui-ci mêle des lettres récentes conçues et dessinées par dix illustrateurs talentueux : Guillaume Chauchat, Simon Thompson, Juliette Binet, Clara Markman, Christophe Jacquet, Joëlle Merizen, Clément Paurd et Marie Saarbach.',1,745.61000000,863176456,NULL,9,NULL,0,'745.61 D532',1,NULL,0,0,NULL),(643,NULL,NULL,'Page sucker_numero un_skull.jpg','EN','Assoc. tux-tv.net',210,2002,'Burel, Ludovic',NULL,NULL,'CAT213',NULL,'page-sucker_numero-un_skull-jpg','2016-12-23 22:01:27','2021-01-31 19:55:16',20,NULL,NULL,NULL,NULL,NULL,NULL,1,94.40000000,552147450,NULL,1,NULL,0,'094.4 B952',1,NULL,0,0,NULL),(644,NULL,'978-2-917053-13-3','Archives du biopouvoir : Marseille, 18e-20e siècles','FR','Conseil General',190,2011,'Artieres, Philippe; Burel, Ludovic',NULL,NULL,'CAT214',NULL,'archives-du-biopouvoir-marseille-18e-20e-siecles','2016-12-23 22:01:27','2021-01-31 16:15:14',20,'417tHhX8loL.jpg','image/jpeg',20431,361,500,NULL,1,307.76094491,779697125,'HV9669.M37',13,8,0,'307.76094491 A784',1,NULL,0,0,NULL),(645,'null','978-952-93-4588-5','AIB 12/14 : Art Ii Biennale 2014','FI/EN','Taidekeskus KulttuuriKauppila',94,2014,'Karvonen, Senni','null','null','CAT215','null','aib-12-14-art-ii-biennale-of-northen-environmental-and-sculpture-art','2016-12-23 22:01:27','2021-02-06 15:06:19',20,NULL,NULL,NULL,NULL,