lder',NULL,NULL,'CAT221',NULL,'museum-off-museum','2016-12-23 22:01:27','2021-01-31 16:15:17',20,'41oJyZsUXwL.jpg','image/jpeg',25098,353,500,'An artwork in itself, the catalog Museum off Museum accompanies a two-part&lt;br&gt;exhibition held over five months at Bielefelder Kunstverein in which seven artists&lt;br&gt;explore the museum as a space of reflection. The exhibition, curated by Thomas&lt;br&gt;Thiel, comprised multiple artistic and scientific approaches to museum-based&lt;br&gt;narrative including installations, talks and a blog. The book beautifully documents&lt;br&gt;each of the exhibition phases and clearly presents the many contributions to this&lt;br&gt;substantial project. Its episodic organization suggests its encyclopedic nature.&lt;br&gt;Designed in large-format hardcover with full-color broadsheet-scaled pages printed&lt;br&gt;on newsprint, many of the sections are accompanied by extensive footnotes.&lt;br&gt;The work of artists Ozlem Altin, Kader Attia, Isabel Cornaro, Simon Fujiwara,&lt;br&gt;Camille Henriot, Jeremy Deller &amp; Bruce Lacey, Slavs and Tatars among many other&lt;br&gt;contributors comprise more than 30 artistic and scientific statements in the form&lt;br&gt;of essays, interviews, visual statements and exhibition documents.',1,700.41100000,900220826,'N6497',48,49,0,'700.411 T431',1,NULL,0,0,NULL),(652,NULL,'978-3-99043-654-7','Getting things done : evolution of the built environment in Vorarlberg','EN/DE','Brikhauser',365,2014,'Wolfgang Fiel',NULL,NULL,'CAT222',NULL,'getting-things-done-evolution-of-the-built-environment-in-vorarlberg','2016-12-23 22:01:27','2021-01-31 16:48:52',20,'41nAG4SUZwL.jpg','image/jpeg',23343,357,500,'Vorarlberg is the most westerly and the smallest of all the federal states in Austria. The region has seen its building culture develop along a special path with a movement beginning in the late 1950s and early 1960s that has been labelled the Vorarlberger Bauschule (Vorarlberg School of Building), a name that resonates far beyond local and national borders and is now represented by a relatively high density of quality architecture.',3,16.94300000,906179110,'NA1009.V6',8,8,0,'16.943 W859',1,NULL,0,0,NULL),(653,NULL,'978-2906732919','Liam Gillick','EN/FR','Centre National d\'Art Contemporain',46,2014,'Yves Aupetitallot',NULL,NULL,'CAT223',NULL,'liam-gillick','2016-12-23 22:01:27','2021-02-06 13:28:02',20,NULL,NULL,NULL,NULL,NULL,NULL,1,709.20000000,NULL,NULL,NULL,NULL,1,'709.2 Y98',1,NULL,0,0,NULL),(654,'null','978-6094471438','Displace : a Migrating Art Academies compendium of ideas','EN','Vilnius Academy of Arts Press',511,2014,'Mindaugas Gapševičius','null','null','CAT224','null','displace','2016-12-23 22:01:27','2021-02-08 15:53:14',20,NULL,NULL,NULL,NULL,NULL,'null',1,707.80000000,921298344,'N82',NULL,3,0,'707.8 M663',4,'undefined',0,0,NULL),(655,'null','978-3-944669-78-6','Art in times of gray democracy : Ulf Aminde, Pablo Helguera, Alexandra Pirici','DE/EN','Kulturstiftung des Bundes',75,2015,'Kurz, Julia','null','null','CAT225','null','art-in-times-of-gray-democracy','2016-12-23 22:01:27','2021-02-05 17:48:08',20,'51ZGO2tmA4L.jpg','image/jpeg',59293,371,500,'Can art stimulate and sustain political participation in established democracies?&lt;br&gt;With this question in mind, visual and performing arts curator Joanna Warsza&lt;br&gt;invited three artists Alexandra Pirici, Pablo Helguera and Ulf Aminde to&lt;br&gt;Leipzig to create three projects in public and semipublic spaces. Pirici staged a&lt;br&gt;choreographic intervention at the Monument to the Battle of the Nations;&lt;br&gt;Helguera, an improvised speaking choir; and Aminde, a dress rehearsal for an&lt;br&gt;art strike. Part of the Performative Democracy series (title taken from the book by&lt;br&gt;Polish sociologist Elzbieta Matynia), these happenings highlight the significance&lt;br&gt;of politically active art. Produced in an oversized magazine-like format, Art in&lt;br&gt;Times of Gray Democracy concludes the Performative Democracy series with a&lt;br&gt;wide variety of texts, including an interview with Matynia and conversations with&lt;br&gt;the artists, addressing art s potential to shape and influence politics.',1,709.05100000,898295483,'N6497',24,24,0,'709.051 K95',1,'undefined',0,0,NULL),(657,NULL,NULL,'Survival Kit 6. Utopian City','LV/EN','Laikmetigas Makslas Centrs, Riga',106,2014,'Mikelsons, Valts; Micule, Santa',NULL,NULL,'CAT227',NULL,'survival-kit-6-utopian-city','2016-12-23 22:01:27','2021-02-06 09:41:19',20,NULL,NULL,NULL,NULL,NULL,NULL,1,709.05100000,NULL,NULL,NULL,NULL,1,'709.051 M618',1,NULL,0,0,NULL),(658,NULL,NULL,'Under Construction. AIR International Research Program','IT/EN','Giusy Checola and FARE',NULL,2013,'Giusy Checola',NULL,NULL,'CAT228',NULL,'under-construction-air-international-research-program','2016-12-23 22:01:27','2021-02-05 19:22:04',20,NULL,NULL,NULL,NULL,NULL,NULL,1,707.80000000,NULL,NULL,NULL,NULL,1,'707.8 G538',1,NULL,0,0,NULL),(659,NULL,'978-90-823018-0-9','Four by three : Perpetual precedents','EN','Kunstlicht',159,2014,'Arasli, Artun Alaska, 1987-',NULL,NULL,'CAT229',NULL,'four-by-three','2016-12-23 22:01:27','2021-02-05 19:22:29',20,NULL,NULL,NULL,NULL,NULL,NULL,1,707.80000000,897804476,'N6350',NULL,7,0,'707.8 A658',1,NULL,0,0,NULL),(660,NULL,'978-9934-8509-0-5','Visionary structures : from Johansons to Johansons','EN','Bozar Books',263,2015,'BOZAR: Centre for Fine Arts (Brussels)',NULL,NULL,'CAT230',NULL,'visionary-structures-from-johansosn-to-johansons','2016-12-23 22:01:27','2021-02-06 09:14:32',20,NULL,NULL,NULL,NULL,NULL,NULL,1,709.05100000,943370337,'N7255.L37',NULL,2,0,'709.051 B662',1,NULL,0,1,NULL),(662,'null','978-9934-8509-3-6','Armpit : Latvian Pavilion, Biennale Arte 2015 : Katrīna Neiburga, Andris Eglītis','LV/EN','Laikmetigas Makslas Centrs, Riga',182,2015,'Neiburga, Katrina; Eglitis, Andris','null','null','CAT232','null','latvian-pavilion-bienale-arte-2015','2016-12-23 22:01:27','2021-02-03 11:09:46'