016-12-23 22:01:27','2021-02-05 17:49:55',20,'51kz8GQo7KL.jpg','image/jpeg',47351,354,500,'Curated by the New York collective DIS, the 9th Berlin Biennale is a platform for collaborative ventures, ideas, catastrophes, and extremes. It seeks to materialize the paradoxes that increasingly define the world of 2016: the virtual as the real, nations as brands, people as data, culture as capital, wellness as politics, happiness as GDP, and so on. “The Present in Drag” is published as a companion volume to the 9th Berlin Biennale for Contemporary Art. Providing information on the works shown in the exhibition, it also includes contributions by Roe Ethridge, Simon and Daniel Fujiwara, Boris Groys, Katja Novitskova, Chus Martínez, Bjarne Melgaard, Sean Patrick Monahan, Sabine Reitmaier, McKenzie Wark,&lt;br&gt;&lt;br&gt;and others.',1,709.05100000,980991595,'N6488.G3',2,2,0,'709.051 B515 Pre',1,'undefined',0,1,NULL),(683,'null','978-0954654542','Luper at Compton Verney','EN','Compton Verney',136,2004,'Greenaway, Peter | Compton Verney House','null','null','CAT253','John W. Fail','luper-at-compton-verney','2016-12-23 22:01:27','2021-02-01 22:33:18',20,'51HeXKefiLL.jpg','image/jpeg',35199,373,500,'null',1,709.20000000,59284052,'N6768.65.I58',19,19,0,'709.2 G795 Lup',1,'undefined',0,0,NULL),(684,'null','978-1872771090','The audience of Mâcon = : Cynulleidfa\'r baban','EN/CY','Ffotogallery/Welsh Film Council',48,1993,'Greenaway, Peter','null','null','CAT254','John W. Fail','audience-of-macon-cynulleidfa-r-baban','2016-12-23 22:01:27','2021-02-08 13:32:22',20,'41yo8_2B3l4wL.jpg','image/jpeg',19333,348,500,'null',1,709.20000000,59831134,'TR680',22,22,0,'709.2 G795 Aud',1,'undefined',0,0,NULL),(685,NULL,'978-1858940335','Flying over water = : Volar damunt l\'aigua','EN/FR','Merrell Holberton',112,1997,'Greenaway, Peter, 1942- | Fundació Joan Miró (Barcelona, Spain)',NULL,NULL,'CAT255','John W. Fail','flying-over-water-volar-damunt-l-aigua','2016-12-23 22:01:27','2021-01-31 16:15:2