enė',NULL,NULL,'CAT262',NULL,'siuolaikine-meno-bienale-kaip-specifines-vietos-atvejis-lokalumas-pries-globaluma','2016-12-23 22:01:27','2021-02-06 09:41:18',20,NULL,NULL,NULL,NULL,NULL,NULL,1,709.05100000,NULL,NULL,NULL,NULL,1,'709.051 D132',1,NULL,0,0,NULL),(693,'null','978-3-956792-23-6','Transparenzen / transparencies. The ambivalence of a new visibility','DE/EN','Sternberg Press',162,2015,'Neuenschwander, Simone; Thiel, Thomas','null','null','CAT263','null','transparenzen-transparencies-the-ambivalence-of-a-new-visibility','2016-12-23 22:01:27','2021-02-05 18:23:41',20,'51qlQcXxdBL.jpg','image/jpeg',43716,353,500,'The globalized world seems at once transparent and opaque. While modern life is characterized by a desire for more transparency in communication, politics and business, limitless access to information has eroded our personal privacy. In the two-part, joint exhibition project curated by Simone Neuenschwander and Thomas Thiel, contemporary artists examine the many cultural facets and atmospheres of a (non) transparent society: the consequences of an algorithm- and data-collection driven life and world, our changed relationship to privacy and strategies of refusal or deliberate disclosure of data, among other issues. Conceptually designed by the activist Dutch design group Metahaven, this overscaled dense catalog is packed with images, artistic statements and scientific essays from both exhibitions, including outlines of all the contributions to this substantial project. Using mapping and fragmentation to convey the ubiquity of silent surveillance, the book is a complex and provocative contribution to this ever-present social dilemma. Contributions by Emmanuel Alloa, Neïl Beloufa, Clare Birchall , Juliette Blightman, Ryan Gander, Calla Henkel, Max Pitegoff, David Horvitz, Metahaven, Katja Novitskova, Yuri Pattison and Manfred Schneider.',1,709.05100000,957546279,'N6490',1,1,0,'709.051 N481',1,'undefined',1,0,NULL),(694,'','','Formy Zamieszkiwania: publicz