0,NULL),(698,'null','null','Ha Kypopt!: русское искуство сегодня','RU','Кунстхалле, Баден- Баден, Винанд',158,2003,'Nikich, Georgy; Vinsen, Mattias','null','null','E.EUR005','null','ha-kypopt','2016-12-23 22:01:27','2021-02-06 14:42:08',7,NULL,NULL,NULL,NULL,NULL,'null',1,709.47090000,0,NULL,NULL,NULL,1,'709.4709 N692',1,'undefined',0,0,NULL),(699,'null','978-9986-957-48-5','Opening the door? : Belarusian art today','EN/LT/RU','ŠMC/CAC',142,2011,'Fomina, Julija; Kuizinas, Kęstutis','null','null','E.EUR006 ','null','opening-the-door-belarussian-art-today','2016-12-23 22:01:27','2021-02-06 14:39:34',7,'51T2A4xksXL.jpg','image/jpeg',38587,327,500,'This exhibition is the first presentation of Belarusian contemporary artists in Lithuania to date. Despite the fact that Minsk, the capital city of Belarus, is situated only 170 kilometres (south) east of Vilnius, trade and cultural exchange between Lithuania and Belarus in the last twenty years has been slow, due to the current political situation in Belarus and exceptionally pro-western orientation of goals and perspectives of Lithuania.\n\n\n\"Opening the Door? Belarusian Art Today\" presents both artists living and working in Belarus as well as those residing abroad. It is not the first time that both halves of a disconnected art scene are being presented in a united project, but significantly it is being held in the closest proximity to its country of origin. Most of the Belarusian artists living in the West keep in touch with their families and make regular visits home, but seldom have they an opportunity to present their work in Minsk (or Belarus, generally). \n\nThis exhibition attempts to provide Belarusians with a possibility to look at their art from the outsider\'s perspective, without common taboos. Most of the works in the project, in one or another way, reflect upon Belarusian society and its concerns today, but only a few dare to openly express things that \'we don\'t talk about\'. \n\n\"Opening the Door? Belarusian Art Today\" is accompanied by a catalogue in Lithuanian, Russian and English and a conference at which Lithuanian and Belarusian researchers will present on the broader context of Belarusian contemporary art and culture.\n\nArtists: Anna Chkolnikova, Lena Davidovich, Oxana Gourinovitch, Artur Klinau, Aleksander Komarov, Alexander Korablev, Aleksej Lunev, Marina Naprushkina, Igor Peshehonov, Positive Actions, Igor Savchenko, Sergey Shabohin, Aleksei Shinkarenko, Philippe Tschmyr ir Belarusian Climate, Vladimir Tsesler ir Sergey Voichenko, Maxim Tyminko, Ruslan Vashkevich, Oleg Yushko',1,709.47800000,698244748,'N7255.B44',NULL,9,0,'709.478 F672',1,'undefined',0,0,NULL),(700,'','978-9949-15-013-7','Postsovkhoz 1-6: An Anthology of MoKS International Art Symposium','EE/EN','MoKS',125,2007,'Muursepp, Evelyn; Grzinich, John; Remm, Jane','','','E.EUR007','','postsovkhoz-1-6-an-anthology-of-moks-international-art-symposium','2016-12-23 22:01:27','2021-02-04 23:34:23',7,'postsovkhoz-1-6-moksi-20010.jpg','image/jpeg',139999,612,600,'',1,707.80000000,0,NULL,NULL,NULL,1,'707.8 M941',3,'undefined',1,0,NULL),(701,'null','null','Meeting Place: north-european contemporary art','EN','Culture Centre Bla Stallet',76,2002,'Olin, Truuls','2 pcs.','null','E.EUR008','null','meeting-place-north-european-contemporary-art','2016-12-23 22:01:27','2021-02-09 14:30:08',7,NULL,NULL,NULL,NULL,NULL,'null',1,709.05100000,0,NULL,NULL,NULL,1,'709.051 O46',3,'undefined',0,0,NULL),(702,'null','null','Russian Red','RU/EN','Kaliningrad branch of the NCCA',0,0,'Vasiliev, ; Yuri, ','postcards collection','null','E.EUR009','null','russian-red','2016-12-23 22:01:27','2021-02-06 14:37:35',7,NULL,NULL,NULL,NULL,NULL,'null',1,709.20000000,0,NULL,NULL,NULL,1,'709.2 V334',1,'undefined',0,0,NULL),(703,'null','null','Tower Kronprinz: Second Advent','RU/EN','Kaliningrad branch of the NCCA',0,2006,'Tsvetaeva, Elena','postcards collection','null','E.EUR010','null','tower-kronprinz-second-advent','2016-12-23 22: