tatoes, painting pictures : women artists in post-Soviet Russia, Estonia, and Latvia : the first decade','EN','Rutgers University Press',171,2001,'Baigell, Renee | Baigell, Matthew [Author]',NULL,NULL,'E.EUR016',NULL,'peeling-potatoes-painting-pictures-women-artists-in-post-soviet-russia-estonia-and-latvia-the-first-decade','2016-12-23 22:01:27','2021-01-31 16:15:30',7,'51SS96V5BWL.jpg','image/jpeg',37628,325,500,'How do women artists in Russia, Estonia and Latvia view themselves in the post-Soviet era? What is their relationship to feminism and how has that relationship changed following the fall of the Soviet regime? Having conducted over 60 interviews between 1995 and 1998, Renee and Matthew Baigell explore in this volume these women\'s difficulties of pursuing an art career in a male-dominated society, and the attitudes of their male counterparts toward feminist concerns.',1,704.04209471,45015230,'N72.F45',338,330,0,'704.04209471 B152',1,NULL,0,0,NULL),(710,'null','978-9955-834-04-5','Generation of the place = : Vietos karta = Viensētas paaudze = Sündinud samas kohas = Pokolenie v-meste','EN/LT','MENE/3xpozicija.lt',216,2011,'Michelkevičius, Vytautas','null','null','E.EUR017','null','vietos-karta-atvaizdas-atmintis-ir-fikcija-baltijos-saylse-generation-of-the-place-image-memory-and-fiction-in-the-baltics','2016-12-23 22:01:27','2021-02-09 14:34:23',7,'31bRLvgDgOL.jpg','image/jpeg',8526,309,500,'This is a collection of photographs by artists of the same generation, born between 1975 and 1985. They all come from the Baltic countries: Lithuania, Latvia, and Estonia. Having been born in the Soviet Union and matured in independent states, they think through images, create fictions and visualize their memory in very different ways, but at the same time there are many parallels between their works. Generation of the Place is simultaneously a metaphor that describes this community, which comes together in the photographs, and a statement that these artists do reflect on the place they live in. Meanwhile, British, Latvian and Lithuanian critics contribute essays about the photographs and their context. You can flip though this publication as an album or as a magazine, in which texts and images form a consistent pleasant, yet also critical texture. This book is an extension of the exhibition shown for the first time in the Tallinn Art Hall (Estonia) in the framework of the Tallinn Month of Photography, 2011.',1,709.47900000,842298220,'TR655',NULL,1,0,'709.479 M623',2,'undefined',0,0,NULL),(711,'1-86450-359-9',NULL,'Moscow','EN','Lonely Planet',256,2003,'Vorhees, Mara | Ragozin, Leonid [Author] | Ver Berkmoes, Ryan [Author]',NULL,NULL,'E.EUR018',NULL,'moscow','2016-12-23 22:01:27','2021-01-31 16:15:30',7,'51_2BW_2B5zfD3L.jpg','image/jpeg',33549,339,500,'Moscow 1 offers advice on getting the most out of Moscow\'s art scene from the Bolshoi Ballet to the Pushkin Fine Arts Museum and Kremlin. The guide also includes a practical language section.',1,914.73104863,51270718,'DK597',544,751,0,'914.73104863 V953',1,NULL,0,0,NULL),(712,'','978-0-230-01941-6','A history of the Baltic states','EN','Palgrave Macmillan',251,2010,'Kasekamp, Andres, 1966-','','','E.EUR019','','a-history-of-the-baltic-states','2016-12-23 22:01:27','2021-01-31 16:15:30',7,'6822499._UY475_SS475_.jpg','image/jpeg',46331,475,475,'',1,947.90000000,499069908,'DK502.7',558,671,0,'947.9 K19',1,NULL,0,0,NULL),(713,NULL,'978-0-7566-9502-6','Estonia, Latvia, and Lithuania','EN','TravelDK.com',434,2013,'Jarvis, Howard | Jarvis, Howard [Author; Contributor; Editor] | Ochser, Tim [Author; Contributor] | Taylor, Neil, 1948- [Author; Contributor] | DK Publishing, Inc. | Oates, John, 1946- [Author; Contributor]',NULL,NULL,'E.EUR020',NULL,'estonia-latvia-and-lithuania','2016-12-23 22:01:27','2021-01-31 16:15:30',7,'515KY8PQDjL.jpg','image/jpeg',45051,288,500,'&lt;p&gt;&lt;i&gt;DK Eyewitness Travel Guide: Estonia, Latvia, and Lithuania&lt;/i&gt; is your indispensable guide to this beautiful part of the world. The fully updated guide includes unique illustrated cutaways, floor plans, and reconstructions of the must-see sights, plus street-by-street maps of cities and towns.&lt;/p&gt; &lt;p&gt;DK\'s insider travel tips and essential local information will help you discover these destinations region-by-region, from local festivals and markets to day trips around the countryside. Detailed listings will guide you to hotels, restaurants, bars, and shops for all budgets, while practical information will help you to get around by train, bus, or car.&lt;/p&gt; &lt;p&gt;With hundreds of full-color photographs, hand-drawn illustrations, and custom maps that illuminate every page, &lt;i&gt;DK Eyewitness Travel Guide: Estonia, Latvia, and Lithuania&lt;/i&gt; truly shows you around these gorgeous destinations as no one else can.&lt;/p&gt;',1,914.79048600,298946829,'DK502.4',624,768,0,'914.790486 J38',1,NULL,0,0,NULL),(714,NULL,'978-1-84353-922-3','The rough guide to the Baltic States','EN','Rough Guides',504,2008,'Bousfield, Jonathan | Meghji, Shafik [Contributor; Author of introduction]',NULL,NULL,'E.EUR021',NULL,'the-rough-guide-to-the-baltic-states-estonia-latvia-and-lithuania','2016-12-23 22:01:27','2021-01-31 16:15:30',7,'513-d4Pau3L.jpg','image/jpeg',39180,322,500,'The Rough Guide to The Baltic States is an indespendabel guide to this intriguing part of Europe. The full colour section introduces the highlights of Estonia, Latvia and Lithuania. The guide features definitive accounts of the fascinating capital cities of Tallinn, Vilnius and Riga, as well as full coverage of the countries’ distinctive landscapes of lakes, forests and national parks. Two new colour sections give the lowdown on the countries’ cuisine and landscapes. The guide also contains practical advice on the best places for hiking, canoeing and birdwatching. Detailed maps for every region, and up-to-date reviews of accommodation, restaurants and nightlife, are also included. &lt;p&gt;&lt;/p&gt;&lt;p&gt;The Rough Guide to The Baltic States is like having a local friend plan your trip!&lt;/p&gt;',1,914.79048600,59307949,'DK502.4',142,94,0,'914.790486 B777',1,NULL,0,0,NULL),(715,NULL,'978-1-933128-49-8','East coast Europe','EN','Sternberg Press, Založba ZRC',352,2008,'Markus Miessen',NULL,NULL,'E.EUR022',NULL,'east-coast-europe','2016-12-23 22:01:27','2021-01-31 16:15:30',7,'41lt4wJIVwL.jpg','image/jpeg',25650,312,500,'East Coast Europe, which took place during Spring 2008 at the New School in New York, is a project about the perceptions of contemporary&lt;br&gt;European identity and its relation to spatial practices and international politics. \"Europe\" in the title is the central topic for investigation, its&lt;br&gt;contemporary culture, expansion and its status as a continuing social project. \"East Coast\" refers to two distinct edges of Europe, both real&lt;br&gt;and imaginary-the geographical East Coast of the USA and the political \"East Coast\" of the EU. The book details a dense network of&lt;br&gt;contemporary experience of the EU\'s extensive exchange of knowledge, people, and goods with the US and also with its own eastern border.&lt;br&gt;Contributions by Shamim Momin, Taryn Simon, Marina Abramovic, Orchard, Kazys Varnelis, Lisa Farjam, Jordan Wolfson, Sislej Xhafa,&lt;br&gt;Nedko Solakov, et al.',1,306.09000000,318526193,'D2021',8,24,0,'306.09 M345',1,NULL,0,0,NULL),(716,'null','978-83-933818-9-0','In the Heart of the Heart of the Country: Collection of the Museum of Modern Art in Warsaw','EN','Museum of Modern Art in Warsaw',128,2013,'Velez, Marcel Andino; Cichocki, Sebastian; Dziewanska, Marta; Fudala, Tomasz; Lipska, Magdalena; Matuszkiewicz, Maria; Mytkowska, Joanna; Ronduda, Lukasz; Sielewicz, Natalia','null','null','E.EUR023','null','in-the-heart-of-the-heart-of-the-country-collection-of-the-museum-of-modern-art-in-warsaw','2016-12-23 22:01:27','2021-02-06 15:03:20',7,NULL,NULL,NULL,NULL,NULL,'null',1,0.00000000,0,NULL,NULL,NULL,1,'709.05',1,'undefined',0,0,NULL),(718,'null','9781861898951','Art and democracy in post-communist Europe','UK','REAKTION books',312,2012,'Brzyski, Anna, 1969-','null','Eastern European','E.EUR025','null','art-and-democracy-in-post-communist-europe','2016-12-23 22:01:27','2021-02-06 14:17:07',7,'419TWP07wyL.jpg','image/jpeg',24877,334,500,'The conclusion of the Cold War in 1989 signalled the beginning of a new era in Eastern Europe, and this widespread change was felt no less strongly in the world of art. In Art and Democracy in Post-Communist Europe, Piotr Piotrowski examines the art made after 1989 in Eastern Europe in light of the profound political, social, economic and cultural transformations in the region. As well as discussing these alterations, Piotrowski describes the changing nature of artworks themselves – from work moulded by the cultural imperatives of the communist state, used as a tool of political propaganda, to autonomous work protesting against and resisting the ruling powers. He describes the rich tradition of anarchistic motifs and themes of protest in Eastern European art, and the emergence of a utopian vision in more recent times. The discussion includes themes of communist memory; the critique of nationalism; issues of gender after 1989; and the representation of historic trauma in contemporary museology, going on to discuss the recent foundation of museums of contemporary art in Bucharest, Tallinn and Warsaw. The function of art in post-communist Europe is assessed, as well as its restrictions and hidden censorship mechanisms.Throughout the book the author provides close readings of numerous artists, many new to a Western audience, such as Ilya Kabakov and Krzysztof Wodiczko, and Marina Abramovic’s work responding to the atrocities of the Balkans. This cogent investigation of the artistic reorientation of the former Eastern Bloc breaks important new ground, and fills a major gap in contemporary artistic and political discourse.',3,709.47000000,812160018,'NX180.P64',3,3,0,'709.47 B794',1,'undefined',0,0,NULL),(719,'','','Homo Sonorus: An International Anthology of Sound Poetry','RU/EN','Kaliningrad Branch of the NCCA',438,2001,'Bulatov, Dmitry','book + 4 CDs','',' E.EUR026','','homo-sonorus-an-international-anthology-of-sound-poetry','2016-12-23 22:01:27','2021-02-06 14:20:54',7,'b82e59d_pvc2277homosonorus.web.jpg','image/jpeg',248101,698,1200,'',1,709.04070000,0,NULL,NULL,NULL,1,'709.0407 B933',1,'undefined',1,0,NULL),(720,NULL,'978-9934-8324-0-6','Baltic Comics Magazine š! #11','LV','Biedriba Grafiskie Stasti',162,2012,'Schilter, David; Muizniece, Sanita',NULL,NULL,'E.EUR027',NULL,'baltic-comics-magazine-s-11','2016-12-23 22:01:27','2021-01-26 18:43:25',7,'61904YAulKL.jpg','image/jpeg',74242,356,500,NULL,3,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(721,'','978-83-88400-50-6','Spoleczne Dyskursky Sztuki Fotografii','PL','Akademia sztuk pięnych w poznaniu',204,2010,'Michalowska, Marianna; Wolynski, Piotr','','','E.EUR028','','spoleczne-dyskursky-sztuki-fotografii','2016-12-23 22:01:27','2021-02-06 15:17:01',7,'download.jpeg','image/jpeg',5268,202,250,'',1,770.94380000,0,NULL,NULL,NULL,1,'770.9438 M622',2,'undefined',0,0,NULL),(722,'5-94620-005-4','','Communication and identification in contemporary art','RU/EN','Kaliningrad branch of the NCCA',0,2002,'Tchesnokova, Irina; Tsvetaeva, Elena','catalogue','','E.EUR030/E.EUR054','','communication-and-identification-in-contemporary-art','2016-12-23 22:01:27','2021-02-06 15:18:50',7,NULL,NULL,NULL,NULL,NULL,'',1,707.80000000,0,NULL,NULL,NULL,1,'707.8 T251',2,'undefined',0,0,NULL),(723,'null','978-1-906155-84-1','Contemporary art in Eastern Europe','EN','black dog publishing',240,2010,'Adler, Phoebe; McCorquodale, Duncan','null','null','E.EUR031','null','contemporary-art-in-eastern-europe','2016-12-23 22:01:27','2021-02-09 07:22:40',7,'51sbgwOwpJL.jpg','image/jpeg',52989,410,500,'&lt;div&gt;From Russia to Poland and Romania, and from the Czech Republic to Yugoslavia and East Germany, &lt;I&gt;Contemporary Art in Eastern Europe&lt;/I&gt; is an ambitious attempt to chart the changing realities of the eastern half of Europe as seen through the eyes of artists, critics, photographers and curators.&lt;br&gt;&lt;BR&gt;If the Iron Curtain and the antagonisms of the Cold War era had often kept the richness and diversity of Eastern European art hidden from the rest of the world, the contemporary era has been a witness to its unparalleled creative explosion and fruitful dialogue with the global art scene. The work featured in this book explores the correlations between shifts in the political, cultural, economic and geographical realities of Eastern Europe and the region’s contemporary art. The artists in this book revisit the region’s past to envision a better future, reaching challenging conclusions and producing some of the most powerful and inspiring art being produced today.&lt;br&gt;&lt;BR&gt;The book features essays from respected writers in the field and profiles the most influential artists producing work in and from the region today, including Marina Abramovic, Christo, Krzysztof Wodiczko, Zofia Kulik, Komar and Melamid, IRWIN, Natalia Lach-Lachowicz, Alexander Brodsky, Ewa Partum, NSK, Group OHO, Stano Filko, Laibach,  KwieKulik, Post Ars,  Weekend Art, Zbigniew Libera, Marjetica Potrc, and Mladen Stilinovic.&lt;BR&gt;&lt;BR&gt;The following countries are covered in this anthology: Albania, Bosnia and Herzegovina, Bulgaria, Croatia, Czech Republic, East Germany, Estonia, Hungary, Latvia, Lithuania, Macedonia, Moldova, Poland, Romania, Russia, Slovak Republic, Slovenia and Yugoslavia.&lt;BR&gt;&lt;BR&gt;&lt;I&gt;Contemporary Art in Eastern Europe&lt;/I&gt; is the third title in the ARTWORLD series following &lt;I&gt;Contemporary Art in the Middle East&lt;/I&gt; and &lt;I&gt;Contemporary Art in Latin America&lt;/I&gt;.&lt;BR&gt;&lt;/div&gt;',1,709.47000000,619946231,'N6758.6',206,209,0,'709.47 A237',1,'undefined',0,