9.051',1,'undefined',0,0,NULL),(729,'null','null','Archstoyanie festival 2008-2009','RU/EN','Archstoyanie festival; Nikola- Lenivets project',90,2008,'Bychkova, Juliya; Kochurkin, Anton','null','null','E.EUR038','null','archstoyanie-festival-2008-2009','2016-12-23 22:01:27','2021-02-06 15:11:32',7,NULL,NULL,NULL,NULL,NULL,'null',1,709.05100000,0,NULL,NULL,NULL,1,'709.051 A669',1,'undefined',0,1,NULL),(730,'5-94620-002-X','','Art of tortures and execution - art against tortures and execution','RU/EN','Kaliningrad branch of the NCCA',190,2002,'Tchesnokova, Irina; Zheleznyak, Julia','','eastern european','E.EUR039/E.EUR','','art-of-tortures-and-execution-art-against-tortures-and-execution','2016-12-23 22:01:27','2021-02-06 15:08:55',7,NULL,NULL,NULL,NULL,NULL,'',1,709.05100000,0,NULL,NULL,NULL,1,'709.051 T251',2,'undefined',0,0,NULL),(731,'','978-973-7913-79-1','Genealogies of post-communism','EN','Idea Design and Print',341,2009,'Sîrbu, Adrian T., 1965-','','','E.EUR001','','genealogies-of-post-communism','2016-12-23 22:01:27','2021-02-09 13:33:51',7,'84jo3t2gq480.jpg','image/jpeg',212483,957,1359,'',1,320.94700000,855264580,'DJK51',3,5,0,'320.947 S774',1,'undefined',0,0,NULL),(732,'null','978-90-8964-251-6','Artists on the edge : the rise of coastal artists\' colonies, 1880-1920 : with particular reference to artists\' communities around the North Sea','EN','Amsterdam University Press',408,2010,'Barrett, Brian D.','null','null','RES001','null','artists-on-the-edge-the-rise-of-coastal-artists-colonies-1880-1920','2016-12-23 22:01:27','2021-02-08 16:41:11',11,'51I3L6kLiyL.jpg','image/jpeg',34492,380,500,'&lt;DIV&gt;&lt;/DIV&gt;&lt;P&gt;By the close of the nineteenth century, the European countryside was dotted with artists’ colonies in landscapes as varied as the artists and hosts who inhabited them. The most valuable and fruitful of these colonies were established along the coasts, and as they grew, traditional, stoic fishermen watched as their seaside villages were transformed into communities of art and leisure. Though idyllic in setting, these were not merely rustic retreats, but highly motivated international forums for experiment and debate, populated by those at the cutting edge of artistic change.&lt;/p&gt;&lt;P&gt; &lt;/P&gt;&lt;P&gt;The movement, driven by ideological decisions and sustained by practical considerations, was shaped by a confluence of innovations in technology, transportation, hospitality, and publishing. In turn, it shaped the modern art market and inspired generations of painters. With this incisive study, Brian Dudley Barrett makes a major contribution to the geography of art, chronicling a time when living on the edge yielded fresh works and radical new perspectives.&lt;/p&gt;',1,709.03400000,669125399,'N6757',181,201,0,'709.034 B274',1,'undefined',0,0,NULL),(734,NULL,'978-0-226-38961-5','The studio reader : on the space of artists','EN','The School of the Art Institute of Chicago',376,2010,'Jacob, Mary Jane; Grabner, Michelle',NULL,NULL,'RES004',NULL,'the-studio-reader-on-the-space-of-artists','2016-12-23 22:01:27','2021-01-31 16:15:31',11,'51r9XPRbePL.jpg','image/jpeg',51311,389,500,'&lt;div&gt;&lt;/div&gt;&lt;P&gt;The image of a tortured genius working in near isolation has long dominated our conceptions of the artist’s studio. Examples abound: think Jackson Pollock dripping resin on a cicada carcass in his shed in the Hamptons. But times have changed; ever since Andy Warhol declared his art space a “factory,” artists have begun to envision themselves as the leaders of production teams, and their sense of what it means to be in the studio has altered just as dramatically as their practices.&lt;/P&gt;&lt;P&gt;&lt;I&gt;The Studio Reader &lt;/I&gt;pulls back the curtain from the art world to reveal the real activities behind artistic production. What does it mean to be in the studio? What is the space of the studio in the artist’s practice? How do studios help artists envision their agency and, beyond that, their own lives? This forward-thinking anthology features an all-star array of contributors, ranging from Svetlana Alpers, Bruce Nauman, and Robert Storr to Daniel Buren, Carolee Schneemann, and Buzz Spector, each of whom locates the studio both spatially and conceptually—at the center of an art world that careens across institutions, markets, and disciplines. A companion for anyone engaged with the spectacular sites of art at its making, &lt;I&gt;The Studio Reader &lt;/I&gt;reconsiders this crucial space as an actual way of being that illuminates our understanding of both artists and the world they inhabit.&lt;/p&gt;',1,702.80000000,844847598,'N8520',3,3,0,'702.8 J16',1,NULL,0,0,NULL),(735,'null','9789984392516','Roja. Rojarak : a book which was born in the residence for artists','LV/LT','Rojaraku and Tissu',128,2007,'Maris, Grosbahs; Helene, Gerster','3 copies','null','RES005','null','roja-rojarak-a-book-which-was-born-in-the-residence-for-artists','2016-12-23 22:01:27','2021-02-05 18:16:31',11,NULL,NULL,NULL,NULL,NULL,'null',1,707.80000000,0,NULL,NULL,NULL,1,'707.8 M332',2,'undefined',0,0,NULL),(736,NULL,'978-9955-18-561-1','Menininkų kūrybos centrai ir jų bendruomenės vidurio ir rytų Europoje : = Künstlergemeinschaften und ihre ländlichen Schaffenszentren in Mittel- und Osteuropa','LT/DE','Klaipėdos universiteto leidykla',160,2011,'Motuzienė, Lina; Etevičiūtė, Živilė',NULL,NULL,'RES008',NULL,'menininku-kurybos-centrai-ir-ju-bendruomenes-vidurio-ir-rytu-europoje-dfdb02fe-eb5d-44e5-a603-2d88fefd3fcd','2016-12-23 22:01:27','2021-02-03 09:39:05',11,NULL,NULL,NULL,NULL,NULL,NULL,3,709.20000000,885027900,NULL,3,NULL,0,'709.2 M917 Men',1,NULL,1,0,NULL),(737,'1-58115-404-6','','Artists communities : a directory of residencies that offer time and space for creativity','EN','Alliance of Artists Communities',273,2005,'Glass, Caitlin S; Obalil, Deborah','','','RES009/RES083','','artist-communities-a-directory-of-residencies-that-offer-time-and-space-for-creativity','2016-12-23 22:01:27','2021-02-01 20:01:36',11,'51kbm_2BOOkzL.jpg','image/jpeg',43596,333,500,'&lt;div&gt;The bible of creative residency programs returns, with fresh information and new features for artists of all disciplines. More than 300 programs worldwide are described, with 95 leading communities featured in two-page spreads with photographs. The user-friendly layout allows for quick scans of facility descriptions, deadlines, fees, selection processes, odds of acceptance, special programs, and more. For artists seeking to boost their creativity in a fresh and inspiring setting, Artists\' Communities is the definitive sourcebook.&lt;/div&gt;',1,700.25730000,57202204,'NX110',518,513,0,'700.2573 G549',2,'undefined',1,0,NULL),(738,'null','978-0-9539222-4-6','Ways of Working A Mock up','EN','Wysing Arts Centre Escalator Visual Arts ',103,2012,'         ','null','null','RES010','null','ways-of-working-a-mock-up','2016-12-23 22:01:27','2021-02-08 15:32:51',11,NULL,NULL,NULL,NULL,NULL,'null',1,707.80000000,0,NULL,NULL,NULL,1,'707.8 W994',1,'undefined',0,1,NULL),(740,'null','978-83-61156-35-2','Re-tooling residencies : a closer look at the mobility of art professionals','EN','Ujazdowski Castle',264,2011,'Ptak, Anna','4 copies','null','RES007','null','re-tooling-residencies-a-closer-look-at-the-mobility-of-art-professionals','2016-12-23 22:01:27','2021-02-06 12:41:33',11,NULL,NULL,NULL,NULL,NULL,'null',1,700.25730000,767629193,'N6758.6',NULL,3,0,'700.2573 P975',5,'undefined',1,0,NULL),(741,'null','null','Naujienos ir senienos: „Lietuvos spaudos“ kiosko išpažintis','EN/LT','null',0,19,'Hlynsdottir, Bergalind Jona','null','null','RES013','null','naujienos-ir-senienos-lietuvos-spaudos-kiosko-ispazintis','2016-12-23 22:01:27','2021-02-09 15:11:02',11,NULL,NULL,NULL,NULL,NULL,'null',1,700.41100000,0,NULL,NULL,NULL,1,'700.411 H677',1,'undefined',0,0,NULL),(742,'null','null','Niekada ten Nidoje / Nie da in Nida','LT/DE','null',0,2013,'Klotzek, Wilhelm','null','null','RES016','n