,1,'700.7 M425',1,'undefined',0,0,NULL),(871,'91-7988-264-1',NULL,'Ronneby brunn under trehundra år, 1705-2005','SE','Byggforlaget och forfattarna',232,2005,'Lis Hogdal',NULL,NULL,'MISC044',NULL,'ronneby-brunn-under-trehundra-aar','2016-12-23 22:01:28','2021-01-31 16:15:36',22,NULL,NULL,NULL,NULL,NULL,NULL,1,613.12209486,68188860,'DL991.R59',2,4,0,'613.12209486 L769',1,NULL,0,0,NULL),(872,'1-85326-355-9',NULL,'The Wordsworth Book of spells','EN','Wordsworth Reference ',587,1995,'Waite, Arthur Edward, 1857-1942',NULL,NULL,'MISC045','John W. Fail','the-wordsworth-dictionary-of-beliefs-religions','2016-12-23 22:01:28','2021-01-31 16:15:36',22,NULL,NULL,NULL,NULL,NULL,NULL,1,133.44000000,38501619,'BF1589',15,15,0,'133.44 W145',1,NULL,0,0,NULL),(873,NULL,'978-0-670-02110-9','Reading in the brain : the science and evolution of a cultural invention','EN','Penguin Group ',388,2009,'Deheane, ; Stanislas, ',NULL,NULL,'MISC046','John W. Fail','reading-in-the-brain-the-science-and-evolution-of-a-human-invention','2016-12-23 22:01:28','2021-01-31 18:20:12',22,'41KHc68TVFL.jpg','image/jpeg',27298,331,500,'&lt;DIV&gt;&lt;b&gt;A renowned cognitive neuroscientist?s fascinating and highly informative account of how the brain acquires reading&lt;/b&gt;&lt;br&gt;&lt;br&gt;How can a few black marks on a white page evoke an entire universe of sounds and meanings? In this riveting investigation, Stanislas Dehaene provides an accessible account of the brain circuitry of reading and explores what he calls the ?reading paradox?: Our cortex is the product of millions of years of evolution in a world without writing, so how did it adapt to recognize words? &lt;i&gt;Reading in the Brain&lt;/i&gt; describes pioneering research on how we process language, revealing the hidden logic of spelling and the existence of powerful unconscious mechanisms for decoding words of any size, case, or font.&lt;br&gt;&lt;br&gt; Dehaene?s research will fascinate not only readers interested in science and culture, but also educators concerned with debates on how we learn to read, and who wrestle with pathologies such as dyslexia. Like Steven Pinker, Dehaene argues that the mind is not a blank slate: Writing systems across all cultures rely on the same brain circuits, and reading is only possible insofar as it fits within the limits of a primate brain. Setting cutting-edge science in the context of cultural debate, &lt;i&gt;Reading in the Brain&lt;/i&gt; is an unparalleled guide to a uniquely human ability.&lt;br&gt;&lt;br&gt;&lt;/div&gt;',3,418.40190000,795365890,'BF456.R2',8,8,0,'418.4019 D322',1,NULL,0,0,NULL),(874,'0-679-73739-1',NULL,'Monster in a box','EN','Vintage Books',81,1992,'Gray, Spalding, 1941-2004',NULL,NULL,'MISC047','John W. Fail','monster-in-a-box','2016-12-23 22:01:28','2021-01-31 16:15:38',22,'51Z2LxQxPCL.jpg','image/jpeg',48926,348,500,'The oddity that was Spaulding Gray is expressed in this book',1,813.54000000,24065052,'PS3557.R333',612,612,0,'813.54 G782',1,NULL,0,0,NULL),(875,'0 330 29947 6',NULL,'Swimming to Cambodia','EN','Pan Books',304,1986,'Gray, Spalding, 1941-2004',NULL,NULL,'MISC048','John W. Fail','swimming-to-cambodia','2016-12-23 22:01:28','2021-01-31 16:15:38',22,NULL,NULL,NULL,NULL,NULL,NULL,1,791.43028092,12614781,'PN2287.G6759',594,856,0,'791.43028092 G782',1,NULL,0,0,NULL),(876,'0-922915-19-9','null','Kooks','EN','Feral House Portland',253,1994,'Kossy, Donna','null','null','MISC049','John W. Fail','kooks','2016-12-23 22:01:28','2021-02-09 13:29:35',22,NULL,NULL,NULL,NULL,NULL,'null',1,302.54200000,30572778,'AG243',66,66,0,'302.542 K86',1,'undefined',0,0,NULL),(877,NULL,NULL,'Charmed circle : [Gertrude Stein &amp; company]','EN','Avon Books',640,1975,'Mellow, James Robert, 1926-1997',NULL,NULL,'MISC050','John W. Fail','charmed-circle','2016-12-23 22:01:28','2021-01-31 16:15:38',22,NULL,NULL,NULL,NULL,NULL,NULL,1,818.52090000,34054217,'PS3537.T323',5,5,0,'818.5209 M527',1,NULL,0,0,NULL),(878,'9-780922-915057','null','Apocalypse culture','EN','Feral House Portland',362,1990,'Parfrey, Adam, 1957-2018 | Parfrey, Adam, 1957-2018 [Publishing director; Editor]','null','null','MISC051','John W. Fail','apocalypse-culture','2016-12-23 22:01:28','2021-02-09 13:29:25',22,'51StTXeNF8L.jpg','image/jpeg',48660,310,500,'&lt;div&gt;\"Parfrey has edited a new book of Revelation, a collection which is almost as awesome and terrifying as the original biblical text.\"&lt;BR&gt;--Edwin Pouncey, NME&lt;BR&gt;&lt;BR&gt;\"&lt;I&gt;Apocalypse Culture&lt;/I&gt; is compulsory reading for all those concerned with the crisis of our times. An extraordinary collection unlike anything I have ever encountered. These are the terminal documents of the twentieth century.\"&lt;BR&gt;--J.G. Ballard&lt;BR&gt;&lt;/div&gt;',1,302.54200000,15591230,'CB430',280,443,0,'302.542 P229',1,'undefined',0,0,NULL),(879,'0 75380 736','9780753807361','The Culture of Lies','EN','Phoenix',275,1996,'Ugresic, Dubravka','null','null','MISC052','John W. Fail','the-culture-of-lies','2016-12-23 22:01:28','2021-02-04 23:42:44',22,NULL,NULL,NULL,NULL,NULL,'null',1,949.72030000,0,NULL,NULL,NULL,1,'949.7203 U26',1,'undefined',0,0,NULL),(880,'0-224-03885-0',NULL,'Have a nice day : from the Balkan war to the American dream','EN','Jonathan Cape London',241,1994,'Ugrešić, Dubravka | Hawkesworth, Celia, 1942- [Translator] | Elias-Bursać, Ellen [Translator]',NULL,NULL,'MISC053','John W. Fail','have-a-nice-day','2016-12-23 22:01:28','2021-01-31 16:15:38',22,'51xL8awGJjL.jpg','image/jpeg',37794,323,500,NULL,1,917.30492900,31131467,'E169.Z82',211,280,0,'917.304929 U26',1,NULL,0,0,NULL),(881,'0-679-43998-6',NULL,'Mr. Wilson\'s cabinet of wonder','EN','Vintage Books',168,1995,'Weschler, Lawrence',NULL,NULL,'MISC054','John W. Fail','mr-wolson-s-cabinet-of-wonder','2016-12-23 22:01:28','2021-01-31 18:53:13',22,'71P8VS3NTHL.gif','image/gif',155369,287,475,'Writing with great style and humor, Weschler guides the readers through the Museum of Jurassic Technology and through the mind of its curator, David Wilson, a man of unusual imagination who mounts exhibits such as spore-inhaling ants, bats deploying ultraviolet frequencies, peach-pit carvings, and other exhibits that seem the manifest definition of bizarre. Illustrations.',1,69.50000000,32276080,'AM101.L725',950,951,0,'069.5 W511',1,NULL,0,0,NULL),(882,NULL,'978-0-9817091-2-3','The barbaric heart : faith, money, and the crisis of nature','EN','PoliPointPress',189,2009,'White, Curtis, 1951-',NULL,NULL,'MISC055','John W. Fail','the-barbaric-heart','2016-12-23 22:01:28','2021-01-31 16:15:39',22,'31M1N9FAyuL.jpg','image/jpeg',12182,324,500,'Smart, funny, and fresh, &lt;i&gt;The Barbaric Heart&lt;/i&gt; argues that the present environmental crisis will not be resolved by the same forms of crony capitalism and managerial technocracy that created the crisis in the first place. With his trademark wit, White argues that the solution might very well come from an unexpected quarter: the arts, religion, and the realm of the moral imagination.&lt;br /&gt;&lt;br /&gt;',1,170.00000000,310396067,'HM681',178,169,0,'170 W583',1,NULL,0,0,NULL),(883,NULL,'978-1590173848','The three Christs of Ypsilanti : a psychological study','EN','NYRB Classics',368,2011,'Rokeach, Milton',NULL,NULL,'MISC056','John W. Fail','the-three-christs-of-ypsilanti','2016-12-23 22:01:28','2021-01-31 16:15:39',22,'51ZY8sbFd5L.jpg','image/jpeg',50480,328,500,'&lt;p&gt;On July 1, 1959, at Ypsilanti State Hospital in Michigan, the social psychologist Milton Rokeach brought together three paranoid schizophrenics: Clyde Benson, an elderly farmer and alcoholic; Joseph Cassel, a failed writer who was institutionalized after increasingly violent behavior toward his family; and Leon Gabor, a college dropout and veteran of World War II.&lt;br /&gt;&lt;br /&gt;The men had one thing in common: each believed himself to be Jesus Christ. Their extraordinary meeting and the two years they spent in one another’s company serves as the basis for an investigation into the nature of human identity, belief, and delusion that is poignant, amusing, and at times disturbing. Displaying the sympathy and subtlety of a gifted novelist, Rokeach draws us into the lives of three troubled and profoundly different men who find themselves “confronted with the ultimate contradiction conceivable for human beings: more than one person claiming the same identity.”&lt;/p&gt;',1,616.89092000,171349,'RC465',730,763,0,'616.89092 R742',1,NULL,0,0,NULL),(884,NULL,NULL,'Encyclopaedia Destructica volume four','EN','Encyclopedia Destructica',118,2007,'Matt Wellins',NULL,NULL,'MISC057','John W. Fail','encyclopaedia-destructica-volume-four','2016-12-23 22:01:28','2021-01-26 16:17:12',22,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(885,NULL,'978-0393316735','Commodify your dissent : salvos from the Baffler','EN','Norton',288,1997,'Frank, Thomas, 1965- [Editor] | Weiland, Matt [Editor]','Salvos from The Baffler',NULL,'MISC034','John W. Fail','commodify-your-dissent','2016-12-23 22:01:28','2021-01-31 16:15:39',22,'51UvL1rQ4tL.jpg','image/jpeg',58784,375,500,'&lt;p&gt;From the pages of &lt;em&gt;The Baffler&lt;/em&gt;, the most vital and perceptive new magazine of the nineties, sharp, satirical broadsides against the Culture Trust.&lt;/p&gt;&lt;br /&gt;In the \"old\" Gilded Age, the barons of business accumulated vast wealth and influence from their railroads, steel mills, and banks. But today it is culture that stands at the heart of the American enterprise, mass entertainment the economic dynamo that brings the public into the consuming fold and consolidates the power of business over the American mind. For a decade &lt;em&gt;The Baffler&lt;/em&gt; has been the invigorating voice of dissent against these developments, in the grand tradition of the muckrakers and The American Mercury. This collection gathers the best of its writing to explore such peculiar developments as the birth of the rebel hero as consumer in the pages of &lt;em&gt;Wired&lt;/em&gt; and &lt;em&gt;Details&lt;/em&gt;; the ever-accelerating race to market youth culture; the rise of new business gurus like Tom Peters and the fad for Hobbesian corporate \"reengineering\"; and the encroachment of advertising and commercial enterprise into every last nook and cranny of American life. With its liberating attitude and cant-free intelligence, this book is a powerful polemic against the designs of the culture business on us all.',1,973.92000000,37432838,'E169.Z82',341,336,0,'973.92 F828',1,NULL,0,0,NULL),(886,'9-780743243803',NULL,'The partly cloudy patriot','EN','Simon & Schuster',200,2002,'Vowell, Sarah, 1969-',NULL,NULL,'MISC035','John W. Fail','the-partly-cloudy-patriot','2016-12-23 22:01:28','2021-01-31 16:15:39',22,'51qDwloQWkL.jpg','image/jpeg',39932,325,500,'From public radio &lt;I &gt;This American Life&lt;/I&gt; contributor and self-described “history nerd” Sarah Vowell comes a collection of humorous and personal essays investigating American history, pop culture and &lt;I &gt;Buffy the Vampire Slayer&lt;/I&gt;.&lt;BR&gt;&lt;BR&gt;In this insightful and funny collection of personal stories Vowell travels through the American past and in doing so ponders a number of curious questions: Why is she happiest when visiting the sites of bloody struggles like Salem or Gettysburg? Why do people always inappropriately compare themselves to Rosa Parks? Why is a bad life in sunny California so much worse than a bad life anywhere else? What is it about the Zen of foul shots? And, in the title piece, why must doubt and internal arguments haunt the sleepless nights of the true patriot?&lt;BR&gt; &lt;BR&gt;Her essays confront a wide range of subjects, themes, icons, and historical moments: Ike, Teddy Roosevelt, and Bill Clinton; Canadian Mounties and German filmmakers; Tom Cruise and &lt;I &gt;Buffy the Vampire Slayer&lt;/I&gt;; twins and nerds; the Gettysburg Address, the State of the Union, and George W. Bush\'s inauguration. &lt;BR&gt; &lt;BR&gt;The result is a teeming and engrossing book, capturing Vowell\'s memorable wit and her keen social commentary.',1,973.00000000,664759649,'E178.6',2,2,0,'973 V974',1,NULL,0,0,NULL),(887,NULL,'978-0552779401','One summer : America, 1927','EN','Black Swan',670,2014,'Bryson, Bill | Bryson, Bill',NULL,NULL,'MISC036','John W. Fail','one-summer-america-1927','2016-12-23 22:01:28','2021-01-31 16:15:39',22,'51872ErFEZL.jpg','image/jpeg',55755,321,500,'&lt;b&gt;A &lt;i&gt;Chicago Tribune&lt;/i&gt; Noteworthy Book&lt;br&gt;A GoodReads Reader\'s Choice&lt;br&gt;&lt;br&gt;In &lt;i&gt;One Summer&lt;/i&gt; Bill Bryson, one of our greatest and most beloved nonfiction writers, transports readers on a journey back to one amazing season in American life.&lt;/b&gt;&lt;br&gt;&lt;br&gt;The summer of 1927 began with one of the signature events of the twentieth century: on May 21, 1927, Charles Lindbergh became the first man to cross the Atlantic by plane nonstop, and when he landed in Le Bourget airfield near Paris, he ignited an explosion of worldwide rapture and instantly became the most famous person on the planet. Meanwhile, the titanically talented Babe Ruth was beginning his assault on the home run record, which would culminate on September 30 with his sixtieth blast, one of the most resonant and durable records in sports history. In between those dates a Queens housewife named Ruth Snyder and her corset-salesman lover garroted her husband, leading to a murder trial that became a huge tabloid sensation. Alvin “Shipwreck” Kelly sat atop a flagpole in Newark, New Jersey, for twelve days—a new record. The American South was clobbered by unprecedented rain and by flooding of the Mississippi basin, a great human disaster, the relief efforts for which were guided by the uncannily able and insufferably pompous Herbert Hoover. Calvin Coolidge interrupted an already leisurely presidency for an even more relaxing three-month vacation in the Black Hills of South Dakota. The gangster Al Capone tightened his grip on the illegal booze business through a gaudy and murderous reign of terror and municipal corruption. The first true “talking picture,” Al Jolson’s &lt;i&gt;The Jazz Singer&lt;/i&gt;, was filmed and forever changed the motion picture industry. The four most powerful central bankers on earth met in secret session on a Long Island estate and made a fateful decision that virtually guaranteed a future crash and depression.&lt;br&gt;     All this and much, much more transpired in that epochal summer of 1927, and Bill Bryson captures its outsized personalities, exciting events, and occasional just plain weirdness with his trademark vividness, eye for telling detail, and delicious humor. In that year America stepped out onto the world stage as the main event, and &lt;i&gt;One Summer&lt;/i&gt; transforms it all into narrative nonfiction of the highest order.&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;i&gt;From the Hardcover edition.&lt;/i&gt;',1,973.91000000,825046674,'E791',2851,3536,0,'973.91 B915',1,NULL,0,0,NULL),(888,'null','null','ISSP 2009 Catalogue','EN','ISSP',0,2009,'','null','null','LV.A001','null','issp-2009-catalogue','2016-12-23 22:01:28','2021-02-09 07:22:40',8,NULL,NULL,NULL,NULL,NULL,'null',1,779.09400000,0,NULL,NULL,NULL,1,'779.094 I86 Iss',1,'undefined',0,1,NULL),(889,'null','null','ISSP 2010 Catalogue','EN','ISSP',154,2010,NULL,'null','null','LV.A002','null','issp-2010-catalogue','2016-12-23 22:01:28','2021-02-09 08:50:04',8,NULL,NULL,NULL,NULL,NULL,'null',1,779.09400000,0,NULL,NULL,NULL,1,'779.094 N969',1,'undefined',0,0,NULL),(890,'null','null','ISSP 2011 Catalogue','EN','ISSP',174,2011,NULL,'null','null','LV.A003','null','issp-2011-catalogue','2016-12-23 22:01:28','2021-02-09 08:50:04',8,NULL,NULL,NULL,NULL,NULL,'null',1,779.09400000,0,NULL,NULL,NULL,1,'779.094 N969 Iss',1,'undefined',0,0,NULL),(891,'null','null','ISSP 2008 Catalogue','EN','ISSP',0,2008,NULL,'null','null','LV.A004','null','issp-2008-catalogue