921- [Translator; Editor] | Heim, Michael Henry [Translator] | Reed, T. J. 1937- [Commentator; Writer of accompanying material; Editor; Author of introduction]','Translated and with an introduction by David Luke','','FIC001','','death-in-venice-and-other-stories','2016-12-23 22:01:29','2021-01-31 16:15:41',21,'71uCgWke5mL.jpg','image/jpeg',208375,894,1460,'',1,833.91200000,106470,'PT2625.A44',5008,6904,0,'833.912 M282 Dea',1,NULL,0,0,NULL),(942,'1-85958-009-2',NULL,'Classic myth and legend,','EN','Senate',440,1994,'Moncrieff, A. R. Hope (Ascott Robert Hope), 1846-1927',NULL,NULL,'FIC002',NULL,'classical-mythology','2016-12-23 22:01:29','2021-01-31 17:03:35',21,'51vMz1yh-GL.jpg','image/jpeg',39812,261,425,'An inspiration to many centuries of writers, the characters that people the Ancient Greek myths are a spellbinding mixture of gods and heroes, monsters and magicians. some, like Thesus and Agamemmon, are probably based on historical figures. Others have been invented to explain the wonders of nature, the passage of the sun across the sky or the beautiful song of the nightingale. This delightful collection brings together all the most familiar tales with some that are less well known.',3,292.13000000,894780,'BL721',305,586,0,'292.13 M739',1,NULL,0,0,NULL),(943,'0-099-28297-6',NULL,'The cry of the owl','EN','Vintage',250,1999,'Highsmith, Patricia | Llinás, Joaquín, [Translator]',NULL,NULL,'FIC003',NULL,'the-cry-of-the-owl','2016-12-23 22:01:29','2021-01-31 16:15:42',21,'41y-aWYyTnL.jpg','image/jpeg',29815,333,500,'&lt;DIV&gt;In a small Pennsylvania town, Robert Forrester is recuperating from a nasty divorce and a bout of psychological trouble. One evening, while driving home, he sees a pretty young woman framed by her bright kitchen window. Soon, he can’t keep himself away. But when Robert is inevitably discovered, obsession is turned on its head, and he finds himself unable to shake the young woman, nor entirely sure whether he should. Recently made into a major motion picture starring Julia Stiles and Paddy Considine, &lt;i&gt;The Cry of the Owl&lt;/i&gt; is essential Highsmith, a modern classic ready to be reborn.&lt;/DIV&gt;',1,813.54000000,1813819,'PS3558.I366',454,479,0,'813.54 H638',1,NULL,0,0,NULL),(944,'','978-5-417-00927-3','Jūros žvaigždė','LT','Mintis',552,2007,'O\'Connor, Joseph','','','FIC004','','juros-zvaigzde','2016-12-23 22:01:29','2021-02-04 22:10:57',21,'5190d835382d3.jpg','image/jpeg',18732,305,480,'',1,823.91400000,0,NULL,NULL,NULL,1,'823.914 O18',1,'undefined',0,0,NULL),(945,'9986-495-49-0','','Kelionė į antgamtinį pasaulį','LT','Amžinoji Uola',170,2005,'Morno, Rodžeris','','','FIC006','','kelione-i-antgamtini-pasauli','2016-12-23 22:01:29','2021-02-04 21:43:48',21,'kelione-i-antgamtini-pasauli-big.jpg','image/jpeg',12191,155,260,'',1,891.92000000,0,NULL,NULL,NULL,1,'891.92 M866',1,'undefined',0,0,NULL),(946,'null','978-609-404-055-9','Aš ir kt. Dykaduoniai','LT','Druka',88,2009,'Bložė, Vytautas P.','poetry','null','FIC007','null','as-ir-kt-dykaduoniai','2016-12-23 22:01:29','2021-02-04 20:12:30',21,NULL,NULL,NULL,NULL,NULL,'null',1,891.92000000,0,NULL,NULL,NULL,1,'891.92 B651 Air',1,'undefined',0,0,NULL),(947,'9955-624-13-2','','Perrašai : [eiliuoti tekstai]','LT','Vilniaus dailės akademijos leidykla',298,2005,'Daujotytė, Viktorija','','','FIC008','','perrasai-eiliuoti-tekstai','2016-12-23 22:01:29','2021-02-04 22:10:02',21,'9955-624-13-2_3_.jpg','image/jpeg',2321,125,169,'',1,891.92000000,0,NULL,NULL,NULL,1,'891.92 D235',1,'undefined',0,0,NULL),(948,'0-75287-377-6',NULL,'The two minute rule','EN','Orion Books',325,2006,'Crais, Robert | Ediciones B (Firm) | Tézenas, Hubert [Translator]',NULL,NULL,'FIC009',NULL,'the-two-minute-rule','2016-12-23 22:01:29','2021-01-31 16:15:44',21,'51PPAhSp1PL.jpg','image/jpeg',54973,336,500,'Ask anyone on the wrong side of the law about the two minute rule and they\'ll tell you that\'s as long as you can hope for at a robbery before the cops show up. Break the two minute rule and it\'s a lifetime in jail. But not everyone plays by the rules…&lt;br&gt;&lt;br&gt;When ex-con Max Holman finally gets out of jail, freedom doesn\'t taste too sweet. The only thing on his mind is reconciliation with his estranged son, who is, ironically, a cop. But then he hears the devastating news:  His son and three other Los Angeles police officers were gunned down in cold blood the night before Holman\'s release. When the hit is exposed as a revenge killing and the question of police corruption is raised, it becomes a father\'s last duty to clear his son\'s name and catch the killer. With all the elements that have made Robert Crais one of the very best crime novelists today, The Two Minute Rule is gripping, edgy suspense from the author who sets the standard when it comes to surprising plot twists and powerful characters.&lt;br&gt;',1,813.54000000,62342228,'PS3553.R264',3494,3442,0,'813.54 C886',1,NULL,0,0,NULL),(949,'','','Tims Talers jeb pardotie smiekli','LV','Liesma',190,1970,'Kriss, Džeimss','','','FIC010','','tims-talers-jeb-pardotie-smiekli','2016-12-23 22:01:29','2021-02-04 20:20:56',21,'12809201.jpg','image/jpeg',23232,253,350,'',1,891.92000000,0,NULL,NULL,NULL,1,'891.92 K89',1,'undefined',0,0,NULL),(950,'0-330-29152-1',NULL,'The engineer of human souls : an entertainment on the old themes of life, women, fate, dreams, the working class, secret agents, love, and death','EN','Pan Books',571,1984,'Škvorecký, Josef, 1924-2012',NULL,NULL,'FIC011',NULL,'the-engineer-of-human-souls','2016-12-23 22:01:29','2021-01-31 16:15:44',21,'11n9316x-GL.jpg','image/jpeg',3348,97,130,'The Engineer of Human Souls is a labyrinthine comic novel that investigates the journey and plight of novelist Danny Smiricky, a Czech immigrant to Canada. As the novel begins, he is a professor of American literature at a college in Toronto. Out of touch with his young students, and hounded by the Czech secret police, Danny is let loose to roam between past and present, adopting whatever identity that he chooses or has been imposed upon him by History.',1,891.86350000,10889718,'PG5038.S527',878,975,0,'891.8635 K97',1,NULL,0,0,NULL),(951,'','978-0-140-28567-3','About a boy','EN','Penguin Books',307,1988,'Hornby, Nick | Hornby, Nick [Contributor; Creator; Other] | Drechsler, Clara, 1961- [Translator] | Bok, Anneke [Translator] | Hellmann, Harald [Translator]','','','FIC013','','about-a-boy','2016-12-23 22:01:29','2021-01-31 16:15:44',21,'4271.jpg','image/jpeg',47234,292,475,'',1,823.91400000,37980871,'PR6058.O689',3274,2838,0,'823.914 H814',1,NULL,0,0,NULL),(952,'9955-13-021-0','','Plytų gatvė','LT','Jotema',432,2005,'Ali, ; Monica, ','','','FIC012','','plytu-gatve','2016-12-23 22:01:29','2021-02-04 20:20:35',21,'plyt-gatv-ali-monica.jpg','image/jpeg',36847,600,600,'',1,823.92000000,0,NULL,NULL,NULL,1,'823.92 A398',1,'undefined',0,0,NULL),(953,'0-670-03459-2',NULL,'Slow man','EN','Viking ',265,2005,'Coetzee, J. M., 1940- | Böhnke, Reinhild [Translator]',NULL,NULL,'FIC014',NULL,'slow-man','2016-12-23 22:01:29','2021-02-04 20:13:20',21,'41C2EE88Q5L.jpg','image/jpeg',17182,325,500,'When photographer Paul Rayment loses his leg in a bicycle accident, his solitary  life is irrevocably changed whether he likes it or not. Stubbornly refusing a  prosthesis, Paul returns to his bachelor’s apartment in Adelaide, Australia,  uncomfortable with his new dependency on others. He is given to bouts of  hopelessness and resignation as he looks back on his sixty years of life, but  his spirits are lifted when he finds himself falling in love with Marijana, his  practical, down-to-earth Croatian nurse who is struggling to raise her family in  a foreign land. As Paul contemplates how to win her heart, he is visited by the  mysterious writer Elizabeth Costello, who challenges Paul to take an active role  in his own life. &lt;P&gt; In this new book, Coetzee offers a profound meditation on what makes us human,  on what it means to grow older and reflect on how we have lived our lives. Like  all great works of literature, &lt;I&gt;Slow Man&lt;/I&gt; is a novel that asks questions  but rarely provides answers; it is a portrait of a man in search of truth. Paul  Rayment’s accident changes his perspective on life, and as a result, he begins  to address the kinds of universal concerns that define us all: What does it mean  to do good? What in our lives is ultimately meaningful? Is it more important for  one to feel loved or cared for? How do we define the place that we call \"home\"?  In his clear and uncompromising voice, Coetzee struggles with these issues, and  the result is a deeply moving story about love and mortality that dazzles the  reader on every page.',1,823.91400000,61431359,'PR9369.3.C58',1984,2112,0,'823.914 C672',1,NULL,0,0,NULL),(954,'0-571-21972-1',NULL,'Solaris','EN','faber and faber',214,2003,'Lem, Stanisław | Kilmartin, Joanna [Translator] | Cox, Steve, 1961- [Translator] | Suvin, Darko, 1930- [Author of introduction] | Orzechowska, Joanna, [Translator]',NULL,NULL,'FIC015',NULL,'solaris','2016-12-23 22:01:29','2021-01-31 16:15:45',21,'51hSgdnW42L.jpg','image/jpeg',40972,325,500,'A psychologist arrives at a research space station called Prometheus, his mission to ascertain whether research into the mysterious planet of Solaris should be terminated. He finds Prometheus all but deserted, its straggling crew seemingly haunted by hallucinations of figures from their pasts.',3,891.85370000,105763,'PG7158.L39',1403,1548,0,'891.8537 L544',1,NULL,0,0,NULL),(955,'968-5961-25-5','','Lunar Park','ES','Mondadori',380,2006,'Ellis, Bret Easton, (1964- ...)., | Rodríguez Juiz, Cruz [Translator] | Drechsler, Clara, 1961- [Translator] | Hellmann, Harald [Translator]','','','FIC016','','lunar-park','2016-12-23 22:01:29','2021-02-04 14:06:14',21,'4031.jpg','image/jpeg',13788,307,475,'',1,813.54000000,57549743,'PS3555.L5937',1685,1532,0,'813.54 E47',1,NULL,0,0,NULL),(957,'9986-39-261-6','','Herbas ir varlės : romanas','LT','Lietuvos rašytojų sąjungos leidykla',223,2003,'Staniulis, Tomas','','','FIC018','','herbas-ir-varles','2016-12-23 22:01:29','2021-02-04 20:10:40',21,'file1921515_book_cover.jpg','image/jpeg',17676,520,344,'',1,891.92000000,52729033,'PG8723.29.T36',NULL,8,0,'891.92 S784',1,'undefined',0,0,NULL),(958,'','978-0-241-95278-8','What the hell is he thinking?: All the questions you\'ve ever asked about men answered','EN','Penguin Books',286,2010,'Strimpel, Zoe','','','MISC060','formerly miscatalogued as FIC019','what-the-hell-is-he-thinking-all-the-questions-you-ve-ever-asked-about-men-answered','2016-12-23 22:01:29','2021-02-09 17:29:06',22,'81msBCS6xML.jpg','image/jpeg',379007,1524,2339,'',1,306.70000000,0,NULL,NULL,NULL,1,'306.7 S916',1,'undefined',0,0,NULL),(959,'0-571-20918-1',NULL,'Immortality','EN','faber and faber',387,1991,'Kundera, Milan | Kussi, Peter [Translator] | Sollers, Philippe, 1936-',NULL,NULL,'FIC020',NULL,'immortality','2016-12-23 22:01:29','2021-02-04 14:33:48',21,'21FSV05S4XL.jpg','image/jpeg',6106,110,180,'A.novel, divided into seven parts and exploring immortality. This is the author\'s seventh novel. His previous works include \"The Joke\", \"The Book of Laughter and Forgetting\" and \"The Unbearable Lightness of Being\". He has written one play, \"Jacques and his Master\".',3,891.86350000,22355245,'PG5039.21.U6',2156,2303,0,'891.8635 K95',1,NULL,0,0,NULL),(960,'','978-0-8050-8788-8','To hellholes and back : bribes, lies, and the art of extreme tourism','EN','Holt Paperbacks',322,2009,'Thompson, Chuck','Bribes, Lies, and the Art of Extreme Tourism','','LPST068','formerly miscatalogued as FIC021','to-hellholes-and-back','2016-12-23 22:01:29','2021-01-31 16:15:46',16,'41DSW1kgM0L.jpg','image/jpeg',25751,330,500,'&lt;p&gt;&lt;b&gt;The guru of extreme tourism sets out to face his worst fears in Africa, India, Mexico City, and—most terrifying of all—at Disney World&lt;/b&gt;&lt;/p&gt;&lt;p&gt;In the widely-acclaimed &lt;i&gt;Smile When You\'re Lying&lt;/i&gt;, Chuck Thompson laid bare the travel industry\'s dirtiest secrets.  Now he\'s out to discover if some of the world\'s most ill-reputed destinations live up to their bad raps, while confronting a few of his own travel anxieties in the process.  Whether he\'s traveling across the Congo with a former bodyguard from notorious dictator Joseph Mobutu\'s retinue or diving into the heart of India\'s monsoon season, &lt;i&gt;To Hellholes and Back&lt;/i&gt; delivers Thompson\'s trademark combination of hilarious stories and wildly provocative opinions, as well as some surprising observations about America\'s evolving place in the world.&lt;/p&gt;',1,910.40000000,317928958,'G465',350,343,0,'910.4 T469',1,NULL,0,0,NULL),(961,'0-679-60161-9',NULL,'Ahead of all parting : the selected poetry and prose of Rainer Maria Rilke','DE/EN','The Modern Library New York',615,1995,'Rilke, Rainer Maria, 1875-1926 | Mitchell, Stephen, 1943- [Editor]',NULL,NULL,'FIC022',NULL,'ahead-of-all-parting-the-selected-poetry-and-prose-of-rainer-maria-rilke','2016-12-23 22:01:29','2021-02-04 14:19:21',21,'51gLWRxUu6L.jpg','image/jpeg',35889,337,500,'The reputation of Rainer Maria Rilke has grown steadily since his death in 1926; today he is widely considered to be the greatest poet of the twentieth century. This Modern Library edition presents Stephen Mitchell’s acclaimed translations of Rilke, which have won praise for their re-creation of the poet’s rich formal music and depth of thought. “If Rilke had written in English,” Denis Donoghue wrote in &lt;i&gt;The New York Times Book Review, &lt;/i&gt;“he would have written in this English.” &lt;i&gt;Ahead of All Parting &lt;/i&gt;is an abundant selection of Rilke’s lifework. It contains representative poems from his early collections &lt;i&gt;The Book of Hours &lt;/i&gt;and &lt;i&gt;The Book of Pictures; &lt;/i&gt;many selections from the revolutionary &lt;i&gt;New Poems, &lt;/i&gt;which drew inspiration from Rodin and Cezanne; the hitherto little-known “Requiem for a Friend”; and a generous selection of the late uncollected poems, which constitute some of his finest work. Included too are passages from Rilke’s influential novel, &lt;i&gt;The Notebooks of Malte Laurids Brigge, &lt;/i&gt;and nine of his brilliant uncollected prose pieces. Finally, the book presents the poet’s two greatest masterpieces in their entirety: the &lt;i&gt;Duino Elegies &lt;/i&gt;and &lt;i&gt;The Sonnets to Orpheus&lt;/i&gt;. “Rilke’s voice, with its extraordinary combination of formality, power, speed and lightness, can be heard in Mr. Mitchell’s versions more clearly than in any others,” said W. S. Merwin. “His work is masterful.”',3,831.91200000,31605945,'PT2635.I65',475,464,0,'831.912 R573',1,NULL,0,0,NULL),(962,'0-14-018625-5',NULL,'The Street of Crocodiles','EN','Penguin Books',160,1977,'Schulz, Bruno, 1892-1942 | Wheatley, Mark, 1958- [Other] | Schulz, Bruno, 1892-1942 [Contributor; Other] | Hahn, Josef, 1912-1991 [Translator; Contributor] | McBurney, Simon | Shkrabi︠̕u︡k, Andriĭ',NULL,NULL,'FIC023',NULL,'the-street-of-crocodiles','2016-12-23 22:01:29','2021-01-31 16:15:47',21,'51U8GJp4E_2BL.jpg','image/jpeg',44798,320,500,'The Street of Crocodiles in the Polish city of Drogobych is a street of memories and dreams where recollections of Bruno Schulz\'s uncommon boyhood and of the eerie side of his merchant family\'s life are evoked in a statling blend of the real and fantastic. Most memorable and most chilling is the portrait of the author\'s father, a maddened shopkeeper who imports rare birds\' eggs to hatch in his attic, who believes tailors\' dummies should be treated like people, and whose obsessive fear of cockroaches causes him to resemble one. Bruno Shultz, a Polish Jew killed by Nazis in 1942 is considered by many to have been the leading Polish writer between the two world wars.',3,891.85370000,1611429,'PG7158.S294',652,736,0,'891.8537 S389',1,NULL,0,0,NULL),(963,NULL,'978-0-345-45374-7','The ultimate hitchhiker\'s guide to the galaxy : five novels and one story','EN','Ballantine Books',815,2002,'Adams, Douglas, 1952-2001,',NULL,NULL,'FIC024',NULL,'the-ultimate-hitchhiker-s-guide-to-the-galaxy','2016-12-23 22:01:29','2021-01-31 16:15:47',21,'41LqmJuZ5ML.jpg','image/jpeg',30542,500,500,'Book very clean, dust cover in good shape. Includes five stories: The Hitchhiker\'s Guide to the Galaxy; The Restaurant at the End of the Universe; Life, the Universe, and Everything; So Long and Thanks for All the Fish; Young Zaphod Plays It Safe',3,822.91400000,784094455,'PR6051.D3352',61,60,0,'822.914 A212',1,NULL,0,0,NULL),(964,'','978-5-415-02133-8','Valgyk.Melskis.Mylėk','LT','Vaga',381,2011,'Gilbert, Elizabeth','','','FIC025','','valgyk-melskis-mylek','2016-12-23 22:01:29','2021-02-04 22:12:17',21,'1475739131_1462873083_valgyk-melskis-mylek.jpg','image/jpeg',40115,391,589,'',1,910.40000000,0,NULL,NULL,NULL,1,'910.4 G465',1,'undefined',0,0,NULL),(965,'','978-1-85715-289-0','The magic mountain (Der Zauberberg)','EN','Everyman\'s Library',854,2005,'Mann, Thomas (1875-1955) | Lowe-Porter, H. T. 1876-1963 [Translator; Author; Contributor] | Woods, John E. [Translator] | Hoffman, Felix [Illustrator] | Neumann, Michael, 1951- [Editor]','','','FIC026','','the-magic-mountain','2016-12-23 22:01:29','2021-01-31 16:15:47',21,'0dc53c291cd90869eb9b596727f111fe.jpg','image/jpeg',335602,608,900,'',1,833.91200000,223495,'PT2625.A44',3349,7796,0,'833.912 M282 Mag',1,NULL,0,0,NULL),(966,NULL,'978-0-15-657204-0','Marcovaldo, or, The seasons in the city','EN','Harcourt Books',121,1983,'Calvino, Italo',NULL,NULL,'FIC027',NULL,'marcovaldo-or-the-seasons-in-the-city','2016-12-23 22:01:29','2021-02-04 14:27:47',21,'4184ULZew6L.jpg','image/jpeg',23681,331,500,'&lt;div&gt;Marcovaldo is an unskilled worker in a drab industrial city in northern Italy. He is an irrepressible dreamer and an inveterate schemer. Much to the puzzlement of his wife, his children, his boss, and his neighbors, he chases his dreams-but the results are never the expected ones. Translated by William Weaver. A Helen and Kurt Wolff Book&lt;br /&gt;&lt;/div&gt;',1,853.91400000,9393818,'PQ4809.A45',884,837,0,'853.914 C168 Mar',1,NULL,0,0,NULL),(967,'null','978-0-749-38647-4','Buddenbrooks','EN','Vintage Classics',604,1999,'Mann, Thomas, 1875-1955 ','null','null','FIC028','null','buddenbrooks','2016-12-23 22:01:29','2021-02-04 14:21:18',21,'512n8St-pFL.jpg','image/jpeg',37713,324,500,'A Major Literary Event: a brilliant new translation of Thomas Mann\'s first great novel, one of the two for which he was awarded the Nobel Prize in literature in 1929.&lt;br&gt;&lt;br&gt;Buddenbrooks, first published in Germany in 1900, when Mann was only twenty-five, has become a classic of modem literature -- the story of four generations of a wealthy bourgeois family in northern Germany. With consummate skill, Mann draws a rounded picture of middle-class life: births and christenings; marriages, divorces, and deaths; successes and failures. These commonplace occurrences, intrinsically the same, vary slightly as they recur in each succeeding generation. Yet as the Buddenbrooks family eventually succumbs to the seductions of modernity -- seductions that are at variance with its own traditions -- its downfall becomes certain.&lt;br&gt;&lt;br&gt;In immensity of scope, richness of detail, and fullness of humanity, Buddenbrooks surpasses all other modem family chronicles; it has, indeed, proved a model for most of them. Judged as the greatest of Mann\'s novels by some critics, it is ranked as among the greatest by all. Thomas Mann was awarded the Nobel Prize for literature in 1929.&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;i&gt;From the Hardcover edition.&lt;/i&gt;',2,833.91200000,295409,'PT2625.A44',3342,6058,0,'833.912 M282 Magic',1,'undefined',0,0,NULL),(968,NULL,'978-0-374-52837-9','The brothers Karamazov','EN','Farrar, Straus & Giroux',798,2002,'Dostoyevsky, Fyodor, 1821-1881',NULL,NULL,'FIC029',NULL,'the-brothers-karamazov','2016-12-23 22:01:29','2021-02-04 20:19:55',21,'51Z63N4f2nL.jpg','image/jpeg',41489,335,500,'&lt;p&gt;The award-winning translation of Dostoevsky\'s last and greatest novel.&lt;/p&gt;',1,891.73300000,24539109,'PG3326',845,845,0,'891.733 D722',1,NULL,0,0,NULL),(969,'null','null','Betoniniai triušiai / The Concrete Bunnies','LT/EN','Vario burnos',35,2012,'Butkus, Tomas S.; Gimžauskas, Audronis; Dobriakov, Jurij','CD is missing','null','FIC030','null','betoniniai-triusiai-the-concrete-bunnies','2016-12-23 22:01:29','2021-02-04 20:13:48',21,NULL,NULL,NULL,NULL,NULL,'null',1,891.92000000,0,NULL,NULL,NULL,1,'891.92 B983',1,'undefined',0,0,NULL),(970,'3-442-43262-6',NULL,'Flieh, wenn du kannst : Roman','DE','Goldman',416,1995,'Fielding, Joy | Sandberg-Ciletti, Mechtild [Translator]',NULL,NULL,'FIC031',NULL,'flieh-wenn-du-kannst','2016-12-23 22:01:29','2021-02-04 13:47:55',21,'41IaA_2BJYUIL.jpg','image/jpeg',22603,315,500,NULL,3,810.00000000,44450856,NULL,64,NULL,0,'810 F459',1,NULL,0,0,NULL),(971,'9955-584-65-3','','Doriforė : romanas','LT','Baltos lankos',260,2004,'Parulskis, Sigitas','','','FIC032','','dorifore','2016-12-23 22:01:29','2021-02-04 22:07:42',21,'153657-imgp3218.JPG','image/jpeg',54573,539,800,'',1,891.92000000,63297071,'PG8722.26.A77',NULL,7,0,'891.92 P221',1,'undefined',0,0,NULL),(972,NULL,'978-9955-23-464-7','Tiramisu Karalienė','LT','Baltos lankos',280,2011,'Bohdan Slawinski',NULL,NULL,'FIC033',NULL,'tiramisu-karaliene','2016-12-23 22:01:29','2021-01-23 17:45:50',21,'31pA07Vwt9L.jpg','image/jpeg',14175,170,284,'Man nerupejo jos pamatai - pasake, kad turi dukra ir vyra, kazkoki Olega Petersena, milziniskos korporacijos prezidenta. O juk as esu tik vargsas, chalturas gaudantis doktorantas, kartais ka nors isverciantis, suorganizuojantis kokia nors konferencija apie jaunuju proza ar lingvistinei poezijai skirta projekta. Del jos galeciau buti kad ir varliu pjaustytojas - literatura tokia slidi ir salta. Kuklus doktorantas, kuris, uzuot gyvenes, yra iki ausu pasineres i tekstus. Bet mastykime protingai, moksliskai, kaip isterijos tyrinetojai, koncentracijos lageriu ir muilo idejos kurejai, kaip ulonai, kurie grizk pabuciuok, po daugelio metu, suvarge, savo mylima - jiems nesant armiju aplankyta - skaiscia tarsi madona atrado. Juk tai tik tikejimo klausimas - jeigu tik busiu istvermingas, jeigu tik neissigasiu, gal palenksiu ja i savo puse? *** Grozis derejo prie jos gerklinio murkavimo. Ji svytejo pasitikejimu savimi, dvelke cinamonu ir labai gerais kvepalais. Jai galejo buti keturiasdesimt, is bedos tiko man i motinas, bet man tai visiskai netrukde. Jei kas nors butu pasakes, kad ji puikiai susitvarkiusi, buciau iskvietes dvikovon, ji tiesiog buvo grazi. Stebuklingai uzglaisciusi vos matomus irimo pedsakus, ir todel man atrode dar labiau gundanti. Subrendusi, savo svelnuma ir jautruma puoselejanti moteris, joje stai pastebiu jaudinancius rudziu slakelius. Gal nubudo manyje kokia nors vaikystes nostalgija - moteris, sugebanti pasipriesinti plesriai aplinkai, kartu svelni ir protinga meiluze, parodysianti geriausia kelia per gyvenima.',3,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(973,'','978-9986-588-40-5','Metų laikai : eilėraščių poema','LT','Klaipėdos kultūrų komunikacijų centras',136,2010,'Bložė, Vytautas P.','','','FIC034','','metu-laikai-eilerasciu-poema','2016-12-23 22:01:29','2021-02-04 19:59:28',21,'e4b3dfe87f813d6e3d06b402af197270ed204fe4.jpg','image/jpeg',43281,900,681,'',1,891.92000000,0,NULL,NULL,NULL,1,'891.92 B651',1,'undefined',0,0,NULL),(974,'','9789955605812','Bedalis ir labdarys : dialogai ir monologai','LT','Apostrofa',156,2013,'Pukytė, Paulina','','','FIC035','','bedalis-ir-labdarys','2016-12-23 22:01:29','2021-01-24 18:41:16',21,'Bedalis-ir-labdarys-1946.jpg','image/jpeg',87787,552,800,'',3,NULL,883421938,'PG8723.26.U35',NULL,2,0,NULL,1,NULL,0,0,NULL),(975,'null','978-3-499-21614-5','Stadtrandritter : Roman','DE','Rotfuchs',678,2013,'Mohl, Nils','null','\n','FIC036','null','stadtrandritter-nils-mohl','2016-12-23 