. that were either part of the original artifact, or were introduced by the scanning process.  We believe this work is culturally important, and despite the imperfections, have elected to bring it back into print as part of our continuing commitment to the preservation of printed works worldwide.  We appreciate your understanding of the imperfections in the preservation process, and hope you enjoy this valuable book.',1,843.91400000,1110508,'PQ2676.E67',727,952,0,'843.914 P434 Voi',1,NULL,0,0,NULL),(985,NULL,'978-1860461255','Three by Perec','EN','Harvill',179,1996,'Perec, Georges, 1936-1982 | Monk, Ian',NULL,NULL,'FIC046','John W. Fail','three','2016-12-23 22:01:29','2021-01-31 16:15:49',21,'41PXCSR0HEL.jpg','image/jpeg',30135,293,475,'Perec has rightfully assumed his position in the pantheon of truly original writers of the past century. Godine has issued all but one of is his books in this country, including his masterpiece Life, A User\'s Manual. Here, in one volume, are three \"easy pieces\" by the master of the verbal firecracker and Gallic wit. The novella \"The Exeter Text\" contains all those e\'s that were omitted from A Void (Perec hated waste) and no other vowel (honest). In \"Which Moped with Chrome-Plated Handlebars at the Back of the Yard?\" we are introduced to Sergeant Henri Pollak and his vehicle (the aforementioned moped) that carried him between Vincennes and Montparnasse; in \"A Gallery Portrait\", the sensation of the 1913 exhibition in Pittsburgh depicts the artists\' patron, beer baron Hermann Raffke, sitting in front of his huge art collection, which includes (of course) \"A Gallery Portrait\" of the baron sitting before \"A Gallery Portrait,\" etc.',1,843.91400000,35233311,'PQ2676.E67',172,171,0,'843.914 P434 Thr',1,NULL,0,0,NULL),(986,NULL,'978-0140265439','New Penguin parallel texts, short stories in French','EN/FR','Penguin',214,1999,'Coward, Richard, 1955-',NULL,NULL,'FIC047','John W. Fail','short-stories-in-french-new-penguin-parallel-text','2016-12-23 22:01:29','2021-01-31 16:15:49',21,'51IN0fhEG4L.jpg','image/jpeg',34313,330,500,'This is an all new version of the popular PARALLEL TEXT series, containing eight pieces of contemporary fiction in the original French and in English translation. Including stories by Bolanger, Cotnoir, Le Clezio and Germain, this volume gives afascinating insight into French culture and literature as well as providing an invaluable educational tool.',1,843.01080000,937656570,'PQ1109',2,1,0,'843.0108 C874',1,NULL,0,0,NULL),(987,'0586038175','null','Briefing for a descent into hell','EN','Panther',252,1973,'Lessing, Doris, 1919-2013','null','null','FIC048','John W. Fail','briefing-for-a-descent-into-hell','2016-12-23 22:01:29','2021-02-04 15:22:56',21,'416j2NFUKGL.jpg','image/jpeg',17708,333,500,'null',1,823.91400000,258347896,'PR6023.E833',13,16,0,'823.914 L639',1,'undefined',0,0,NULL),(988,'0-8112-0495-2',NULL,'Splendide-Hôtel','EN','New Directions',61,1973,'Sorrentino, Gilbert',NULL,NULL,'FIC049','John W. Fail','splendide-hotel','2016-12-23 22:01:29','2021-02-04 15:20:59',21,'51nyf71TikL.jpg','image/jpeg',34129,341,500,'&lt;p&gt;Arthur Rimbaud\'s invented \"Splendide-Hotel,\" \"built in the chaos of ice and of the polar night,\" provides the occasion for Sorrentino\'s imaginative meditation on letters and language. Each chapter serves as an opportunity for the author to expand on thoughts and images suggested by a letter of the alphabet, as well as to reflect upon the workings of the imagination, particularly in the art of William Carlos Williams and Arthur Rimbaud. Reminiscent of the philosophical treatise/poem \"On Being Blue\" by William H. Glass, \"Splendide-Hotel\" is a Grand Hotel of the mind, splendidly conceived.',1,818.54070000,754626,'PS3569.O7',498,507,0,'818.5407 S713',1,NULL,0,0,NULL),(989,'null','978-1-892061-31-7','Partial list of people to bleach : [fictions and an essay]','EN','Future Tense',56,2007,'Lutz, Gary, 1955-','null','null','FIC050','John W. Fail','partial-list-of-people-to-bleach','2016-12-23 22:01:29','2021-02-04 15:16:23',21,'51rE4_2BWKeSL.jpg','image/jpeg',50136,404,500,'A stunning collection of new and rare stories by Gary Lutz, the celebrated author of Stories in the Worst Way and I Looked Alive.',1,813.60000000,166889610,'PS3562.U82',39,51,0,'813.6 L975',1,'undefined',0,0,NULL),(990,'1-878972-14-6',NULL,'How I wrote certain of my books','EN','Exact Change',262,1995,'Roussel, Raymond, 1877-1933 | Winkfield, Trevor [Translator; Editor] | Ashbery, John, 1927-2017 [Translator; Editor; Author of introduction]',NULL,NULL,'FIC051','John W. Fail','how-i-wrote-certain-of-my-books','2016-12-23 22:01:29','2021-01-31 16:15:50',21,'51Jl2kk7W_2BL.jpg','image/jpeg',49168,375,500,'Raymond Roussel (1877-1933), next-door neighbor of Marcel Proust, can be described without exaggeration as the most eccentric writer of the twentieth century. His unearthly style based on elaborate linguistic riddles and puns fascinated the Surrealists and famously influenced the composition of Marcel Duchamp\'s “Large Glass,” but also affected writers as diverse as Gide, Robbe-Grillet and Foucault (author of a book-length study of Roussel). The title essay of this collection is the key to Roussel’s method, and it is accompanied by selections from all his major works of fiction, drama and poetry, translated by his New York School admirers John Ashbery, Kenneth Koch and Harry Mathews, and the painter and author Trevor Winkfield. Ashbery writes that Roussel’s work is “like the perfectly preserved temple of a cult which has disappeared without a trace… we can still admire its inhuman beauty, and be stirred by a language that seems always on the point of revealing its secret.”',1,848.91209000,2404799,'PQ2389.R6',283,131,0,'848.91209 R865',1,NULL,0,0,NULL),(991,'0-916583-86-4',NULL,'Imaginative qualities of actual things','EN','Dalkey Archive',243,1991,'Sorrentino, Gilbert',NULL,NULL,'FIC052','John W. Fail','imaginative-qualities-of-actual-things','2016-12-23 22:01:29','2021-01-31 16:15:51',21,'71SCAGSDG8L.gif','image/gif',163448,302,475,'Gilbert Sorrentino’s third novel is about the New York artistic and literary world of the 1950s and ’60s, specifically the artists, writers, hangers-on, and the phonies who populated that world. In a prose that is ruthless as well as possessed of an enormous comic verve, the dedicated, the stupid, the rapacious, and the foolish are dissected. Eight major characters, many of whom reappear in Sorrentino’s later novels, are employed to allow the reader a variety of views of the same world.&lt;br /&gt;&lt;br /&gt;Told in the weary voice of a cynical and sardonic narrator, the novel is crammed with fantastic characters, incidents, and episodes, and moves from wit and satire through elegiac brooding, to bitter invective. It is a superb re-creation of a real time and place.',1,813.54000000,196024,'PS3569.O7',516,537,0,'813.54 S713 Ima',1,NULL,0,0,NULL),(992,NULL,'978-1-56478-549-7','Friction','EN','Dalkey Archive',417,2007,'Urroz Kanan, Eloy, 1967-',NULL,NULL,'FIC116','John W. Fail','friction','2016-12-23 22:01:29','2021-01-31 16:15:51',21,'511Z9wjaimL.jpg','image/jpeg',51195,333,500,'&lt;p&gt;A dazzling literary card game: an investigation into how and why we fall into or out of love--with a person or a book.',1,863.64000000,226356229,'PQ7298.31.R73',245,255,0,'863.64 U81',1,NULL,0,0,NULL),(993,'0-684-82479-5','null','Snow White','EN','Scirbner',186,1996,'Barthelme, Donald','null','null','FIC053','John W. Fail','snow-white','2016-12-23 22:01:29','2021-02-04 13:52:44',21,'41NhuD1s_2B7L.jpg','image/jpeg',30183,329,500,'An inventive, satiric modern retelling of the classic fairy tale provides an incisive and biting commentary on the absurdities and complexities of modern life.&lt;BR&gt;&lt;BR&gt;In &lt;I &gt;Snow White&lt;/I&gt;, Donald Barthelme subjects the traditional fairy tale to postmodern aesthetics. In the novel, the seven dwarves are men who live communally with Snow White and earn a living by washing buildings and making Chinese baby food. Snow White quotes Mao and the dwarves grapple with low self-esteem in this raucous retelling of the classic tale.',1,813.54000000,88108,'PS3552.A76',252,1183,0,'813.54 B285 Sno',2,'undefined',0,0,NULL),(994,'0-14-014992-9',NULL,'The king','EN','Penguin',162,1990,'Barthelme, Donald | Moser, Barry [Illustrator]',NULL,NULL,'FIC054','John W. Fail','the-king','2016-12-23 22:01:29','2021-01-31 16:15:53',21,'41zFV5LRXbL.jpg','image/jpeg',21925,201,300,'An alternative history in fiction form which explores such concepts as the function of myth in history and the role of royalty in the modern world. King Arthur is rediscovered doing battle with the Nazis, and the grail to end all wars appears to be a bomb.',1,813.54000000,20167742,'PS3552.A76',903,880,0,'813.54 B285 Kin',1,NULL,0,0,NULL),(995,'0-8112-0776-5',NULL,'How German is it : a novel = Wie deutsch ist es','EN','New Directions',245,1980,'Abish, Walter',NULL,NULL,'FIC055','John W. Fail','how-german-is-it','2016-12-23 22:01:29','2021-01-31 16:15:55',21,'51Y7znrHa_2BL.jpg','image/jpeg',48677,318,500,'&lt;p&gt;Ulrich Hargenau testifies against fellow members of a German terrorist group in order to save himself and his wife, Paula, and contemplates the nature of his German heritage.&lt;/p&gt;&lt;br /&gt;The question How German Is It underlies the conduct and actions of the characters in Walter Abish\'s novel, an icy panorama of contemporary Germany, in which the tradition of order and obedience, the patrimony of the saber and the castle on the Rhine, give way to the present, indiscriminate fascination with all things American. On his return from Paris to his home city of Würtenburg, Ulrich Hargenau, whose father was executed for his involvement in the 1944 plot against Hitler, is compelled to ask himself, \"How German am l?\"––as he compares his own recent attempt to save his life, and his wife Paula\'s, by testifying against fellow members of a terrorist group, with his father\'s selfless heroism. Through Ulrich––privileged, upper class––we confront the incongruities of the new democratic Germany, in particular the flourishing community of Brumholdstein, named after the country\'s greatest thinker, Brumhold, and built on the former site of a concentration camp. Paula\'s participation in the destruction of a police station; the State\'s cynical response to crush the terrorists; two attempts on Ulrich\'s life; the discovery in Brumholdstein of a mass grave of death camp inmates––all these, with subtle irony, are presented as pieces of a puzzle spelling out the turmoil of a society\'s endeavor to avoid the implications of its menacing heritage.',1,813.54000000,245646184,'PS3551.B5',21,19,0,'813.54 A148 How',1,NULL,0,0,NULL),(996,'0-141-01641-8',NULL,'The book of ash','EN','Penguin',404,2004,'Flint, James, 1968-',NULL,NULL,'FIC056','John W. Fail','the-book-of-ash','2016-12-23 22:01:29','2021-01-31 16:15:55',21,'41N700P3JNL.jpg','image/jpeg',26095,326,500,'Wonderfully told, funny and touching, The Book of Ash is the story of a son\'s search for his father and his struggle to understand his family and the adult world. Twenty years ago Cooper James\' life was torn apart. His family collapsed among the claustrophobic confines of a rural hippy commune. Cooper hasn\'t seen his father since the day his adultery was uncovered. As an adult he tries to forget his bizarre past and get on with the present but when a coffee canister, sent from America, filled with a strange grey dust arrives at his work, he is called before his superiors to explain. If it is not an anthrax hoax, then what is it? Could it be the ashes of his father. And if so, how has it found its way to him? Cooper leaves Britiain for the United States where he tries to piece together the shards of his father\'s life from the conflicting accounts of his wierd and highly unreliable friends. And through these encounters he learns all the things that his father might have told him, father-to-son - and what really happened the night his father left.',1,823.91400000,56436523,'PR6056.L533',93,62,0,'823.914 F624',1,NULL,0,0,NULL),(997,'0-330-29871-2',NULL,'The complete Firbank','EN','Picador',755,1988,'Firbank, Ronald, 1886-1926',NULL,NULL,'FIC057','John W. Fail','the-complete-firbank','2016-12-23 22:01:29','2021-01-31 16:15:55',21,'41YDMV0Q5oL.jpg','image/jpeg',28333,318,490,NULL,1,823.91200000,3278306,'PR6011',110,121,0,'823.912 F522',1,NULL,0,0,NULL),(998,NULL,'978-1-936365-18-0','A moment in the sun : a novel','EN','McSweeney\'s',955,2011,'Sayles, John, 1950-',NULL,NULL,'FIC058','John W. Fail','a-moment-in-the-sun','2016-12-23 22:01:29','2021-01-31 16:15:56',21,'51FbMxuqKaL.jpg','image/jpeg',51282,336,500,'&lt;div&gt;It’s 1897. Gold has been discovered in the Yukon. New York is under the sway of Hearst and Pulitzer. And in a few months, an American battleship will explode in a Cuban harbor, plunging the U.S. into war. Spanning five years and half a dozen countries, this is the unforgettable story of that extraordinary moment: the turn of the twentieth century, as seen by one of the greatest storytellers of our time.&lt;br&gt;&lt;BR&gt;Shot through with a lyrical intensity and stunning detail that recall Doctorow and &lt;I&gt;Deadwood&lt;/I&gt; both, &lt;I&gt;A Moment in the Sun&lt;/I&gt; takes the whole era in its sightsfrom the white-racist coup in Wilmington, North Carolina to the bloody dawn of U.S. interventionism in the Philippines. Beginning with Hod Brackenridge searching for his fortune in the North, and hurtling forward on the voices of a breathtaking range of men and womenRoyal Scott, an African American infantryman whose life outside the military has been destroyed; Diosdado Concepcíon, a Filipino insurgent fighting against his country’s new colonizers; and more than a dozen others, Mark Twain and President McKinley’s assassin among themthis is a story as big as its subject: history rediscovered through the lives of the people who made it happen.&lt;BR&gt;&lt;/DIV&gt;',1,813.54000000,663952998,'PS3569.A95',1069,1068,0,'813.54 S275',1,NULL,0,0,NULL),(999,'0-099-44697-9',NULL,'The bushwhacked piano','EN','Vintage',220,2003,'McGuane, Thomas',NULL,NULL,'FIC059','John W. Fail','the-bushwhacked-piano','2016-12-23 22:01:29','2021-02-04 14:03:03',21,'41S_2B1ute97L.jpg','image/jpeg',21495,325,500,'&lt;p&gt;As a citizen, Nicholas Payne is not in the least solid. As a boyfriend, he is nothing short of disastrous, and his latest flame, the patrician Ann Fitzgerald, has done a wise thing by dropping him. But Ann isn\'t counting on Nicholas\'s wild persistence, or on the slapstick lyricism of Thomas McGuane, who in &lt;i&gt;The Bushwhacked Piano &lt;/i&gt;sends his hero from Michigan to Montana on a demented mission of courtship whose highlights include a ride on a homicidal bronco and apprenticeship to the inventor of the world\'s first highrise for bats. The result is a tour de force of American Dubious.&lt;br&gt;&lt;br&gt;&lt;/p&gt;',1,813.54000000,126024,'PS3563.A3114',800,764,0,'813.54 M478 Bus',1,NULL,0,0,NULL),(1000,'1-56478-181-X','','At Swim-Two-Birds','EN','Dalkey Archive',315,1998,'O\'Brien, Flann','','','FIC060','John W. Fail','at-swim-two-birds','2016-12-23 22:01:29','2021-02-04 14:41:57',21,'FlannO_BrianAtSwimTwoBirds.jpg','image/jpeg',90823,362,567,'',1,823.91200000,0,NULL,NULL,NULL,1,'823.912 O13 Ats',1,'undefined',0,0,NULL),(1001,'0-8112-0533-9',NULL,'Alphabetical Africa','EN','New Directions',152,1974,'Abish, Walter',NULL,NULL,'FIC061','John W. Fail','alphabetical-africa','2016-12-23 22:01:29','2021-01-31 16:15:59',21,'51RZOFt8VAL.jpg','image/jpeg',33950,295,500,'&lt;p&gt;&lt;strong&gt;“Walter Abish has dovetailed his novel within a Procrustean scheme that has the terrifying and irrefutable logic of the alphabet. &lt;em&gt;Alphabetical Africa&lt;/em&gt; is in the line of writers such as Raymond Roussel, Raymond Queneau, Georges Perec and Harry Mathews, who have used constrictive forms to penetrate the space on the other side of poetry.” ― John Ashbery&lt;/strong&gt;&lt;/p&gt;&lt;em&gt;Alphabetical Africa&lt;/em&gt;, Walter Abish\'s delightful first novel, is an extraordinary linguistic tour de force, high comedy set in an imaginary dark continent that expands and contracts with ineluctable precision, as one by one the author adds the letters of the alphabet to his book, and then subtracts them. While the \"geoglyphic\" African landscape forms and crumbles, it is, among other things, attacked by an army of driver ants, invaded by Zanzibar, painted orange by the transvestite Queen Quat of Tanzania, and becomes a hunting ground for a pair of murderous jewel thieves tracking down their nymphomaniac moll.',1,813.54000000,940414,'PS3551.B5',351,351,0,'813.54 A148 Alp',1,NULL,0,0,NULL),(1002,'1-56478-237-9',NULL,'Reckless eyeballing','EN','Dalkey Archive',148,2000,'Reed, Ishmael, 1938-',NULL,NULL,'FIC062','John W. Fail','reckless-eyeballing','2016-12-23 22:01:29','2021-01-31 16:16:00',21,'51yTV_2B1D_2B0L.jpg','image/jpeg',37446,375,500,'&lt;div&gt;&lt;p&gt;Masochism is out and feminism is in, Jews are out and Germans are in, race is out and gender is in, and everyone\'s fighting (and rewriting) for a piece of the pie. Jewish director Jim Minsk disappears during a trip to the South. Black playwright Ian Ball writes the all-female play &lt;I&gt;Reckless Eyeballing&lt;/I&gt; in hopes of getting off the \"sex-list.\" Preeminent playwright Jack Brashford, claiming the Jews stole all his black material, decides to write about Armenians. In the background, an unknown assailant dubbed the \"Flower Phantom\" runs loose through the city shaving heads of prominent black feminists (to the secret delight of black men).&lt;/p&gt;&lt;p&gt;In this hilarious, devastating, but also deeply sympathetic novel, Ishmael Reed turns characters on the backs, sides, tops and bottoms to expose the multiple hypocrisies at the heart of American culture.&lt;/p&gt;&lt;/div&gt;',1,813.54000000,12694339,'PS3568.E365',973,954,0,'813.54 R324',1,NULL,0,0,NULL),(1003,'0-8021-1694-9',NULL,'The selected prose of Fernando Pessoa','EN','Grove Press',342,2001,'Pessoa, Fernando, 1888-1935 | Zenith, Richard [Translator]',NULL,NULL,'FIC063','John W. Fail','the-selected-prose-of-fernando-pessoa','2016-12-23 22:01:29','2021-01-31 16:16:00',21,'41B25S9ZYWL.jpg','image/jpeg',30168,315,475,'Building on the wonderful Fernando Pessoa &amp; Co.: Selected Poems, acclaimed by Booklist as \"a beautiful one-volume course in the soul of the twentieth century,\" preeminent translator Richard Zenith now delivers a superbly edited and translated selection from the prose work of a truly unique figure of early modernism. Though known primarily as a poet, Fernando Pessoa wrote prose widely, in several languages and in every genre -- fiction, drama, letters, and essays. Drawing from the huge body of work that Pessoa left behind, Richard Zenith has produced a volume that is full of delights. Pessoa and his many literary alter egos, or \"heteronyms,\" experiment with the Surrealists\' automatic writing and invent the movement \"Sensationism\" (whose adherents were all heteronyms). There are appreciations of Shakespeare, Dickens, Wilde, and Joyce, critical essays in which one heteronym derides the work of another, and a love letter by Pessoa\'s only known female heteronym. There is a selection from Pessoa\'s best-known work, The Book of Disquiet, retranslated from newly discovered materials. Like Fernando Pessoa &amp; Co., Selected Prose is an important monument to one of the greatest exponents of modernism, a forgotten but crucial part of the literary canon.',1,869.84108000,45806447,'PQ9261.P417',254,254,0,'869.84108 P475',1,NULL,0,0,NULL),(1004,NULL,'978-1-59420-423-4','Bleeding edge','EN','Penguin',477,2013,'Pynchon, Thomas, | Gunsteren, Dirk van, 1953- [Translator] | Rowohlt Taschenbuch Verlag [Publisher]',NULL,NULL,'FIC064','John W. Fail','bleeding-edge','2016-12-23 22:01:29','2021-01-31 16:16:01',21,'51jHJnk0uSL.jpg','image/jpeg',61621,329,500,'&lt;b&gt;&lt;u&gt;&lt;i&gt;The Washington Post &lt;/i&gt;&lt;/u&gt;&lt;br&gt;“Brilliantly written… a joy to read… &lt;i&gt;Bleeding Edge&lt;/i&gt; is totally gonzo, totally wonderful. It really is good to have Thomas Pynchon around, doing what he does best.” (Michael Dirda)&lt;/b&gt;&lt;br&gt;&lt;br&gt;It is 2001 in New York City, in the lull between the collapse of the dot-com boom and the terrible events of September 11th. Silicon Alley is a ghost town, Web 1.0 is having adolescent angst, Google has yet to IPO, Microsoft is still considered the Evil Empire. There may not be quite as much money around as there was at the height of the tech bubble, but there’s no shortage of swindlers looking to grab a piece of what’s left.&lt;br&gt;&lt;br&gt;Maxine Tarnow is running a nice little fraud investigation business on the Upper West Side, chasing down different kinds of small-scale con artists. She used to be legally certified but her license got pulled a while back, which has actually turned out to be a blessing because now she can follow her own code of ethics—carry a Beretta, do business with sleazebags, hack into people’s bank accounts—without having too much guilt about any of it. Otherwise, just your average working mom—two boys in elementary school, an off-and-on situation with her sort of semi-ex-husband Horst, life as normal as it ever gets in the neighborhood—till Maxine starts looking into the finances of a computer-security firm and its billionaire geek CEO, whereupon things begin rapidly to jam onto the subway and head downtown. She soon finds herself mixed up with a drug runner in an art deco motorboat, a professional nose obsessed with Hitler’s aftershave, a neoliberal enforcer with footwear issues, plus elements of the Russian mob and various bloggers, hackers, code monkeys, and entrepreneurs, some of whom begin to show up mysteriously dead. Foul play, of course.&lt;br&gt;&lt;br&gt;With occasional excursions into the DeepWeb and out to Long Island, Thomas Pynchon, channeling his inner Jewish mother, brings us a historical romance of New York in the early days of the internet, not that distant in calendar time but galactically remote from where we’ve journeyed to since.&lt;br&gt;&lt;br&gt;Will perpetrators be revealed, forget about brought to justice? Will Maxine have to take the handgun out of her purse? Will she and Horst get back together? Will Jerry Seinfeld make an unscheduled guest appearance? Will accounts secular and karmic be brought into balance?&lt;br&gt;&lt;br&gt;Hey. Who wants to know?&lt;br&gt;&lt;br&gt;&lt;b&gt;&lt;i&gt;&lt;u&gt;Slate.com&lt;/u&gt;&lt;/i&gt;&lt;br&gt;\"If not here at the end of history, when? If not Pynchon, who? Reading &lt;i&gt;Bleeding Edge&lt;/i&gt;, tearing up at the beauty of its sadness or the punches of its hilarity, you may realize it as the 9/11 novel you never knew you needed… a necessary novel and one that literary history has been waiting for.\"&lt;/b&gt;&lt;br&gt;&lt;br&gt;&lt;u&gt;&lt;b&gt;&lt;i&gt;The New York Times Book Review&lt;/i&gt;&lt;/b&gt;&lt;/u&gt;&lt;br&gt;&lt;b&gt;Exemplary… dazzling and ludicrous... Our reward for surrendering expectations that a novel should gather in clarity, rather than disperse into molecules, isn’t anomie but delight.&lt;/b&gt;” &lt;b&gt;(Jonathan Lethem)&lt;/b&gt;&lt;br&gt;&lt;br&gt;&lt;u&gt;&lt;b&gt;&lt;i&gt;Wired&lt;/i&gt; magazine&lt;/b&gt;&lt;/u&gt;&lt;br&gt;“&lt;b&gt;The book’s real accomplishment is to claim the last decade as Pynchon territory, a continuation of the same tensions — between freedom and captivity, momentum and entropy, meaning and chaos — through which he has framed the last half-century.\"&lt;/b&gt;&lt;br&gt;&lt;br&gt;&lt;b&gt;&lt;u&gt;***A &lt;i&gt;New York Times&lt;/i&gt; Notable Book of 2013***&lt;/u&gt;&lt;/b&gt;',1,813.54000000,837179750,'PS3566.Y55',2577,2532,0,'813.54 P997',1,NULL,0,0,NULL),(1005,NULL,'978-0374531553','2666 : Part 2 of 3','EN','Farrar, Straus and Giroux',912,2008,'Bolaäno, Roberto, 1953-2003',NULL,NULL,'FIC065','John W. Fail','2666','2016-12-23 22:01:29','2021-02-04 14:28:04',21,'51SNE0eiv_2BL.jpg','image/jpeg',38620,500,248,'&lt;p&gt;THE  POSTHUMOUS MASTERWORK FROM \"ONE OF THE GREATEST AND MOST INFLUENTIAL MODERN WRITERS\" (JAMES WOOD, &lt;i&gt;THE NEW YORK TIMES BOOK REVIEW&lt;/i&gt;) &lt;/p&gt;&lt;p&gt;Composed in the last years of Roberto Bolaño\'s life, &lt;i&gt;2666 &lt;/i&gt;was greeted across Europe and Latin America as his highest achievement, surpassing even his previous work in its strangeness, beauty, and scope. Its throng of unforgettable characters includes academics and convicts, an American sportswriter, an elusive German novelist, and a teenage student and her widowed, mentally unstable father. Their lives intersect in the urban sprawl of SantaTeresa―a fictional Juárez―on the U.S.-Mexico border, where hundreds of young factory workers, in the novel as in life, have disappeared.&lt;/p&gt;',3,863.64000000,670446413,'PQ8098.12.O38',2,2,0,'863.64 B687',1,NULL,0,0,NULL),(1006,NULL,'9781933293172','And your point is? : scorn and meaning in Jeff Lint\'s fiction','EN','Raw Dog Screaming',116,2006,'Aylett, Steve, 1967-',NULL,NULL,'FIC066','John W. Fail','and-your-point-is','2016-12-23 22:01:29','2021-01-31 16:16:02',21,'51RZBKW2STL.jpg','image/jpeg',37945,323,500,'This follow-up to LINT, the biography of cult author Jeff Lint, delves deeper into the psychosis of the seminal writer\'s work. This series of essays and reviews from around the globe, representing decades of study, is being presented for the first time in collected form. A must-have for collectors, students, imitators, and stalkers alike.  \"Satire has no effect-a mirror holds no fear for those with no shame.\"  Contributors include Steve Aylett, Eileen Welsome, Arkhipov Halt, Daniel Guyal, Chris Diana, Alfred Bork, Michael H. Hersh, George Cane, Dennis Ofstein, and Jean-Marie Guerin.',1,823.91400000,221324470,'PR6051.Y57',NULL,3,0,'823.914 A978 And',1,NULL,0,0,NULL),(1007,NULL,'978-0947757656','The feverhead','EN','Atlas',107,1993,'Bauer, Wolfgang, 1941-2005',NULL,NULL,'FIC067','John W. Fail','the-feverhead','2016-12-23 22:01:29','2021-01-31 16:16:02',21,'51QHHTNDDPL.jpg','image/jpeg',54502,305,475,'The Feverhead is written in the form of letters between a couple of not-all-that-bright Austrians. Their correspondence is doomed to failure, nearly every letter crosses in the post and yet they succeed in their quest: the search for a perfect thermometer (and a serial murderer). In fact they both independently discover the secret of the universe in a remote spot thousands of miles from their intended (and different) destinations.Bauer’s comedy of errors is ennacted by an unusual cast that includes microscopic schoolgirls, ambigously sexed nuns, incompetent detectives, two ultimately bad poets, living steam engines and a venerable three-eyed sea-captain whose two bodies remain exactly 3.5 metres apart, not to mention: ULF.',1,833.91400000,7295161,'PT2662.A85',62,83,0,'833.914 B344',1,NULL,0,0,NULL),(1008,'null','978-0947757298','The castle of communion','EN','Atlas',116,1993,'Noël, Bernard','null','null','FIC068','John W. Fail','the-castle-of-communion','2016-12-23 22:01:29','2021-02-03 09:11:11',21,'51EFCMXF0XL.jpg','image/jpeg',53561,304,475,'When Le Château de Cène (here translated as The Castle of Communion) first appeared in France in 1969, under the sonorous pseudonym of Urbain d’Orlhac, it created a sensation. Immediately recognised as being among the finest works of French literary eroticism (along with, say, Bataille’s Story of the Eye, or Reage’s Story of O), its author was soon identified: the poet and essayist Bernard Noël, born in 1930.   &lt;P&gt;The author recounts an intense initiatory sexual quest which occurs on a mysterious remote island. Chosen as the moon’s lover the hero undertakes a Dantesque voyage through sucessive levels of pain and ecstasy. The book’s climax is a beatific rite of sexual purification in the Castle of Communion, which is described in a poetic language at once incantatory, crude and almost mystical. The intensity of the book matches its method of composition: dictated into a tape recorder and finished in only 3 weeks, and written as a partial response to the atrocities of the French authorities in Algeria.   &lt;P&gt;This edition is postfaced by Noël’s essay The Outrage Against Words, his thoughts on the government’s unsuccessful attempts through the courts to supress the novel for \"outraging public morals.\" He illuminates the intimate connection between writing and censorship in general.',1,843.91200000,1198250,'PQ2674.O27',69,75,0,'843.912 N786',1,'undefined',0,0,NULL),(1009,'null','978-2253115847','Ne tirez pas sur l\'oiseau moqueur','FR','Le Livre de Poche',447,2006,'Lee, Harper','null','null','FIC069','John W. Fail','ne-tirez-pas-sur-l-oiseau-moqueur','2016-12-23 22:01:29','2021-02-04 14:45:10',21,'51H-splF2FL.jpg','image/jpeg',48651,309,500,'Dans une petite ville d Alabama, a l epoque de la Grande Depression, Atticus Finch eleve seul ses deux enfants, Jem et Scout. Avocat integre et rigoureux, il est commis d office pour defendre un Noir accuse d avoir viole une Blanche. Ce bref resume peut expliquer pourquoi ce livre, publie en 1960 au c ur de la lutte pour les droits civiques des Noirs aux etats-Unis, connut un tel succes.&lt;br/&gt;Mais comment ce roman est-il devenu un livre culte dans le monde entier ? C est que, tout en situant son sujet en Alabama dans les annees 1930, Harper Lee a ecrit un roman universel sur l enfance. Racontee par Scout avec beaucoup de drolerie, cette histoire tient du conte, de la &lt;i&gt;court story&lt;/i&gt; americaine et du roman initiatique. Couronne par le prix Pulitzer en 1961, &lt;i&gt;Ne tirez pas sur l oiseau moqueur&lt;/i&gt; s est vendu a plus de 30 millions d exemplaires dans le monde entier.&lt;/p&gt;\"',1,813.54000000,276976,'PS3562.E353',15331,19694,0,'813.54 L478',1,'Porta, Baldomero [Translator] | Kim, Uk-tong [Translator] | Lee, Harper [Author; Other] | Pàmies, Xavier, 1959- [Translator] | Arad, Zvi, 1909-1994 [Translator]',0,0,NULL),(1010,'0-395-54703-2',NULL,'Richard Brautigan\'s A Confederate general from Big Sur, Dreaming of Babylon, and The Hawkline monster : three books in the manner of their original editions','EN','Houghton Mifflin',608,1991,'Brautigan, Richard',NULL,NULL,'FIC070','John W. Fail','a-confederate-general-from-big-sur-dreaming-of-babylon-and-the-hawkline-monster','2016-12-23 22:01:29','2021-01-31 16:16:05',21,'51QqTrVxOzL.jpg','image/jpeg',39430,325,500,'&lt;DIV&gt;Richard Brautigan was the author of ten novels, including a contemporary classic, Trout Fishing in America, nine volumes of poetry, and a collection of stories.Here are three Brautigan novels--A Confederate General from Big Sur, Dreaming of Babylon and The Hawkline Monster--reissued in a one-volume omnibus edition. &lt;/DIV&gt;',1,813.54000000,79762996,'PS3503.R2736',45,45,0,'813.54 B825',1,NULL,0,0,NULL),(1011,NULL,'978-0811217071','Senselessness','EN','New Directions',142,2008,'Castellanos Moya, Horacio, 1957- | Silver, Katherine [Translator]',NULL,NULL,'FIC071','John W. Fail','senselessness','2016-12-23 22:01:29','2021-01-31 16:16:05',21,'51AL_2Bsq1PIL.jpg','image/jpeg',36296,325,500,'&lt;p&gt;A Rainmaker Translation Grant Winner from the Black Mountain Institute: &lt;em&gt;Senselessness&lt;/em&gt;, acclaimed Salvadoran author Horacio Castallanos Moya\'s astounding debut in English, explores horror with hilarity and electrifying panache.&lt;/p&gt;&lt;br /&gt;A boozing, sex-obsessed writer finds himself employed by the Catholic Church (an institution he loathes) to proofread a 1,100 page report on the army\'s massacre and torture of thousands of indigenous villagers a decade earlier, including the testimonies of the survivors. The writer\'s job is to tidy it up: he rants, \"that was what my work was all about, cleaning up and giving a manicure to the Catholic hands that were piously getting ready to squeeze the balls of the military tiger.\" Mesmerized by the strange Vallejo-like poetry of the Indians\' phrases (\"the houses they were sad because no people were inside them\"), the increasingly agitated and frightened writer is endangered twice over: by the spell the strangely beautiful heart-rending voices exert over his tenuous sanity, and by real danger—after all, the murderers are the very generals who still run this unnamed Latin American country.',1,863.64000000,62752401,'PQ7539.2.C34',511,545,0,'863.64 C348 Sen',1,NULL,0,0,NULL),(1013,NULL,'978-1934824269','Zone','EN','Open Letter',517,2010,'Énard, Mathias, 1972- | Mandell, Charlotte [Translator] | Evenson, Brian, 1966- [Editor] | Fock, Holger, 1958- [Translator]',NULL,NULL,'FIC073','John W. Fail','zone-6d1be8d1-93d3-4ce9-8a01-ade159052cad','2016-12-23 22:01:29','2021-01-31 16:16:05',21,'41uTKX1x5GL.jpg','image/jpeg',21638,324,500,'&lt;div&gt;One of the truly original books of the decade—written as a single, hypnotic, propulsive, physically irresistible sentence—&lt;i&gt;Zone&lt;/i&gt; tells the story of a French Intelligence agent on his way to the Vatican to sell a briefcase of secrets. Over the course of his train ride, he thinks back over his life and all the damage he\'s caused in this violent century.&lt;/div&gt;',1,843.92000000,244654117,'PQ2705.N273',541,644,0,'843.92 N223',1,NULL,0,0,NULL),(1014,NULL,'978-0679724612','Dictionary of the Khazars : a lexicon novel in 100,000 words','EN','Vintage',338,1989,'Pavić, Milorad','A Lexicon Novel in 100,000 Words (Male Edition)',NULL,'FIC074','John W. Fail','dictionary-of-the-khazars','2016-12-23 22:01:29','2021-02-04 14:33:36',21,'51JMGHD2M1L.jpg','image/jpeg',42214,285,500,'A national bestseller, Dictionary of the Khazars was cited by The New York Times Book Review as one of the best books of the year. Written in two versions, male and female (both available in Vintage International), which are identical save for seventeen crucial lines, Dictionary is the imaginary book of knowledge of the Khazars, a people who flourished somewhere beyond Transylvania between the seventh and ninth centuries. Eschewing conventional narrative and plot, this lexicon novel combines the dictionaries of the world\'s three major religions with entries that leap between past and future, featuring three unruly wise men, a book printed in poison ink, suicide by mirrors, a chimerical princess, a sect of priests who can infiltrate one\'s dreams, romances between the living and the dead, and much more.',3,891.82350000,18163210,'PG1419.26.A78',1305,1321,0,'891.8235 P338',1,NULL,0,0,NULL),(1015,NULL,'978-1564781727','The Dalkey Archive : a novel','EN','Dalkey Archive',224,2006,'O\'Brien, Flann (1911-1966)',NULL,NULL,'FIC075','John W. Fail','the-dalkey-archive','2016-12-23 22:01:29','2021-01-31 16:16:06',21,'41R-7ov0ZwL.jpg','image/jpeg',23328,305,500,'Hailed as \"the best comic fantasy since \"Tristram Shandy\" upon its publication in 1964, \"The Dalkey Archive,\" is Flann O\'Brien\'s fifth and final novel; or rather (as O\'Brien wrote to his editor), \"The book is not meant to be a novel or anything of the kind but a study in derision, various writers with their styles, and sundry modes, attitudes and cults being the rats in the cage.\" Among the targets of O\'Brien\'s derision are religiosity, intellectual abstractions, J. W. Dunne\'s and Albert Einstein\'s views on time and relativity, and the lives and works of Saint Augustine and James Joyce, both of whom have speaking parts in the novel. Bewildering? Yes, but as O\'Brien insists, \"a measure of bewilderment is part of the job of literature.\"',1,823.91200000,1039602,'PR6029.N56',532,895,0,'823.912 O13',1,NULL,0,0,NULL),(1016,' 978-0385240871','null','Lost in the Funhouse','EN','Anchor',203,1988,'Barth, John, 1930-','null','null','FIC136','John W. Fail','lost-in-the-funhouse','2016-12-23 22:01:29','2021-02-04 14:32:16',21,'41pxxtu490L.jpg','image/jpeg',29335,329,500,'Barth\'s lively, highly original collection of short pieces is a major landmark of experimental fiction.  Though many of the stories gathered here were published separately, there are several themes common to them all, giving them new meaning in the context of this collection.',1,813.54000000,1183948,'PS3552.A75',7,17,0,'813.54 B284',1,'undefined',0,0,NULL),(1017,'','','Pale Fire','EN','G.P. Putnam',315,1962,'Nabokov, Vladimir Vladimirovich, 1899-1977','','','FIC076','John W. Fail','pale-fire','2016-12-23 22:01:29','2021-02-04 14:00:21',21,'1040957_NabokovV_Pale.jpg','image/jpeg',16307,300,493,'',1,813.54000000,1110733761,'PS3527.A15',1,1,0,'813.54 N117',1,'undefined',0,0,NULL),(1018,NULL,'978-1900565110','Raymond Roussel','EN','Atlas',350,2001,'Caradec, François',NULL,NULL,'FIC077','John W. Fail','raymond-roussel','2016-12-23 22:01:29','2021-01-31 16:16:07',21,'51CEKPXC94L.jpg','image/jpeg',64288,432,475,'The bizarre life of Raymond Roussel (1877-1933) had the makings of a Jules Verne novel, rivalling only his writings in outlandishness. His specially-constructed motorized caravan, his travels through Africa behind closed shutters, and his mysterious death in a Palermo hotel are among the numerous details of his extraordinary life. First published in France in 1972, Caradec\'s biography remains the definitive unraveling of the Rousselian enigma.',1,848.91209000,37615622,NULL,196,NULL,0,'848.91209 C258',1,NULL,0,0,NULL),(1019,NULL,NULL,'Amrit Singh and the Birmingham Quean : fictions, fakes and forgeries in a vernacular counterculture','EN','self-published',575,2006,'Trainor, Samuel',NULL,NULL,'FIC078','John W. Fail','the-birmingham-quean','2016-12-23 22:01:29','2021-01-31 16:16:07',21,NULL,NULL,NULL,NULL,NULL,NULL,1,823.92000000,85828694,NULL,1,NULL,0,'823.92 T768',1,NULL,0,0,NULL),(1020,'null','978-1582-431338','This is not a novel','EN','Counterpoint',190,2001,'Markson, David','null','null','FIC079','John W. Fail','this-is-not-a-novel','2016-12-23 22:01:29','2021-02-04 22:25:19',21,'41PSrMURrSL.jpg','image/jpeg',18684,325,500,'&lt;div&gt;This Is Not a Novel is a highly inventive work which drifts \"genre-less,\" somewhere in between fiction, nonfiction, and psychological memoir. In the opening pages of the \"novel,\" a narrator, called only \"Writer,\" announces that he is tired of inventing characters, contemplating plot, setting, theme, and conflict. Yet the writer is determined to seduce the reader into turning pages-and to \"get somewhere,\" nonetheless.&lt;BR&gt;&lt;BR&gt;What follows are pages crammed with short lines of astonishingly fascinating literary and artistic anecdotes, quotations, and cultural curiosities. This Is Not a Novel is leavened with Markson\'s deliciously ironic wit and laughter, so that when the writer does indeed finally get us \"somewhere\" it\'s the journey will have mattered as much as the arrival.&lt;/div&gt;',1,813.54000000,45015388,'PS3563.A67',385,399,0,'813.54 M345 Thi',1,'undefined',0,0,NULL),(1021,NULL,'978-1564781321','Reader\'s block','EN','Dalkey Archive',194,1996,'Markson, David',NULL,NULL,'FIC080','John W. Fail','reader-s-block','2016-12-23 22:01:29','2021-01-31 16:16:09',21,'41-Mgcun78L.jpg','image/jpeg',26470,325,500,'In this spellbinding, utterly unconventional fiction, an aging author who is identified only as Reader contemplates the writing of a novel. As he does, other matters insistently crowd his mind - literary and cultural anecdotes, endless quotations attributed and not, scholarly curiosities - the residue of a lifetime\'s reading which is apparently all he has to show for his decades on earth. Out of these unlikely yet incontestably fascinating materials - including innumerable details about the madness and calamity in many artists\' and writers\' lives, the eternal critical affronts, the startling bigotry, the countless suicides - David Markson has created a novel of extraordinary intellectual suggestiveness. But while shoring up Reader\'s ruins with such fragments, Markson has also managed to electrify his novel with an almost unbearable emotional impact. Where Reader ultimately leads us is shattering.',1,813.54000000,34358496,'PS3563.A67',447,441,0,'813.54 M345',1,NULL,0,0,NULL),(1022,NULL,'978-0316082549','Come back, Dr. Caligari','EN','Little Brown ',183,1971,'Barthelme, Donald',NULL,NULL,'FIC081','John W. Fail','come-back-dr-caligari','2016-12-23 22:01:29','2021-01-31 16:16:10',21,'31fIrnDz_2BKL.jpg','image/jpeg',13557,300,300,'Come Back, Dr. Caligari - Donald Barthelme / Little Brown &amp; Co. Publishers',1,813.54000000,345449,'PS3552.A76',677,884,0,'813.54 B285 Com',1,NULL,0,0,NULL),(1023,'null','978-0977199280','Scorch Atlas','EN','Featherproof',188,2009,'Butler, Blake','null','null','FIC082','John W. Fail','scorch-atlas','2016-12-23 22:01:29','2021-02-04 14:02:19',21,'514MXtucrHL.jpg','image/jpeg',34942,279,500,'&lt;div&gt;In this striking novel-in-stories, a series of strange apocalypses have hit America. Entire neighborhoods drown in mud, glass rains from the sky, birds speak gibberish, and parents of young children disappear. Millions starve while others grow coats of mold. But a few are able to survive and find a light in the aftermath, illuminating what we’ve become. In The Disappeared,” a father is arrested for missing free throws, leaving his son to search alone for his lost mother. A boy swells to fill his parents’ ransacked attic in The Ruined Child.” Rendered in a variety of narrative forms, from a psychedelic fable to a skewed insurance claim questionnaire, Blake Butler’s full-length fiction debut paints a gorgeously grotesque version of America, bringing to mind both Kelly Link and William H. Gass, yet imbued with Butler\'s own vision of the apocalyptic and bizarre.&lt;/div&gt;',1,813.60000000,762475018,'PS3602.U8665',3,3,0,'813.6 B986',1,'undefined',0,0,NULL),(1024,'null','978-0865472006','The sleepwalkers : a trilogy','EN','North Point',648,1985,'Broch, Hermann, 1886-1951','null','null','FIC083','John W. Fail','the-sleepwalkers','2016-12-23 22:01:29','2021-02-04 14:19:12',21,'41Wn_2BuMLX6L.jpg','image/jpeg',26270,337,500,'Book by Broch, Hermann',1,833.91200000,294797,'PT2603.R657',647,1042,0,'833.912 B864',1,'undefined',0,0,NULL),(1025,NULL,'978-0374517502','Terra nostra','EN','Farrar, Straus and Giroux',795,1987,'Fuentes, Carlos 1928-2012 | Ordiz, Francisco Javier [Editor; Other]',NULL,NULL,'FIC084','John W. Fail','terra-nostra','2016-12-23 22:01:29','2021-01-31 16:16:10',21,'51pkp-2G2BL.jpg','image/jpeg',34420,327,500,'\"Terra Nostra is the spreading out of the novel, the exploration of its possibilities, the voyage to the edge of what only a novelist can see and say.\" Milan Kundera',1,863.00000000,2066810,'PQ7297.F793',1591,2599,0,'863 F954',1,NULL,0,0,NULL),(1026,NULL,'978-0970335524','This shape we\'re in','EN','McSweeney\'s',55,2001,'Lethem, Jonathan',NULL,NULL,'FIC085','John W. Fail','this-shape-we-re-in','2016-12-23 22:01:29','2021-01-31 16:16:11',21,'5195N0FUpVL.jpg','image/jpeg',36611,335,500,'&lt;DIV&gt;Lethem, author of the bestselling Motherless Brooklyn , returns in concentrated form - packing twice the adventure into one-eighth the pages. This book could be some kind of allegory book, but it might not be an allegory book at all. It involves people and drinking and people looking for a giant eye. It is among the best things Mr. Lethem has written.&lt;/div&gt;',1,813.60000000,46728741,'PS3562.E8544',104,104,0,'813.6 L647',1,NULL,0,0,NULL),(1027,'','978-1860461125','Blindness','EN','Harvill',213,1993,'Green, Henry, 1905-1973 | Mendelsohn, Daniel Adam, 1960- [Author of introduction]','','','FIC086','John W. Fail','blindness','2016-12-23 22:01:29','2021-01-31 16:16:11',21,'22de48212fe99d59e70d1a2d35c31c89.jpg','image/jpeg',17191,236,384,'',1,823.91200000,3249897,'PR6013.R416',1034,1082,0,'823.912 G796',1,NULL,0,0,NULL),(1028,NULL,'978-0811200820','Maldoror (Les chants de Maldoror)','EN','New Directions',342,1965,'Lautréamont, Comte de',NULL,NULL,'FIC087','John W. Fail','maldoror-les-chants-de-maldoror','2016-12-23 22:01:29','2021-01-31 16:16:11',21,'51TmwCvu8fL.jpg','image/jpeg',48007,335,500,'&lt;p&gt;This macabre but beautiful work, &lt;em&gt;Les Chants de Maldoror&lt;/em&gt;, has achieved a considerable reputation as one of the earliest and most extraordinary examples of Surrealist writing.&lt;/p&gt;&lt;br /&gt;&lt;em&gt;Maldoror&lt;/em&gt; is a long narrative prose poem which celebrates the principle of Evil in an elaborate style and with a passion akin to religions fanaticism. The French poet-critic Georges Hugnet has written of Lautréamont: \"He terrifies, stupefies, strikes dumb. He could look squarely at that which others had merely given a passing glance.\" When first published in 1868-69, &lt;em&gt;Maldoror&lt;/em&gt; went almost unnoticed. But in the 1890s the book was rediscovered and hailed as a work of genius by such eminent writers as Huysmans, Léon Block, Maeterlinck, and Rémy de Gourmont. Later still, Lautréamont was to be canonized as one of their principal \"ancestors\" by the Paris surrealists. This edition, translated by Guy Wernham, includes also a long introduction to a never-written, or now lost, volume of poetry. Thus, except for a few letters, it gives all the surviving literary work of Lautréamont.',1,841.80000000,495429,'PQ2220.D723',1220,1494,0,'841.8 L389',1,NULL,0,0,NULL),(1029,'null','978-1590172421','All about H. Hatterr','EN','NYRB Classics',320,2007,'Desani, G. V. (Govindas Vishnoodas), 1909-2000','null','null','FIC088','John W. Fail','all-about-h-hatterr','2016-12-23 22:01:29','2021-02-04 14:10:13',21,'51s6zjs0WML.jpg','image/jpeg',61727,312,500,'Wildly funny and wonderfully bizarre, &lt;i&gt;All About H. Hatterr&lt;/i&gt; is one of the most perfectly eccentric and strangely absorbing works modern English has produced. H. Hatterr is the son of a European merchant officer and a lady from Penang who has been raised and educated in missionary schools in Calcutta. His story is of his search for enlightenment as, in the course of visiting seven Oriental cities, he consults with seven sages, each of whom specializes in a different aspect of “Living.” Each teacher delivers himself of a great “Generality,” each great Generality launches a new great “Adventure,” from each of which Hatter escapes not so much greatly edified as by the skin of his teeth. The book is a comic extravaganza, but as Anthony Burgess writes in his introduction, “it is the language that makes the book. . . . It is not pure English; it is like Shakespeare, Joyce, and Kipling, gloriously impure.”',1,823.91400000,77786,'PR9499.3.D472',442,616,0,'823.914 D442',1,'undefined',0,0,NULL),(1030,NULL,'978-0811201674','The Bark Tree','EN','New Directions',282,1971,'Queneau, Raymond',NULL,NULL,'FIC089','John W. Fail','the-bark-tree','2016-12-23 22:01:29','2021-02-04 14:41:11',21,'41W0UkngYxL.jpg','image/jpeg',20534,333,500,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(1031,' 978-0811207898',NULL,'Exercises in style','EN','New Directions',204,1981,'Queneau, Raymond, 1903-1976 | Wright, Barbara, 1915-2009 [Translator; Author] | Themerson, Stefan, [Illustrator]',NULL,NULL,'FIC090','John W. Fail','exercises-in-style','2016-12-23 22:01:29','2021-01-31 16:16:11',21,'41ULJL2hT9L.jpg','image/jpeg',28776,321,500,'&lt;p&gt;&lt;strong&gt;“A work of genius in a brilliant translation by Barbara Wright….Endlessly fascinating and very funny.” ―Philip Pullman&lt;/strong&gt;&lt;/p&gt; The plot of &lt;em&gt;Exercises in Style&lt;/em&gt; is simple: a man gets into an argument with another passenger on a bus. However, this anecdote is told 99 more times, each in a radically different style, as a sonnet, an opera, in slang, and with many more permutations. This virtuoso set of variations is a linguistic rust-remover, and a guide to literary forms.',1,848.91207000,2054427,'PQ2633.U43',550,979,0,'848.91207 Q3',1,NULL,0,0,NULL),(1032,NULL,'978-1564781871','Oulipo : a primer of potential literature','EN','Dalkey Archive',221,1998,'Motte, Warren F. [Translator; Editor; Other]',NULL,NULL,'FIC091','John W. Fail','oulipo-a-primer-of-potential-literature','2016-12-23 22:01:29','2021-01-31 16:16:11',21,'416DrR8s5zL.jpg','image/jpeg',21716,329,500,'&lt;p&gt;A remarkable collection of writings by members of the group known as the Oulipo (Ouvroir de litterature potentiale), this anthology includes, among others, Italo Calvino, Harry Mathews, Georges Perec, Jacques Roubaud, and Raymond Queneau. Founded in Paris in 1960, the Oulipo views imaginative writing as an exercise dominated by the method of \"constraints.\" While a major contribution to literary theory, and also great fun, Oulipo: A Primer of Potential Literature is perhaps most distinguished as an indispensable guide to writers.',1,840.60440000,12215395,'PQ22.O8',542,537,0,'840.6044 M922',1,NULL,0,0,NULL),(1033,NULL,'978-0802133953','Thirteen stories and thirteen epitaphs','EN','Grove Press',256,1994,'Vollmann, William T.',NULL,NULL,'FIC092','John W. Fail','thirteen-stories-and-thirteen-epitaphs','2016-12-23 22:01:29','2021-01-31 16:16:13',21,'51XSSt8DgHL.jpg','image/jpeg',40982,327,500,'This stunning new collection of stories confirms William T. Vollmann\'s growing reputation as the American writer whose books \"tower over the work of his contemporaries by virtue of their enormous range, huge ambition, stylistic daring, wide learning, audacious innovation, and sardonic wit\" (Washington Post Book World). All these qualities are in evidence in this collection in which the character of the writer and that of some of his intimates - both real and imaginary - surface and resurface in a series of extraordinary situations and encounters. Two astonishing stories frame this collection. The first, \"The Ghost of Magnetism, \" tells about a young man leaving San Francisco to become a sort of literary hobo living on his freeze-dried memories. The last, \"The Grave of Lost Stories, \" describes the death of Poe in a fungus-encrusted tomb somewhere deep in the earth. Here is the colorful and disreputable group of people familiar to us from Vollmann\'s earlier fiction - pimps, tramps, pornographers, witch doctors  and massage-parlor girls. Within these stories, Vollmann gives us one of the most searching, bizarre, and subversive views of America today.',1,813.54000000,24717284,'PS3572.O395',443,441,0,'813.54 V924',1,NULL,0,0,NULL),(1034,NULL,'978-1783781379','10:04 : a novel','EN','Granta',244,2014,'Lerner, Ben, 1979- | Wevers, Arthur [Translator] | Stingl, Nikolaus, 1952- [Translator] | Rowohlt (Firm) [Publisher] | Alikavazovic, Jakuta [Translator] | Rodríguez Juiz, Cruz [Translator]',NULL,NULL,'FIC093','John W. Fail','10-04','2016-12-23 22:01:29','2021-01-31 16:16:13',21,'21NiTCHfsrL.jpg','image/jpeg',7508,314,500,'  &lt;b&gt;Following the international buzz for his debut, &lt;i&gt;Leaving the Atocha Station&lt;/i&gt;, comes &lt;i&gt;10:04&lt;/i&gt;, Ben Lerner\'s electric second novel that blends artistry and wit, intelligence and tenderness. A unique collision between art and life by an extraordinary young writer. For readers of Jeffrey Eugenides, Jonathan Lethem, Sheila Heti.&lt;/b&gt; &lt;br&gt;     &lt;i&gt;Leaving the Atocha Station&lt;/i&gt; was hailed as \"one of the truest (and funniest) novels...of his generation\" (Lorin Stein, &lt;i&gt;New York Review of Books&lt;/i&gt;), \"a work so luminously original in style and form as to seem like a premonition, a comet from the future\" (Geoff Dyer, &lt;i&gt;The Observer&lt;/i&gt;). Now Lerner\'s second novel departs from &lt;i&gt;Atocha&lt;/i&gt;\'s exquisite ironies in order to explore new territories of thought and feeling.&lt;br&gt;     In the last year, the narrator of &lt;i&gt;10:04&lt;/i&gt; has enjoyed unexpected literary success, has been diagnosed with a potentially fatal heart condition, and has been asked by his best friend to help her conceive a child, despite his dating a rising star in the visual arts. In a New York of increasingly frequent super storms and political unrest, he must reckon with his biological mortality, the possibility of a literary afterlife, and the prospect of (unconventional) fatherhood in a city that might soon be under water.&lt;br&gt;     In prose that Jonathan Franzen has called \"hilarious...cracklingly intelligent...and original in every sentence,\" Lerner captures what it\'s like to be alive now, when the difficulty of imagining a future has changed our relation to both our present and our past. Exploring sex, friendship, medicine, memory, art, and politics, &lt;i&gt;10:04&lt;/i&gt; is both a riveting work of fiction and a brilliant examination of the role fiction plays in our lives.',1,813.60000000,220500808,'PS3612.E68',1272,1105,0,'813.6 L614',1,NULL,0,0,NULL),(1035,NULL,'978-2070408504','Le petit prince, : avec des aquarelles de l\'auteur','FR','Folio',96,1999,'Saint-Exupéry, Antoine de, 1900-1944',NULL,NULL,'FIC094','John W. Fail','le-petit-prince','2016-12-23 22:01:29','2021-01-31 16:16:13',21,'41n-PDcZWkL.jpg','image/jpeg',25287,304,500,'Imaginez-vous perdu dans le d??sert, loin de tout lieu habit??, et face ?? un petit gar??on tout blond, surgi de nulle part. Si de surcro??t ce petit gar??on vous demande avec insistance de dessiner un mouton, vous voil?? plus qu\'??tonn?? ! ?? partir de l??, vous n\'aurez plus qu\'une seule interrogation : savoir d\'o?? vient cet ??trange petit bonhomme et conna??tre son histoire. S\'ouvre alors un monde ??trange et po??tique, peupl?? de m??taphores, d??crit ?? travers les paroles d\'un \"petit prince\" qui porte aussi sur notre monde ?? nous un regard tout neuf, empli de na??vet??, de fra??cheur et de gravit??. Tr??s vite, vous d??couvrez d\'??tranges plan??tes, peupl??es d\'hommes d\'affaires, de buveurs, de vaniteux, d\'allumeurs de r??verb??res. Cette ??vocation onirique, ?? laquelle participent les aquarelles de l\'auteur, a tout d\'un parcours initiatique, o?? l\'enfant apprendra les richesses essentielles des rapports humains et le secret qui les r??git : \"On ne voit bien qu\'avec le coeur, l\'essentiel est invisible pour les yeux.\" Oeuvre essentielle de la litt??rature, ce livre de Saint-Exup??ry est un ouvrage que l\'on aura ?? coeur de raconter ?? son enfant, page apr??s page, histoire aussi de red??couvrir l\'enfant que l\'on ??tait autrefois, avant de devenir une grande personne',1,843.91200000,970956,'PZ24',1,50,0,'843.912 S137',1,NULL,0,0,NULL),(1036,'null','978-0992862565','Street Line Critics','EN','Limerick City Council',123,2014,'Bender, Lotte','null','null','FIC095','John W. Fail','street-line-critics','2016-12-23 22:01:29','2021-02-04 14:49:28',21,NULL,NULL,NULL,NULL,NULL,'null',1,709.41500000,0,NULL,NULL,NULL,1,'709.415 B458',1,'undefined',0,0,NULL),(1037,NULL,'978-1564780065','The lollipop trollops and other poems','EN','Dalkey Archive',117,1992,'Theroux, Alexander',NULL,NULL,'FIC096','John W. Fail','the-lollipop-trollops-and-other-poems','2016-12-23 22:01:29','2021-01-31 16:16:13',21,'4138x_2BGB1zL.jpg','image/jpeg',30437,329,500,'The Lollipop Trollops gathers the poems―written over several decades―of Alexander Theroux, one of the most brilliant novelists of our age. It is an uncompromising and explosive volume, a work of astonishing force and variety.&lt;br /&gt;Although written in a genre by which he has been known thus far only to a few, this book but continues what, taken altogether, including his essays, plays, stories, and fables, he understands to be a part of a single vision, the unfolding drama of a mind in action. “Ideas of a certain kind,” writes the author, “thoughts of a certain nap, can properly be expressed in no other way, not merely one-take ideas, rather substances requiring a specific form, the way brandy suitably calls for a snifter, absinthe a drip glass, and champagne an eight-ounce ‘tulip.\'”&lt;br /&gt;A variety of voices and visions reflect the alternations of mood, degrees of power, and a broad array of themes, a major one of which remains Theroux’s insistent exploration of the mystery at the heart of the creative process itself. The complex styles, his versatility, incorporates a vast knowledge.&lt;br /&gt;Here are occasional poems that explore secret moments of passion as well as sonnets, simple unadorned lyrics, blank verse, jingles, and, along with some masterful Therouvian “triplets,” much scarifying satire, forms in their plenitude including everything from closed couplets to bold free verse, from the dissonant to the deeply meditative to the elegantly lyrical. There is mad exactness here, great insight, rapier wit.&lt;br /&gt;Theroux has a commanding genius, whether writing of love or sketching a profile or fitting out thoughts like weapons with tips barbed with ferocious signifiers. With his love of words and penetrating way of seeing things like no one else, whether pastoral or political or polemical, he conjures poems out of his fingers like miraculous birds with an instant singing life.',1,811.54000000,25629702,'PS3570.H38',260,261,0,'811.54 T412',1,NULL,0,0,NULL),(1038,NULL,'978-0140052749','Panama','EN','Penguin',175,1979,'McGuane, Thomas',NULL,NULL,'FIC097','John W. Fail','panama','2016-12-23 22:01:29','2021-01-31 16:16:15',21,'41Kpw8y9s4L.jpg','image/jpeg',24112,304,500,'Declining celebrity Chet Pomeroy, attempts to win back Catherine, the girl whom he married (or perhaps did not marry) in Panama several years before. His quest for Catherine takes him to Key West, Florida, a centre of commercialism and corruption where nightmares stalk his waking hours.',1,813.54000000,4195144,'PS3563.A3114',634,639,0,'813.54 M478 Pan',1,NULL,0,0,NULL),(1039,NULL,'978-1878972217','Bayamus : and the theatre of semantic poetry and the life of Cardinal Pölätüo with notes on his writings, his times and his contemporaries : two novels','EN','Exact Change',256,2004,'Themerson, Stefan',NULL,NULL,'FIC098','John W. Fail','bayamus-cardinal-polatuo-two-novels','2016-12-23 22:01:29','2021-01-31 16:16:16',21,'5132C235JNL.jpg','image/jpeg',40508,342,475,'This is the first U.S. publication of two riotous novels by the Polish-born British writer Stefan Themerson (1910-1988), who with his wife Franciszka ran the Gaberbocchus Press in London. Gaberbocchus published both Kurt Schwitters and Bertrand Russell--and these extremes unite in Themerson’s highly individual brand of philosophical Dadaism. Bayamus recounts the adventures of a self-proclaimed mutant with three legs (one is attached to a roller skate) and his efforts to propogate a new species; it includes an instructive visit to the “Theatre of Semantic Poetry,” where old rhymes mutate into new truths. Cardinal Pölätüo is the biography of Apollinaire’s anonymous father, who turns out to be a ecclesiast with a murderous interest in poetry, a faith based on science, and a dreamlife so frankly obscene that only a dictionary of Freudian symbols can explain its innocence.',1,823.91400000,37868854,'PR6039.H37',56,59,0,'823.914 T383 Bay',1,NULL,0,0,NULL),(1040,NULL,'978-0805043655','Darconville\'s cat','EN','Henry Holt',728,1996,'Theroux, Alexander',NULL,NULL,'FIC099','John W. Fail','darconville-s-cat','2016-12-23 22:01:29','2021-01-31 16:16:17',21,'51b3gk-6mkL.jpg','image/jpeg',43669,329,500,'Cover free of tears but shows light chipping at edges, Spine is uncreased, Light bump evident on top of spine, Pages are free of marks or highlighting, Not ex-library.',1,813.54000000,6942897,'PS3570.H38',598,598,0,'813.54 T412',1,NULL,0,0,NULL),(1041,NULL,'978-0571137404','The mystery of the sardine','EN','Faber & Faber',194,1986,'Themerson, Stefan',NULL,NULL,'FIC100','John W. Fail','the-mystery-of-the-sardine','2016-12-23 22:01:29','2021-01-31 16:16:17',21,'41el_2B4pxyHL.jpg','image/jpeg',32195,320,500,'&lt;p&gt;When an unknown black poodle inexplicably explodes in philosophy professor Timothy Chesterton-Brown\'s back yard--paralyzing the professor and killing his guest--the \"mystery of the sardine\" begins. Its solution will involve such unwitting detectives as a twelve-year-old mathematician, his mother, his beloved, a palmist named Miss Prentice, and a bureaucrat dubbed the Minister of Imponderabilia. The clues they unearth--drawing on logic, the occult, intuition, and everything in between--lead them far away from the tiny seaside town where they begin. We follow them to Majorca, Rome, Warsaw, and London, but in the end, the solution lies beyond even the furthest and most magical reaches of reason.',1,823.91400000,12522455,'PR6039.H37',170,268,0,'823.914 T383 Mys',1,NULL,0,0,NULL),(1042,NULL,'978-1564781550','The fountains of Neptune : a novel','EN','Dalkey Archive',220,1989,'Ducornet, Rikki, 1943-',NULL,NULL,'FIC101','John W. Fail','the-fountains-of-neptune','2016-12-23 22:01:29','2021-01-31 16:16:18',21,'51YD5bHH1IL.jpg','image/jpeg',44342,375,500,'&lt;div&gt;&lt;p&gt;\"My sleep began in the spring of 1914. I slept through both World Wars and the tainted calm between. It was as if I had been cursed by an evil fairy, pricked by an enchanted spinning wheel; an impenetrable briar had gripped my mind.\" Thus begins Rikki Ducornet\'s brilliant lyric novel about Nicolas who, as a result of witnessing his mother\'s murder, falls into a decades-long coma. Awakened in a seaport town in France, he reconstructs his past through story-telling and myth, resulting in an astonishing exploration of memory and imagination.&lt;/p&gt;&lt;/div&gt;',1,813.54000000,19514836,'PS3554.U279',494,497,0,'813.54 D839 Fou',1,NULL,0,0,NULL),(1043,' 978-1564784773',NULL,'Omega minor','EN','Dalkey Archive',691,2007,'Verhaeghen, Paul',NULL,NULL,'FIC102','John W. Fail','omega-minor','2016-12-23 22:01:29','2021-01-31 16:16:18',21,'414Oq2U_2BAYL.jpg','image/jpeg',26917,339,500,'&lt;p&gt;Berlin, Spring of 1995. While a group of neo-Nazis are preparing an anniversary bash of disastrous proportions, an old physics professor returns to Potsdam to atone for his sins, an Italian postdoc designs an experiment that will determine the fate of the universe, and, in a room at Le Charit?, a Holocaust survivor tells his tale to the willing ear of a young psychologist. Who is that talking cat, why do ghosts of SS soldiers roam the city, and what is Speer\'s favorite actress up to?',1,833.91400000,56608384,'PT6466.32.E663',228,265,0,'833.914 V512',1,NULL,0,0,NULL),(1044,NULL,'978-1878972071','Exploits &amp; opinions of Doctor Faustroll, pataphysician : a neo-scientific novel','EN','Exact Change',160,1996,'Jarry, Alfred, 1873-1907 | Taylor, Simon Watson',NULL,NULL,'FIC103','John W. Fail','exploits-and-opinions-of-dr-faustroll-pataphysician','2016-12-23 22:01:29','2021-01-31 16:16:19',21,'51P1ceTGwaL.jpg','image/jpeg',53634,373,500,'Alfred Jarry is best known as the author of the proto-Dada play &lt;I&gt;Ubu Roi&lt;/I&gt;, but this anarchic novel of absurdist philosophy is widely regarded as the central work to his oeuvre. &lt;I&gt;Exploits and Opinions of Dr. Faustroll&lt;/I&gt; recounts the adventures of the inventor of “Pataphysics ... the science of imaginary solutions.”',1,842.80000000,35596114,'PQ2619.A65',108,108,0,'842.8 J37',1,NULL,0,0,NULL),(1045,NULL,'978-0865472129','Odd number','EN','North Point',159,1985,'Sorrentino, Gilbert',NULL,NULL,'FIC104','John W. Fail','odd-number','2016-12-23 22:01:29','2021-01-31 16:16:20',21,'51H9IJ0LywL.jpg','image/jpeg',44908,345,500,'Fine cloth copy in a near-fine, very slightly dust-dulled dw, now mylar-sleeved. Remains particularly and surprisingly well-preserved overall; tight, bright, clean and strong.; 8vo 8\" - 9\" tall; 159 pages; Description: 159 p. : ill. ; 24 cm. Subjects: Examination of witnesses --Fiction. Criminals --Fiction. Form/Genre: Experimental fiction - Literary fiction - Legal fiction.',1,813.54000000,12600818,'PS3569.O7',283,284,0,'813.54 S713 Odd',1,NULL,0,0,NULL),(1046,NULL,'978-0701127619','The stain : a novel','EN','Chatto & Windus',191,1984,'Ducornet, Rikki, 1943-',NULL,NULL,'FIC105','John W. Fail','the-stain','2016-12-23 22:01:29','2021-01-31 16:16:21',21,'51TcKxsvNNL.jpg','image/jpeg',46448,375,500,'&lt;p&gt;In?\"The Stain\"?Rikki Ducornet tells the story of a young girl named Charlotte, branded with a furry birthmark in the shape of a dancing hare, regarded as the mark of Satan. \"Sadistic nuns, scatology, butchered animals, monkish rapists, and Satan\" (Kirkus), as well as the village exorcist, inhabit this bawdy tale of perversion, power, possession, and the rape of innocence. Ducornet weaves an intricate design of fantasy and reality, at once surreal, hilarious, and terrifying.',1,813.54000000,11091016,'PS3554.U279',385,382,0,'813.54 D839 Sta',1,NULL,0,0,NULL),(1047,NULL,'978-0394759777','Pages from a cold island','EN','Vintage',274,1988,'Exley, Frederick',NULL,NULL,'FIC106','John W. Fail','pages-from-a-cold-island','2016-12-23 22:01:29','2021-01-31 16:16:22',21,'516FSLJvEML.jpg','image/jpeg',44011,341,500,'The death of Edmund Wilson precipitates an odyssey through the distorted literary landscape of America in search of Wilson\'s essence as the pre-eminent man of letters and the author\'s own creative wellsprings',1,813.54000000,1104319,'PS3555.X58',636,620,0,'813.54 E96',1,NULL,0,0,NULL),(1048,NULL,'978-0811204835','The flight of Icarus','EN','New Directions',191,1973,'Queneau, Raymond, 1903-1976 | Wright, Barbara, 1915-2009 [Former owner; Translator]',NULL,NULL,'FIC107','John W. Fail','the-flight-of-icarus','2016-12-23 22:01:29','2021-01-31 16:16:22',21,'51xW3fEphHL.jpg','image/jpeg',54357,315,500,'&lt;p&gt;The Flight of Icarus (Le Vol d\'lcare) is his only novel written in the form of a play: seventy-four short scenes, complete with stage directions.&lt;/p&gt;&lt;br /&gt;Called by some the French Borges, by others the creator of le nouveau roman a generation ahead of its time, Raymond Queneau\'s work in fiction continues to defy strict categorization. The Flight of Icarus (Le Vol d\'lcare) is his only novel written in the form of a play: seventy-four short scenes, complete with stage directions. Consciously parodying Pirandello and Robbe-Grillet, it begins with a novelist\'s discovery that his principal character, Icarus by name, has vanished. This, in turn, sets off a rash of other such disappearances. Before long, a number of desperate authors are found in search of their fugitive characters, who wander through the Paris of the 1890s, occasionally meeting one another, and even straying into new novels. Icarus himself––perhaps following the destiny his name suggests––develops a passion for horseless carriages, kites, and machines that fly. And throughout the almost vaudevillian turns of the plot, we are aware, as always, of Queneau\'s evident delight at holding the thin line between farce and philosophy.',1,843.91200000,289281,'PQ2633.U43',404,883,0,'843.912 Q3',1,NULL,0,0,NULL),(1049,NULL,'978-1564785121','Log of the S.S. The Mrs Unguentine,','EN','Dalkey Archive',113,2008,'Crawford, Stanley G., 1937-',NULL,NULL,'FIC108','John W. Fail','log-of-the-s-s-the-mrs-unguentine','2016-12-23 22:01:29','2021-01-31 16:16:24',21,'51Yj0qmrg2L.jpg','image/jpeg',33039,341,500,'\"A captivating short work almost beyond description.\" The New Yorker',1,813.54000000,262348,'PS3553.R295',196,218,0,'813.54 C899',1,NULL,0,0,NULL),(1050,NULL,'978-0156439619','If on a winter\'s night a traveller','EN','Harcourt Brace Jovanovich',260,1982,'Calvino, Italo,',NULL,NULL,'FIC109','John W. Fail','if-on-a-winter-s-night-a-traveler-21681299-47d0-4d84-a2bc-035763519c7d','2016-12-23 22:01:29','2021-01-31 16:16:24',21,NULL,NULL,NULL,NULL,NULL,NULL,1,853.91400000,7847224,'PQ4809.A45',387,347,0,'853.914 C168 Ifon',1,NULL,0,0,NULL),(1051,NULL,'978-1564781567','Collected fiction','EN','Dalkey Archive',240,1990,'Zukofsky, Louis, 1904-1978',NULL,NULL,'FIC110','John W. Fail','collected-fiction','2016-12-23 22:01:29','2021-01-31 16:16:25',21,'4129DkY0IiL.jpg','image/jpeg',22323,315,500,'&lt;p&gt;Best known as one of the most significant poets of the 20th century, Louis Zukofsky was also an accomplished writer of fiction, all of which is collected here for the first time. Included is his only novel, \"Little\" (1970), which John Leonard in the \"New York Times\" called \"an odd, playful, thoroughly charming novel about a child prodigy.\" (The novel is very autobiographical and Zukofsky\'s son, violin virtuoso, Paul Zukofsky, has written an afterword for this edition.) Also included are the four stories comprising \"It Was,\" published in 1961 in a limited edition and virtually unobtainable for years. The stories range from the brief title story in which a writer struggles with the composition of the perfect sentence to the novella length \"Ferdinand,\" which Guy Davenport praised in the \"New York Times Book Review\" as \"a finely tuned story from a sensibility of extraordinary range and skill.\"',1,813.54000000,20453834,'PS3549.U47',504,503,0,'813.54 Z93',1,NULL,0,0,NULL),(1052,NULL,'978-0802135278','The public burning','EN','Grove Press',544,1998,'Coover, Robert',NULL,NULL,'FIC111','John W. Fail','the-public-burning','2016-12-23 22:01:29','2021-01-31 16:16:26',21,'51-S42chzOL.jpg','image/jpeg',41263,320,500,'A controversial best-seller in 1977, The Public Burning has since emerged as one of the most influential novels of our time. The first major work of contemporary fiction ever to use living historical figures as characters, the novel reimagines the three fateful days in 1953 that culminated with the execution of alleged atomic spies Julius and Ethel Rosenberg. Vice-President Richard Nixon - the voraciously ambitious bad boy of the Eisenhower regime - is the dominant narrator in an enormous cast that includes Betty Crocker, Joe McCarthy, the Marx Brothers, Walter Winchell, Uncle Sam, his adversary The Phantom, and Time magazine incarnated as the National Poet Laureate. All of these and thousands more converge in Times Square for the carnivalesque auto-da-fe at which the Rosenbergs are put to death. And not a person present escapes implication in Cold War America\'s ruthless \"public burning.\"',1,813.54000000,2874068,'PS3553.O633',1261,1299,0,'813.54 C769',1,NULL,0,0,NULL),(1053,NULL,'978-1560250197','George Mills : a novel','En','Thunder\'s Mouth',508,1991,'Elkin, Stanley, 1930-1995',NULL,NULL,'FIC112','John W. Fail','george-mills','2016-12-23 22:01:29','2021-01-31 16:16:27',21,'41V5StM5bQL.jpg','image/jpeg',18671,333,500,'Doomed by a thousand-year-old curse to serve important  personages throughout the centuries, George Mills loves and follows  various lieges, from a stableboy ancestor in the First Crusade to a  modern-day furniture mover. Reprint. &lt;i&gt;LJ. &lt;/i&gt;',1,813.54000000,8281725,'PS3555.L47',1094,1129,0,'813.54 E37',1,NULL,0,0,NULL),(1054,NULL,'978-1564784179','Hobson\'s Island','EN','Dalkey Archive',196,2005,'Themerson, Stefan, 1910-1988',NULL,NULL,'FIC113','John W. Fail','hobson-s-island','2016-12-23 22:01:29','2021-01-31 16:16:28',21,'5100wp9AfpL.jpg','image/jpeg',46601,316,500,'&lt;p&gt;Hobson\'s Island (so called because Mr. Hobson bought it, or did Mr. Hobson buy it because it was so called?) enjoyed decades of isolation in the Atlantic Ocean. For years, the caretakers lived there peacefully, with only a cow for company and an empty house to care for. But all is suddenly disrupted when a wave of unusual visitors arrive: a deposed African king fleeing a revolution, a Hobson descendant claiming ownership, government agents eyeing the nation-less real estate, and scientists looking to test a dangerous new invention. In typical Themerson fashion, the comic is wound up with the serious and let go to devastating effect. A clever and apt parodying of Cold War power plays and twisted science, Hobson\'s Island is a strangely touching, sympathetic, and emotional account of the families and individuals brought together and broken up by Hobson\'s Island.',1,823.91400000,17838641,'PR6039.H37',144,230,0,'823.914 T383 Hob',1,NULL,0,0,NULL),(1055,NULL,'978-1873982365','The Dedalus book of surrealism : the identity of things','EN','Dedalus',289,1994,'Richardson, Michael, 1953-',NULL,NULL,'FIC114','John W. Fail','the-myth-of-the-world-surrealism-2','2016-12-23 22:01:29','2021-01-31 16:16:28',21,'51t7MAYJikL.jpg','image/jpeg',35592,317,500,'international anthology of Surrealist fiction',1,808.83910000,57727256,'PN6120.95.S92',19,19,0,'808.8391 R524',1,NULL,0,0,NULL),(1056,'null','978-0971904712','McSweeney\'s 8','EN','McSweeney\'s',335,2002,'Eggers, Dave; Maliszewski, Paul','null','null','FIC115','John W. Fail','mcsweeney-s-8','2016-12-23 22:01:29','2021-02-04 14:51:12',21,'41uNI68MorL.jpg','image/jpeg',25770,333,500,'Issue No. 8 features fiction, essays, letters, and interviews that explore the sometimes-fuzzy boundary between fiction and fact. There are some stories in this issue that read like fact but are actually fiction. There are some essays that you will swear must be fiction but are, in fact, completely true. There\'s an interview with an artist whose paintings look like the work of a time centuries past and an interview with a person who holds fake press conferences. The issue is a hardcover book, with a cover designed by Elizabeth Kairys, and contains over three hundred pages of new writing',1,813.60800000,50593663,'PS642',NULL,16,0,'813.608 E28',1,'undefined',1,0,NULL),(1057,'','978-0-9568559-4-7','Tender buttons; : objects, food, rooms','EN','Uniformbooks',78,2012,'Stein, Gertrude, 1874-1946,','','','FIC162','','tender-buttons','2016-12-23 22:01:29','2021-01-31 16:16:28',21,'41Wes9gVR8L.jpg','image/jpeg',16794,308,500,'Gertrude Stein\'s innovative modernist writing continues to astonish, amaze and fascinate one hundred years later.  Arguably the most daring of all the American modernists, Stein was heavily influenced by European artistic trends, yet her writing remains quintessentially American and feminist in its attitudes. This is fascinating book for students of modernism in its most innovative form. Arguably Stein is the great innovator of American modernism – perpetually intriguing and always exciting in its experiments.',1,818.52070000,94507,'PS3537.T323',1002,2244,0,'818.5207 S819',1,NULL,0,0,NULL),(1058,NULL,NULL,'The Decameron of Boccaccio','IT','IGDA',282,1982,'Boccaccio, Giovanni, 1313-1375',NULL,NULL,'FIC117',NULL,'decameron','2016-12-23 22:01:29','2021-01-31 16:16:28',21,NULL,NULL,NULL,NULL,NULL,NULL,1,850.10000000,9423288,'PQ4272.E5',105,173,0,'850.1 B664',1,NULL,0,0,NULL),(1059,NULL,'978-0330444576','Indecision : a novel','EN','Picador',240,2006,'Kunkel, Benjamin | Scherpenisse, Wim, 1958- [Translator]',NULL,NULL,'FIC118','John W. Fail','indecision','2016-12-23 22:01:29','2021-01-31 16:16:28',21,'41Z_2BfE_2BqmKL.jpg','image/jpeg',28978,311,500,'Dwight Wilmerding, twenty-eight, is having a midlife crisis. And there\'s an even bigger problem: his chronic inability to make up his mind. Encouraged to try a drug meant to banish indecision, he is all at once fired from his low-grade tech-support job in Manhattan and invited to a rendezvous in exotic Ecuador with the girl of his long-ago prep-school dreams. Unable to decide if the magic pills are working, he finds his would-be romantic escape becoming a journey into unbidden responsibility and -- deep in the jungles of the Amazon -- the foreign country of a changed outlook. \'Indecision manages to make the whole flailing, postadolescent, prelife crisis feel fresh and funny again ...The funniest and smartest coming-of-age novel in years\' Jay McInerney, New York Times Book Review \'He\'s got this voice that just grabs your attention and won\'t let go ...Old Dwight\'s book really knocked me out\' Michiko Kakutani, New York Times',1,813.60000000,57286042,'PS3611.U54',883,808,0,'813.6 K95',1,NULL,0,0,NULL),(1060,NULL,'978-0345807298','The circle','EN','Penguin',497,2014,'Eggers, Dave, 1970-',NULL,NULL,'FIC119','John W. Fail','the-circle','2016-12-23 22:01:29','2021-01-31 16:16:29',21,'41RJXiRKIYL.jpg','image/jpeg',30922,324,500,'&lt;b&gt;Soon to be a Major Motion Picture, &lt;i&gt;The Circle&lt;/i&gt; is the exhilarating novel from Dave Eggers, best-selling author of &lt;i&gt;Heroes of the Frontier&lt;/i&gt;.&lt;/b&gt;&lt;br&gt; &lt;br&gt;When Mae Holland is hired to work for the Circle, the world’s most powerful internet company, she feels she’s been given the opportunity of a lifetime. The Circle, run out of a sprawling California campus, links users’ personal emails, social media, banking, and purchasing with their universal operating system, resulting in one online identity and a new age of civility and transparency. As Mae tours the open-plan office spaces, the towering glass dining facilities, the cozy dorms for those who spend nights at work, she is thrilled with the company’s modernity and activity. There are parties that last through the night, there are famous musicians playing on the lawn, there are athletic activities and clubs and brunches, and even an aquarium of rare fish retrieved from the Marianas Trench by the CEO. Mae can’t believe her luck, her great fortune to work for the most influential company in the world—even as life beyond the campus grows distant, even as a strange encounter with a colleague leaves her shaken, even as her role at the Circle becomes increasingly public. What begins as the captivating story of one woman’s ambition and idealism soon becomes a heart-racing novel of suspense, raising questions about memory, history, privacy, democracy, and the limits of human knowledge.',1,813.60000000,855533777,'PS3605.G48',876,802,0,'813.6 E28',1,NULL,0,0,NULL),(1061,NULL,'978-1853260957','King Lear','EN','Wordsworth Classics',176,1997,'Shakespeare, William, 1564-1616 | Bloom, Harold [Author of afterword, colophon, etc.] | Muir, Kenneth [Editor; Author of introduction; Other] | Raffel, Burton [Editor; Author of introduction] | Wells, Stanley, 1930- [Editor] | Foakes, R. A. [Editor; Other; Author of introduction]',NULL,NULL,'FIC120',NULL,'king-lear','2016-12-23 22:01:29','2021-02-04 14:23:21',21,'51OpY6BAPBL.jpg','image/jpeg',40174,500,500,'The Wordsworth Classics Shakespeare Series presents a newlyedited sequence of William Shakespeares works The textual editing takes account of recent scholarship while giving the material a careful reappraisal King Lear has been widely acclaimed as Shakespeares most powerful tragedy Elemental and passionate it encompasses the horrific and the heartrending Love and hate loyalty and treachery cruelty and selfsacrifice all these contend in a tempestuous drama which has become an enduring classic of the worlds literature In the theatre and on screen King Lear continues to challenge and enthral This Wordsworth edition of King Lear provides a comprehensive integrated text of the play',1,822.33000000,29977,'PR2819.A2',24603,17269,0,'822.33 S527',1,NULL,0,0,NULL),(1062,NULL,'978-0330448628','The road','EN','Picador',307,2007,'McCarthy, Cormac 1933- | Stingl, Nikolaus, 1952- [Translator] | Murillo Fort, Luis [Translator]',NULL,NULL,'FIC121',NULL,'the-road','2016-12-23 22:01:29','2021-02-04 13:59:53',21,'41hmWkDrX8L.jpg','image/jpeg',27556,306,500,'A searing, postapocalyptic novel destined to become Cormac McCarthy’s masterpiece.&lt;br&gt;&lt;br&gt;A father and his son walk alone through burned America.  Nothing moves in the ravaged landscape save the ash on the wind. It is cold enough to crack stones, and when the snow falls it is gray.  The sky is dark. Their destination is the coast, although they don’t know what, if anything, awaits them there.  They have nothing; just a pistol to defend themselves against the lawless bands that stalk the road, the clothes they are wearing, a cart of scavenged food—and each other.&lt;br&gt;&lt;br&gt;&lt;i&gt;The Road&lt;/i&gt; is the profoundly moving story of a journey.  It boldly imagines a future in which no hope remains, but in which the father and his son, “each the other’s world entire,” are sustained by love.  Awesome in the totality of its vision, it is an unflinching meditation on the worst and the best that we are capable of: ultimate destructiveness, desperate tenacity, and the tenderness that keeps two people alive in the face of total devastation.',3,813.54000000,69022057,'PS3563.C337',6369,8106,0,'813.54 M478 Roa',1,NULL,0,0,NULL),(1063,NULL,'978-2070398591','Le cantique de l\'apocalypse joyeuse : roman','FR','Folio',390,2009,'Paasilinna, Arto, 1942-2018',NULL,NULL,'FIC122',NULL,'la-cantique-de-l-apocalypse-joyeuse','2016-12-23 22:01:29','2021-01-31 16:16:30',21,'41Ek2gddcOL.jpg','image/jpeg',27670,305,500,NULL,1,839.00000000,319215031,NULL,44,NULL,0,'839 P112',1,NULL,0,0,NULL),(1064,'null','978-8433975775','El año de la liebre','ES','Anagrama',180,2011,'Paasilinna, Arto, 1942-2018','null','null','FIC123','null','el-ano-de-la-liebre','2016-12-23 22:01:29','2021-02-04 14:53:38',21,'41D04uvPoiL.jpg','image/jpeg',31974,318,500,'null',1,894.54133000,58328918,'PH355.P22',NULL,6,0,'894.54133 P112',1,'undefined',0,0,NULL),(1065,'','978-0099494096','Kafka on the shore','EN','Vintage',615,2005,'Murakami, Haruki, 1949- | Gabriel, Philip, 1953- [Translator; Author]','','','FIC124','','kafka-on-the-shore','2016-12-23 22:01:29','2021-01-31 16:16:30',21,'418ybjvpCPL._SX321_BO1_204_203_200_.jpg','image/jpeg',21356,323,499,'',1,895.63500000,56095515,'PL856.U673',2847,2855,0,'895.635 M972',1,NULL,0,0,NULL),(1066,NULL,'978-6071109101','Die Erzählungen','ES','Punto de Lectura',545,2011,'Cortázar, Julio',NULL,NULL,'FIC125',NULL,'cuentos-completos-1','2016-12-23 22:01:29','2021-01-31 16:16:30',21,'51moLgfjzaL.jpg','image/jpeg',41548,331,500,'&lt;div&gt;Incluye todos los cuentos de: La otra orilla, Bestiario, Las armas secretas, y Final del juego.   &lt;b&gt;ENGLISH DESCRIPTION&lt;/b&gt;  Cortazar is a must for any reader. His stories brilliantly portray unlikely beings full of magic and tenderness. They are the greatest synthesis of his literary work as well as an opportunity to embark on an endless voyage, guided by the hand of a true master. Cortazar\'s literature is brought to life in three exceptional volumes written by this immortal cronopio, one of the best storytellers of the twentieth century. The collection includes an in-depth introduction by Mario Vargas Llosa.&lt;/div&gt;',1,863.64000000,75829489,'PQ7797.C7145',2,3,0,'863.64 C827',1,NULL,0,0,NULL),(1068,' 978-0330298636',NULL,'Love','EN','Picador',120,1988,'Carter, Angela, 1940-1992 | Niffenegger, Audrey [Author of introduction]',NULL,NULL,'FIC127',NULL,'love','2016-12-23 22:01:29','2021-01-31 16:16:31',21,'41HC5GHESNL.jpg','image/jpeg',23796,314,475,'\"One day, Annabel saw the sun and moon in the sky at the same time.  The sight filled her with a terror which entirely consumed her … for she had no instinct for self-preservation if she was confronted by ambiguities.\"&lt;p&gt;Annabel and Lee are married; Lee and Buzz are brothers.  A quirky threesome, they have set up a household on the fringes on university life in the late sixties.  Their hermetic existence is filled with drugs, sex, alchohol, intensity, and madness; their relationships with one another are haunting and complex.&lt;p&gt;Carter\'s compelling tale carries echoes of Poe and Bronte into the very modern world of artists\' flats, psychiatrists\' offices, and generational conflicts.  It is ultimately a tale of the search for loyalty and love in the midst of emotional starvation.&lt;/p&gt;&lt;/p&gt;',1,823.91400000,221313,'PR6053.A73',514,472,0,'823.914 C324',1,NULL,0,0,NULL),(1069,'417060807',NULL,'334','EN','Methuen',260,1982,'Disch, Thomas M.',NULL,NULL,'FIC128',NULL,'334','2016-12-23 22:01:29','2021-02-04 22:45:14',21,NULL,NULL,NULL,NULL,NULL,NULL,1,813.54000000,707750,'PS3554.I8',388,362,0,'813.54 D611',1,NULL,0,0,NULL),(1070,'','','The Body artist','EN','Picador',125,2002,'DeLillo, Don','','','FIC129','','the-body-artist','2016-12-23 22:01:29','2021-01-31 16:16:33',21,'51i8sOCwt-L._SY344_BO1_204_203_200_.jpg','image/jpeg',22040,227,346,'',1,813.54000000,45817278,'PS3554.E4425',226,308,0,'813.54 D353 Bod',1,NULL,0,0,NULL),(1071,'null','978-0980226607','The easy chain','EN','Aurora148',502,2008,'Dara, Evan','null','null','FIC130','null','the-easy-chain','2016-12-23 22:01:29','2021-02-04 14:54:37',21,'41JXEwI9BuL.jpg','image/jpeg',25886,334,500,'&lt;span id=\"caseCorrespondence_16477226785_text\"&gt;--So what’s the book about?&lt;br /&gt;--It about this British guy who goes to The University of Chicago—?&lt;br /&gt;--Nah.  And it really isn’t about his getting this, like, social illness—&lt;br /&gt;--The one where…  Come on: it’s impossible to become allergic to lying—&lt;br /&gt;--Exactly – the book isn’t about that at all…&lt;/span&gt;',1,813.60000000,276949171,'PS3554.A638',NULL,19,0,'813.6 D213',1,'undefined',0,0,NULL),(1072,NULL,'978-0312608880','Comet in Moominland','EN','Square Fish',192,2010,'Jansson, Tove | Portch, Elizabeth [Translator; Illustrator; Author]',NULL,NULL,'FIC131',NULL,'comet-in-moominland','2016-12-23 22:01:29','2021-01-31 16:16:34',21,'41Kzl8BHTpL.jpg','image/jpeg',31144,335,500,'&lt;p&gt;When Moomintroll learns that a comet will be passing by, he and his friend Sniff travel to the Observatory on the Lonely Mountains to consult the Professors. Along the way, they have many adventures, but the greatest adventure of all awaits them when they learn that the comet is headed straight for their beloved Moominvalley.&lt;/p&gt;',1,839.73740000,469650,'PZ7.J247',231,710,0,'839.7374 J35',1,NULL,0,0,NULL),(1073,NULL,'978-1590172339','The book of Ebenezer Le Page','EN','NYRB Classics',400,2007,'Edwards, G. B. (Gerald Basil), 1899-1976 | Fowles, John, 1926-2005 [Signer]',NULL,NULL,'FIC132',NULL,'the-book-of-ebenezer-le-page','2016-12-23 22:01:29','2021-01-31 16:16:34',21,'51zY9MuA7KL.jpg','image/jpeg',55697,312,500,'Ebenezer Le Page, cantankerous, opinionated, and charming, is one of the most compelling literary creations of the late twentieth century. Eighty years old, Ebenezer has lived his whole life on the Channel Island of Guernsey, a stony speck of a place caught between the coasts of England and France yet a world apart from either. Ebenezer himself is fiercely independent, but as he reaches the end of his life he is determined to tell his own story and the stories of those he has known. He writes of family secrets and feuds, unforgettable friendships and friendships betrayed, love glimpsed and lost. &lt;i&gt;The Book of Ebenezer Le Page&lt;/i&gt; is a beautifully detailed chronicle of a life, but it is equally an oblique reckoning with the traumas of the twentieth century, as Ebenezer recalls both the men lost to the Great War and the German Occupation of Guernsey during World War II, and looks with despair at the encroachments of commerce and tourism on his beloved island. &lt;br /&gt;         &lt;br /&gt;G. B. Edwards labored in obscurity all his life and completed &lt;i&gt;The Book of Ebenezer Le Page&lt;/i&gt; shortly before his death. Published posthumously, the book is a triumph of the storyteller’s art that conjures up the extraordinary voice of a living man.',1,823.91400000,6918815,'PR6055.D87',1144,1102,0,'823.914 E26',1,NULL,0,0,NULL),(1074,NULL,'978-0575073029','Toxicology : stories','EN','Gollancz',144,2002,'Aylett, Steve, 1967-',NULL,NULL,'FIC133',NULL,'toxicology','2016-12-23 22:01:29','2021-01-31 16:16:34',21,'51u1eFlXOaL.jpg','image/jpeg',55140,324,500,'Featuring some stories set in Beerlight, this is an awe-inspiring, mind scrambling collection of fiction from one of the UK\'s most exciting new writers. Aylett has been feted by Michael Moorcock, The Face, iD, The Standard, The Independent, The Guardian, SFX and Starburst. With these stories it is easy to see why. Steve Aylett\'s is a unique imagination. This UK edition includes new stories not included in the US edition.',1,823.91400000,41580495,'PR6051.Y57',867,855,0,'823.914 A978 Tox',1,NULL,0,0,NULL),(1075,NULL,'978-0140127119','Libra','EN','Penguin',458,1989,'DeLillo, Don | Cavándoli, Margarita [Translator] | Hermann, Hans [Translator] | Verlag Kiepenheuer &amp; Witsch [Publisher]',NULL,NULL,'FIC134',NULL,'libra','2016-12-23 22:01:29','2021-02-04 13:55:31',21,'51Zq7CwM86L.jpg','image/jpeg',38623,325,500,'In this powerful, eerily convincing fictional speculation on the assassination of John F. Kennedy, Don DeLillo chronicles Lee Harvey Oswald\'s odyssey from troubled teenager to a man of precarious stability who imagines himself an agent of history. When \'history\' presents itself in the form of two disgruntled CIA operatives who decide that an unsuccessful attempt on the life of the president will galvanize the nation against communism, the scales are irrevocably tipped.',3,813.54000000,17510108,'PS3554.E4425',2960,3020,0,'813.54 D353 Lib',1,NULL,0,0,NULL),(1076,'null','978-9512084029','Illan tullen','FI','Gummerus',300,2010,'Cunningham, Michael','null','null','FIC135','null','illan-tullen','2016-12-23 22:01:29','2021-02-04 14:57:29',21,NULL,NULL,NULL,NULL,NULL,'null',1,813.60000000,0,NULL,NULL,NULL,1,'813.6 C973',1,'undefined',0,0,NULL),(1077,NULL,'978-0-500-976654-4','The dream of Fluxus : George Maciunas : an artist\'s biography','EN','Edition Hansjorg Mayer',172,2007,'Kellein, Thomas',NULL,NULL,'MON001',NULL,'the-dream-of-fluxus-george-maciunas-an-artist-s-biography','2016-12-23 22:01:29','2021-01-31 16:16:36',6,NULL,NULL,NULL,NULL,NULL,NULL,3,709.20000000,166394884,'N6537.M313',331,308,0,'709.2 K29',1,NULL,0,0,NULL),(1078,NULL,'978-3-86335-142-7','Frances Stark : my best thing','EN','Koenig Books, Contemporary Art Gallery,  the Banff Centre',88,2012,'Godfrey, Mark (Mark Benjamin)',NULL,NULL,'MON002',NULL,'frances-stark-my-best-thing','2016-12-23 22:01:29','2021-02-06 09:57:55',6,'41hDIm0laYL.jpg','image/jpeg',29283,339,500,'This intimate publication focuses on Frances Stark’s feature-length video “My Best Thing,” a digital video animation that traces the development of two sexual encounters into conversations about film, literature, art, collaboration and subjectivity. Mark Godfrey’s essay explores the artist’s use of online sex-chat rooms to generate material for the video.',1,709.20000000,760370372,'N6537.S686',87,83,0,'709.2 G583',1,NULL,0,0,NULL),(1079,'null','978-3-86335-253-0','Florian Pumhösl. Räumliche Sequenz / Spatial sequence. Arbeiten in Ausstellungen 1993-2012 / Works in Exhibition 1993-2012','DE/EN','Kunsthaus Bregenz ',327,2012,'Pumhösl, Florian','null','null','MON003','null','florian-pumhosl-raumliche-sequenz-spatial-sequence','2016-12-23 22:01:29','2021-02-01 22:33:21',6,'21ZbK3zo-8L.jpg','image/jpeg',8166,391,500,'Viennese artist Florian Pumhösl (born 1971) makes paintings, films and architectural installations inspired by historical avant-gardes, and uses the site of the exhibition in itself as a medium. This publication presents all of Pumhösl’s installations since 1993, with illustrations and explanatory texts.',1,709.20000000,849907382,'N6490',5,5,0,'709.2 P976',1,'undefined',0,0,NULL),(1080,'null','9786094271410','Museum','LT/EN','kitos knygos',254,2013,'Liškevičius, Dainius, 1970-','null','null','MON004','null','muziejus-museum','2016-12-23 22:01:29','2021-02-09 09:02:11',6,NULL,NULL,NULL,NULL,NULL,'null',1,709.20000000,927465964,'N6995.L5',NULL,1,0,'709.2 L693 Mus',3,'undefined',0,0,NULL),(1081,'null','978-609-95496-2-0','Kęstutis Zapkus','LT/EN','Vilniaus dailės akademijos leidykla',231,2014,'Kreivytė, Laima','null','null','MON005','null','kestutis-zapkus','2016-12-23 22:01:29','2021-02-06 09:51:50',6,NULL,NULL,NULL,NULL,NULL,'null',1,759.79300000,883188449,'ND237.Z35',NULL,4,0,'759.793 Z35',1,'undefined',0,0,'Zapkus, Kęstutis'),(1082,'null','978-9955-767-20-6','Rafael Chwoles : the search for Jerusalem','EN','Vilna Gaom State Jewish Museum',271,2013,'Laučkaitė, Laima','null','null','MON006','null','rafael-chwoles-the-search-for-jerusalem','2016-12-23 22:01:29','2021-02-08 17:20:15',6,NULL,NULL,NULL,NULL,NULL,'null',1,759.79300000,907807718,'ND955.L573',NULL,15,0,'759.793 L366',1,'undefined',0,0,NULL),(1083,'null','978-609-426-055-1','Vitas Luckus : biografija','LT','Lietuvos Dailės Muziejus/ Lietuvos fotomenininkų sąjungos Kaunos skyrius',239,2014,'Matulyė, Margarita','null','null','MON009','null','vitas-luckus-biografija','2016-12-23 22:01:29','2021-02-08 17:36:44',6,NULL,NULL,NULL,NULL,NULL,'null',1,779.09200000,900161489,'TR140.L83',NULL,10,0,'779.092 L941',1,'undefined',0,0,'Luckus, Vitas'),(1084,'null','978-609-426-056-8','Vitas Luckus : biography','EN','Lithuanian Art Museum/Kaunas Branch of the Union of Lithuanian Art Photographers',247,2014,'Matulyė, Margarita','null','null','MON010','null','vitas-luckus-biography','2016-12-23 22:01:29','2021-02-08 17:36:44',6,'41vV7l5roqL.jpg','image/jpeg',24610,286,479,'Vitas Luckus (1943-1987) is one of the most significant Lithuanian photography artists of the second half of the 20th century. In his work Luckus bridged tradition and the avant-garde, modernism and postmodernism. Along with Antanas Sutkus, Aleksandras Macijauskas, Romualdas Rakauskas, Algimantas Kun#ius, and other peers Luckus founded the base for the Lithuanian photography school. In original expression he greatly expanded the boundaries of the prevailing aesthetics in photography. Luckus worked both in artistic and applied photography: he was one of the most innovative creators of fashion and advertising photography.',1,779.09200000,900161489,'TR140.L83',NULL,10,0,'779.092 L941 Vit',1,'undefined',0,0,'Luckus, VItas'),(1085,'null','978-609-426-018-6','Povilas Ričardas Vaitiekūnas. Tapyba. Piešiniai / Paintings and Drawings','LT/EN','Lietuvos Dailės Muziejus',87,2010,'Žvirblytė, Milda','null','null','MON011','null','povilas-ricardas-vaitiekunas-tapyba-piesiniai-paintings-and-drawings','2016-12-23 22:01:29','2021-02-06 10:01:16',6,NULL,NULL,NULL,NULL,NULL,'null',1,759.79300000,0,NULL,NULL,NULL,1,'759.793 V128',1,'undefined',1,0,'Vaitiekūnas, Povilas Ričardas '),(1086,'null','978-9955-9914-2-7','Gražina Vitartaitė : vidinės laisvės link','LT','TypoArt',170,2007,'Vitartaitė, Gražina, 1942-','dailės darbų albumas','null','MON012','null','grazina-vitartaite-vidines-laisves-link','2016-12-23 22:01:29','2021-02-08 17:21:15',6,NULL,NULL,NULL,NULL,NULL,'null',1,759.79300000,729686145,'ND955.L573',NULL,4,0,'759.793 V836',1,'undefined',0,0,NULL),(1087,NULL,'978-951-53-3389-6','Three-dimensional projection : situation sculpture between the artist and the viewer','EN','The Finnish Academy of Fine Arts',125,2011,'Oja, Marjatta',NULL,NULL,'MON013',NULL,'marjatta-oja-three-dimsensional-projection-situation-sculpture-between-the-artist-and-the-viewer','2016-12-23 22:01:29','2021-01-31 16:16:37',6,'41SrMw55e8L.jpg','image/jpeg',18940,231,500,'NF, 128pps, 4to, hardcover, rare analysis of her pioneering artistic productions and the moving image since the late 1980ss, well illustrated with solid textual analysis.',1,777.00000000,900237228,NULL,1,NULL,0,'777 O39',1,NULL,0,0,NULL),(1088,NULL,'978-3-86560-690-7','Gustav Metzger : decades, 1959-2009','EN','Koenig Books, Serpentine Gallery, London',111,2009,'Metzger, Gustav | O\'Brien, Sophie [Contributor; Editor] | Serpentine Gallery [Issuing body; Other] | Musée départemental de Rochechouart [Other] | Larner, Melissa [Editor] | Fondazione Galleria civica (Trento, Italy) | Trento (Italy).',NULL,NULL,'MON014',NULL,'gustav-metzger-decades-1959-2009-catalogue','2016-12-23 22:01:29','2021-01-31 16:16:37',6,'41EWGYMK0hL.jpg','image/jpeg',32390,431,500,'Pioneer of Auto-Destructive art, affiliate of Fluxus and the subject of several books but never a full retrospective, Gustav Metzger (born 1926) at last receives a substantial retrospective on more than half a century of activity. Born in Nüremberg, Germany, to Polish-Jewish parents, Metzger was evacuated to England with his brother as part of the Kindertransport in 1939 (his parents disappeared in 1943); 20 years later, after a period of study with the painter David Bomberg, he would abandon painting to seek ways of working that would recognize the destructiveness of the twentieth century: \"artists have a special part to play in opposing extinction, if only on a theoretical, intellectual basis,\" he wrote. Metzger\'s manifesto for \"Auto-Destructve\" art led to the famous &lt;I&gt;Destruction in Art Symposium&lt;/I&gt; held at the London ICA in 1966, in which Yoko Ono, Wolf Vostell, Al Hansen and John Latham also participated. His subsequent work has included political activism, installation, performance and writing; among the many iconic images that Metzger has bequeathed to art history is one of him assaulting a large canvas with acid, wearing a gas mask and suit-an instance of creative destructiveness which later inspired Pete Townshend of The Who to trash his guitar onstage. With essays and an interview, &lt;I&gt;Decades&lt;/I&gt; records Metzger\'s passionate war with art for the sake of a more peaceable world.',1,759.20000000,463798993,'N6797.M47',121,120,0,'759.2 M596',1,NULL,0,0,NULL),(1089,NULL,'978-3-86560-665-5','Silke Otto-Knapp : present time exercise','EN','Modern Art Oxford/The Banff Centre/Koenig Books, London',116,2009,'Otto-Knapp, Silke, 1970-',NULL,NULL,'MON015',NULL,'silke-otto-knapp-present-time-exercise','2016-12-23 22:01:29','2021-01-31 16:16:38',6,'41qpbWuubJL.jpg','image/jpeg',23282,401,500,'Rendered in pallid, ghostly tones, Silke Otto-Knapp\'s watercolors and gouaches recall turn-of-the-century painters such as Bakst, or children\'s illustrators like Arthur Rackham. Her delicately delineated vignettes of encounters, dances and isolate doings seem to take place beyond a veil, in a submarine realm of amphitheaters and botanical gardens. &lt;I&gt;Present Time Exercise&lt;/I&gt; surveys her work from the past five years.',1,759.30000000,437036390,'ND497.O885',37,31,0,'759.3 O89',1,NULL,0,0,NULL),(1090,'null','978-609-95406-8-9','Žaliasis sąsiuvinis = : Green notebook','LT/EN','modernaus meno centras/modern art center',207,2013,'Stankevičius-Stankus, Algimantas Julijonas, 1933-2002','null','null','MON016','null','algimantas-julijonas-stankevicius-stankus-zaliasis-sasiuvinis-green-notebook','2016-12-23 22:01:29','2021-02-05 15:54:43',6,NULL,NULL,NULL,NULL,NULL,'null',1,709.20000000,879571087,'N7255.L573',2,6,0,'709.2 S784',1,'undefined',0,0,NULL),(1091,'0-920159-63-X','null','Ken Lum: Photo-Mirrors','EN/FR/ESP','The Banff Centre for the Arts',24,1998,'Gabrielle Mark, Lisa','null','null','MON017','null','ken-lum-photo-mirrors','2016-12-23 22:01:29','2021-02-06 10:00:26',6,NULL,NULL,NULL,NULL,NULL,'null',1,709.20000000,0,NULL,NULL,NULL,1,'709.2 L957',1,'undefined',0,0,'Lum, Ken'),(1092,NULL,'978-9986-716-82-2','Audrius Puipa : gyvenimo ir meno virtuozas','LT','artseria',352,2012,'Rachlevičiūtė, Ramutė',NULL,NULL,'MON018',NULL,'audrius-puipa-gyvenimo-ir-meno-virtuozas','2016-12-23 22:01:29','2021-02-03 11:11:15',6,NULL,NULL,NULL,NULL,NULL,NULL,3,760.00000000,314306092,'ND955.L573',1,6,0,'760 R119',1,NULL,0,0,NULL),(1093,'null','978-6098-099-06-5','Vitas Luckus : kūryba = Vitas Luckus : works','LT/EN','Lietuvos fotomenininkų sąjungos Kaunos skyrius. Lietuvos dailės muziejus',487,2014,'Matulytė, Margarita','null','null','MON019','null','vitas-luckus-kuryba-works','2016-12-23 22:01:29','2021-02-08 17:36:44',6,'51fiOKS9VeL.jpg','image/jpeg',39047,423,499,'The monograph Vitas Luckus. Biografija. Kūryba is a comprehensive study of the photographer\'s creative legacy, which presents the whole spectrum of this original creative artist\'s ideas and output and reveals the author as a cultural phenomenon to readers in Lithuania and abroad for the first time. These revelations of cultural studies and personal history fundamentally alter the outlook on the cultural processes of photography in the Soviet era. Vitas Luckus (1943-1987) was a person of the modern era with a reformer\'s spirit and a prophet\'s destiny. This artist was one of the first in the Soviet Union to make a bridge to post-modernism, using his avant-garde creativity to widen the aesthetic limits that had dominated the Lithuanian school of photography. In this publication, the artistic works of Luckus are accompanied by the author\'s captions, letters and documents. Reminiscences by the photographer\'s near ones, friends and colleagues about his work, his favourite activities and his tragic fate as well as some incisive comments by art critics bring alive this charismatic character\'s portrait and lay open his cultural panorama. According to Tatjana Luckienė-Aldag, who took care of the photographer\'s archive, it was important not just to compile all the information held, but to present it in such a way that people would understand Vitas\'s ideas and feel his spirit.',1,779.09200000,934534751,'TR140.L83',NULL,10,0,'779.092 L941 Vita',1,'undefined',0,0,'Luckus, Vitas'),(1094,'null','978-609-8058-07-9','ALEKSANDROS KAŠUBOS DARBAI 1942-2010','LT','Lietuvos dailės muziejus',141,2012,'Howard, M.; Blurb, ; Jomantienė, Iš anglų kalbos vertė Irena','null','null','MON020','null','aleksandros-kasubos-darbai-1942-2010','2016-12-23 22:01:29','2021-02-06 09:58:41',6,NULL,NULL,NULL,NULL,NULL,'null',1,709.20000000,0,NULL,NULL,NULL,1,'709.2 K19 Ale',1,'undefined',1,0,'Kasuba, Aleksandra'),(1095,'0-920159-49-1','null','Ron Moppett','EN','Walter Phillips Gallery/The Banff Centre School of Fine Arts',40,1982,'Lorne Falk, Nancy Tousley, Mayo Graham','null','null','MON021','null','ron-moppett','2016-12-23 22:01:29','2021-02-06 09:59:46',6,NULL,NULL,NULL,NULL,NULL,'null',1,709.20000000,0,NULL,NULL,NULL,1,'709.2 M687',1,'undefined',0,0,'Moppett, Ron'),(1097,'null','978-9955-471-23-3','Skulptoriaus dosjė: Vladas Urbanavičius : = The sculptor\'s dossier: Vladas Urbanavičius','LT','Nacionalinis M. K. Čiurlionio dailės muziejus / AICA Lietuvos skyrius',231,2009,'Jankevičiūtė, Giedrė','null','null','MON023','null','skulptoriaus-dosje-vladas-urbanavicius','2016-12-23 22:01:29','2021-02-03 10:26:59',6,NULL,