image/jpeg',43509,400,500,'The Kurhotel was one of Austria\'s most-noted spa hotels of its time.&lt;br&gt;Built in the 1950s, it quickly became the vacation spot of the 70s.&lt;br&gt;But by 2000, its brilliance began to wane, along with a sudden and&lt;br&gt;still-unsolved abandonment by its owner. The hotel was left completely&lt;br&gt;intact and amazingly still remains in its original state: linens on beds,&lt;br&gt;mid-century modern furnishings in the rooms and curtains still hanging&lt;br&gt;in the windows. This seductive but chilling environment has become&lt;br&gt;the backdrop for Austrian photographer Marko Zink and his new series of work. In addition to images filled with the essence of fleeting moments, four interconnecting short stories written by the artist further lead the viewer into layers of unsolved mysteries and untold secrets. A well-executed artist s book and nontraditional record of the exhibition, the volume includes texts by Bettina Schulz, Gunther Oberhollenzer and Andreas Stadler.',1,779.09200000,830935171,'TR647',10,10,0,'779.092 Z78 Imk',1,'undefined',0,0,NULL),(1103,NULL,'978-3-7757-4042-5','Jorinde Voigt : Ludwig van Beethoven Sonatas 1-32','DE/EN','Hatje Cantz',136,2015,'Voigt, Jorinde, 1977-',NULL,NULL,'MON029',NULL,'jorinde-voigt-ludwig-va-beethoven-sonatas-i-32','2016-12-23 22:01:29','2021-01-31 16:16:40',6,'51_2BY7Pb0HwL.jpg','image/jpeg',43760,406,500,'Described by &lt;I&gt;The Guardian&lt;/I&gt; as a “rising star” on the German art scene, German artist Jorinde Voigt (born 1977) has been steadily developing a semiotic system in her drawings that interweaves subjectivity and systematics, spontaneity and meticulousness, chaos and order, poetry and science. Through her philosophical drawing process she attempts to reveal complex phenomena from our environment and culture in visual compositions founded upon certain parameters. The starting point for Voigt’s current series of works, &lt;I&gt;Ludwig van Beethoven, Sonate 1–32&lt;/I&gt;, comprises the musical scores for the cycle of piano sonatas that Beethoven composed in the late 18th and early 19th centuries, which has been called the “New Testament of music.” Here, the artist does not strive to illustrate or interpret the music; rather, she was more concerned with researching perception and “developing a way of writing that extracts the emotional spectrum inscribed in Beethoven’s scores”―in other words, to survey the invisible.',1,741.09200000,909055579,'NC251.V65',44,44,0,'741.092 V892',1,NULL,0,0,NULL),(1104,'9955-438-29-0','null','Alfonsas Budvytis, 1949-2003 : monografija','LT','Lietuvos fotomenininkų sąjungos fotografijos fondas',159,2006,'Jurėnaitė, Raminta','null','null','MON030','null','alfonsas-budvytis-ff13a3db-0080-478a-89a5-15a2afb14ad1','2016-12-23 22:01:29','2021-02-08 17:36:45',6,NULL,NULL,NULL,NULL,NULL,'null',1,779.09200000,891109436,'TR140.B83',NULL,2,0,'779.092 B927 Alf',1,'undefined',0,0,'Budvytis, Alfonsas'),(1105,'ISBN: 9955-471-00-X','null','Juozas Zikaras','LT','Nacionalinis M. K. Čiurlionio dailės muziejus / AICA Lietuvos skyrius',171,2009,'Banytė, Miglė; Laukaitienė, Vaiva','null','null','MON031','null','juozas-zikaras','2016-12-23 22:01:29','2021-02-06 10:06:50',6,NULL,NULL,NULL,NULL,NULL,'null',1,709.20000000,0,NULL,NULL,NULL,1,'709.2 Z64',1,'undefined',0,0,'Zikaras, Juozas'),(1106,'null','null','Koelse','FI','null',96,2014,'Ahonen, ANtti','null','null','MON032','John W. Fail','koelse','2016-12-23 22:01:29','2021-02-06 10:05:54',6,NULL,NULL,NULL,NULL,NULL,'null',1,780.92000000,0,NULL,NULL,NULL,1,'780.92 A285',1,'undefined',0,0,NULL),(1107,'9986-669-52-9',NULL,'Mindaugas Navakas : / R / ir atgal',NULL,'Lietuvos dailės muziejus',NULL,2006,'Navakas, Mindaugas, 1952-',NULL,NULL,'MON038',NULL,'r-ir-atgal','2016-12-23 22:01:29','2021-02-03 09:39:07',6,NULL,NULL,NULL,NULL,NULL,NULL,1,709.20000000,1026509073,'N7255.L573',NULL,1,0,'709.2 N317',1,NULL,0,0,NULL),(1108,'3-929255-58-8','null','Hund ist auch Mensch: Ich, der Sklave