e\'s design, of other people\'s music, is not the result of some slack, dead-end postmodernism, but rather the outcome of a rare sensitivity and openness. His work is about the small differences that we all make, in any situation, simply by being alive. Ron Terada is co-produced with Ikon Gallery, Birmingham; and Justina M. Barnicke Gallery, Toronto.',1,709.20000000,611414056,'N6549.T45',96,97,0,'709.2 T315',1,'undefined',0,0,NULL),(1112,'null','978-6109-426-037-7','Tadeusz Kantor. Painting. Theatre / Tapyba. Teatras','LT / EN','Lietuvos daileės muziejus / Nacionalinė dailės galerija',255,2012,'Chrobak, Jozef; Michalik, Justyna','null','null','MON054','null','tadeusz-kantor-painting-theatre-tapyba-teatras','2016-12-23 22:01:29','2021-02-06 09:57:29',6,NULL,NULL,NULL,NULL,NULL,'null',1,709.20000000,0,NULL,NULL,NULL,1,'709.2 K16',1,'undefined',1,0,'Kantor, Tadeusz'),(1113,'null','978-9955-34-373-8','Ona Narbutienė : gyvenimo preliudai','LT','Versus Aureus',288,2012,'Gedgaudas, Edmundas','null','null','MON059','null','ona-narbutiene-gyvenimo-preliudai','2016-12-23 22:01:30','2021-02-06 12:23:12',6,'31ZzF3fvcuL.jpg','image/jpeg',12284,170,243,'Edmundo Gedgaudo siltas, atviras, subtilus - taip gali rasyti tik muzikas ir meni­ninkas, bendramintis ir bendradarbis - pasakojimas apie iskilia muzikologe, Lietuvos nacionalines kulturos ir meno premijos laureate, nepaprasta asmenybe skaitytoja nukelia i tolima praeiti - prie Onos Narbutienes gyvenimo istaku. Knygoje vietos pakanka ir dienorasciams, ir artimuju prisiminimams, ir poetiskiems laiskams, tai aplinkai, kurioje Ona Narbutiene augo ir brendo. Ona Narbutiene gerai zinoma ne tik kaip mokslininke, zymi muzikologe, muzikos pedagoge, bet ir kulturos veikeja, labai kurybinga asmeny­be. Siandien ne viena stebina tokia, regis, neaprepiama ir ivairiapuse jos veikla: Ona Narbutiene buvo Kulturos ir meno tarybos pirmininke, Nacionalines kulturos ir meno premijos tarybos nare, ivairiu komisiju eksperte, pedagoge, 15 knygu autore ir sudary­toja, renginiu vedeja...',1,780.92000000,859419295,'ML423.G43',NULL,2,0,'780.92 N219',1,'undefined',0,0,'Narbutienė, Ona'),(1114,'','978-9955-9429-8-6','Marija Teresė Rožanskaitė. Vaizdai ir tekstai','LT','Tarptautinės dailės kritikų asociacijos (AICA) Lietuvos skyrius',214,2011,'Kreivytė, Laima','','','MON060/MON061','','marija-terese-rozanskaite-vaizdai-ir-tekstai','2016-12-23 22:01:30','2021-02-06 12:23:53',6,NULL,NULL,NULL,NULL,NULL,'',1,709.20000000,0,NULL,NULL,NULL,1,'709.2 R628 Mari',2,'undefined',1,0,'Rožanskaitė, Marija Teresė'),(1115,NULL,'978-3-941613-20-1','Axel Loytved - works : [anlässlich der Abschlussausstellung des 12. Stipendiums \"Junge Kunst in Essen\", 2. Mai - 13. Juni 2010]','DE/EN','Kunsthaus Essen',80,2010,'Loytved, Axel',NULL,NULL,'MON070',NULL,'axel-loytved-works','2016-12-23 22:01:30','2021-01-31 16:16:41',6,NULL,NULL,NULL,NULL,NULL,NULL,1,709.20000000,635896863,NULL,5,NULL,0,'709.2 L923',1,NULL,0,0,NULL),(1116,NULL,'978-609-426-031-5','Vytautas Šerys','LT / EN','Lietuvos Dailės Muziejus',79,2011,'Šerys, Vytautas, 1931-',NULL,NULL,'MON053',NULL,'vytautas-serys-retrospektyva-a-restrospective','2016-12-23 22:01:30','2021-01-24 18:49:20',6,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,17111746,'NB699.S467',NULL,6,0,NULL,1,NULL,0,0,NULL),(1117,'0-14-023505-1',NULL,'Biografi','EN','penguin',202,1993,'Jones, Lloyd, 1955-',NULL,NULL,'LPST001',NULL,'biografi','2016-12-23 22:01:30','2021-01-31 16:16:41',16,'41sNiJWUYfL.jpg','image/jpeg',31605,325,500,NULL,1,914.96504000,31374471,'PR9639.3.J64',55,45,0,'914.96504 J77',1,NULL,0,0,NULL),(1118,NULL,'978-0-7679-1938-8','At home : a short history of private life','EN','Doubleday',497,2010,'Bryson, Bill',NULL,NULL,'LPST002',NULL,'at-home-a-short-history-of-private-life','2016-12-23 22:01:30','2021-01-31 16:16:41',16,'51tSahVX-uL.jpg','image/jpeg',65015,306,500,'&lt;p&gt;In these pages, the beloved Bill Bryson gives us a fascinating history of the modern home, taking us on a room-by-room tour through his own house and using each room to explore the vast history of the domestic artifacts we take for granted. As he takes us through the history of our modern comforts, Bryson demonstrates that whatever happens in the world eventually ends up in our home, in the paint, the pipes, the pillows, and every item of furniture. Bryson has one of the liveliest, most inquisitive minds on the planet, and his sheer prose fluency makes &lt;i&gt;At Home&lt;/i&gt; one of the most entertaining books ever written about private life.&lt;br /&gt;&lt;br /&gt;&lt;/p&gt;',1,643.10000000,496956701,'GT165.5',3755,3951,0,'643.1 B915',1,NULL,0,0,NULL),(1119,'null','978-0-8070-6473-3','The poetics of space','EN','Beacon Press Books',241,1994,'Bachelard, Gaston','null','null','LPST003','null','the-poetics-of-space','2016-12-23 22:01:30','2021-02-04 15:07:25',16,'41bQQdcUZUL.jpg','image/jpeg',26096,319,500,'&lt;p&gt;Thirty years since its first publication in English, French philosopher Gaston Bachelard\'s &lt;i&gt;The Poetics of Space &lt;/i&gt;one of the most appealing and lyrical explorations of home. Bachelard takes us on a journey, from cellar to attic, to show how our perceptions of houses and other shelters shape our thoughts, memories, and dreams.&lt;/p&gt;',1,194.00000000,237486,'B2430.B253',1594,2808,0,'194 B121',2,'undefined',0,0,NULL),(1120,NULL,'978-1-846-14349-6','Pocket atlas of remote islands : fifty islands I have not visited and never will','EN','Penguin Books',239,2012,'Schalansky, Judith, 1980-',NULL,NULL,'LPST005',NULL,'pocket-atlas-of-remote-islands','2016-12-23 22:01:30','2021-01-31 19:51:24',16,'41-kvSkTxQL.jpg','image/jpeg',18772,321,500,NULL,3,912.09142000,778274844,'G500',39,45,0,'912.09142 S297',1,NULL,0,0,NULL),(1121,'','978-961-92999-1-3','The problem of space travel : the rocket motor','EN','KSEVT',229,2010,'Noordung, Hermann, 1892-1929','','second edition','LPST006','','the-problem-of-space-travel-the-rocket-motor','2016-12-23 22:01:30','2021-01-31 18:41:29',16,'cover.gif','image/gif',78817,263,397,'',3,629.40000000,2007332,'TL790',212,300,0,'629.4 N818',1,NULL,0,0,NULL),(1122,'null','null','Mapping our Minds. Minding our Maps','EN','null',0,2007,'','null','null','LPST007','null','mapping-our-minds-minding-our-maps','2016-12-23 22:01:30','2021-02-03 13:42:22',16,NULL,NULL,NULL,NULL,NULL,'null',1,704.94000000,NULL,NULL,NULL,NULL,1,'704.94 Ma',1,'undefined',0,0,NULL),(1123,NULL,'978-0-262-20150-6','The interventionists : users\' manual for the creative disruption of everyday life','EN','MASS MoCA',154,2004,'Thompson, Nato | Thompson, Nato [Editor] | Massachusetts Museum of Contemporary Art [Other] | Noordeman, Arjen [Book designer]',NULL,NULL,'LPST008',NULL,'the-interventionists-users-manual-for-the-creative-disruption-of-everyday-life','2016-12-23 22:01:30','2021-01-31 16:16:42',16,'41owMpqalYL.jpg','image/jpeg',22741,384,500,'&lt;p&gt;Art made to attach to buildings or to be given away? Wearable art for street demonstrations or art that sets up a booth at a trade show? This is the art of the interventionists, who trespass into the everyday world to raise our awareness of injustice and other social problems. These artists don\'t preach or proselytize; they give us the tools to form our own opinions and create our own political actions. The Interventionists, which accompanies an exhibit at MASS MoCA, serves as a handbook to this new and varied work. It\'s a user\'s guide to art that is exciting, provocative, unexpected, inspiring (artistically and politically), and fun. From Michael Rakowitz\'s inflatable homeless shelter and William Pope.L\'s \"Black Factory\" truck with pulverizer, gift shop, and giant inflatable igloo to the Biotic Baking Brigade\'s political pie-throwing, the art of The Interventionists surveys a growing genre and offers a guide for radical social action.The book classifies the artists according to their choice of tactics: the Nomads, who create mobile projects; Reclaim the Streets, artists who act in public places; Tools for Resistance: Ready to Wear, artists who produce fashion for political action; and the Experimental University, artists whose work engages pedagogy and theory. The accompanying text includes essays by noted scholars putting the work in a broader cultural and social context as well as texts by the artists themselves.&lt;/p&gt;',1,700.45560747,56397521,'NX650.P6',483,484,0,'700.45560747 T469',1,NULL,0,0,NULL),(1124,'null','978-88-95679-09-9','A Travers Champs/ QUERFELDEIN Workshop Goms 15-25/04/2008 Vol. 1','DE/FR','null',0,2008,'Ecole Cantonale d\'Art du Valais','null','null','LPST009','null','a-travers-champs-querfeldein-workshop-goms-15-25-04-2008-vol-1','2016-12-23 22:01:30','2021-02-05 13:02:53',16,NULL,NULL,NULL,NULL,NULL,'null',1,709.49400000,0,NULL,NULL,NULL,1,'709.494 E17',2,'undefined',0,0,NULL),(1125,NULL,'9786094471070','Tourists like us : critical tourism and contemporary art practices','EN','ECAV and Nida Art Colony',260,2013,'École cantonale d\'art du Valais',NULL,NULL,'LPST010',NULL,'tourists-like-us-critical-tourism-and-contemporary-art','2016-12-23 22:01:30','2021-01-31 16:16:42',16,'41xkh7QMOwL.jpg','image/jpeg',28820,353,500,'This book opens up a new field of discussion at the crossroads between contemporary art and critical tourism. As common ground for theoretical inquiry and artistic research, the notion of critical tourism asks us to question again our understanding of authenticity, the tourist gaze, the museification of landscape, the visual construction of place, post-romanticism, contemporary exoticism, site-specificity and global connectedness. The book specifically explores the role of the artist, and of the art institution, in the age of destination culture. How are individual and institutional practices changing in an era of hosting, hospitality, displacing and cultural nomadism? Based on the comparison between two very different but nonetheless similar landscapes the Swiss Alps and the Baltic Dunes and Beaches art historians, environmental historians, geographers, explorers, curators and artists address the relatively new field of critical tourism in a transdisciplinary context. Together they consider how to critically approach and understand seductive and remote landscapes, against the backdrop of global cultural tourism. The book is not only a critical account of discussions around the topics but it is also rich in visual materials, documents and descriptions of artistic interventions in these two touristic settings. This publication is the result of over a year of exchanges between ECAV Ecole Cantonale d Art du Valais in Sierre (Switzerland) and Nida Art Colony (NAC), which belongs to the Vilnius Academy of Arts (Lithuania). The book reviews the concepts, residencies, exhibitions, workshops and the symposium that formed this exchange between 2012 to 2013, in the context of the research and residency programme On Hosting and Displacing: Artistic Residencies and Cultural Production in Remote Contexts .',3,709.05100000,891516162,'G156.5.C75',2,2,0,'709.051 C689',1,NULL,0,1,NULL),(1126,'null','null','Walking Silvermines / Siúlóid Béal Átha Gabhann','EN','Bryonie Reid',0,2007,'Reid, Bryonie','null','null','LPST012','null','walking-silvermines-siuloid-beal-atha-gabhann','2016-12-23 22:01:30','2021-02-03 13:37:24',16,NULL,NULL,NULL,NULL,NULL,'null',1,709.41500000,NULL,NULL,NULL,NULL,1,'709.415 R354',1,'undefined',0,0,NULL),(1127,NULL,NULL,'Are You Working Too Much? Post - Fordism, Precarity, and Labor of Art',NULL,'Sterberg Press',212,2011,'Aranda, Juleta; Kuan Wood, Brian; Vidokle, Anton','e - flux journal',NULL,'LPST013',NULL,'are-you-working-too-much-post-fordism-precarity-and-labor-of-art','2016-12-23 22:01:30','2021-01-26 16:59:27',16,NULL,NULL,NULL,NULL,NULL,NULL,3,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(1128,'1-57181-746-8',NULL,'Tourism : between place and performance',NULL,'Berhahn Books',246,2002,'Crang, Mike | Coleman, Simon, 1963- [Editor] | Crang, Mike [Editor]',NULL,NULL,'LPST015',NULL,'tourism-between-place-and-performance','2016-12-23 22:01:30','2021-01-31 16:16:42',16,'41G9ridVMfL.jpg','image/jpeg',30804,333,500,'&lt;p&gt;  Many accounts of tourism have adopted an almost paradigmatic visual model of the gaze. This collection presents an expanded notion of spectatorship with a more dynamic sense of embodied and performed engagement with places. The approach resonates with ideas in anthropology, sociology, and geography on performance, invented traditions, constructed places and traveling cultures. Contributions highlight the often contradictory, contested and paradoxical constructions of landscape and community involved both in tourist attractions and among tourists themselves. The collection examines many different practices, ranging from the energetic pursuit of adventure holidays to the reading of holiday brochures. It illustrates different techniques of seeing the landscape and a variety of ways of creating and performing the local. Chapters thus demonstrate the mutual entanglement of practices, images, conventions, and creativity. They chart these global flows of people, texts, images, and artefacts. Case studies are drawn from diverse types of tourism and destination focused around North America, Europe, and Australasia.&lt;/p&gt;',1,338.47910000,47900489,'G155.A1',604,605,0,'338.4791 C891',1,NULL,0,0,NULL),(1129,NULL,'978-0-8122-1280-8','Hosts and guests : the anthropology of tourism','EN','University of Pennsylvania Press',341,1989,'Smith, Valene L. | Smith, Valene L. [Author; Editor; Other]',NULL,NULL,'LPST016',NULL,'hosts-and-guests-the-anthropology-of-tourism','2016-12-23 22:01:30','2021-02-03 12:24:30',16,'51JxVM7e78L.jpg','image/jpeg',48622,333,500,'&lt;p&gt;Tourism—one of the world\'s largest industries—has long been appreciated for its economic benefits, but in this volume tourism receives a unique systematic scrutiny as a medium for cultural exchange. Modern developments in technology and industry, together with masterful advertising, have created temporarily leisured people with the desire and the means to travel. They often in turn effect profound cultural change in the places they visit, and the contributors to this work all attend to the impact these \"guests\" have on their \"hosts.\"&lt;/p&gt;&lt;p&gt;In contrast to the dramatic economic transformations, the social repercussions of tourism are subtle and often recognized only by the indigenous peoples themselves and by the anthropologists who have studied them before and after the introduction of tourism. The case studies in &lt;i&gt;Hosts and Guests&lt;/i&gt; examine the five types of tourism—historical, cultural, ethnic, environmental, and recreational—and their impact on diverse societies over a broad geographical range&lt;/p&gt;',1,380.14591000,3205099,'G155.A1',1631,1785,0,'380.14591 S643',1,NULL,0,0,NULL),(1130,'null','978-1-4051-0672-6','Place : A short introduction','EN','Blackwell Publishing',153,2004,'Cresswell, Tim','null','null','LPST017','null','place-a-short-introduction','2016-12-23 22:01:30','2021-02-04 22:25:19',16,'51yvuQlnwvL.jpg','image/jpeg',35590,330,500,'This text introduces students of human geography to the fundamental concept of place, marrying everyday uses of the term with the complex theoretical debates that have grown up around it.  &lt;ul&gt; &lt;li&gt;A short introduction to one of the most fundamental concepts in human geography&lt;/li&gt; &lt;li&gt;Marries everyday uses of the term \"place\" with the more complex theoretical debates that have grown up around it&lt;/li&gt; &lt;li&gt;Makes the debates intelligible to students, using familiar stories as a way into more abstract ideas&lt;/li&gt; &lt;li&gt;Excerpts and discusses key papers on place by Doreen Massey and David Harvey&lt;/li&gt; &lt;li&gt;Considers empirical examples of ways in which the concept of place has been used in research&lt;/li&gt; &lt;li&gt;Teaching and learning aids include an annotated bibliography, lists of key readings and texts, a survey of web resources, suggested pedagogical resources and possible student projects&lt;/li&gt; &lt;/ul&gt;',1,304.23000000,474240757,'GF50',3,4,0,'304.23 C922',1,'undefined',0,0,NULL),(1131,'1-56584-454-8',NULL,'On the beaten track : tourism, art and place','EN','The New Press,New York',182,1999,'Lippard, Lucy R.',NULL,NULL,'LPST018',NULL,'on-the-beaten-track-tourism-art-and-place','2016-12-23 22:01:30','2021-01-31 16:16:42',16,'51EWipF-XkL.jpg','image/jpeg',35307,412,500,'&lt;div&gt;&lt;p&gt;In this “excellent” (&lt;I&gt;The Baltimore Sun&lt;/I&gt;) book, Lucy R. Lippard weaves together cultural criticism, anthropology, and community activism for an in-depth look at how tourism sites are conceived and represented, and how they affect the places they transform. Critic Andrew Ross calls Lippard “the most surefooted tour guide you could hope for” in her exploration of being a tourist in one’s own home, of how advertising and photography define place, of how antique shops function as populist museums, and of the commodification of indigenous cultures. With her characteristic breadth and critical eye, Lippard discusses the political economies of leisure spaces, the tourist’s fascination with tragic destinations (such as the sites of massacres and nuclear weapons tests, or Holocaust memorials), and our willingness to let national parks and heritage sites define nature and history.&lt;/p&gt;&lt;BR&gt;&lt;/div&gt;',1,338.47910000,41157471,'G155.A1',543,538,0,'338.4791 L765',1,NULL,0,0,NULL),(1132,'0-415-11311-3',NULL,'Consuming places','EN','Routledge',257,1995,'Urry, John | Urry, John',NULL,NULL,'LPST020',NULL,'consuming-places','2016-12-23 22:01:30','2021-01-31 16:16:42',16,'31wUMUtQqaL.jpg','image/jpeg',11389,361,500,'&lt;P&gt;John Urry has been discussing and writing on these and similar questions for the past fifteen years. In &lt;EM&gt;Consuming Places&lt;/EM&gt;, he gathers together his most significant contributions. Urry begins with an extensive review of the connections between society, time and space. The concept of \'society\', the nature of \'locality\', the significance of \'economic restructuring\', and the concept of the \'rural\', are examined in relationship to place. The book then considers how places have been transformed by the development of service occupations and industries. Concepts of the service class and post-industrialism are theoretically and empirically discussed. Attention is then devoted to the ways in which places are consumed. Particular attention is devoted to the visual character of such consumption and its implications for place and people. The implications for nature and the environment are also explored in depth. The changing nature of consumption, and the tensions between commodification and collective enthusiasms, are explored in the context of the changing ways in which the countryside is consumed. &lt;/P&gt;',1,306.30000000,30895766,'HC79.C6',2193,2139,0,'306.3 U81',1,NULL,0,0,NULL),(1133,NULL,'978-1-56584-248-9','The lure of the local : senses of place in a multicentered society','EN','New Press, The',328,1997,'Lippard, Lucy R.',NULL,NULL,'LPST021',NULL,'the-lure-of-the-local-senses-of-place-in-a-multicentered-society','2016-12-23 22:01:30','2021-01-31 16:16:42',16,'51u2c_2BjTN0L.jpg','image/jpeg',39839,424,500,'&lt;div&gt;&lt;p&gt;In&lt;I&gt; The Lure of the Local&lt;/I&gt; Lucy R. Lippard weaves together cultural studies, history, geography, and contemporary art to provide a fascinating examination of our multiple senses of place.&lt;/p&gt;&lt;p&gt;Divided into five parts—Around Here; Manipulating Memory; Down to Earth: Land Use; The Last Frontiers: Cities and Suburbs; and Looking Around—the book extends far beyond the confines of the art worlds, including issues of community, land use, perceptions of nature, how we produce the landscape, and how the landscape affects our lives. Praised by critics and readers alike, she consistently makes unexpected connections between contemporary art and its political, social, and cultural contexts.&lt;/p&gt;&lt;BR&gt;&lt;/div&gt;',1,304.23000000,34958680,'GF503',833,814,0,'304.23 L765',1,NULL,0,0,NULL),(1134,'0-415-19219-6',NULL,'Seductions of place : geographical perspectives on globalization and touristed landscapes','EN','Routledge',340,2005,'Lew, Alan A. | Cartier, Carolyn L. [Contributor; Editor] | Lew, Alan A. [Contributor; Editor]',NULL,NULL,'LPST022',NULL,'seductions-of-place-geographical-perspectives-on-globalization-and-touristed-landscapes','2016-12-23 22:01:30','2021-01-31 16:16:42',16,'51R6w9hshCL.jpg','image/jpeg',43529,315,500,'&lt;P&gt;The seductiveness of touristed landscapes is simultaneously local and global, as travelled places are formed and reworked by the activities of diverse, mobile people, in their desires to experience situated, sensuous qualities of difference. Cartier and Lew’s interesting and informative book explores contemporary issues in travel and tourism and human geography, and the complex cultural, political, and economic activities at stake in touristed landscapes as a result of globalization. &lt;BR&gt;&lt;/P&gt; &lt;P&gt;This book assesses travel and tourism as simultaneously cultural and economic processes, through ideas about place seduction and the formation of landscapes. Throughout, examples are given from urban and environmental touristed landscapes, from major world cities to tropical islands, and chapter contributions include:&lt;/P&gt; &lt;P&gt;&lt;/P&gt; &lt;UL&gt; &lt;LI&gt;an analysis of the representational character of landscape and the built environment&lt;/LI&gt; &lt;LI&gt;historic constructions of place seduction&lt;/LI&gt; &lt;LI&gt;the importance of class, racial, and gender dimensions of place&lt;/LI&gt; &lt;LI&gt;how mobility and the seduction of place orient identity formation&lt;/LI&gt; &lt;LI&gt;the environmental impacts of tourism economies. &lt;/LI&gt;&lt;/UL&gt; &lt;P&gt;Broad in scope, this book is ideal for social scientists and humanists who are interested in contemporary debates about place studies, mobility, and the located realities of globalization.&lt;/P&gt;',1,306.48190000,50654517,'G71.5',657,640,0,'306.4819 L669',1,NULL,0,0,NULL),(1135,NULL,'978-0-520-25783-2','The ethics of sightseeing','EN','University of California Press',271,2011,'MacCannell, Dean',NULL,NULL,'LPST024',NULL,'the-ethics-of-sightseeing','2016-12-23 22:01:30','2021-01-31 16:16:43',16,'51X9vqzY-dL.jpg','image/jpeg',50863,330,500,'&lt;div&gt;Is travel inherently beneficial to human character? Does it automatically educate and enlighten while also promoting tolerance, peace, and understanding? In this challenging book, Dean MacCannell identifies and overcomes common obstacles to ethical sightseeing. Through his unique combination of personal observation and in-depth scholarship, MacCannell ventures into specific tourist destinations and attractions: picturesque” rural and natural landscapes, hip” urban scenes, historic locations of tragic events, Disney theme parks, beaches, and travel poster ideals. He shows how strategies intended to attract tourists carry unintended consequences when they migrate to other domains of life and reappear as staged authenticity.” Demonstrating each act of sightseeing as an ethical test, the book shows how tourists can realize the productive potential of their travel desires, penetrate the collective unconscious, and gain character, insight, and connection to the world.&lt;/div&gt;',1,338.47910000,665064481,'G155.A1',1772,1766,0,'338.4791 M122',1,NULL,0,0,NULL),(1136,'','978-3-941560-95-6','Transient spaces : the tourist syndrome','EN','argobooks',141,2010,'Sorbello Marina, Weitzel Antje','the tourist syndrome','','LPST028','','transient-spaces-the-tourist-syndrome','2016-12-23 22:01:30','2021-01-31 16:16:43',16,'51-rffT1o4L.jpg','image/jpeg',62546,384,500,'',1,704.94930348,704340587,'G155.A1',2,10,0,'704.94930348 S713',1,NULL,0,0,NULL),(1137,NULL,'978-1-84195-745-6','A field guide to getting lost','EN','Canongate',211,2005,'Solnit, Rebecca 1961-',NULL,NULL,'LPST029',NULL,'a-field-guide-to-getting-lost','2016-12-23 22:01:30','2021-01-31 16:16:43',16,'51Z_2BcEEuRgL.jpg','image/jpeg',37124,313,500,'&lt;b&gt;A stimulating exploration of wandering, being lost, and the uses of the unknown from the author of &lt;i&gt;Men Explain Things To Me&lt;br&gt;&lt;br&gt;&lt;/i&gt;&lt;/b&gt;Written as a series of autobiographical essays, &lt;i&gt;A Field Guide to Getting Lost&lt;/i&gt; draws on emblematic moments and relationships in Rebecca Solnit\'s life to explore issues of uncertainty, trust, loss, memory, desire, and place. Solnit is interested in the stories we use to navigate our way through the world, and the places we traverse, from wilderness to cities, in finding ourselves, or losing ourselves. While deeply personal, her own stories link up to larger stories, from captivity narratives of early Americans to the use of the color blue in Renaissance painting, not to mention encounters with tortoises, monks, punk rockers, mountains, deserts, and the movie &lt;i&gt;Vertigo&lt;/i&gt;. The result is a distinctive, stimulating voyage of discovery.',3,917.90454000,57316646,'E169.Z83',906,898,0,'917.90454 S684',1,NULL,0,0,NULL),(1138,NULL,'978-1-846-14099-0','A history of the world in twelve maps','EN','ALLEN LANE',514,2012,'Brotton, Jerry',NULL,NULL,'LPST030',NULL,'a-history-of-the-world-in-twelve-maps','2016-12-23 22:01:30','2021-01-31 16:16:43',16,'51fc7puePgL.jpg','image/jpeg',36450,325,500,'&lt;b&gt;From the author of &lt;i&gt;The Sultan and the Queen&lt;/i&gt;, a fascinating look at twelve maps—from Ancient Greece to Google Earth—and how they changed our world&lt;/b&gt;&lt;br&gt;&lt;br&gt;In this masterful study, historian and cartography expert Jerry Brotton explores a dozen of history’s most influential maps, from stone tablet to vibrant computer screen. Starting with Ptolemy, “father of modern geography,” and ending with satellite cartography, &lt;i&gt;A History of the World in 12 Maps&lt;/i&gt; brings maps from classical Greece, Renaissance Europe, and the Islamic and Buddhist worlds to life and reveals their influence on how we—literally—look at our present world.&lt;br&gt;&lt;br&gt;As Brotton shows, the long road to our present geographical reality was rife with controversy, manipulation, and special interests trumping science. Through the centuries maps have been wielded to promote any number of imperial, religious, and economic agendas, and have represented the idiosyncratic and uneasy fusion of science and subjectivity. Brotton also conjures the worlds that produced these notable works of cartography and tells the stories of those who created, used, and misused them for their own ends.',1,526.09000000,794136967,'GA201',461,439,0,'526.09 B863',1,NULL,0,0,NULL),(1139,NULL,'978-0-00-735157-2','Map addict : a tale of obsession, fudge &amp; the Ordnance Survey',NULL,'Collins',330,2009,'Parker, Mike, 1966-',NULL,NULL,'LPST031',NULL,'map-addict-a-tale-of-obsession-fudge-and-the-ordanance-survey','2016-12-23 22:01:30','2021-01-31 16:16:43',16,'51ewV-uqVFL.jpg','image/jpeg',39818,329,500,'&lt;p&gt;\'My name is Mike and I am a map addict. There, it\'s said…\'&lt;/p&gt;&lt;p&gt;Mike Parker, presenter of Radio 4’s On the Map, celebrates the richness of all things maps in this fantastic, critically-acclaimed read.&lt;/p&gt;&lt;p&gt;Have you ever got through an entire day without referring to some kind of navigational aide, be it checking the A-Z, touring the globe on Google Earth, planning a walk or navigating a shopping centre? Maps are everywhere and they are, according to self proclaimed map-addict Mike Parker, the unsung heroes of life. Here he sings their song, celebrating everything cartographic.&lt;/p&gt;&lt;p&gt;With a mix of wry observation and hard fact, the offbeat and the completely pedantic, Parker wages a one-man war against the moronic blandishments of the Sat Nav age. He combines cartographic history and trivia with memoir and oblique observation to create a highly readable exposé of the world of maps. Only here can you find out which area has officially been named by the OS as the most boring square kilometre in the land and whether Milton Keynes was really built to pagan alignment.&lt;/p&gt;&lt;p&gt;Confessing that his own impressive map collection was founded on a virulent teenage shoplifting habit Parker ponders how a good leftie can be so gung-ho about British cartographic imperialism and establishes himself as defender and saviour of British cartography in the internet age.&lt;/p&gt;',1,912.00000000,310154435,'GA791',206,200,0,'912 P242',1,NULL,0,0,NULL),(1140,NULL,'978-1-4027-6592-6','The art of the map : an illustrated history of map elements and embellishments','EN','Sterling New York',218,2012,'Reinhartz, Dennis','An Illustrated History of Map  Elements and Embellishments',NULL,'LPST032',NULL,'the-art-of-the-map','2016-12-23 22:01:30','2021-01-31 16:16:43',16,'61H6YQ9jiXL.jpg','image/jpeg',107004,459,500,'&lt;div&gt;This lavishly illustrated history of the golden age of cartography, from the sixteenth through the nineteenth centuries, explores not only the embellishments on maps but also what they reveal about the world in which they were created. Here there be monsters real and imagined; ships actual and archetypical; newly discovered flora such as corn and tobacco; fauna ranging from buffalo to unicorns; godlike beings and fantasy-like depictions of native peoples. The stunningly rendered images illuminate an entire world.&lt;/div&gt;',1,912.09000000,778424078,'GA108.7',248,243,0,'912.09 R371',1,NULL,0,0,NULL),(1141,'0-7190-5867-8','','Rural artists\' colonies in Europe, 1870-1910','EN','Manchester University Press',238,2001,'Lübbren, Nina | Barber Institute of Fine Arts','','','LPST034','','rural-artists-colonies-in-europe-1870-1910','2016-12-23 22:01:30','2021-02-09 15:07:44',16,'510GZgiv9PL.jpg','image/jpeg',35228,346,500,'Why did thousands of 19th-century artists leave the established urban centres of culture to live and work in the countryside? By 1900 there were over 80 rural artists\' communities across northern and central Europe. This is a critical analysis of the phenomenon on a Europe-wide basis. It combines close visual readings of intriguing and little known paintings with a multi-disciplinary approach, drawing on sociology, geography and theories of tourism. Rural artists\' colonies have been unjustly neglected by an art history preoccupied with the urban avant-garde. Yet these communities hatched some of the most exciting innovations of late 19th-century painting. Moreover, the practices and images of rural artists articulated central concerns of urban middle-class audiences, in particular the yearning for a life that was authentic, pre-modern and immersed in nature. Paradoxically, it was precisely this nostalgia that placed artists\' colonies firmly within modernity, mainly through their contribution to an emergent mass tourism.',1,709.03400000,45230423,'N6757',316,289,0,'709.034 L927',1,'undefined',0,0,NULL),(1142,'','978-0-226-53205-9','Landscape and power','EN ','The university of Chicago Press',375,2002,'Mitchell, W. J. T. (William John Thomas), 1942- | Mitchell, W. J. T. 1942- [Editor; Other]','Second Edition','','LPST035','','landscape-and-power','2016-12-23 22:01:30','2021-02-08 17:22:56',16,'31WYFJ1KYFL.jpg','image/jpeg',16120,333,500,'&lt;div&gt;The first edition of this book, published in 1994, reshaped the direction of landscape studies by considering landscape not simply as an object to be seen or a text to be read, but as an instrument of cultural force, a central tool in the creation of national and social identities. This second edition adds not only a new preface, but five new essays—from Edward Said, W. J. T. Mitchell, Jonathan Bordo, Michael Taussig, and Robert Pogue Harrison-extending the scope of the book in remarkable ways.&lt;BR&gt;&lt;/div&gt;',1,704.94000000,28213559,'N8205',1164,1156,0,'704.94 M682',1,'undefined',0,0,NULL),(1143,'','978-0-9568607-3-6','Experimental ruins : west edition : field guide','EN','Office of Experiments/Arts Catalyst',NULL,2013,'Office of Experiments (Art collective)','','','LPST036','','experimental-ruins-west-edition','2016-12-23 22:01:30','2021-01-31 16:16:43',16,NULL,NULL,NULL,NULL,NULL,'',1,700.46000000,1062189601,NULL,1,NULL,0,'700.46 O32',1,NULL,0,0,NULL),(1144,'','978-0-9557478-3-0','Setting the fell on fire : Allenheads Contemporary Arts : contemporary art in a rural context','EN','Allenheads Contemporary Arts',96,2009,'Warr, Tracey','','','LPST037','','setting-the-fell-on-fire-contemporary-art-in-a-rural-context','2016-12-23 22:01:30','2021-02-05 15:46:19',16,'41X2cyLKtqL.jpg','image/jpeg',24469,500,416,'',1,700.00000000,322349679,'NX820.G72',27,28,0,'707.8',1,'undefined',1,1,NULL),(1145,'0-415-09616-2',NULL,'Terra infirma : geography\'s visual culture','EN','Routledge',195,2006,'Rogoff, Irit',NULL,NULL,'LPST038',NULL,'terra-infirma-geography-s-visual-culture','2016-12-23 22:01:30','2021-01-31 16:16:45',16,'31dmCqMibJL.jpg','image/jpeg',14538,387,500,'In an age of \'ethnic cleansing\' and forced migration, of contested borders and nations in turmoil, how have issues of place and identity, and of belonging and exclusion, been represented in visual culture? In &lt;EM&gt;Terra Infirma&lt;/EM&gt;, Irit Rogoff examines geography\'s truth claims and signifying practices, arguing that geography is a language in crisis, unable to represent the immense changes that have taken place in a post-colonial, post-communist, post-migratory world. She uses the work of international contemporary artists to explore how art in the twentieth century has confronted and challenged issues of identity and belonging.&lt;BR&gt;Rogoff\'s dazzling and richly-illustrated study takes in painting, installation art, film and video by a wide range of artists including Charlotte Salomon, Ana Mendieta, Joshua Neustein, Yehoshua Glotman, Mona Hatoum, Hans Haacke, Ashley Bickerton, Alfredo Jaar and Guillermo Gomez-Pena.   Structuring her argument through themes of luggage, mapping, borders and bodies, Rogoff explores how artists have confronted twentieth century phenomena such as the horror of the Holocaust, the experience of diaspora at New York\'s Ellis Island, and, in the present day, disputed and fraught  boundaries in the Middle East, the two Germanies, the Balkan states and the US-Mexican border.',3,709.04000000,42764764,'N8217.G437',566,546,0,'709.04 R721',1,NULL,0,0,NULL),(1146,'0-415-96054-1',NULL,'Landscape theory','EN','Routledge',366,2008,'DeLue, Rachael Ziady | DeLue, Rachael Ziady [Editor] | Elkins, James, 1955- [Editor]',NULL,NULL,'LPST039 ',NULL,'landscape-theory','2016-12-23 22:01:30','2021-01-31 16:16:45',16,'41ElBpSN33L.jpg','image/jpeg',20754,325,500,'&lt;P&gt;Artistic representations of landscape are studied widely in areas ranging from art history to geography to sociology, yet there has been little consensus about how to understand the relationship between landscape and art. This book brings together more than fifty scholars from these multiple disciplines to establish new ways of thinking about landscape in art. &lt;/P&gt; &lt;P&gt; &lt;/P&gt;',3,704.94360000,154678338,'NX650.L34',931,924,0,'704.9436 D331',1,NULL,0,0,NULL),(1147,NULL,'978-1-84920-377-7','The tourist gaze','EN','Sage Publication',282,2011,'Urry, John | Urry, John [Author]',NULL,NULL,'LPST040',NULL,'the-tourist-gaze-3-0','2016-12-23 22:01:30','2021-01-31 16:16:45',16,'41Ah4Qh36VL.jpg','image/jpeg',30567,333,500,'The Tourist Gaze, Third Edition restructures, reworks and remakes the groundbreaking previous versions making this successful book even more relevant for tourism students, researchers and designers in the new century. &lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;The tourist gaze remains an agenda setting theory, incorporating new principles and research. Packed full of fascinating insights this new edition is fresh and contemporary, intelligently broadening its theoretical and geographical scope and providing a nuanced account which responds to various critiques.&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;The book has been significantly revised to include up-to-date empirical data, many new case studies and fresh concepts. Three new chapters have been added which explore photography and digitization, embodied performances, risks, and alternative futures.&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;Innovative and informative, this book is essential reading for all involved in contemporary tourism, leisure, cultural policy, design, economic regeneration, heritage and the arts.&lt;/p&gt;',3,338.47910000,47339322,'G155.A1',488,464,0,'338.4791 U81',1,NULL,0,0,NULL),(1148,'','978-1-84243-370-6','The geology of Britain : an introduction','EN ','Oldcastle Books',253,2012,'Toghill, Peter','','','LPST041','','the-art-of-wandering','2016-12-23 22:01:30','2021-01-31 18:32:25',16,'41xE1Nht_2BNL.jpg','image/jpeg',24684,326,500,'&lt;P&gt;&lt;B&gt;A philosophical history of that strange but prolific hybrid—the writer as walker&lt;/B&gt;&lt;/P&gt;&lt;P&gt;From the peripatetic philosophers of Ancient Greece to the streets of 20th-century London, Paris, and New York, the figure of writer as walker has continued to evolve through the centuries, the philosopher and the Romantic giving way to the experimentalist and radical. From pilgrim to pedestrian, flâneur to stalker, the names may change, but the activity of walking remains constant, creating a literary tradition encompassing philosophy and poetry, the novel and the manifesto; a tradition which this book explores in detail. Today, as the figure of the wanderer returns to the forefront of the public imagination, writers and walkers around the world are reengaging with the ideas which animated earlier generations—for the walker is once again on the march, mapping new territory and recording new visions of the landscape.',3,554.10000000,42135598,'QE261',292,174,0,'554.1 T645',1,NULL,0,0,NULL),(1149,'1-4051-1464-9',NULL,'Nature performed : environment, culture and performance','EN','Wiley-Blackwell',226,2003,'Szerszynski, Bronislaw [Editor] | Heim, Wallace [Editor] | Waterton, Claire [Editor]',NULL,NULL,'LPST042',NULL,'nature-performed-environment-culture-and-performance','2016-12-23 22:01:30','2021-01-31 16:16:45',16,'510DZZFGl9L.jpg','image/jpeg',44781,333,500,'This book brings together contributions from scholars across the humanities.&lt;br /&gt; &lt;ul&gt; &lt;li style=\"list-style: none\"&gt;&lt;br /&gt; &lt;/li&gt; &lt;li&gt;A wide-ranging exploration of the interface between performance and nature.&lt;/li&gt; &lt;li style=\"list-style: none\"&gt;&lt;br /&gt; &lt;/li&gt; &lt;li&gt;Examines the use and usefulness of ideas of ‘performance’ for understanding human-nature relationships.&lt;/li&gt; &lt;li style=\"list-style: none\"&gt;&lt;br /&gt; &lt;/li&gt; &lt;li&gt;Draws on different disciplines and intellectual traditions and on different conceptions of ‘performance’ and ‘nature’.&lt;/li&gt; &lt;li style=\"list-style: none\"&gt;&lt;br /&gt; &lt;/li&gt; &lt;li&gt;Contributions are rooted in real-world contexts and problems, explored through detailed ethnographic work.&lt;/li&gt; &lt;li style=\"list-style: none\"&gt;&lt;br /&gt; &lt;/li&gt; &lt;li&gt;Explores domains as diverse as allotments and bioinvasion, fox hunting and green politics.&lt;/li&gt; &lt;li style=\"list-style: none\"&gt;&lt;br /&gt; &lt;/li&gt; &lt;li&gt;Makes a distinctive contribution to the ‘cultural turn’ in environmental research.&lt;/li&gt; &lt;/ul&gt;',3,304.20000000,52738764,'GF75',591,592,0,'304.2 S997',1,NULL,0,0,NULL),(1150,NULL,'978-2-84975-229-6','My Winnipeg : guide de la scène artistique = guide of the artistic scene','FR/EN','FAGE editions / la maison rouge / plug in editions / Musee International des Arts Modestos',246,2011,NULL,NULL,NULL,'LPST043',NULL,'my-winnipeg-guide-of-the-artistic-scene','2016-12-23 22:01:30','2021-01-31 16:16:45',16,'51dAtv233-L.jpg','image/jpeg',33656,287,500,'What do Guy Maddin, Marcel Dzama, AA Bronson, and Diana Thorneycroft have in common? They re all from Winnipeg. Instigated by a French museum and touring France and Canada, this exhibition and accompanying publication set out to show that - far from heading toward globalization - the art world is driven by thriving but little-known centres of creative activity. Artists are inspired by the cities in which they live and the work they produce helps define their region s identity. This identity is carried in films, music, literature and art, conveying these artists vision around the globe. Winnipeg is a prime example of how geographical location can shape artistic production and how that production can explode onto the international scene. Brimming with information and analysis, this collection of facts and fictions looks at Winnipeg s art scene from the ground up. Critical writing by French and Canadian authors and illustrated biographies of 71 artists provide an up-close view of an intensely productive artistic community. Publication of an exhibition held at two French museums throughout 2011, La Maison rouge and MusÃ©e international des arts modestes, and opening at Plug In ICA in 2012. Published with Editions Fage. In English and French.',1,709.71274307,757314842,'N6547.W56',51,68,0,'709.71274307 My',1,NULL,0,0,NULL),(1151,NULL,'978-1-84243-347-8','Psychogeography','EN','Pocket Essentials',157,2012,'Coverley, Merlin',NULL,NULL,'LPST044',NULL,'psychogeography','2016-12-23 22:01:30','2021-01-31 16:16:45',16,'51xtcE2k8rL.jpg','image/jpeg',41986,330,500,'&lt;DIV&gt;&lt;DIV&gt;&lt;B&gt;The term \"psychogeography\" is used to illustrate a bewildering array of ideas, from ley lines and the occult to urban walking and political radicalism—where does it come from and what exactly does it mean?&lt;/B&gt;&lt;/DIV&gt;&lt;DIV&gt; &lt;/DIV&gt;&lt;DIV&gt;Psychogeography is the point where psychology and geography meet in assessing the emotional and behavioral impact of urban space. The relationship between a city and its inhabitants is measured firstly through an imaginative and literary response, secondly on foot through walking the city. This creates a tradition of the writer as walker and has both a literary and a political component. This guide examines the origins of psychogeography in the Situationist Movement of the 1950s, exploring the theoretical background and its political applications as well as the work of early practitioners such as Guy Debord and Raoul Vaneigem. Elsewhere, psychogeographic ideas continue to find retrospective validation in much earlier traditions from the visionary writing of William Blake and Thomas De Quincey to the rise of the flâneur on the streets of 19th century Paris and on through the avant-garde experimentation of the Surrealists. These precursors are discussed here alongside their modern counterparts, for today these ideas hold greater currency than ever through the popularity of writers and filmmakers such as Iain Sinclair and Peter Ackroyd, Stewart Home and Patrick Keiller. This guide offers both an explanation and definition of the terms involved, an analysis of the key figures and their work, and practical information on psychogeographical groups and organizations.&lt;/div&gt;&lt;/DIV&gt;',3,155.91000000,64555794,'G70',805,222,0,'155.91 C873',1,NULL,0,0,NULL),(1152,NULL,'978-3-7913-5194-0','Ends of the earth : land art to 1974','EN','Prestel / MOCA / Haus der Kunst',263,2012,'Kaiser, Philipp, 1972- [Curator; Creator; Editor; Author of introduction] | Museum of Contemporary Art (Los Angeles, Calif.) | Kwon, Miwon [Contributor; Curator; Editor; Author of introduction]',NULL,NULL,'LPST045',NULL,'ends-of-the-earth-land-art-to-1974','2016-12-23 22:01:30','2021-01-31 16:16:45',16,'61UOTHhn8JL.jpg','image/jpeg',67847,500,461,'The fascinating and generously illustrated catalogue documents the history of Land art from its emergence during the early 1960s through 1974. A companion volume to the first large-scale exhibition on Land art, this book traces the emergence of the artistic impulses to use the earth as material, land as medium, and to locate works in remote sites, beyond familiar art contexts. Ends of the Earth challenges many myths about Land art-that it was primarily a North American phenomenon, that it was foremost a sculptural practice, and that it exceeds the confines of the art system. Essays by leading young scholars will offer new insights into Land art\'s emergence, including its intrinsic connection to media, its dreams of an elsewhere, the attraction of wastelands, and the problems inherent in a historical evaluation of site-specific or ephemeral art. The book will also include a series of reflections from the major curators, critics, and dealers who helped to make Land art both as work and discourse in the 1960s and 1970s.',1,709.04076075,768166330,'N6494.E27',484,477,0,'709.04076075 K13',1,NULL,0,0,NULL),(1153,NULL,'978-0-7148-5643-8','Land and environmental art','EN','Phaidon Inc Ltd',204,1998,'Kastner, Jeffrey | Kastner, Jeffrey [Redactor; Editor; Author of introduction] | Wallis, Brian, 1953- [Contributor; Curator; Editor; Author of introduction]',NULL,NULL,'LPST046',NULL,'land-and-environmental-art','2016-12-23 22:01:30','2021-01-31 16:16:46',16,'21a_2BBuADD1L.jpg','image/jpeg',5516,103,165,'Language:Chinese.Paperback. Pages: 204 Publisher: Phaidon Press The traditional landscape genre was radically transformed in the 1960s when many artists stopped merely representing the land and made their mark directly in the environment. Drawn by vast. uncultivated spaces of desert and mountain as well as by post-industrial wastelands. artists such as Michael Heizer. Nancy Holt and Robert Smithson moved earth to create colossal primal symbols. Others punctuated the horizon with man-made signposts. such as Christo\'s Running Fence and Walter de Maria\'s The Lightning Field. For Richard Long . journeys became works of art while Dennis Oppenheim immersed his entire body in the contours of the land. In this oad survey of Land Art. ian Wallis discusses the key artists. works and issues that define Land Art historically. as well as its later ramifications .',1,709.04076000,40552707,'N6494.E27',1316,1307,0,'709.04076 K19',1,NULL,0,0,NULL),(1154,'3-906130-29-0','null','Geschiebe. Landschaft als Denkraum : [Ausstellung im Haus für Kunst Uri und im Aussenraum von Altdorf 2004]','DE','Gisler Verlag',135,2004,'Omlin, Sibylle','null','null','LPST047','null','geschiebe-landschaft-als-denkraum','2016-12-23 22:01:30','2021-02-05 16:27:32',16,NULL,NULL,NULL,NULL,NULL,'null',1,712.00000000,60520565,'N7148.6',6,8,0,'712 O54',1,'undefined',0,0,NULL),(1155,'','978-2-940377-54-1','Paysage, son, image','EN/FR','ECAV',115,2012,'Colloque scientifique \"Paysage, son, image\" (2010 : Sierre, Switzerland)','','','LPST048','','paysage-son-image','2016-12-23 22:01:30','2021-02-05 17:20:37',16,'csm_omlin_01_b24ce95a70.jpg','image/jpeg',8710,180,283,'',1,700.10500000,809977500,'N8213',1,3,0,'700.105 C714',1,'undefined',0,0,NULL),(1156,NULL,'978-1-61689-058-2','Cartographies of time','EN','Princeton Architectural Press',272,2010,'Rosenberg, Daniel, 1966- | Grafton, Anthony [Author; Contributor] | Grafton, Anthony 1950- [Author] | Hartz, Cornelius [Translator] | Rosenberg, Daniel, 1953-',NULL,NULL,'LPST049',NULL,'cartographies-of-time-a-history-of-the-timeline','2016-12-23 22:01:30','2021-01-31 16:16:47',16,'51hvKbneO3L.jpg','image/jpeg',55350,405,500,'Our critically acclaimed smash hit Cartographies of Time is now available in paperback. In this first comprehensive history of graphic representations of time, authors Daniel Rosenberg and Anthony Grafton have crafted a lively history featuring fanciful characters and unexpected twists and turns. From medieval manuscripts to websites, Cartographies of Time features a wide variety of timelines that in their own unique ways, curving, crossing, branching, defy conventional thinking about the form. A fifty-four-foot-long timeline from 1753 is mounted on a scroll and encased in a protective box. Another timeline uses the different parts of the human body to show the genealogies of Jesus Christ and the rulers of Saxony. Ladders created by missionaries in eighteenth-century Oregon illustrate Bible stories in a vertical format to convert Native Americans. Also included is the April 1912 Marconi North Atlantic Communication chart, which tracked ships, including the Titanic, at points in time rather than by their geographic location, alongside little-known works by famous figures, including a historical chronology by the mapmaker Gerardus Mercator and a chronological board game patented by Mark Twain. Presented in a lavishly illustrated edition, Cartographies of Time is a revelation to anyone interested in the role visual forms have played in our evolving conception of history',3,902.02000000,288932835,'D11.5',1472,1473,0,'902.02 R813',1,NULL,0,0,NULL),(1157,NULL,'978-1-84627-064-2','The snow tourist','EN','Portobello Books',280,2009,'English, Charlie',NULL,NULL,'LPST050',NULL,'the-snow-tourist-a-search-for-the-worlds-purest-deepest-snowfall','2016-12-23 22:01:30','2021-01-31 16:16:47',16,'511WS0x-zML.jpg','image/jpeg',60581,322,500,'A bracing and beguiling quest for the world\'s deepest, purest snowfall that takes us from carrot-nosed snowmen in frosty gardens to the most perilous peaks on earth - a book that does for the white stuff what Robert Macfarlane did for mountains.In this unique book, part eulogy, part history, part travelogue, Charlie English goes in search of the best snow on the planet. Along the way he explains the extraordinary hold this commonplace phenomenon has over us, and reveals the ongoing drama of our relationship with it. Combining on-the-slopes experience with off-piste research, Charlie English\'s journey begins with the magical moment when his two-year old son sees snow for the first time, before setting off in the footsteps of the Romantic poets over the Alps, following the sled-tracks of the Inuit across Greenland, and meeting up with a flurry of fellow enthusiasts, from snow-making scientists in Japan and global warming experts at Caltech to plough drivers in Alaska. This is a book for anyone who reaches for their mittens at the sight of the first flake.',1,551.57840000,221130200,'GB2603.7',124,124,0,'551.5784 E58',1,NULL,0,0,NULL),(1158,'','978-1-184467-669-9','Postmodern geographies : the reassertion of space in critical social theory','EN','Verso Books',228,1989,'Soja, Edward W.','','','LPST051','','postmodern-geographies-the-reassertion-of-space-in-critical-social-theory','2016-12-23 22:01:30','2021-01-31 16:16:47',16,'346378.jpg','image/jpeg',29075,311,475,'',1,910.01000000,18190662,'G70',884,824,0,'910.01 S676',1,NULL,0,0,NULL),(1159,'null','978-3-03764-147-7','Atlas of transformation','EN','tranzit / jrp ringier',720,2010,'Baladrán, Zbyněk','null','office (damaged)','LPST052','null','atlas-of-transformation','2016-12-23 22:01:30','2021-02-05 17:24:22',16,'51qfUn0ZFQL.jpg','image/jpeg',49103,373,500,'What happens to a country when it undergoes change on a revolutionary scale? And how does one grasp such monumental transformation? In over 200 entries, the &lt;I&gt;Atlas of Transformation&lt;/I&gt; offers a massive glossary of key terms for the effects and consequences of social political change, based on the transformations seen over the past two decades in Eastern Europe. These terms are explicated in extended essayistic entries, and describe themes obviously associated with large-scale change, such as adaptation, collectivity, demolition, ecology, immigration, ownership and privatization--but also explore somewhat more oblique themes such as iconoclasm, pornography, punishment and schizophrenia. Including relevant historical texts alongside new writing, among the authors contributing to the &lt;I&gt;Atlas&lt;/I&gt; are Timothy Garton Ash, Hakim Bey, Homi K. Bhabha, Deleuze and Guattari, Boris Groys, Karl Holmqvist, Frederic Jameson, Franz Kafka and Slavoj Zizek.',1,700.30000000,669124440,'N6490',60,64,0,'700.3 B171',1,'undefined',0,0,NULL),(1160,'0-8135-3550-6',NULL,'Local acts : community-based performance in the United States','EN','Rutgers University Press',212,2005,'Cohen-Cruz, Jan, 1950-',NULL,NULL,'LPST053',NULL,'local-acts-community-based-performance-in-the-united-states','2016-12-23 22:01:30','2021-01-31 16:16:48',16,'51DmCIQ88XL.jpg','image/jpeg',36853,328,500,'&lt;DIV&gt;&lt;p style=\"line-height:150%\" class=\"MsoNormal\"&gt;An eclectic mix of art, theatre, dance, politics, experimentation, and ritual,&lt;i&gt; &lt;/i&gt;community-based performance has become an increasingly popular art movement in the United States. Forged by the collaborative efforts of professional artists and local residents, this unique field brings performance together with a range of political, cultural, and social projects, such as community-organizing, cultural self-representation, and education. &lt;i&gt;Local Acts&lt;/i&gt; presents a long-overdue survey of community-based performance from its early roots, through its flourishing during the politically-turbulent 1960s, to present-day popular culture. Drawing on nine case studies, including groups such as the African American Junebug Productions, the Appalachian Roadside Theater, and the Puerto Rican Teatro Pregones, Jan Cohen-Cruz provides detailed descriptions of performances and processes, first-person stories, and analysis. She shows how the ritual side of these endeavors reinforces a sense of community identification while the aesthetic side enables local residents to transgress cultural norms, to question group habits, and to incorporate a level of craft that makes the work accessible to individuals beyond any one community. The book concludes by exploring how community-based performance transcends even national boundaries, connecting the local United States with international theater and cultural movements.&lt;/p&gt;&lt;/div&gt;',1,792.02220973,55960850,'PN2267',2055,2058,0,'792.02220973 C678',1,NULL,0,0,NULL),(1161,'null','978-88-95679-19-8','A Travers Champs/ QUERFELDEIN 29/06-17/08/2008 VOL.2','DE/FR','null',0,2008,'Ecole Cantonale d\'Art du Valais','null','null','LPST054','null','a-travers-champs-querfeldein-29-06-17-08-2008-vol-2','2016-12-23 22:01:30','2021-02-03 18:35:08',16,NULL,NULL,NULL,NULL,NULL,'null',1,709.49400000,0,NULL,NULL,NULL,1,'709.494 E17 Tra',1,'undefined',0,1,NULL),(1162,'0-500-51016-4',NULL,'Song of the earth','EN','Cameron Books',167,2002,'Gooding, Mel',NULL,NULL,'LPST055',NULL,'song-of-the-earth-european-artists-and-the-landscape','2016-12-23 22:01:30','2021-01-31 16:16:48',16,'51G8AVJ4YPL.jpg','image/jpeg',33464,475,403,'For the past four decades, a quiet but remarkably resilient strand of activity in contemporary art has been evident - that of artists who have largely turned their back on the city to embrace the context and inspiration offered by the natural environment, though in a spirit quite distinct from the tradition of landscape painting. Song of the Earth showcases the work of six important contemporary artists who work in the landscape and make use of the materials and processes of nature. Their methods favour observation, collecting and forms of manipulation that are more reflective than intrusive, setting them firmly apart from artists of the American Land Art movement working over the same period. Herman de Vries, Chris Drury, Ian Hamilton Finlay, Nikolaus Lang, Richard Long and Giuseppe Pennone do not belong to a particular school, but they are united in their empathy for nature and their decision to work outside the urban contexts of much modernist art. Interviews with the artists, conducted by William Furlong, reveal both widely differing motivations in their approaches to their work and striking similarities in their underlying concerns, and sometimes, methods of working. The introductory essay by Mel Gooding places these artists in both historical and contemporary contexts, as well as discussing other artists including Josef Beuys, Sjoerd Buisman, Hamish Fulton, Andy Goldsworthy and David Nash. Song of the Earth fills a significant need for more information about a field of contemporary art that enjoys an impressively warm response when it is seen, but whose character and sometimes remote location can make it inaccessible to the public gaze. This richly illustrated book is essential reading for anyone interested in contemporary European art and will delight all those who are drawn to the natural environment.',1,704.94360000,48885030,'N7650',166,178,0,'704.9436 G646',1,NULL,0,0,NULL),(1163,NULL,'978-0-262-61202-9','One place after another : site-specific art and locational identity','EN','The MIT Press',218,2004,'Kwon, Miwon',NULL,NULL,'LPST056',NULL,'one-place-after-another-site-specific-art-and-locational-identity','2016-12-23 22:01:30','2021-01-31 16:16:49',16,'51Z1MJTVVXL.jpg','image/jpeg',43529,364,475,'&lt;p&gt;Site-specific art emerged in the late 1960s in reaction to the growing commodification of art and the prevailing ideals of art\'s autonomy and universality. Throughout the 1970s and 1980s, as site-specific art intersected with land art, process art, performance art, conceptual art, installation art, institutional critique, community-based art, and public art, its creators insisted on the inseparability of the work and its context. In recent years, however, the presumption of unrepeatability and immobility encapsulated in Richard Serra\'s famous dictum \"to remove the work is to destroy the work\" is being challenged by new models of site specificity and changes in institutional and market forces.  &lt;i&gt;One Place after Another&lt;/i&gt; offers a critical history of site-specific art since the late 1960s and a theoretical framework for examining the rhetoric of aesthetic vanguardism and political progressivism associated with its many permutations. Informed by urban theory, postmodernist criticism in art and architecture, and debates concerning identity politics and the public sphere, the book addresses the siting of art as more than an artistic problem. It examines site specificity as a complex cipher of the unstable relationship between location and identity in the era of late capitalism. The book addresses the work of, among others, John Ahearn, Mark Dion, Andrea Fraser, Donald Judd, Renee Green, Suzanne Lacy, Inigo Manglano-Ovalle, Richard Serra, Mierle Laderman Ukeles, and Fred Wilson.&lt;/p&gt;',1,709.04070000,47892291,'N6490',1796,2021,0,'709.0407 K98',1,NULL,0,0,NULL),(1164,NULL,'978-0-520-21892-5','La guerra actual y las doctrinas del Vasco Francisco de Vitoria','EN','California',231,1999,'Ispizúa, Segundo de, 1869-1924',NULL,NULL,'LPST057',NULL,'the-tourist-a-new-theory-of-the-leisure-class','2016-12-23 22:01:30','2021-01-31 17:34:18',16,'41mzGaVLhWL.jpg','image/jpeg',30579,317,500,'&lt;div&gt;Long regarded as a classic, &lt;i&gt;The Tourist&lt;/i&gt; is an examination of the phenomenon of tourism through a social theory lens that encompasses discussions of authenticity, high and low culture, and the construction of social reality. It brings the concerns of social science to an analysis of travel and sightseeing in the postindustrial age, during which the middle class acquired leisure time for international travel. This edition includes a new foreword by Lucy R. Lippard and a new afterword by the author.&lt;/div&gt;',3,341.60000000,48387262,'KZ2159',1,3,0,'341.6 I73',1,NULL,0,0,NULL),(1165,NULL,'978-0-099-53243-9','Strands','EN','Vintage Books',237,2013,'Sprackland, Jean',NULL,NULL,'LPST058',NULL,'strands-a-year-of-discoveries-on-the-beach','2016-12-23 22:01:30','2021-02-01 18:01:23',16,'418u29YN4KL.jpg','image/jpeg',30874,326,500,'&lt;i&gt;Strands&lt;/i&gt; describes a year\'s worth of walking on the ultimate beach: inter-tidal and constantly turning up revelations: mermaid\'s purses, lugworms, sea potatoes, messages in bottles, buried cars, beached whales and a perfect cup from a Cunard liner. &lt;br /&gt;&lt;br /&gt;This is a series of meditations prompted by walking on the wild estuarial beaches of Ainsdale Sands between Blackpool and Liverpool, &lt;i&gt;Strands&lt;/i&gt; is about what is lost and buried then discovered, about all the things you find on a beach, dead or alive, about flotsam and jetsam, about mutability and transformation - about &lt;i&gt;sea-change&lt;/i&gt;.',3,821.91400000,796197847,'PR6069.P63',58,58,0,'821.914 S767',1,NULL,0,0,NULL),(1166,'null','null','Gdansk4fun: Catalogue of tourism products','PL/EN/DE/RU','Tourist Information Center',104,2013,'Gdansk Tourist Information','null','null','LPST059','null','gdansk4fun-catalogue-of-tourism-products','2016-12-23 22:01:30','2021-02-03 13:25:20',16,NULL,NULL,NULL,NULL,NULL,'null',1,306.48190000,NULL,NULL,NULL,NULL,1,'306.4819 G291',1,'undefined',0,1,NULL),(1167,NULL,'978-1-907317-87-3','The art of walking : a field guide','EN','black dog publishing',187,2012,'Evans, David, 1949-',NULL,NULL,'LPST060',NULL,'the-art-of-walking-a-field-guide','2016-12-23 22:01:30','2021-01-31 16:16:49',16,'51D41iRTVGL.jpg','image/jpeg',50531,370,500,'&lt;div&gt;&lt;I&gt;The Art of Walking: A Field Guide&lt;/I&gt; is a unique look at walking as a mode of artistic practice and is the first book to explore this fascinating subject of how walking can be used as an artistic medium. &lt;br&gt;&lt;BR&gt;An introductory essay identifies breaks and continuities between walking artists now and the pedestrian activities of the historic- and neo-avant-gardes of the early- and mid-20th Century, respectively. Subsequent visually-led sections deal with recent art engaging with different types of walkers including pilgrims, peripatetic writers and philosophers, dandies, drifters, marchers, stalkers, tour guides and dog walkers.&lt;BR&gt;&lt;BR&gt;Artists to be evaluated include Marina Abramovic and Ulay, Vito Acconci, Dennis Adams, Francis Alÿs, Keith Arnatt, Tim Brennan, Stanley Brouwn, Bruce Nauman, Sophie Calle, Janet Cardiff and George Bures Miller, Jeremy Deller, Simon Faithfull, Hamish Fulton, Regina José Galindo, Mona Hatoum, Akira Kanayama, Richard Long, The Long March Foundation, Melanie Manchot, Yoko Ono, Adrian Piper, Simon Pope and Kryzysztov Wodiczko.&lt;BR&gt;&lt;/div&gt;',1,704.94961372,778420197,'N8259',148,135,0,'704.94961372 E92',1,NULL,0,0,NULL),(1168,'','978-0-7619-6567','Hybrid geographies : natures, cultures, spaces','EN','Sage Publication',225,2006,'Whatmore, Sarah','','','LPST061','','hubrid-geographies-natures-cultures-spaces','2016-12-23 22:01:30','2021-01-31 16:16:49',16,'41icTrmiFAL._SX336_BO1_204_203_200_.jpg','image/jpeg',25860,338,499,'',1,304.20000000,50941100,'GF50',1072,687,0,'304.2 W555',1,NULL,0,0,NULL),(1169,NULL,'978-0140020946','The children of Sánchez','EN','Penguin Modern Classics',508,1972,'Lewis, Oscar, 1914-1970',NULL,NULL,'LPST065','John W. Fail','the-children-of-sanchez','2016-12-23 22:01:30','2021-01-31 16:16:49',16,'51uM4Q3nsTL.jpg','image/jpeg',34584,375,500,NULL,1,309.17200000,465190356,'HQ562',16,36,0,'309.172 L674',1,NULL,0,0,NULL),(1170,'','','Magic and the millennium; : a sociological study of religious movements of protest among tribal and third-world peoples','EN','Paladin',540,1975,'Wilson, Bryan R.','','','LPST066','John W. Fail','magic-and-the-millenium','2016-12-23 22:01:30','2021-01-31 16:16:49',16,'9780586082089-us-300.jpg','image/jpeg',17847,300,458,'',1,301.58000000,784164,'BL60',826,837,0,'301.58 W747',1,NULL,0,0,NULL),(1171,'385084765','','The Hidden dimension','EN','Anchor/Doubleday',240,1982,'Hall, Edward T. (Edward Twitchell), 1914-2009','','','LPST067','John W. Fail','the-hidden-dimension','2016-12-23 22:01:30','2021-01-31 16:16:50',16,'7155711-L.jpg','image/jpeg',43118,293,500,'',1,304.23000000,66432174,'BF469',7,11,0,'304.23 H175',1,NULL,0,0,NULL),(1172,NULL,'978-1844574360','A history of experimental film and video : from canonical avant-garde to contemporary British practice','EN','BFI',208,1999,'Rees, A. L. | British Film Institute [Publisher; Other]',NULL,NULL,'FM001','John W. Fail','a-history-of-experimental-film-and-video','2016-12-23 22:01:30','2021-02-03 11:31:15',19,'41t5IkWl5rL.jpg','image/jpeg',21045,323,500,'&lt;DIV&gt;This new edition covers thehistory of avante-garde film and video, ranging from Cezanne and dada, via Cocteau, Brakhage and Le Grice, to the new wave of British video artists in the 1990s. The author also reconstitutes the avante-garde film as an independent form of art practice with its own internal logic and aesthetic discourse.&lt;/DIV&gt;',3,791.43090000,60155369,'PN1995.9.E96',590,862,0,'791.4309 R328',1,NULL,0,0,NULL),(1173,NULL,'978-0521479196','The films of Peter Greenaway','EN','Cambridge University',240,1997,'Lawrence, Amy, 1957-',NULL,NULL,'FM002','John W. Fail','the-films-of-peter-greenaway','2016-12-23 22:01:30','2021-01-31 16:16:50',19,'41wN8MHq_2BhL.jpg','image/jpeg',22415,333,500,'The Films of Peter Greenaway is the first critical overview of one of the most controversial contemporary film-makers. Trained as an artist, Greenaway began his career in cinema as an editor of government-sponsored films. He began to attract critical attention in 1980 with his epic mock-documentary The Falls, the first British film to be named Best Film by the British Film Institute in 30 years. Since then he has created the wittily elegant The Draughtsman\'s Contract, the strikingly unconventional Shakespearean adaptation Prospero\'s Books,  and the disturbingly violent The Cook, The Thief, His Wife and Her Lover. In-depth analyses of these and several other of Greenaway\'s most important works are examined within the context of the director\'s biography and artistic goals. This edition also includes stills from Greenaway\'s feature films, as well as his own drawings.',1,791.43023309,36112190,'PN1998.3.G73',540,535,0,'791.43023309 L421',1,NULL,0,0,NULL),(1174,NULL,'978-0940642096','Incredibly strange films','EN','Re/Search',211,1985,'Morton, Jim; Vale, V.; Juno, Andrea',NULL,NULL,'FM003','John W. Fail','re-search-10-incredibly-strange-films','2016-12-23 22:01:30','2021-01-31 16:16:50',19,'518ThhKVH_2BL.jpg','image/jpeg',52793,380,500,'Incredibly Strange Films (Re/Search #10) is a functional guide to important territory neglected by the film-criticism establishment, spotlighting unhailed directors - Herschell Gordon Lewis, Russ Meyer, Larry Cohen and others - who have been critically consigned to the ghettos of gore and sexploitation films. In-depth interviews focus on philosophy, while anecdotes entertain as well as illuminate theory.  The book also includes biographies, genre overviews, filmographies, bibliography, an A-Z of film personalities, articles, quotations, lists of recommended films, and sources.',1,791.43500000,15028348,'PN1995',44,44,0,'791.435 M891',1,NULL,1,0,NULL),(1175,NULL,'978-0415277877','Experimental cinema : the film reader','EN','Routledge',368,2002,'Dixon, Wheeler W., 1950- | Dixon, Wheeler W., 1950- [Editor] | Foster, Gwendolyn Audrey [Editor]',NULL,NULL,'FM004','John W. Fail','experimental-cinema-the-film-reader','2016-12-23 22:01:30','2021-02-03 11:31:28',19,'41vlAUYinhL.jpg','image/jpeg',30993,317,500,'&lt;b&gt;&lt;i&gt;                  Experimental Cinema, The Film Reader&lt;/i&gt; brings together key writings on&lt;br /&gt;American avant-garde cinema to explore the long tradition of underground filmmaking from its origins in the 1920s to the work of contemporary film and video artists. &lt;br /&gt;&lt;br /&gt;&lt;i&gt;The Reader &lt;/i&gt;traces the development of major movements such as the New American Cinema of the 1960s and the Structuralist films of the 1970s, examining the work of key practitioners and recovering neglected&lt;br /&gt;filmmakers. &lt;br /&gt;&lt;br /&gt;Contributors focus on the ways in which underground films have explored issues of gender, sexuality and race, and foreground important technical innovations such as the use of Super 8mm and video. &lt;br /&gt;&lt;br /&gt;Each section features an editor\'s introduction setting debates in their context. &lt;br /&gt;&lt;br /&gt;Sections include:&lt;br /&gt;&lt;br /&gt;*Origins of the American avant-garde cinema - Explores the influence of the birth of experimental film, and considers the early work of filmmakers such as Maya Deren.&lt;br /&gt;&lt;br /&gt;*The 1960s experimental film explosion - traces the development of the New American Cinema, examining the influence and work of key filmmakers such as Kenneth Anger, Jack Smith, Andy Warhol, Stan Brakhage, and collage filmmaker Bruce Conner.&lt;br /&gt;&lt;br /&gt;*Structuralism in the 1970s - Identifies and discusses the main figures in Structuralist film including Michael Snow and Hollis Frampton.&lt;br /&gt;&lt;br /&gt;*Alternative cinemas - Examines the work of recent filmmakers such as Isaac Julien, Julie Dash, and Barbara Hammer, and considers the future of experimental film.&lt;br /&gt;&lt;br /&gt;Contents&lt;br /&gt;&lt;br /&gt;1. The First American Film Avant-Garde, 1919-1945 by Jan-Christopher Horak&lt;br /&gt;&lt;br /&gt;2. Notes on the New American Cinema by Jonas Mekas&lt;br /&gt;&lt;br /&gt;3. The Woman Filmmaker in the New York Avant-Garde by Lauren Rabinovitz&lt;br /&gt;&lt;br /&gt;4. Women in the Avant-Garde: Germaine Dulac, Maya Deren, Agnes Varda, Chantal Akerman and Trinh T. Minh-ha by Judith Mayne&lt;br /&gt;&lt;br /&gt;5. Pop, Queer or Fascist? The Ambiguity of Mass Culture in Kenneth Anger\'s Scorpio Rising by Juan A. Suarez&lt;br /&gt;&lt;br /&gt;6. Stan Brakhage - The 60th Birthday Interview by Suranjan Ganguly&lt;br /&gt;&lt;br /&gt;7. The Perfect Queer Appositeness of Jack Smith by Jerry Tartaglia&lt;br /&gt;&lt;br /&gt;8. An Interview with Carolee Schneemann by Kate Haug&lt;br /&gt;&lt;br /&gt;9. &lt;i&gt;The Flower Thief &lt;/i&gt;and The Film Poem: Warhol\'s Early Films and the Beat Writers by Reva Wolf&lt;br /&gt;&lt;br /&gt;10. Walking on Thin Ice: The Films of Yoko Ono by Daryl Chin&lt;br /&gt;&lt;br /&gt;11. Yoko Ono on Yoko Ono by Yoko Ono&lt;br /&gt;&lt;br /&gt;12. Structural Film by P. Adams Sitney&lt;br /&gt;&lt;br /&gt;13. Interview with Michael Snow by Scott MacDonald&lt;br /&gt;&lt;br /&gt;14. The Films of Warren Sonbert by Phillip Lopate&lt;br /&gt;&lt;br /&gt;15. Warren Sonbert Interview by David Ehrenstein&lt;br /&gt;&lt;br /&gt;16. An Interview with Hollis Frampton by Peter Gidal&lt;br /&gt;&lt;br /&gt;17. Re/Constructing Lesbian Auto /Biographies in &lt;i&gt;Tender Fictions&lt;/i&gt; and &lt;i&gt;Nitrate Kisses&lt;/i&gt; by Gwendolyn Audrey Foster&lt;br /&gt;&lt;br /&gt;18. The Films of Sadie Benning and Su Friedrich by Chris Holmlund&lt;br /&gt;&lt;br /&gt;19. Black Women\'s Independent Cinema by Gloria J. Gibson&lt;br /&gt;&lt;br /&gt;20. Dark and Lovely Too: Black Gay Men in Independent Film by Kobena Mercer             &lt;/b&gt;',3,791.43611000,49784601,'PN1995.9.E96',414,407,0,'791.43611 D621',1,NULL,0,0,NULL),(1176,NULL,'978-1846380488','Chris Marker, La jetě','EN','Afterall',112,2009,'Harbord, Janet',NULL,NULL,'FM005','John W. Fail','chris-marker-la-jetee','2016-12-23 22:01:30','2021-01-31 16:16:50',19,'41X3JpeG33L.jpg','image/jpeg',26377,335,500,'&lt;P&gt;Chris Marker\'s legendary \"ciné roman\" (\"film novel\")  &lt;I&gt;La Jetée&lt;/I&gt; is considered one of the greatest and most influential experimental films of all time. This short film--a postapocalyptic story composed almost entirely of black-and-white still photographs -- has been praised by cultural theorists and Netflix subscribers alike. In this illustrated study of  &lt;I&gt;La Jetée&lt;/I&gt;, Janet Harbord focuses in part on the film\'s treatment of time -- its shifts from a pre-war past to a projected future a further future of the future (each with its own signature images and sound) -- arguing that in this way it addresses the nature of consciousness and the simultaneity of time-frames that we inhabit. Harbord moves easily from a close reading of the film to discussions of broader cultural issues, lucidly piecing together the enigma that is  &lt;I&gt;La Jetée&lt;/I&gt;.&lt;/P&gt;',1,791.43615000,871228087,'PN1997.J444',1,1,0,'791.43615 H255',1,NULL,0,0,NULL),(1177,NULL,'978-0312131494','The psychotronic video guide to film','EN','St. Martin\'s Griffin',672,1996,'Weldon, Michael',NULL,NULL,'FM006','John W. Fail','the-psychotronic-video-guide-to-film','2016-12-23 22:01:30','2021-01-31 16:16:51',19,'51jCeyeePXL.jpg','image/jpeg',62729,378,500,'&lt;div&gt;How to know a Psychotronic Movie:&lt;br&gt;&lt;br&gt;These films can commonly be identified by their use of exploitation elements and their interest in humanity\'s lower common demoninators.&lt;br&gt;&lt;br&gt;They occur throughout the world, but are particuarly common at midnight movie festivals and in video stores\' cult sections, they are especially frequent at that beloved and dying institution, the drive-in.&lt;br&gt;&lt;br&gt;Their packaging is commonly deceptive.  They almost always appear on videocassette.&lt;br&gt;&lt;br&gt;Among their kind are biker films, sci-fi series, quickie biopics, gimmick films, teen sex comedies, blaxploitation films, stalkers, slashers, snoozers, shrudderers, and anything starring Lynda Blair, david Carradine, Shannon Tweed or Drew Barrymore.&lt;br&gt;&lt;br&gt;And they\'re all here in the &lt;i&gt;Psychotronic Video Guide.&lt;/i&gt;&lt;br&gt;&lt;br&gt;From Abby to Zontar, this book covers more than nine thousand amazing movies from the turn of the century right up to today\'s golden age of video, all described with Michael Weldon\'s dry wit.  More than 450 rare and wonderful illustrations round out the book, making it a treasure trove of cinematic lore and essential for every fan of filmdom\'s finest offerings.&lt;br&gt;&lt;/div&gt;',1,791.43635300,1038145413,'PN1995.9.S284',1,1,0,'791.436353 W443',1,NULL,0,0,NULL),(1178,NULL,'978-0195024869','Visionary film : the American avant-garde','EN','Oxford',480,1979,'Sitney, P. Adams','The American Avant-Garde 1943-1978',NULL,'FM007','John W. Fail','visionary-film','2016-12-23 22:01:30','2021-01-31 16:16:51',19,'5113Y5PqUDL.jpg','image/jpeg',36079,324,500,'Critics hailed the first edition of Visionary Film as the most complete work written on the exciting, often puzzling, and always controversial genre of American avant-garde film. Now P. Adams Sitney has revised and updated his classic book with a detailed study of major achievements made in the last decade.',1,791.43700000,926214,'PN1995.9.E96',1001,1022,0,'791.437 S563',1,NULL,0,0,NULL),(1179,NULL,'978-0571150809','The belly of an architect','EN','Faber & Faber',192,1988,'Greenaway, Peter, 1942- ..',NULL,NULL,'FM008','John W. Fail','the-belly-of-an-architect','2016-12-23 22:01:30','2021-02-03 11:29:15',19,'51skZ7UMNRL.jpg','image/jpeg',44577,310,500,'Book by Greenaway, Peter',1,822.91400000,16473834,'PN1997.B3649',154,154,0,'822.914 G795',1,NULL,0,0,NULL),(1180,'null','978-1846380013','Hollis Frampton : (Nostalgia)','EN','Afterall',92,2006,'Moore, Rachel O., 1956-','null','null','FM009','John W. Fail','hollis-frampton-nostalgia','2016-12-23 22:01:30','2021-02-06 10:46:43',19,'41-ZJjLszeL.jpg','image/jpeg',31910,337,500,'&lt;p&gt;In his 1971 short film, (nostalgia), American artist and writer Hollis Frampton oveturned the conventional narrative roles of words and images. In his account of an artists\'s transformation from photographer to filmmaker, Frampton burns photographs he had taken and selected from his past along with one found photograph. A calm voice tells a story about an image, but the story is about the following image, not the one shown. Confounding comprehension still further, the narration begins and ends during the photograph\'s combustion; smoke and ashes get in our eyes while we are trying to make sense of the image and the narration--trying to remember the story that fits the image, trying to remember the image that fits the story...Frampton\'s (nostalgia) is a formal masterpiece, long overlooked and understudied. It emerges from a body of film work that is rarely screened, the prints damaged and difficult to locate. Frampton\'s work is valued in artist filmmaking and film theory circles, but it has never taken its rightful place at the heart of modern art theory. This study will introduce a new generation to a critical moment in art history--when (nostalgia) confirmed both the essence and fragility of cinema itself.Afterall Books are distributed by The MIT Press.&lt;/p&gt;',1,791.43720000,70115862,'PN1997.N567',128,135,0,'791.4372 M822',1,'undefined',0,0,NULL),(1181,NULL,'978-0521388214','Avant-garde film : motion studies','EN','Cambridge University',212,1993,'MacDonald, Scott, 1942-','Motion Studies',NULL,'FM010','John W. Fail','avant-garde-film','2016-12-23 22:01:30','2021-02-03 11:37:15',19,'412xWL_2BXaTL.jpg','image/jpeg',29435,333,500,'The past thirty years have seen the proliferation of forms of independent cinema that challenge the conventions of mass-market commercial movies from within the movie theatre. Avant-Garde Film examines fifteen of the most suggestive and useful films from this film tradition. The films discussed include  No. 4 (Bottoms) by Yoko Ono, Wavelength by Michael Snow, Serene Velocity by Ernie Gehr, Print Generation by J. J. Murphy, Standard Gauge by Morgan Fisher, Zorns Lemma by Hollis Frampton, The Ties that Bind by Su Friedrich, From the Pole to the Equator by Yervant Gianikian and The Carriage Trade by Warren Sonbert. Through in-depth readings of these works, Scott MacDonald takes viewers on a critical circumnavigation of the conventions of movie going as seen by filmmakers who have rebelled against the conventions. MacDonald\'s discussions do not merely analyse the films; they provide a useful, accessible, jargon-free critical apparatus for viewing avant-garde film and communicate the author\'s pleasure in exploring \'impenetrable\' works.',3,791.43750000,25874269,'PN1995.9.E96',691,685,0,'791.4375 M135',1,NULL,0,0,NULL),(1182,NULL,'978-0929701165','Film at wit\'s end : eight avant-garde filmmakers','EN','Documentext',183,1991,'Brakhage, Stan','Eight Avant-Garde Filmmakers',NULL,'FM011','John W. Fail','film-at-wit-s-end','2016-12-23 22:01:30','2021-02-03 11:31:02',19,'51rG3-Oy8iL.jpg','image/jpeg',44386,335,500,'In these eight sparkling biographies, Stan Brakhage brings us into intimate acquaintance with some of America\'s most influential independent filmmakers. With insight and sharp detail, Brakhage puts the lives and works of these filmic visionaries into personal focus. We meet Jerome Hill, born to inherit railroads and banks but destined to forge his artistic vision into a lasting film statement. And Marie Menken who, against the odds of a miserable and brutal marriage, developed a film aesthetic that revolutionized the very essence of independent filmmaking. Then James Broughton, the inveterate San Franciscan, whose irrepressible sense of whimsy and profound grasp of classical symbols combined to create some of the most vital filmworks of the last four decades; Christopher MacLaine, the \"Artaud of North Beach\"; Maya Deren, known to independent filmmakers as \"the mother of us all\"; Sidney Peterson, sophisticated, erudite, shy, the gentleman of the avant-garde film world; and two of Brakhage\'s most prominent contemporaries, Bruce Conner and Ken Jacobs. &lt;p&gt; These filmmakers are members of one of the most radical of 20th-century art movements; and yet as radical and individual as they are, their films and their lives are a continuous source of inspiration, not only to young, developing film-artists, but to the makers of commercial movies and videos as well. Brakhage presents them and their work in portraits that are at once critical and anecdotal. One comes away from Film at Wit\'s End as one leaves an enjoyable, lively evening among friends.',3,791.43028023,19555812,'PN1995.9.E96',477,530,0,'791.43028023 B795',1,NULL,0,0,NULL),(1183,NULL,'978-0826414984','The Kinks\' the Kinks Are the Village Green Preservation Society','EN','Continuum',160,2003,'Miller, Andy',NULL,NULL,'FM012','John W. Fail','the-kinks-the-village-green-preservation-society-thirty-three-and-a-third-series','2016-12-23 22:01:30','2021-01-31 16:16:52',19,'41fx0BmsfhL.jpg','image/jpeg',32531,365,500,'Ignored by virtually everyone upon its release in November 1968, \'The Kinks Are The Village Green Preservation Society\' is now seen as one of the best British albums ever recorded. Here, Andy Miller traces the perilous circumstances surrounding its creation, and celebrates the timeless, perfectly crafted songs pieced together by a band who were on the verge of disintegration and who refused to follow fashion.&lt;br /&gt;&lt;br /&gt;\'Big Sky\' contains some of the most beautiful, thunderous music The Kinks ever recorded, aligned to a vulnerability and warmth no other group - and I mean no other group - could ever hope to equal. It is a perfectly balanced production. On the one hand, the mesh of clattering drums and electric guitar never threatens to overwhelm the melody; on the other, the gossamer-light harmonies, Ray and Dave\'s vocal line traced by Rasa Davies\' wordless falsetto, are bursting with emotion. When most of the instruments drop away at 1.20, the effect is effortlessly vivid - two lines where Davies\' performance is both nonchalant and impassioned. The result is wonderfully, enchantingly sad, made more so perhaps by the knowledge that The Kinks will never again sound so refined or so right.',1,782.42166092,781614718,'ML421',23,24,0,'782.42166092 M648',1,NULL,0,0,NULL),(1184,NULL,'978-0413318602','The electric muse : the story of folk into rock','EN','Methuen',182,1975,'Laing, Dave | Laing, Dave [Author]',NULL,NULL,'FM013','John W. Fail','the-electric-muse-the-story-of-folk-into-rock','2016-12-23 22:01:30','2021-01-31 16:16:53',19,'51xh6ahuQOL.jpg','image/jpeg',45685,336,500,NULL,1,781.73000000,2022014,'ML102.P66',99,105,0,'781.73 L187',1,NULL,0,0,NULL),(1185,NULL,'978-0805033939','Invisible republic : Bob Dylan\'s basement tapes','EN','Holt/Owl',304,1998,'Marcus, Greil',NULL,NULL,'FM014','John W. Fail','invisible-republic-bob-dylan-s-basement-tapes','2016-12-23 22:01:30','2021-01-31 16:16:53',19,'51114JWEERL.jpg','image/jpeg',47516,314,475,'Out of the basement of a house called Big Pink came music that is as seductive and baffling today as it was thirty years ago. Greil Marcus\'s long-awaited book follows Dylan\'s historic 1964 rock \'n\' roll debut at the Newport Folk Festival, which prompted accusations of a betrayal of folk music and values. Marcus thinks the secret Basement Tapes were Dylan\'s response to the furor, never meant for release. The mystery, however, of the Basement Tapes remains in the music.',1,782.42164092,35970971,'ML420.D98',644,738,0,'782.42164092 M322',1,NULL,0,0,NULL),(1186,NULL,'978-0826429575','Wowee zowee','EN','Continuum',160,2010,'Charles, Bryan',NULL,NULL,'FM015','John W. Fail','pavement-s-wowee-zowee-33-1-3','2016-12-23 22:01:30','2021-01-31 16:16:53',19,'41OisxuiT_2BL.jpg','image/jpeg',28273,365,500,'&lt;p&gt;&lt;font face=\"Times New Roman\" size=3&gt;Pavement wrapped up at Easley Recording in Memphis. They mixed the tracks and recorded overdubs in New York. They took a step back and assessed the material. It was a wild scene. They had fully fleshed-out songs and whispers and rumors of half-formed ones. They had songs that followed a hard-to-gauge internal logic. They had punk tunes and country tunes and sad tunes and funny ones. They had fuzzy pop and angular new wave. They had raunchy guitar solos and stoner blues. They had pristine jangle and pedal steel. The final track list ran to eighteen songs and filled three sides of vinyl. &lt;/font&gt;&lt;/p&gt;&lt;br /&gt;&lt;p&gt;&lt;font face=\"Times New Roman\" size=3&gt;Released in 1995, on the heels of two instant classics, &lt;em&gt;Wowee Zowee&lt;/em&gt; confounded Pavement\'s audience. Yet the record has grown in stature and many diehard fans now consider it Pavement\'s best. Weaving personal history and reporting-including extensive new interviews with the band-Bryan Charles goes searching for the story behind the record and finds a piece of art as elusive, anarchic and transportive now as it was then. &lt;br /&gt;&lt;/font&gt;&lt;/p&gt;',1,782.42166092,466344000,'ML421.P38',221,225,0,'782.42166092 C476',1,NULL,0,0,NULL),(1187,NULL,'978-0826417480','Bee thousand','EN','Continuum',144,2006,'Woodworth, Marc',NULL,NULL,'FM016','John W. Fail','guided-by-voices-bee-thousand-33-1-3','2016-12-23 22:01:30','2021-01-31 16:16:53',19,'41KOJ4U0JfL.jpg','image/jpeg',22838,365,500,'Marc Woodworth\'s book covers the album\'s long and unorthodox period of writing, recording, sequencing, and editing. It includes interviews with members of the band, manager Pete Jamison, web-master and GBV historian Rich Turiel and Robert Griffin of Scat Records. At least sixty-five songs were recorded and considered for the album and five distinct concepts were rejected before the band hit upon the records final form. One late version, very nearly released, contained only a few of &lt;I&gt;Bee Thousand&lt;/I&gt;\'s definitive songs.&lt;br /&gt;&lt;br /&gt;The rest were left out and nearly ended up in the boxes of cassette out-takes cluttering up Robert Pollard\'s basement. The story of Guided By Voices transformation from an occasional and revolving group of complete unknowns to indie-rock heroes is very much part of the story behind the making of Bee Thousand.&lt;br /&gt;&lt;br /&gt;In addition to providing a central account of how the record was made, Woodworth devotes a substantial chapter to the album\'s lyrics. Robert Pollard\'s lyrics are described by critics, when they\'re described at all, as a brand of tossed-off surrealism, as if his verbal sensibility is somehow incidental to the songs themselves. Nothing could be further from the truth. Woodworth offers a sustained discussion of Pollard\'s work as a writer of often sublime, beautiful, and very human lyrics. &lt;br /&gt;&lt;br /&gt;The third key section of the book covers aesthetics. Woodworth considers the great appeal of the do-it-yourself nature of &lt;I&gt;Bee Thousand&lt;/I&gt; and reflects on the larger importance of the strain of alternative rock for which this record is a touchstone.',1,782.42166092,70630466,'ML421.G853',115,134,0,'782.42166092 W899',1,NULL,0,0,NULL),(1188,'0865478562',NULL,'Electric Eden : unearthing Britain\'s visionary music','EN','Faber & Faber',672,2011,'Young, Rob, 1968-','Unearthing Britain\'s Visionary Music',NULL,'FM017','John W. Fail','electric-eden','2016-12-23 22:01:30','2021-01-31 16:16:53',19,'51aJ9uLM2IL.jpg','image/jpeg',46128,334,500,'&lt;p&gt;A &lt;i&gt;Kirkus Reviews&lt;/i&gt; Best Nonfiction of 2011 title &lt;/p&gt;&lt;p&gt;In the late 1960s, with popular culture hurtling forward on the sounds of rock music, some brave musicians looked back instead, trying to recover the lost treasures of English roots music and update them for the new age. The records of Fairport Convention, Pentangle, Steeleye Span, and Nick Drake are known as \"folk rock\" today, but Rob Young\'s epic, electrifying book makes clear that those musicians led a decades-long quest to recover English music-and with it, the ancient ardor for mysticism and paganism, for craftsmanship and communal living.&lt;/p&gt;&lt;p&gt;It is a commonplace that rock and R&amp;B came out of the folk and blues revivals of the early 1960s, and Young shows, through enchanting storytelling and brilliant commentary, that a similar revival in England inspired the Beatles and Pink Floyd, Led Zeppelin and Traffic, Kate Bush and Talk Talk. Folklorists notated old songs and dances. Marxists put folk music forward as the true voice of the people. Composers like Benjamin Britten and Ralph Vaughan Williams devised rich neo-traditional pageantry. Today, the pioneers of the \"acid folk\" movement see this music as a model for their own.&lt;/p&gt;&lt;p&gt;&lt;i&gt;Electric Eden &lt;/i&gt;is that rare book which has something truly new to say about popular music, and like Greil Marcus\'s &lt;i&gt;Lipstick&lt;/i&gt; &lt;i&gt;Traces&lt;/i&gt;, it uses music to connect the dots in a thrilling story of art and society, of tradition and wild, idiosyncratic creativity.&lt;/p&gt;',1,781.62210000,501273587,'ML3650',583,606,0,'781.6221 Y69',1,NULL,0,0,NULL),(1189,'null','978-1441162076','Listening to noise and silence : towards a philosophy of sound art','EN','Continuum',256,2010,'Voegelin, Salomé | Voegelin, Salomé','Towards a Philosophy of Sound Art','null','FM018','John W. Fail','listening-to-noise-and-silence','2016-12-23 22:01:30','2021-02-05 17:35:52',19,'41w5VZCA58L.jpg','image/jpeg',29836,333,500,'&lt;p&gt;&lt;b&gt;&lt;/b&gt;&lt;br&gt;&lt;b&gt;&lt;i&gt;Listening to Noise and Silence&lt;/i&gt; engages with the emerging practice of sound art and the concurrent development of a discourse and theory of sound. In this original and challenging work, Salomé Voegelin immerses the reader in concepts of listening to sound artwork and the everyday acoustic environment, establishing an aesthetics and philosophy of sound and promoting the notion of a sonic sensibility. &lt;/b&gt;&lt;br&gt;&lt;b&gt;&lt;/b&gt;&lt;br&gt;&lt;b&gt;A multitude of sound works are discussed, by lesser known contemporary artists and composers (for example Curgenven, Gasson and Federer), historical figures in the field (Artaud, Feldman and Cage), and that of contemporary canonic artists such as Janet Cardiff, Bill Fontana, Bernard Parmegiani, and Merzbow.&lt;/b&gt;&lt;br&gt;&lt;b&gt;&lt;/b&gt;&lt;br&gt;&lt;b&gt;Informed by the ideas of Adorno, Merleau-Ponty and others, the book aims to come to a critique of sound art from its soundings rather than in relation to abstracted themes and pre-existing categories. &lt;i&gt;Listening to Noise and Silence&lt;/i&gt; broadens the discussion surrounding sound art and opens up the field for others to follow.&lt;/b&gt;&lt;/p&gt;',1,700.90400000,466343731,'NX650.S68',1342,1340,0,'700.904 V873',1,'undefined',0,0,NULL),(1190,NULL,'978-0520256170','The San Francisco Tape Music Center : 1960s counterculture and the avant-garde','EN','University of California',344,2008,'David W. Bernstein','1960s Counterculture and the Avant-Garde',NULL,'FM019','John W. Fail','the-san-francisco-tape-music-center','2016-12-23 22:01:30','2021-01-31 16:16:54',19,'51QWsnvLpSL.jpg','image/jpeg',37340,348,500,'&lt;div&gt;This book tells the story of the influential group of creative artistsPauline Oliveros, Morton Subotnick, Ramon Sender, William Maginnis, and Tony Martinwho connected music to technology during a legendary era in California\'s cultural history. An integral part of the robust San Francisco scene,” the San Francisco Tape Music Center developed new art forms through collaborations with Terry Riley, Steve Reich, David Tudor, Ken Dewey, Lee Breuer, the San Francisco Actor\'s Workshop, the San Francisco Mime Troupe, the Ann Halprin Dancers\' Workshop, Canyon Cinema, and others. Told through vivid personal accounts, interviews, and retrospective essays by leading scholars and artists, this work, capturing the heady experimental milieu of the sixties, is the first comprehensive history of the San Francisco Tape Music Center.&lt;/div&gt;',1,786.70973000,174500759,'ML33.S3',318,317,0,'786.70973 D251',1,NULL,1,0,NULL),(1191,'null','null','Robert Wyatt','IT','Stampa Alternativa',95,0,'Marinoni, Gigi','null','null','FM020','John W. Fail','robert-wyatt','2016-12-23 22:01:30','2021-02-09 08:56:06',19,NULL,NULL,NULL,NULL,NULL,'null',1,780.92000000,0,NULL,NULL,NULL,1,'780.92 M337',1,'undefined',1,0,NULL),(1192,NULL,'978-0520267459','Source : music of the avant-garde, 1966-1973','EN','University of California',396,2011,'Austin, Larry | Austin, Larry [Editor] | Kahn, Douglas, 1951- [Editor] | Gurusinghe, Nilendra [Editor]',NULL,NULL,'FM021','John W. Fail','source-music-of-the-avant-garde-1966-1973','2016-12-23 22:01:30','2021-01-31 16:16:54',19,'51HlpijPdPL.jpg','image/jpeg',34937,500,400,'&lt;div&gt;The journal &lt;i&gt;Source: Music of the Avant-garde&lt;/i&gt; was and remains a seminal source for materials on the heyday of experimental music and arts. Conceived in 1966 and published to 1973,  it included some of the most important composers and artists of the time: John Cage, Harry Partch, David Tudor, Morton Feldman, Robert Ashley, Pauline Oliveros, Dick Higgins, Nam June Paik, Steve Reich, and many others. A pathbreaking publication, &lt;i&gt;Source&lt;/i&gt; documented crucial changes in performance practice and live electronics, computer music, notation and event scores, theater and installations, intermedia and technology, politics and the social roles of composers and performers, and innovations in the sound of music.&lt;/div&gt;',1,780.90400000,503307324,'ML197',1317,1314,0,'780.904 A936',1,NULL,0,0,NULL),(1193,NULL,'978-0306807411','The accidental evolution of rock\'n\'roll : a misguided tour through popular music','EN','Da Capo',438,1997,'Eddy, Chuck','A Misguided Tour Through Popular Music',NULL,'FM022','John W. Fail','the-accidental-evolution-of-rock-n-roll','2016-12-23 22:01:30','2021-01-31 16:16:54',19,'5163RrDqwNL.jpg','image/jpeg',44183,324,500,'&lt;DIV&gt;History, jokebook, buying guide, book of lists, and treatise all rolled into one, &lt;I&gt;The Accidental Evolution of Rock\'n\'Roll&lt;/I&gt; is most of all a joyride through the wildest music ever made. Whether discussing Def Leppard or Nirvana, Vanilla Ice or Public Enemy, Donna Summer or Bob Dylan, Chuck Eddy is an unparalleled master at deciphering unknown tongues and disentangling musical accidents. In this lavishly and hilariously illustrated book, he reveals the roots of rap, disco, power ballads, bubblegum, suburban country, and noise-rock; why selling out is good and honesty is never what it seems; the similarities between disco and garage rock and between reggae and heavy metal; whether songs can ever really \"mean\" anything; what math rock has in common with amputation rock and orgasm rock; and much, much more. By eventually encompassing the whole wacky world of popular music, this book is destined to change it forever.&lt;/Div&gt;&lt;/div&gt;',1,781.64090000,35919230,'ML3470',157,157,0,'781.6409 E21',1,NULL,0,0,NULL),(1194,NULL,'978-0978869731','Rock/Music writings','EN','Primary Information',224,2009,'Graham, Dan, 1942-',NULL,NULL,'FM023','John W. Fail','rock-music-writings','2016-12-23 22:01:30','2021-01-31 16:16:54',19,'51Of3riYBSL.jpg','image/jpeg',43031,333,500,'As admired for his writing as for his work in art, photography and architecture, Dan Graham was one of the first contemporary artists to embrace Punk, Postpunk and No Wave, becoming a figurehead for those movements, and an early supporter of (and friend to) Glenn Branca and Sonic Youth among many others. &lt;I&gt;Rock/Music Writings&lt;/I&gt; collects 13 of Graham\'s most influential writings, on bands ranging from The Kinks to Bow Wow Wow, first published in art journals such as &lt;I&gt;Real Life&lt;/I&gt;, &lt;I&gt;Open Letter&lt;/I&gt; and &lt;I&gt;ZG&lt;/I&gt; between 1968 and 1988, and in the now rare volume &lt;I&gt;Rock My Religion&lt;/I&gt;. It includes such landmark essays as “Punk as Propaganda,” which explicates the self-packaging and media critique of The Ramones, Devo, the Sex Pistols, the Desperate Bicycles and others; “Rock My Religion,” in which Graham traces themes of ecstatic reverie in rock performance (with a focus on Patti Smith), through a beautiful composite of quotation, commentary and photography; and “New Wave Rock and the Feminine,” which discusses the onstage personae of Lydia Lunch, Debbie Harry and Siouxsie Sioux, and the gender politics of all-female groups such as The Slits, The Raincoats, Bush Tetras and others. Throughout &lt;I&gt;Rock/Music Writings&lt;/I&gt;, Graham\'s appraisals are clear-eyed, sophisticated and poetically constructed, a genre of their own within artists\' writings.',1,781.63000000,432994877,'ML3534',100,110,0,'781.63 G739',1,NULL,0,0,NULL),(1195,NULL,'978-0306809699','The Nick Tosches reader','EN','Da Capo',624,2000,'Tosches, Nick',NULL,NULL,'FM024','John W. Fail','the-nick-tosches-reader','2016-12-23 22:01:30','2021-01-31 16:16:54',19,'417MrNyJNIL.jpg','image/jpeg',30487,333,500,'&lt;div&gt;&lt;I&gt;Newsday&lt;/I&gt; has said that Nick Tosches \"casts brilliant black light.\" The &lt;I&gt;San Diego Reader&lt;/I&gt; has said that \"Tosches\'s best sentences uncoil like rattlesnakes and strike with a venom that spreads poison through all the little Sunday-school ideas you\'ve held dear.\" And &lt;I&gt;Rolling Stone&lt;/I&gt; has said that \"Tosches can write like a wild rockabilly raveup. He can be elegant as a slow blues.\" &lt;I&gt;The Nick Tosches Reader&lt;/I&gt; is the author\'s own selection of his best work over the past thirty years, including fiction, poetry, interviews, rock writing, investigative journalism, and criticism. First published in major magazines, obscure underground periodicals, and his own best-selling books, many of these selections deal with rock \'n\' roll and cultural icons—but there are also pieces on everything from William Faulkner to organized crime to heavyweight boxing, including the &lt;I&gt;Vanity Fair&lt;/I&gt; feature that gave rise to Tosches\'s major new book on Sonny Liston, published by Little, Brown. Here is \"a unique and darkly impressionistic cultural history\" of the last three decades as only Nick Tosches could write it.&lt;/Div&gt;&lt;/div&gt;',1,818.54090000,247525184,'PS3570.O74',2,2,0,'818.5409 T713',1,NULL,0,0,NULL),(1196,NULL,'978-0306809538','A whore just like the rest : the music writings of Richard Meltzer','EN','Da Capo',591,2000,'Meltzer, Richard','The Music Writings of Richard Meltzer',NULL,'FM025','John W. Fail','a-whore-just-like-the-rest','2016-12-23 22:01:30','2021-01-31 16:16:54',19,'41UB0-FwmwL.jpg','image/jpeg',29458,333,500,'&lt;div&gt;He is one of the inventors of rock criticism. His first book, &lt;I&gt;The Aesthetics of Rock&lt;/I&gt; (acclaimed by Greil Marcus as \"a disemboweling of rock\'s soft white underbelly\"), became an instant cult classic when published in 1970. And for the next thirty years he fearlessly expanded the boundaries of music writing. Now he has collected the best of his prodigious output into a gonzo sampler of the reviews, profiles, interviews, and essays that form the heart of his rockwriter legacy. Traveling from psychedelia to the \"dinosaur-rot early \'70s\" to the redeeming majesty of punk and the constant solace of jazz, this will stand as a remarkable document of an era by a singular voice in music writing.&lt;/Div&gt;&lt;/div&gt;',1,781.66000000,42888082,'ML3534',213,212,0,'781.66 M517',1,NULL,0,0,NULL),(1197,NULL,'978-2922399202','Spiels d\'un minuteman = : Spiels of a minuteman','EN/FR','L\'Oie de Craven',128,2003,'Watt, Mike',NULL,NULL,'FM026','John W. Fail','spiels-of-a-d-un-minuteman','2016-12-23 22:01:30','2021-01-31 16:16:55',19,'51i5ABUchqL.jpg','image/jpeg',63828,485,500,'What a great collection. Herein you\'ll find all the lyrics Mike Watt penned for the Minutemen (from 1980-1985); his Black Flag/Minutemen winter of 1983 tour diary; an intro by Mike (of course); as well as introductions from Joe Carducci, Thurston Moore and Richard Meltzer. All rounded off with all the illustrations Raymond Pettibon did for the Minutemen (and there was a lot of them!). Beautifully produced, and all bilingual (in French too).',1,782.42166027,54087481,'ML54.6',21,9,0,'782.42166027 W345',1,NULL,0,0,NULL),(1198,NULL,NULL,'Badaboom Gramaphone Issue #5','EN','Ba Da Bing',224,1998,'Ben Goldberg',NULL,NULL,'FM027','John W. Fail','badaboom-gramaphone-issue-5','2016-12-23 22:01:30','2021-01-26 16:17:12',19,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(1199,NULL,NULL,'Sound Collector Number 7','EN','Sound Collector Magazine',160,2001,'Laris Kreslins',NULL,NULL,'FM028','John W. Fail','sound-collector-number-7','2016-12-23 22:01:30','2021-01-26 16:17:12',19,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(1200,NULL,NULL,'Sound Collector Five','EN','Sound Collector Magazine',176,2000,'Laris Kreslins',NULL,NULL,'FM029','John W. Fail','sound-collector-five','2016-12-23 22:01:30','2021-01-26 16:17:12',19,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(1201,NULL,'978-0982981924','Yeti twelve','EN','Yeti',194,2012,'Mike McGonigal',NULL,NULL,'FM030','John W. Fail','yeti-twelve','2016-12-23 22:01:30','2021-01-26 16:17:12',19,'51eSLJDsReL.jpg','image/jpeg',55113,500,500,'&lt;DIV&gt;&lt;I&gt;Yeti&lt;/I&gt; is a book-format music and arts periodical, published twice a year, in spring and fall. Each issue is around 200 pages and contains interviews with writers, musicians, and artists, as well as original fiction, graphic art, and photography. Each biannual issue features specially commissioned cover art — usually printed with stunning metallic ink — and includes a full-length CD of exclusive, unreleased music. &lt;I&gt;Yeti 12&lt;/I&gt; features cover art by and an interview with artist Michael Kupperman; Daphne Carr interviews archivist/activist/musician Ned Sublette. The 7\" record includes Mississippi Fred McDowell (an unreleased track from Alan Lomax\'s first recordings of the Delta blues giant in 1959), plus a new song from cult artist Grouper.&lt;BR&gt;&lt;/DIV&gt;',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(1202,NULL,NULL,'Yeti eight','EN',NULL,196,2009,'Mike McGonigal',NULL,NULL,'FM031','John W. Fail','yeti-eight','2016-12-23 22:01:30','2021-01-26 16:17:12',19,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(1203,NULL,'978-1891241086','Great pop things : the real history of rock and roll from Elvis to Oasis','EN','Verse Chorus',232,1998,'Morton, Colin B. | Death, Chuck [Illustrator; Author]',NULL,NULL,'FM032','John W. Fail','great-pop-things','2016-12-23 22:01:30','2021-01-31 16:16:55',19,'513k5tH4rBL.jpg','image/jpeg',60550,352,500,'&lt;div&gt;The comic strips of Colin B. Morton and Chuck Death deliver an irreverent, heartfelt, and devastatingly funny history of rock and roll. Like Monty Python at its best, their version is surreal and ridiculous - yet somehow everything in it rings true. According to Morton and Death, the bass player in Led Zeppelin was Jean-Paul Sartre. And despite having been able to think up brilliant titles for their first three albums, Led Zeppelin were stuck for what to call the fourth one - so they put a load of prunes on the front. In strip after strip, Morton &amp; Death pinpoint the absurdities and oddities of rock history. In the process, they often come closer to its truth than conventional accounts do, as well as being far more entertaining. As for the drawings, their caricatures of rock stars from Mick Jagger to Frank Zappa, Johnny Rotten to Courtney Love, are in themselves worth the price of admission.&lt;/div&gt;',1,781.66000000,31642275,'ML3534',48,48,0,'781.66 M891',1,NULL,0,0,NULL),(1204,NULL,NULL,'Sound Collector 8','EN','Sound Collector Magazine',160,2002,'Laris Kreslins',NULL,NULL,'FM033','John W. Fail','sound-collector-8','2016-12-23 22:01:30','2021-01-26 16:17:12',19,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(1205,NULL,'978-0262522618','The Csound Book : perspectives in software synthesis, sound design, signal processing an programming','En','MIT Press',782,2000,'Boulanger, Richard Charles, 1956-',NULL,NULL,'FM035',NULL,'the-csound-book-perspectives-in-software-synthesis-sound-design-signal-processing-and-programming','2016-12-23 22:01:30','2021-01-31 18:36:28',19,'51A3GdxOzBL.jpg','image/jpeg',44199,445,500,'&lt;DIV&gt;Created in 1985 by Barry Vercoe, Csound is one of the most widely used software sound synthesis systems. Because it is so powerful, mastering Csound can take a good deal of time and effort. But this long-awaited guide will dramatically straighten the learning curve and enable musicians to take advantage of this rich computer technology available for creating music.Written by the world\'s leading educators, programmers, sound designers, and composers, this comprehensive guide covers both the basics of Csound and the theoretical and musical concepts necessary to use the program effectively. The thirty-two tutorial chapters cover: additive, subtractive, FM, AM, FOF, granular, wavetable, waveguide, vector, LA, and other hybrid methods; analysis and resynthesis using ADSYN, LP, and the Phase Vocoder; sample processing; mathematical and physical modeling; and digital signal processing, including room simulation and 3D modeling.Supplemental Content is now available for download at http://mitpress.mit.edu/9780262522618&lt;/DIV&gt;',1,6.68000000,420226559,'MT723',3,3,0,'006.68 B763',1,NULL,0,0,NULL),(1206,'1733-4098',NULL,'Glissando #25','EN/PL','Fundacja 4.99',162,2014,NULL,NULL,NULL,'FM036',NULL,'glissando-25','2016-12-23 22:01:30','2021-01-23 17:50:25',19,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(1207,NULL,'978-952-604159-9','Sormina : a new musical instrument','EN','Aalto University',242,2011,'Räisänen, Juhani, 1956-',NULL,NULL,'FM037',NULL,'sormina-a-new-musical-instrument','2016-12-23 22:01:30','2021-01-31 16:16:55',19,NULL,NULL,NULL,NULL,NULL,NULL,1,784.19000000,816362180,'ML1092',1,1,0,'784.19 R595',1,NULL,0,0,NULL),(1208,NULL,'978-0860018056','Encyclopedia metallica','EN','Music Sales Corp',128,1998,'Harrigan, Brian',NULL,NULL,'FM038',NULL,'encyclopedia-metallica-the-bible-of-heavy-metal','2016-12-23 22:01:30','2021-01-31 16:16:55',19,'51DlRnCQ9mL.jpg','image/jpeg',63457,369,500,'Book by Harrigan, Brian, Dome, Malcolm',1,782.42166000,8003277,'ML285.5',26,20,0,'782.42166 H297',1,NULL,0,0,NULL),(1209,NULL,NULL,'Personal Best #6','EN','Marhaug Forlag',NULL,2015,'Lasse Marhaug',NULL,NULL,'FM039',NULL,'personal-best-6','2016-12-23 22:01:30','2021-01-26 16:17:12',19,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,1,0,NULL),(1210,'289.79606.7',NULL,'The Films of Robert Bresson','EN','Studio Vista',128,1970,'Cameron, Ian, 1937-2010',NULL,NULL,'FM040',NULL,'the-films-of-robert-bresson','2016-12-23 22:01:30','2021-01-31 16:16:55',19,NULL,NULL,NULL,NULL,NULL,NULL,1,791.43023309,69510,'PN1998.A3',160,160,0,'791.43023309 C182',1,NULL,0,0,NULL),(1211,NULL,'978-0094622906','The sociology of rock','En','Constable',255,1978,'Frith, Simon, 1946-',NULL,NULL,'FM041','John W. Fail','the-sociology-of-rock','2016-12-23 22:01:30','2021-01-31 16:16:55',19,'51YYtq_2B8v4L.jpg','image/jpeg',40211,318,500,NULL,1,306.48400000,4409129,'ML3795',301,301,0,'306.484 F919',1,NULL,0,0,NULL),(1212,'null','978-0743478649','Chronicles, vol. 1','EN','Pocket Books',304,2005,'Dylan, Bob','null','null','FM042','John W. Fail','chronicles-volume-one','2016-12-23 22:01:30','2021-02-03 11:28:43',19,'51lvlwIPMJL.jpg','image/jpeg',36576,316,500,'An unprecedented publishing event - the first audiobook in a series of memoirs by one of the most important and influential musicians and songwriters of our time, read by Sean Penn, one of the leading actors of his generation.&lt;P&gt;In CHRONICLES Volume I, Bob Dylan takes us back to the early 1960s when he arrived in New York to launch his phenomenal career. This is Dylan\'s story in his own words - a personal view of his motivations, frustrations and remarkable creativity.',3,782.42164092,1166006715,'ML420.D98',1,1,0,'782.42164092 D994',1,'undefined',0,0,NULL),(1213,NULL,'978-0618718740','The best American comics 2007','EN','Houghton Mifflin',320,2006,'Ware, Chris, 1967- [Editor; Author of introduction]',NULL,NULL,'GNO001','John W. Fail','the-best-american-comics-2006','2016-12-23 22:01:30','2021-01-31 16:16:57',18,'51E08V4G18L.jpg','image/jpeg',58471,392,500,'&lt;div&gt;The popularity of the graphic genre continues to rage, and The Best American Comics is a diverse, exciting annual selection for fans and newcomers alike. The inaugural volume includes stories culled from graphic novels, pamphlet comics, newspapers, magazines, mini-comics, and the Web.&lt;br&gt;&lt;br&gt;Contributors include Robert Crumb, Chris Ware, Kim Deitch, Jaime Hernandez, Alison Bechdel, Joe Sacco, and Lynda Barry—and unique discoveries such as Justin Hall, Esther Pearl Watson, and Lilli Carré.&lt;/div&gt;',1,741.59730000,154696287,'PN6720',417,418,0,'741.5973 W268',1,NULL,0,0,NULL),(1214,'null','978-1896597300','Drawn & Quarterly : 3','EN','Drawn and Quarterly',176,2000,'Oliveros, Chris','null','null','GNO002','John W. Fail','drawn-and-quarterly-volume-3','2016-12-23 22:01:30','2021-02-03 10:37:55',18,'51KJ1HWB3FL.jpg','image/jpeg',49972,373,500,'D&amp;Q kicks off its tenth anniversary with this massive full-color \"coffee table\" book (a 9\" x 12\" format) featuring 176 pages of all new material. Leading off with extravagant covers and endpapers by Chris Ware, this book features a complete 55 page full color \"Monsieur Jean\" story by \"New Yorker\" artists Dupuy &amp; Berberian, a focus on brilliant Italian cartoonist Franco Matticchio, and an exclusive 14 page \"preview\" of Seth\'s breathtaking sketchbook drawings. RAW cartoonist R. Sikoryak manages to simultaneously deconstruct both Bob Kane\'s Batman and Russian literature in \"Dostoyevsky Comics\", French cartoonist Blutch provides a brief history of boxing in \"Fist To Fist\", and \"new\" 90-year-old cartoonist Harry Mayerovitch\'s takes a whimsical look at the true nature of shadows! Other features include stories by Pentti Otsamo, Jason Little, and new Quebec \"clear-line\" cartoonist Michel Rabagliati. One of the highlights of this edition is a new, extensive archival feature focusing on one of the greatest comic strips of the 20th century, Frank King\'s \"Gasoline Alley\". Thirty full-color Sunday strips from the 1920\'s and 30\'s are reproduced here, the most comprehensive reprint sampling of King\'s work ever, with a rare \"forward\" written by Frank King himself! In honor of this section, Chris Ware\'s covers will be an homage to Gasoline Alley, complete with a new strip drawn in Frank King\'s style!D&amp;Q kicks off its tenth anniversary with this massive full-color \"coffee table\" book (a 9\" x 12\" format) featuring almost 200 pages of all new material. Leading off with extravagant covers and endpapers by Chris Ware, this book features a complete 55 page full color \"Monsieur Jean\" story by \"New Yorker\" artists Dupuy &amp; Berberian, a focus on brilliant Italian cartoonist Franco Matticchio, and an exclusive 14 page \"preview\" of Seth\'s breathtaking sketchbook drawings. RAW cartoonist R. Sikoryak manages to simultaneously deconstruct both Bob Kane\'s Batman and Russian literature in \"Dostoyevsky Comics\", French cartoonist Blutch provides a brief history of boxing in \"Fist To Fist\", and \"new\" 90-year-old cartoonist Harry Mayerovitch\'s takes a whimsical look at the true nature of shadows! Other features include stories by Pentti Otsamo, Jason Little, and new Quebec \"clear-line\" cartoonist Michel Rabagliati. One of the highlights of this edition is a new, extensive archival feature focusing on one of the greatest comic strips of the 20th century, Frank King\'s \"Gasoline Alley\". Thirty full-color Sunday strips from the 1920\'s and 30\'s are reproduced here, the most comprehensive reprint sampling of King\'s work ever, with a rare \"forward\" written by Frank King himself! In honor of this section, Chris Ware\'s covers will be an homage to Gasoline Alley, complete with a new strip drawn in Frank King\'s style! Edited by Chris Oliveros.',1,741.59000000,45425914,'PN6790.C24',43,42,0,'741.59 O48',1,'undefined',1,0,NULL),(1215,'