um side by side with the new generation\'s best cartoonists. Edited by Sammy Harkham, \"Kramer\'s Ergot 6\" features art by 24 contributors including Elvis Studio, Ron Rege Jr., Ben Jones, Jerry Moriarty, Tom Gauld, John Porcellino, Vanessa Davis, Chris Cilla, Shary Boyle, Suiho Tagawa, Fabio Viscogliosi and many others.',1,741.59730000,71430742,'PN6726',105,87,0,'741.5973 H254',1,'undefined',1,0,NULL),(1220,'null','978-1932416084','McSweeney\'s quarterly concern : an assorted sampler of North American comic drawings, strips, and illustrated stories, etc','EN','McSweeneys',263,2004,'Ware, Chris','An Assorted Sampler of North American Comic Drawings, Strips, and Illustrated Stories','null','GNO007','John W. Fail','mcsweeney-s-quarterly-concern-13','2016-12-23 22:01:30','2021-02-03 10:57:44',18,'51y_2BoWQZw8L.jpg','image/jpeg',58700,371,500,'&lt;DIV&gt;This issue is all comics.  It is edited by Chris Ware (author of Jimmy Corrigan: Smartest Kid on Earth), and features so many artists to know and love: Lynda Berry, Mark Beyer, Chester Brown, Jeffrey Brown, Ivan Brunetti, Charles Burns, Malachi B. Cohen, Daniel Clowes, David Collier, Robert Crumb, Kim Deitch, Julie Douchet, Debbie Drechsler, Bud Fisher, Ira Glass, Glen David Gold, Milt Gross, Philip Guston, David Heatley, Gilbert Hernandez, Jaime Hernandez, Goerge Herriman, Ben Katchor, Kaz, Chip Kidd, John McLenan, Joe Matt, Richard McGuire, Mark Newgarden, Archer Prewitt, Gary Panter, Charles Schulz, Joe Sacco, Richard Sala, Tim Samuelson, Seth, Art Spiegelman, Adrian Tomine, Micheal Chabon, Rodolphe Topffer, John Updike, Chris Ware, and Jim Woodring.&lt;/div&gt;',1,741.59730000,951403697,'PN6725',3,3,0,'741.5973 W268 Mcs',1,'undefined',1,0,NULL),(1221,'null','978-1560976974','Mome 3','EN','Fantagraphics',120,2006,'Groth, Gary; Reynolds, Eric','null','null','GNO008','John W. Fail','mome-winter-2006-vol-3','2016-12-23 22:01:30','2021-02-03 10:55:38',18,'61ptq_2BWdBYL.jpg','image/jpeg',94250,384,500,'This third issue of MOME will include the following: John Pham\'s \"221 Sycamore Street,\" presented in a unique three-color process and design that recalls the classic strip Gasoline Alley; Paul Hornschemeier\'s \"Life with Mr. Dangerous,\" a full-color narrative about a young woman who struggles to define a life outside of the example her mother provides, spending far too much time watching a cartoon called \"Mr. Dangerous\"; and David Heatley (Deadpan, McSweeney\'s) tells a story from the fictional town of Overpeck, a city he conceived in a dream. The issue also features new work by Anders Nilsen (in full-color), Jeffrey Brown (of Clumsy, Big Head!, and McSweeney\'s fame), Andrice Arp (Sheherezade), Kurt Wolfgang (Where Hats Go), Gabrielle Bell (Sheherezade), Jonathan Bennett (Esoteric Tales), Sophie Crumb (Belly Button Comix), and Marc Bell (Shrimpy &amp; Paul).',1,741.59730000,987952996,'PN6726',1,1,0,'741.5973 G881',1,'undefined',1,0,NULL),(1222,'null','978-1560978343','Mome : 7,. Spring 2007','EN','Fantagraphics',120,2007,'Groth, Gary; Reynolds, Eric','null','null','GNO009','John W. Fail','mome-spring-2007-vol-7','2016-12-23 22:01:30','2021-02-03 10:55:39',18,'416JDHfjtiL.jpg','image/jpeg',30783,389,500,'&lt;B&gt;The seventh volumes of the acclaimed quarterly comics anthology—a 2006 Harvey and Eisner Award nominee for \"Best Anthology.\"&lt;/B&gt;&lt;BR&gt;&lt;BR&gt;This accessible, reasonably priced, quarterly anthology runs approximately 120 pages per volume and spotlights a cast of a dozen of today\'s most exciting cartoonists. &lt;I&gt;Mome&lt;/I&gt; is quickly earning a reputation as one of the premier literary anthologies on the market, and the only one comprised entirely of comics. Hightlights of the seventh and eighth volumes include: the concluding chapters of Lewis Trondheim\'s \"At Loose Ends,\" an autobiographical diary comic that portrays the acclaimed French cartoonist at a crossroads in his life and work; the &lt;I&gt;Mome&lt;/I&gt; debuts of Eleanor Davis, Tom Kaczynski and T. Edward Bak; contributions from &lt;I&gt;Mome&lt;/I&gt; regulars such as 2006 Eisner Award Most Promising Newcomer nominees Jonathan Bennett and R.Kikuo Johnson, as well as Tim Hensley, David Heatley, Paul Hornschemeier, Anders Nilsen, Sophie Crumb, Kurt Wolfgang, Andrice Arp, Martin Cendreda, Zak Sally and Gabrielle Bell.',1,741.59730000,915548392,'PN6720',1,1,0,'741.5973 G881 Mom',1,'undefined',1,0,NULL),(1223,'null','978-1560978473','Mome','EN','Fantagraphics',120,2007,'Groth, Gary; Reynolds, Eric','null','null','GNO010','John W. Fail','mome-summer-2007-vol-8','2016-12-23 22:01:30','2021-02-03 10:55:39',18,'41d6l2fJUFL.jpg','image/jpeg',32454,389,500,'&lt;B&gt;The eighth volumes of the acclaimed quarterly comics anthology—a 2006 Harvey and Eisner Award nominee for \"Best Anthology.\"&lt;/B&gt;&lt;BR&gt;&lt;BR&gt;This accessible, reasonably priced, quarterly anthology runs approximately 120 pages per volume and spotlights a cast of a dozen of today\'s most exciting cartoonists. &lt;I&gt;Mome&lt;/I&gt; is quickly earning a reputation as one of the premier literary anthologies on the market, and the only one comprised entirely of comics. Hightlights of the seventh and eighth volumes include: the concluding chapters of Lewis Trondheim\'s \"At Loose Ends,\" an autobiographical diary comic that portrays the acclaimed French cartoonist at a crossroads in his life and work; the &lt;I&gt;Mome&lt;/I&gt; debuts of Eleanor Davis, Tom Kaczynski and T. Edward Bak; contributions from &lt;I&gt;Mome&lt;/I&gt; regulars such as 2006 Eisner Award Most Promising Newcomer nominees Jonathan Bennett and R.Kikuo Johnson, as well as Tim Hensley, David Heatley, Paul Hornschemeier, Anders Nilsen, Sophie Crumb, Kurt Wolfgang, Andrice Arp, Martin Cendreda, Zak Sally and Gabrielle Bell.',1,741.59730000,61690562,'PN6720',65,39,0,'741.5973 G881 Mome',1,'undefined',1,0,NULL),(1224,'null','978-1560978725','Mome','EN','Fantagraphics',120,2007,'Groth, Gary','null','null','GNO011','John W. Fail','mome-fall-2007-vol-9','2016-12-23 22:01:30','2021-02-03 10:55:40',18,'51jHeZC6dGL.jpg','image/jpeg',58065,386,500,'&lt;B&gt;A new direction for the popular comics anthology.&lt;/B&gt;&lt;BR&gt;&lt;BR&gt;The acclaimed quarterly comics anthology welcomes several new artists along with returning regulars Jonathan Bennett, Sophie Crumb, Andrice Arp, Paul Hornschemeier and Kurt Wolfgang. Among the newcomers are rising stars Eleanor Davis, T. Edward Bak, Zak Sally, Tom Kaczynski, Joe Kimball and Ray Fenwick. Tim Hensley also returns with more of his brilliant \"Wally Gropius\" strips, as do fan-favorites Al Columbia and R. Kikuo Johnson!&lt;BR&gt;&lt;BR&gt;As a special feature in this volume, &lt;I&gt;MOME&lt;/I&gt; proudly features a 45-page Jim Woodring graphic novella, \"The Lute String.\" This story, previously published only in Japan, features Woodring\'s signature characters—Frank, Pupshaw, and Pushpaw—in a universe-bending saga that finds the trio in a very unexpected world of flying, shrieking demons and bulbous-faced monsters.&lt;I&gt;MOME&lt;/I&gt; is an accessible, reasonably priced quarterly running approximately 120 pages per volume, mostly in color, and spotlighting the most exciting new storytellers in comics along with special surprises. &lt;I&gt;MOME&lt;/I&gt; is quickly earning a reputation as one of the premier literary anthologies on the shelves, and the only one comprised almost entirely of comics.',1,741.59730000,61690562,'PN6720',65,39,0,'741.5973 G881 Mome4',1,'undefined',1,0,NULL),(1225,'null','978-1560979166','Mome : Vol. 11:. Summer 2008','EN','Fantagraphics',120,2008,'Reynolds, Eric, 1971-','null','null','GNO012','John W. Fail','mome-summer-2008-vol-11','2016-12-23 22:01:30','2021-02-03 10:57:28',18,'61TH4FMWZcL.jpg','image/jpeg',66802,389,500,'&lt;B&gt;A literary anthology...with a twist.&lt;/B&gt;&lt;BR&gt;&lt;BR&gt;Since its inception in 2005, &lt;I&gt;MOME&lt;/I&gt; has bridged the gap between the contemporary graphic novel scene and the current cutting-edge literary scene, serving as a perfect sampler of today\'s best young graphic novelists in a quarterly format that sits as handsomely on the newsstand alongside journals like &lt;I&gt;McSweeney\'s&lt;/I&gt; and Paris Review as it does in the graphic novels section.&lt;BR&gt;&lt;BR&gt;Vol. 11 of the popular series welcomes Killoffer, the exciting French cartoonist whose work has previously only been seen in the acclaimed collection, 176 Apparitions of Killoffer, as well as newcomer Jon Vermilyea. Plus, several other surprises from some of the best new talent in comics.&lt;BR&gt;&lt;BR&gt;&lt;I&gt;MOME&lt;/I&gt; is an accessible, reasonably priced quarterly running approximately 120 pages per volume, mostly in color, and spotlighting the most exciting new storytellers in comics along with special surprises. &lt;I&gt;MOME&lt;/I&gt; is quickly earning a reputation as one of the premier literary anthologies on the shelves, and the only one comprised almost entirely of comics.',1,741.59730000,181140098,'PN6720',16,16,0,'741.5973 R463',1,'undefined',1,0,NULL),(1226,'null','978-1560979302','Mome','EN','Fantagraphics',120,2008,'Groth, Gary; Reynolds, Eric','null','null','GNO013','John W. Fail','mome-fall-2008-vol-12','2016-12-23 22:01:30','2021-02-04 17:58:39',18,'51pM2-C3-_2BL.jpg','image/jpeg',54456,389,500,'Since its inception in 2005, MOME has bridged the gap between the contemporary graphic novel scene and the current cutting-edge literary scene, serving as a perfect sampler of today\'s best young graphic novelists in a quarterly format that sits as handsomely on the newsstand alongside journals like McSweeney\'s and Paris Review as it does in the graphic novels section.  Volume 12 welcomes back renowned graphic novelist David B. (Epileptic) for the first time since the fourth volume. MOME also features returning regulars Jonathan Bennett, Sophie Crumb, Andrice Arp, Paul Hornschemeier, Kurt Wolfgang, Eleanor Davis, Zak Sally, Tom Kaczynski, Dash Shaw, Joe Kimball, and Ray Fenwick. Tim Hensley also returns with more of his brilliant \"Wally Gropius\" strips, as do fan favorites Al Columbia and R. Kikuo Johnson! Plus, several other surprises from some of the best new talent in comics.   MOME is an accessible, reasonably priced quarterly running approximately 120 pages per volume, mostly in color, and spotlighting the most exciting new storytellers in comics along with special surprises. MOME is quickly earning a reputation as one of the premier literary anthologies on the shelves, and the only one comprised almost entirely of comics.',3,741.59730000,61690562,'PN6720',65,39,0,'741.5973 G881 Mome45',1,'undefined',1,0,NULL),(1227,'null','978-1606993026','MOME 17','EN','Fantagraphics',120,2010,'Groth, Gary; Reynolds, Eric','null','null','GNO014','John W. Fail','mome-winter-2010-vol-17','2016-12-23 22:01:30','2021-02-04 17:58:36',18,'61LvOq0nQ2L.jpg','image/jpeg',75835,386,500,'&lt;p&gt;&lt;strong&gt;Comicdom’s premier anthology of new lit comics―a 2006, 2007 and 2008 Eisner and Harvey Award nominee for “Best Anthology.”&lt;/strong&gt;&lt;/p&gt; The influence of Fantagraphics’ flagship anthology of new comic art and storytelling continues to grow with annual award nominations, a widely-acknowledged banner 2008 that found &lt;em&gt;MOME&lt;/em&gt; on many year-end critics’ lists, increasing academic and library interest, several gallery exhibitions mounted nationwide, and an increasingly potent well of top-notch, known and unknown talent making every issue a surprising, dense and delightful read. With this season, the quarterly journal of comics will have brought over 2,000 pages of new comics to the world since its inception in 2005.&lt;br /&gt;&lt;br /&gt; Upcoming contributors of short stories to &lt;em&gt;MOME&lt;/em&gt; include: Lilli Carré, Laura Park, Olivier Schrauwen, Tom Kaczynski, Dash Shaw, Ray Fenwick, Émile Bravo, Andrice Arp, Al Columbia, Eleanor Davis, Nathan Neal, Conor O’Keefe, Jon Vermilyea, Jonathan Bennett, Robert Goodin, Sara Edward-Corbett, Derek Van Gieson, and many more.&lt;br /&gt;&lt;br /&gt; 2009 saw the end of three serials for &lt;em&gt;MOME&lt;/em&gt;―legendary cartoonist Gilbert Shelton’s serialized graphic novel, “Last Gig in Shngrlig,” Paul Hornschemeier’s “Life with Mr. Dangerous,” and Tim Hensley’s “Wally Gropius”― and the launch of two more.&lt;br /&gt;&lt;br /&gt; T. Edward Bak’s biography of German naturalist Georg Wilhelm Steller―who traveled with Vitus Bering on what is generally known as the Second Kamchatka Expedition in 1741―is certain to eventually become one of the most acclaimed graphic novels of the decade. In the hands of Bak, Steller’s narrative story transcends natural history, science and biography and becomes a riveting, beautifully illustrated drama.&lt;br /&gt;&lt;br /&gt; Ted Stearn’s cult favorite characters have struck a chord with comic lovers over the years (Matt Groening declares them “why I love comics”) in two previous graphic novels, &lt;em&gt;Fuzz &amp; Pluck&lt;/em&gt; and &lt;em&gt;Fuzz &amp; Pluck: Splitsville&lt;/em&gt;. Stearn now graces &lt;em&gt;MOME&lt;/em&gt; with a new, serialized adventure in which the hapless Fuzz &amp; Pluck discover a literal money tree. The ensuing entanglement of intrigue and desire is a surrealist, picaresque &lt;em&gt;tour de force&lt;/em&gt; of comics storytelling with strong thematical ties to America’s housing and financial meltdown, and the dreams that led to it. There’s also a pirate, and we all know that &lt;em&gt;pirates sell&lt;/em&gt;. Color comics throughout',3,741.59730000,61690562,'PN6720',65,39,0,'741.5973 G881 Mome1',1,'undefined',1,0,NULL),(1228,NULL,'978-0394755519','Read yourself Raw','EN','Pantheon',89,1987,'Spiegelman, Art',NULL,NULL,'GNO015','John W. Fail','read-yourself-raw','2016-12-23 22:01:30','2021-01-31 16:17:03',18,'410-GA1uj0L.jpg','image/jpeg',29324,181,249,'Selected pages from the rare first three issues of \"Raw\" magazine.',1,741.59730000,15791045,'PN6720',163,156,0,'741.5973 S755',1,NULL,0,0,NULL),(1229,'null','978-0140122817','RAW 2 : required reading for the post-literate','EN','Penguin',190,1990,'Spiegelman, Art','null','null','GNO016','John W. Fail','raw-2-v-2','2016-12-23 22:01:30','2021-02-03 10:57:39',18,'61ajUU4ejoL.jpg','image/jpeg',72009,338,500,'Raw returns with an all-new collection of avante-garde American, European, and Japanese commix--and a new chapter of Maus. Black-and-white and full-color illustrations.',1,741.59730000,24792666,'N7433.4.S634',16,16,0,'741.5973 S755 Raw2',1,'undefined',1,0,NULL),(1230,'null','978-0140122824','Raw : high culture for lowbrows','EN','Penguin',228,1991,'Spiegelman, Art','null','null','GNO017','John W. Fail','raw-3-v-2-n-3','2016-12-23 22:01:30','2021-02-03 10:57:35',18,'61wYVzECC6L.jpg','image/jpeg',97286,358,500,'The highly acclaimed Raw returns with a fresh collection of state-of-the-art graphic storytelling that is satirical, celebral, and wild. Highlights of this issue include a legendary 32-page Krazy Kat narrative by George Harriman, a cover by R. Crumb, a collaboration between Jose Munoz and Carlos Sampayo, an eight-page story by Lynda Barry, and works by Jacques Tardi, Alan Moore, and many others.',1,741.59730000,24759663,'PN6720',30,30,0,'741.5973 S755 Raw',1,'undefined',1,0,NULL),(1231,'null','null','SPX2002','EN','Comic Book Legal Defense Fund',0,2002,'SPX','null','null','GNO018','John W. Fail','spx2002','2016-12-23 22:01:30','2021-02-04 17:16:45',18,NULL,NULL,NULL,NULL,NULL,'null',1,741.59730000,0,NULL,NULL,NULL,1,'741.5973 C733',1,'undefined',1,1,NULL),(1232,NULL,'978-0972183161','SPX 2002 : [biographical comics issue]','EN','Comic Book Legal Defense Fund',186,2004,NULL,'A Sequential Arts War Journal ',NULL,'GNO019','John W. Fail','spx-2004','2016-12-23 22:01:30','2021-01-31 16:17:04',18,'61Afn96oXXL.jpg','image/jpeg',81084,368,500,'The Eisner Award-winning anthology returns! This year\'s SPX anthology delves into the theme of \"War.\" From firsthand memoirs to social commentary, the dozens of artists who contributed to this year\'s anthology poured their souls into the thought-provoking, sometimes heart-rending stories. Steve Lieber provides the highly-detailed cover; a homage to comics history. Pick up a copy to help support the CBLDF today and discover the great cartoonists of tomorrow.',1,741.59730000,52369344,'PN6705.U5',1,8,0,'741.5973 Sp',1,NULL,0,0,NULL),(1233,'null','null','Unicorn Mountain, Volume 2 ','EN','Champ Printing Co.',216,2006,'Gettman, Curt','null','null','GNO020','John W. Fail','unicorn-mountain-volume-2','2016-12-23 22:01:30','2021-02-04 17:41:47',18,NULL,NULL,NULL,NULL,NULL,'null',1,741.59730000,0,NULL,NULL,NULL,1,'741.5973 G394',1,'undefined',1,0,NULL),(1234,'null','978-0375714689','Epileptic','EN','Panetheon',368,2006,'Bernard, David','null','null','GNO021','John W. Fail','epileptic','2016-12-23 22:01:30','2021-02-03 12:57:02',18,'613NWD9K5XL.jpg','image/jpeg',70618,372,500,'Hailed by The Comics Journal as one of Europe’s most important and innovative comics artists, David B. has created a masterpiece in Epileptic, his stunning and emotionally resonant autobiography about growing up with an epileptic brother. Epileptic gathers together and makes available in English for the first time all six volumes of the internationally acclaimed graphic work.&lt;br&gt;&lt;br&gt;David B. was born Pierre-François Beauchard in a small town near Orléans, France. He spent an idyllic early childhood playing with the neighborhood kids and, along with his older brother, Jean-Christophe, ganging up on his little sister, Florence. But their lives changed abruptly when Jean-Christophe was struck with epilepsy at age eleven. In search of a cure, their parents dragged the family to acupuncturists and magnetic therapists, to mediums and macrobiotic communes. But every new cure ended in disappointment as Jean-Christophe, after brief periods of remission, would only get worse.&lt;br&gt;&lt;br&gt;Angry at his brother for abandoning him and at all the quacks who offered them false hope, Pierre-François learned to cope by drawing fantastically elaborate battle scenes, creating images that provide a fascinating window into his interior life. An honest and horrifying portrait of the disease and of the pain and fear it sowed in the family, Epileptic is also a moving depiction of one family’s intricate history. Through flashbacks, we are introduced to the stories of Pierre-François’s grandparents and we relive his grandfathers’ experiences in both World Wars. We follow Pierre-François through his childhood, adolescence, and adulthood, all the while charting his complicated relationship with his brother and Jean-Christophe”s losing battle with epilepsy. Illustrated with beautiful and striking black-and-white images, Epileptic is as astonishing, intimate, and heartbreaking as the best literary memoir.&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;i&gt;From the Hardcover edition.&lt;/i&gt;',1,741.59440000,1110958754,'PN6747',17,17,0,'741.5944 B519',1,'undefined',0,0,NULL),(1235,'null','978-1897299647','Picture This','EN','Drawn and Quarterly',204,2010,'Barry, Lynda, 1956-','The Near-sighted Monkey Book','null','GNO022','John W. Fail','picture-this','2016-12-23 22:01:30','2021-02-03 10:53:14',18,'61zAPeyHwJL.jpg','image/jpeg',82960,385,500,'Picture This: The Near-sighted Monkey Book by Lynda Barry',1,741.59730000,489272886,'PN6727.B36',25,25,0,'741.5973 B281',1,'undefined',0,0,NULL),(1236,NULL,'978-0307379139','X\'ed out','EN','Pantheon',56,2010,'Burns, Charles, 1955-',NULL,NULL,'GNO023','John W. Fail','x-ed-out','2016-12-23 22:01:30','2021-01-31 16:17:05',18,'61a81tS56IL.jpg','image/jpeg',68247,382,500,'&lt;b&gt;From the creator of &lt;i&gt;Black Hole&lt;/i&gt;: the first volume of an epic masterpiece of graphic fiction in brilliant color. &lt;/b&gt;&lt;br&gt;&lt;b&gt; &lt;/b&gt;&lt;br&gt;Doug is having a strange night. A weird buzzing noise on the other side of the wall has woken him up, and there, across the room, next to a huge hole torn out of the bricks, sits his beloved cat, Inky. Who died years ago. But who’s nonetheless slinking out through the hole, beckoning Doug to follow. &lt;br&gt; &lt;br&gt;What’s going on? &lt;br&gt; &lt;br&gt;To say any more would spoil the freaky, Burnsian fun, especially because &lt;i&gt;X’ed Out&lt;/i&gt;, unlike &lt;i&gt;Black Hole&lt;/i&gt;, has not been previously serialized, and every unnervingly meticulous panel will be more tantalizing than the last . . . &lt;br&gt; &lt;br&gt;Drawing inspiration from such diverse influences as Hergé and William Burroughs, Charles Burns has given us a dazzling spectral fever-dream—and a comic-book masterpiece.',1,741.59730000,503041989,'PN6727.B87',692,688,0,'741.5973 B967',1,NULL,0,0,NULL),(1237,'null','978-0979415340','Powr Mastrs : 2','EN ','PictureBox',120,2008,'C. F. (Chris Forgues)','null','null','GNO024','John W. Fail','powr-masters-2','2016-12-23 22:01:30','2021-02-03 10:41:35',18,'418r9b_2BUvZL.jpg','image/jpeg',24837,349,500,'&lt;I&gt;Powr Mastrs Vol. 2&lt;/I&gt; follows hot on the heels of this elusive artist’s first volume-- in a series of six graphic novels--which was one of last year’s most anticipated debuts. C.F. comes out of the mythic Providence, Rhode Island art and noise scene--his musical alias is Kites. In a recent profile &lt;I&gt;The Comics Reporter&lt;/I&gt; observes, “Contrasting sharply with many of his flashier contemporaries, [C.F.’s] primary skill lies in overlooked nuances of comics storytelling, in particular pacing.” His distinctive voice and intricate rendering skills have attracted attention from the groundbreaking comics anthology, &lt;I&gt;Kramers Ergot&lt;/I&gt;--he was included in the fourth issue, and featured on the cover of the fifth. Here, C.F.’s epic fantasy--an allegorical tale where power, physical identity and even gender are always in flux--picks up steam: Buell Kazee sneaks down into the cellar of the plex knowe crypt and conjures trouble; Tetradyne Cola takes a nap and dreams of Monica Glass and the lemon sparklers of star studio; members of the Marker clan compare notes on their magical crimes and the witches of Lace Temblor conspire over transmutation night.',1,741.59730000,317560725,'PN6728.P69',13,13,0,'741.5973 C999',1,'undefined',0,0,NULL),(1238,'null','978-1935233053','Driven by lemons','EN','AdHouse',104,2009,'Cotter, Joshua W.','null','null','GNO025','John W. Fail','driven-by-lemons','2016-12-23 22:01:30','2021-02-03 10:40:50',18,'515QPofdoJL.jpg','image/jpeg',65457,302,500,'“Up the stream of consciousness without a paddle.”&lt;br&gt; &lt;br&gt; From the creator who brought you Skyscrapers of the Midwest comes a sketchbook replica of recent multimedia explorations in intuitive narrative.  Won’t you be his neighbor?&lt;br&gt;',1,741.59730000,422755400,'PN6727.C678',59,59,0,'741.5973 C847',1,'undefined',0,0,NULL),(1239,NULL,'978-0224094207','Wrong place','EN','Jonathan Cape',184,2011,'Evens, Brecht, 1986-',NULL,NULL,'GNO026','John W. Fail','the-wrong-place','2016-12-23 22:01:30','2021-02-03 10:36:07',18,'61t-RUmU4ML.jpg','image/jpeg',79885,401,500,'Rendered in vivid watercolour where parquet floors and patterned dresses morph together, The Wrong Place revolves around oft-absent Robbie, a charismatic lothario of mysterious celebrity who has the run of a city as chaotic as it is resplendent. Robbie\'s sexual energy captivates the attention of men and women alike; his literal and figurative brightness is a startling foil to the dreariness of his childhood friend, Francis. With a hand as sensitive as it is exuberant, Angouleme-winner Brecht Evens\'s first English graphic novel captures the strange chemistry of social interaction. The Wrong Place contrasts life as it is, angst-ridden and awkward, with life as it can be: spontaneous, uninhibited, and free.',3,741.50000000,428026646,'PN6714',153,117,0,'741.5 E93',1,NULL,0,0,NULL),(1240,NULL,'978-1560979104','Hall of best knowledge','EN','Fantagraphics',168,2008,'Fenwick, Ray',NULL,NULL,'GNO027','John W. Fail','hall-of-best-knowledge','2016-12-23 22:01:30','2021-01-31 16:17:05',18,'61tJFoLjw0L.jpg','image/jpeg',88679,500,500,'&lt;p&gt;&lt;strong&gt;A wildly original―and hilarious―debut.&lt;br /&gt;&lt;/strong&gt;&lt;/p&gt; Ray Fenwick has pioneered his own medium of storytelling, one best described as \"typographical comics.\" &lt;em&gt;Hall of Best Knowledge&lt;/em&gt; is presented as a handsome, personal journal written by an unnamed voice, referred to only as \"The Author.\" Little is known about him; he makes occasional, derogatory references to a twin brother and younger sibling, but reveals little else. He clearly fashions himself a genius, writing with a faux-aristocratic air, and it is presumably his belief in his own genius that leads him to want to share his knowledge with the world. Each page features information such as \"It hardly needs mentioning that riding a pony is no intellectual triumph.... If riding a pony is so fantastic, why have I never read of any renowned pony-riding genius? It is because such a person does not exist, making it a foolish waste of time unworthy of attention.\" These pearls of wisdom are lettered in an elegant, almost obsessive fashion, entirely hand-crafted and bedecked with Ionic columns and fleurs-de-lis.&lt;br /&gt;&lt;br /&gt; It becomes obvious to the reader early on that all is not as it seems; only at the end does the picture become completely clear. The ensuing journey is a riotous tour through the narrator\'s ego and id, and the humor builds accordingly as he is revealed to be not nearly as smart―or sophisticated―as he thinks.&lt;br /&gt;&lt;br /&gt;&lt;em&gt;Hall of Best Knowledge&lt;/em&gt; is part graphic novel, part art object, part satire, part puzzle. The slow unfolding of the author and his story builds humor with each page, creating a peculiar examination of the idea of genius and the problems that arise in the search and transmission of knowledge.&lt;br /&gt;&lt;br /&gt;&lt;em&gt;HOBK&lt;/em&gt; will be an elegantly designed and packaged book, presented as a found journal, with rounded fore edges, a belly band, and other production/design touches to further solidify and give form to the concept of the book.&lt;br /&gt;',1,741.59710000,181140079,'PN6733.F46',201,201,0,'741.5971 F343',1,NULL,0,0,NULL),(1241,'null','978-1560977186','Monologues for the coming plague','EN','Fantagraphics',260,2006,'Nilsen, Anders, 1973-','null','null','GNO028','John W. Fail','monologues-for-the-coming-plague','2016-12-23 22:01:30','2021-02-03 10:39:12',18,'41VxzYVoPyL.jpg','image/jpeg',18628,316,500,'&lt;p&gt;&lt;strong&gt;An original graphic novel from one of the most exciting young voices in comics.&lt;/strong&gt;&lt;/p&gt;&lt;em&gt;Monologues for the Coming Plague&lt;/em&gt; is the longest and most ambitious work to date by Anders Nilsen, the talented young cartoonist who has appeared in a variety of prominent comics anthologies over the past few years as well as in his own self-published comic, &lt;em&gt;Big Questions&lt;/em&gt;, and has emerged as one of the most critically acclaimed cartoonists of his generation.In 2003 Nilsen went on a signing tour with several other artists for the book &lt;em&gt;Kramer\'s Ergot 4&lt;/em&gt;. The enthusiasm of his fellow artists for drawing in their sketchbooks proved infectious, and he decided to employ the same spontaneous method for a finished book.\"I\'ve always worked in sketchbooks,\" said Nilsen, but I had lost the habit and my way of working had become very slow and deliberate. While waiting in the airport in New York, after the tour, I found myself absorbed in a series of one panel gags about a woman feeding a bird, brainstorming captions and watching ideas follow.\"Taking a cue from the school of Automatic Writing, an aesthetic mode championed by Andre Breton at the beginning of the 19th century that became the foundation of the Surrealist Movement, Nilsen began work on &lt;em&gt;Monologues for the Coming Plague&lt;/em&gt;. The process is born out of a stream of consciousness followed by limited editing and rearranging.The book ranges playfully from riffs on the gag cartoon to paranoid soliloquies of a surrealistic apocalypse, with references to contemporary politics, pop culture, and religion, plays on language, and sequential abstractions. Stories intertwine, branch off, dead end and double back. These are experimental, absurdist art comics, but the book is a page-turner, and some of it is laugh-out-loud funny. Reading it is not so much like reading comics as it is watching the artist make connections between ideas, find patterns, and set down the story as it happens. It\'s a &lt;em&gt;tour de force&lt;/em&gt;, beautifully and uniquely packaged, in black and white and color, by one of the most fascinating new cartoonists of the decade.',1,741.59730000,62478791,'PN6727.N55',80,80,0,'741.5973 N695',1,'undefined',0,0,NULL),(1242,NULL,'978-1896597973','The awake field','EN','Drawn and Quarterly',48,2006,'Regé, Ron',NULL,NULL,'GNO029','John W. Fail','the-awake-field','2016-12-23 22:01:30','2021-01-31 16:17:06',18,'61CPK05C7DL.jpg','image/jpeg',94652,499,500,'&lt;DIV&gt;&lt;B&gt;“Ron Regé is one of a handful of cartoonists in the history of the medium not only to reinvent comics to suit his own idiosyncratic impulses and inspirations as an artist, but also to imbue it with his own peculiar, ever-changing emotional energy. To me, he is unquestionably one of ‘the greats.’” —Chris Ware&lt;/B&gt;&lt;BR&gt;&lt;/DIV&gt;&lt;DIV&gt;&lt;I&gt;&lt;/I&gt; &lt;/DIV&gt;&lt;DIV&gt;&lt;I&gt;The Awake Field&lt;/I&gt; is a collection of Regé’s reflections of small-town life during a recent two-year sabbatical in a coastal community in southern Rhode Island. Short stories collide and swirl together, leaving visions of mysterious creatures floating through lush landscapes, pantomimed fairy tales, hypnotic dances, Bible quotations, and peace comics—all in Regé’s idiosyncratic abstract poetic cartoon language.&lt;/DIV&gt;',1,741.59730000,61258779,'PN6727.R44',46,45,0,'741.5973 R333',1,NULL,0,0,NULL),(1243,'null','978-0976525516','Recidivist','EN','La Mano 21',120,2005,'Sally, Zak','null','null','GNO030','John W. Fail','the-recidivist','2016-12-23 22:01:30','2021-02-04 17:45:11',18,'5129P5SJN5L.jpg','image/jpeg',49218,489,500,'This is the third and final issue of Zak Sally\'s comic book series Recidivist. 5 years in the making, the book contains 6 intersecting stories about loss, secrets, eating things that should not be eaten, car keys, sadness, pills, love, and people whose heads turn into monkeys. Nominated for 2 \"Eisner\" awards.',1,741.59730000,62395143,'PS3619.A44',NULL,22,0,'741.5973 S168',1,'undefined',0,0,NULL),(1244,NULL,'978-1606994467','The man who grew his beard','EN','Fantagraphics',112,2011,'Schrauwen, Olivier',NULL,NULL,'GNO031','John W. Fail','the-man-who-grew-his-beard','2016-12-23 22:01:30','2021-02-03 10:51:55',18,'61MEnP_2BRyFL.jpg','image/jpeg',71435,414,500,'&lt;p&gt;&lt;strong&gt;The first U.S. collection from a budding international superstar.&lt;/strong&gt;&lt;/p&gt;&lt;em&gt;The Man Who Grew His Beard&lt;/em&gt; is Belgian cartoonist Olivier Schrauwen’s first American book, having staked a reputation over the last decade as one of Europe’s most talented storytellers. It collects seven short stories, each a headspinning display of craft and storytelling that mixes early twentieth-century comics influences like Winsor McCay with a thoroughly contemporary voice that provokes and entertains with subversively surreal humor and subtle criticism of twentieth-century tropes and images. The stories themselves, though each stands alone, are intertwined thematically, offering peeks into the minds of semi-autistic, achingly isolated men and their feverish inner worlds and how they interact and contrast with their real environment. Though Schrauwen taps ‘surrealist’ or ‘absurdist’ impulses in his work, you will not read a more careful and precise collection of stories this year.&lt;br /&gt;&lt;br /&gt; The stories included are: “Hair Types,” a hilarious piece that on the surface explores the pseudoscientific classification of personality as a function of hair but becomes something more akin to a fable about self-fulfilling prophecy; “Chromo Congo,” a silent story about two men on safari who meet a corpulent and obnoxious hunter; as well as “The Task,” “The Man Who Grew His Beard,” “The Lock,” “The Cave,” and “The Imaginist.”&lt;br /&gt;&lt;br /&gt; Though this is Schrauwen’s first U.S. edition of comics, he has wowed American fans with his appearances in the anthology &lt;em&gt;MOME&lt;/em&gt; over the last few years, and one of his &lt;em&gt;MOME&lt;/em&gt; stories was one of three comics selected for the 2009 edition of Dave Eggers’ influential &lt;em&gt;Best American Nonrequired Reading&lt;/em&gt;. 112 pages of full-color comics',3,741.59493000,668194130,'PN6790.B43',116,118,0,'741.59493 S377',1,NULL,0,0,NULL),(1245,NULL,'978-1560979159','Powers : Book four','EN','Fantagraphics',720,2008,'Bendis, Brian Michael',NULL,NULL,'GNO032','John W. Fail','bottomless-belly-button','2016-12-23 22:01:30','2021-02-03 10:53:44',18,'418PKQ1CSyL.jpg','image/jpeg',32074,351,500,'&lt;p&gt;&lt;strong&gt;A major new graphic novel from a major new talent.&lt;br /&gt;&lt;/strong&gt;&lt;/p&gt;&lt;em&gt;Bottomless Belly Button&lt;/em&gt; is a comedy-drama that follows the dysfunctional adventures of the Loony Family.&lt;br /&gt;&lt;br /&gt; After 40-some years of marriage, Maggie and David Loony shock their children with their announcement of a planned divorce. But the reason for splitting isn\'t itself shocking: they’re \"just not in love any more.\" The announcement sparks a week long Loony family reunion at Maggie and David\'s creepy (and possibly haunted) beach house.&lt;br /&gt;&lt;br /&gt; The eldest child, Dennis, struggles with his parents\' decision while facing difficulties of his own in his recent marriage. Believing that his parents are hiding the true reasons behind their estrangement, Dennis embarks on a quest to discover the truth and searches through clues, trap doors, and secret tunnels in attempt to find an answer. Claire, the middle child, is a single mother whose 16-year-old daughter, Jill, is apathetic to the divorce but confounded by Claire and troubled by her own \"mannish\" appearance. The youngest child, Peter, is a hack filmmaker suffering from paralyzing insecurities who establishes an unorthodox romance with a mysterious day care counselor at the beach.&lt;br /&gt;&lt;br /&gt; In a six-day period rich with atmospheric sequences, these characters stumble blindly around one another, often ignoring their surroundings and consumed by their own daily conflicts. Visually, Shaw employs a leisurely storytelling pace that allows room for exploring the interconnecting relationships among the characters and plays to his strength as a cartoonist ― small gestural details and nuanced expressions that bring the characters to vivid and intimate life. If the controversial R.D. Laing wrote an episode of &lt;em&gt;The Simpsons&lt;/em&gt;, it might read something like &lt;em&gt;Bottomless Belly Button&lt;/em&gt;.&lt;br /&gt;&lt;br /&gt; Official Selection, 2009 Festival International de la Bande Dessinée de Angouleme; named one of Publishers Weekly\'s 2008 \"Best Books of the Year: Comics;\" named one of Booklist\'s \"Top 10 Graphic Novels\" of the Year.\"',3,741.59730000,1077236828,'PN6728.P66',25,17,0,'741.5973 B458',1,NULL,0,0,NULL),(1246,NULL,'978-1606998038','Doctors','EN','Fantagraphics',96,2014,'Shaw, Dash',NULL,NULL,'GNO033','John W. Fail','doctors','2016-12-23 22:01:30','2021-01-31 16:17:07',18,'517fkzZUgNL.jpg','image/jpeg',37982,375,500,'&lt;p&gt;&lt;strong&gt;Doctors enter your afterlife to bring you back from the dead.&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;This new graphic novel from acclaimed cartoonist Dash Shaw (&lt;em&gt;Bottomless Belly Button&lt;/em&gt;) is his most taut book to date. Dr. Cho is the creator of the Charon, a device that allows his staff to take the form of a memory in a dead patients\' consciousnesses, and bring them back to life, with one catch: the experience is traumatic and the process kills them again soon thereafter. But for some bereaved, the opportunity is priceless. So when Bell is killed in a random accident, her daughter hires Dr. Cho’s team to bring her back. But what if Bell didn’t want to come back? The dying unconsciously create the afterlife they want, or feel they deserve, in their minds before everything fades to black. Isn’t that better than the reality, and no less meaningful than life itself? Can unconsciousness coexist with consciousness? &lt;em&gt;Doctors&lt;/em&gt; is part science-fiction thriller, part family drama, part morality play for the 21st century, and quite possibly Shaw’s best book to date.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;2015 Ignatz Award Nominee: Outstanding Story&lt;/strong&gt;&lt;/p&gt; Full color',1,741.59730000,870098375,'PN6727.S4946',217,211,0,'741.5973 S535',1,NULL,0,0,NULL),(1247,NULL,'978-8493340995','The walking man','EN','Fanfare/Ponent Mon',160,2006,'Taniguchi, Jirō',NULL,NULL,'GNO034','John W. Fail','the-walking-man','2016-12-23 22:01:30','2021-01-31 16:17:07',18,'61BQeagsqzL.jpg','image/jpeg',92966,346,500,'Who takes the time these days to climb a tree in bare feet? To stop and observe birds? Play in puddles after a storm? Go down to the sea to return a shell? The Walking Man does as he strolls at random through urban Japan - often silent, usually alone - with his vivid dreams that let time stand still.',1,741.59520000,57510734,'PN6790.J33',110,84,0,'741.5952 T161 Wal',1,NULL,0,0,NULL),(1248,NULL,'978-8496427334','The ice wanderer','EN','Ponent Mon',240,2010,'Taniguchi, Jirō',NULL,NULL,'GNO035','John W. Fail','the-ice-wanderer-and-other-stories','2016-12-23 22:01:30','2021-02-03 10:58:56',18,'51ohk5TYtpL.jpg','image/jpeg',51124,348,500,'EPIC ADVENTURES FROM THE FROZEN WASTES TO THE DEPTHS OF THE OCEAN. Lost in the Great North, two men are saved by the appearance of an old hunter who divulges a strange legend to them...surrounded by hungry wolves and fighting for their survival, two explorers head for Alaska to bury their companion...1920\'s Japan and a man sets out to find the bear that killed his son...a marine biologist begins a quest to find the mythical graveyard of whales. Through tales filled with respect for animal life this splendid collection - which lies at the crossroads of poetry and adventure - shows master story-imager Taniguchi at his award winning best.',1,741.59520000,317816065,'PN6790.J33',19,19,0,'741.5952 T161 Ice',1,NULL,0,0,NULL),(1249,'null','978-0980003918','Souvlaki circus','null','Buenaventura Press',80,2008,'Vähämäki, Amanda, 1981-','null','null','GNO036','John W. Fail','souvlaki-circus','2016-12-23 22:01:30','2021-02-03 10:46:28',18,'51xs9D0vC_2BL.jpg','image/jpeg',40467,414,500,'Finnish artist Amanda Vähämäki and Italian artist Michelangelo Setola have created the enigmatic \'Souvlaki Circus\', a series of pencil drawings that weave a patchwork narrative of metaphoric truths about humans and nature.',1,741.59489700,182731168,'PN6767.S43',7,7,0,'741.594897 V597',1,'undefined',0,0,NULL),(1250,'null','null','Už Jsme Doma','EN','null',0,1996,'Už Jsme Doma','null','null','GNO037','John W. Fail','uz-jsme-doma','2016-12-23 22:01:30','2021-02-04 17:18:16',18,NULL,NULL,NULL,NULL,NULL,'null',1,780.94300000,0,NULL,NULL,NULL,1,'780.943 U33',1,'undefined',0,0,NULL),(1251,'null','null','Samandal: picture stories from here to there 11','HE/EN','Beyrouth',0,2008,'Akel, Rachel','null','null','GNO039','null','samandal-picture-stories-from-here-to-there-11','2016-12-23 22:01:30','2021-02-04 17:32:06',18,NULL,NULL,NULL,NULL,NULL,'null',1,741.50000000,893732215,NULL,NULL,NULL,1,'741.5 A314',1,'undefined',1,0,NULL),(1252,'null','null','Canicola #12: germania','IT/EN','Canicola'