ring to conceptualize it as what she calls the Chthulucene, as it more aptly and fully describes our epoch as one in which the human and nonhuman are inextricably linked in tentacular practices. The Chthulucene, Haraway explains, [...]',3,599.95000000,934194942,'QL85',755,757,0,'599.95 H254',1,NULL,0,0,NULL),(1493,'0822362333','9780822362333','Geontologies : a requiem to late liberalism','EN','Duke University Press Books',232,2016,'Povinelli, Elizabeth A.','','','TH128','','geontologies-a-requiem-to-late-liberalism','2017-03-07 09:42:08','2021-01-31 16:17:26',14,'9p01a4aad5c5f511d327633dc6c99337f9.jpg','image/jpeg',43892,300,450,'In Geontologies Elizabeth A. Povinelli continues her project of mapping the current conditions of late liberalism by offering a bold retheorization of power. Finding Foucauldian biopolitics unable to adequately reveal contemporary mechanisms of power and governance, Povinelli describes a mode of power she calls geontopower, which operates through the regulation of the distinction between Life and Nonlife and the figures of the Desert, the Animist, and the Virus. Geontologies examines this [...]',1,305.80010000,936344666,'GN345',432,439,0,'305.8001 P739',1,NULL,0,0,NULL),(1494,'0415576865 ','9780415576864','The Life of Lines','EN','Routledge',184,2015,'Ingold, Tim','','','TH129','','the-life-of-lines','2017-03-07 09:44:28','2021-02-08 13:26:41',14,'tim.jpg','image/jpeg',91134,333,499,'To live, every being must put out a line, and in life these lines tangle with one another. This book is a study of the life of lines. Following on from Tim Ingold\'s groundbreaking work Lines: A Brief History, it offers a wholly original series of meditations on life, ground, weather, walking, imagination and what it means to be human. In the first part, Ingold argues that a world of life is woven from knots, and not built from blocks as commonly thought. He shows how the principle of knotting [...]',1,301.00000000,43417191,'DG283',184,189,0,'937.07092 B274',1,