,'The twenty-first century has been marked by our almost boundless ability to imagine things at a larger, or smaller, size; at a faster speed; capable of solving complex problems using less energy. Our imagination on the topic of scale has driven technological progress, but it has also long inspired the creation of art. With the onset of industrialization in the nineteenth century, experimentation with scale across almost all disciplines accelerated to an entirely different dimension. The result [...]',1,701.80000000,979568519,'N7431',44,58,0,'701.8 F635',1,NULL,0,0,NULL),(1628,'159253905X   ','9781592539055','Map art lab : 52 exciting art explorations in mapmaking, imagination, and travel','EN','Quarry Books',144,2014,'Berry, Jill K. | McNeilly, Linden [Author]','','','LPST064','','map-art-lab-52-exciting-art-explorations-in-mapmaking-imagination-and-travel-lab-series','2017-08-22 14:50:37','2021-01-31 16:17:35',16,'61fQ1ynfRNL._SX258_BO1_204_203_200_.jpg','image/jpeg',37399,260,260,'Travel through the exciting world of cartography with Map Lab. This fun and creative book features 52 map-related activities set into weekly exercises, beginning with legends and lines, moving through types and styles, and then creating personalized maps that allow you to journey to new worlds. Authors Jill K. Berry and Linden McNeilly guide readers through useful concepts while exploring colorful, eye-catching graphics. The labs can be used as singular projects or to build up to a year of hands [...]',1,526.00000000,859192215,'N8222.M375',1069,1069,0,'526 B534',1,NULL,0,0,NULL),(1629,'','','° N “52 degrees and above”','EN','Council of the Baltic Sea States',271,2017,'Olsson, Anthony Hay; Kulm, Mirjam','','','LOC073','','n-52-degrees-and-above','2017-08-22 14:57:28','2021-02-09 13:11:15',1,'box.1.1.-480x328.jpg','image/jpeg',26579,480,328,'',1,947.90000000,0,NULL,NULL,NULL,1,'947.9 O42',1,'undefined',0,0,NULL),(1630,'0691176086 ','9780691176086','Pagans and philosophers : the problem of paganism from Augustine to Leibniz','EN','Princeton University Press',328,2017,'Marenbon, John','','','TH142','','pagans-and-philosophers','2017-08-22 15:36:11','2021-01-31 17:01:22',14,'index.png','image/png',6206,183,276,'From the turn of the fifth century to the beginning of the eighteenth, Christian writers were fascinated and troubled by the \"Problem of Paganism,\" which this book identifies and examines for the first time. How could the wisdom and virtue of the great thinkers of antiquity be reconciled with the fact that they were pagans and, many thought, damned? Related questions were raised by encounters with contemporary pagans in northern Europe, Mongolia, and, later, America and China. Pagans and [...]',3,261.22000000,890309903,'BL432',805,829,0,'261.22 M324',1,NULL,0,0,NULL),(1631,'5905110727  ','9785905110726','Erik bulatov','EN','Garage Museum of Contemporary Art',86,2016,'Bulatov, Ėrik, 1933-','','','MON078','','erik-bulatov-new-work','2017-08-22 16:05:08','2021-02-01 22:33:29',6,'jkh.jpg','image/jpeg',12216,224,224,'Since the beginning of his career in the 1950s, Russian artist Erik Bulatov (born 1933) has investigated the potential of painting as social commentary. A founder of the school of Moscow Conceptualism alongside Ilya Kabakov, Collective Actions and Komar & Melamid, among others, Bulatov developed what has been described as conceptual painting, using text and image to explore spatial preoccupations that mirror his understanding of social relations. This volume follows the making of the artist [...]',1,709.20000000,947075600,'N6490',9,9,0,'709.2 B933',1,'undefined',0,0,NULL),(1632,'9081830252','9789081830256','Experimentality','EN','Metorpolis M Books',48,2016,'Slager, Henk [Editor] | Pickering, Andrew, 1948- [Contributor; Author; Other] | Seppä, Anita [Writer of added text; Author]','','','EDU046, EDU052','','experimentality','2017-08-22 16:07:18','2021-02-06 09:33:42',9,NULL,NULL,NULL,NULL,NULL,'',1,707.20000000,940552632,'N6497',NULL,