41',67,67,0,'398.0941 D157',1,NULL,0,0,NULL),(1775,'','9786090700372','Materija ir vaizduotė Hibridinė kūryba tarp meno ir mokslo','LT','Vilniaus universiteto leidykla',233,2018,'Sabolius, Kristupas','','','TH154','','materija-ir-vaizduote-hibridine-kuryba-tarp-meno-ir-mokslo','2019-01-10 10:57:50','2021-02-04 10:43:09',14,'materija-ir-vaizduote_z1.jpg','image/jpeg',16783,600,809,'',1,700.10500000,0,NULL,NULL,NULL,1,'700.105 S113',1,'undefined',1,0,NULL),(1776,'0198792980','9780198792987','Anthropocene : a very short introduction','EN','Oxford University Press, Incorporated',176,2018,'Ellis, Erle C. (Erle Christopher), 1963- | Gockel, Gabriele, 1954- [Translator]','','','FSUS085','','anthropocene','2019-01-10 10:59:58','2021-01-31 17:12:02',15,'9780198792987.jpg','image/jpeg',10006,180,270,'The proposal that the impact of humanity on the planet has left a distinct footprint, even on the scale of geological time, has recently gained much ground. Global climate change, shifting global cycles of the weather, widespread pollution, radioactive fallout, plastic accumulation, speciesinvasions, the mass extinction of species - these are just some of the many indicators that we will leave a lasting record in rock, the scientific basis for recognizing new time intervals in Earth\'s history. [...]',3,304.20000000,1002125416,'GF75',421,434,0,'304.2 E47',1,NULL,0,0,NULL),(1777,'014197804X','9780141978048','From bacteria to Bach and back : the evolution of minds','EN','Penguin',476,2018,'Dennett, D. C. (Daniel Clement)','','','FSUS086','','from-bacteria-to-bach-and-back-the-evolution-of-minds','2019-01-10 16:12:17','2021-01-31 16:34:15',15,'aslkfhdlas.jpg','image/jpeg',15324,181,279,'One of America’s foremost philosophers offers a major new account of the origins of the conscious mind.How did we come to have minds?For centuries, this question has intrigued psychologists, physicists, poets, and philosophers, who have wondered how the human mind developed its unrivaled ability to create, imagine, and explain. Disciples of Darwin have long aspired to explain how consciousness, language, and culture could have appeared through natural selection, blazing promising trails that [...]',3,128.20000000,964661184,'B105.C477',1180,1250,0,'128.2 D399',1,NULL,0,0,NULL),(1778,'0199565570','9780199565573','Landscapes and geomorphology : a very short introduction','EN','Oxford University Press',152,2010,'Goudie, Andrew | Viles, Heather A. [Author]','','','LPST073','','landscapes-and-geomorphology-a-very-short-introduction-very-short-introductions','2019-01-10 16:14:33','2021-01-31 18:31:47',16,'9488220._UY630_SR1200_630_.jpg','image/jpeg',61649,1200,630,'Landscapes are all around us, but most of us know very little about how they have developed, what goes on in them, and how they react to changing climates, tectonics, and human activities. Examining what landscape is, and how we use a range of ideas and techniques to study it, Andrew Goudie and Heather Viles demonstrate how scientists have built on classic methods--pioneered by the great researchers of the nineteenth century--to shed new light on our planet. Using examples from around the world [...]',3,551.41000000,620092528,'GB400.4',552,528,0,'551.41 G688',1,NULL,0,0,NULL),(1779,' 0854882243  ','9780854882243','Sexuality','EN','The MIT Press',240,2014,'Amelia Jones','','','TH151','','sexuality','2019-01-10 16:17:33','2021-01-31 16:17:55',14,'collid_books_covers_0_isbn_9780262526579_type_.jpg','image/jpeg',103591,550,781,'This title critically surveys art\'s identification with desire, self-performance and self-representation via key texts by artists an theorists from the mid 20th century to the present. It has been argued, most notably in psychoanalytic and modernist art discourse, that the production of works of art is fundamentally driven by sexual desire. It has further been argued, particularly since the early 1970s, that sexual drives and desires also condition the distribution, display and reception of art [...]`',1,704.90000000,892043697,'NC765',4,4,0,'704.9 A499',1,NULL,0,0,NULL),(1780,'','9780854882489','Information','EN','Whitechapel Art Gallery',238,2016,'Whitechapel Art Gallery','','','TH152','','information-documents-of-contemporary-art','2019-01-10 16:21:22','2021-01-31 16:17:56',14,'SarahCook_Information.jpg','image/jpeg',109522,600,809,'',1,709.04000000,945730189,'N6490',339,337,0,'709.04 W582',1,NULL,0,1,NULL),(1781,'1138291439  ','9781138291430','Place and experience : a philosophical topography','EN','Routledge',256,2018,'Malpas, Jeff','','','LPST074','','place-and-experience','2019-01-10 16:23:46','2021-01-31 16:34:51',16,'1.jpg','image/jpeg',18604,287,430,'The first edition of Place and Experience established Jeff Malpas as one of the leading philosophers and thinkers of place and space and provided a creative and refreshing alternative to prevailing post-structuralist and postmodern theories of place. It is a foundational and ground-breaking book in its attempt to lay out a sustained and rigorous account of place and its significance. The main argument of Place and Experience has three strands: first, that human being is inextricably bound to [...]',3,128.40000000,961003623,'B105.P53',165,192,0,'128.4 M259',1,NULL,0,0,NULL),(1782,'151790109X  ','9781517901097','Object-oriented feminism','EN','Univ Of Minnesota Press',280,2016,'Behar, Katherine, 1976- [Editor]','','','TH150','','object-oriented-feminism','2019-01-10 16:26:17','2021-01-31 17:15:53',14,'Cwa4WLrXAAAIObb.jpg','image/jpeg',155092,900,1200,'The essays in Object-Oriented Feminism explore OOF: a feminist intervention into recent philosophical discourses—like speculative realism, object-oriented ontology (OOO), and new materialism—that take objects, things, stuff, and matter as primary. Object-oriented feminism approaches all objects from the inside-out position of being an object too, with all of its accompanying political and ethical potentials. This volume places OOF thought in a lon