ull','What exactly are the Weird and the Eerie? In this new essay, Mark Fisher argues that some of the most haunting and anomalous fiction of the 20th century belongs to these two modes. The Weird and the Eerie are closely related but distinct modes, each possessing its own distinct properties.  Both have often been associated with Horror, yet this emphasis overlooks the aching fascination that such texts can exercise. The Weird and the Eerie both fundamentally concern the outside and the unknown, [...]','TH238','null','the-weird-and-the-eerie','2020-12-09 15:39:13','2021-02-01 11:11:24',14,NULL,NULL,NULL,NULL,NULL,'null',1,809.30400000,945719244,'PN3503',199,138,0,'809.304 F535',1,NULL,0,0,NULL),(1951,'486480043X','9784864800433','Another Scale Of Architecture','null','LIXIL',227,2019,'Ishigami, Junya','null','null','TH174','null','another-scale-of-architecture','2020-12-09 16:55:23','2021-02-03 16:29:35',14,NULL,NULL,NULL,NULL,NULL,'null',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(1952,'0262043572','9780262043571','Material witness : media, forensics, evidence','null','MIT Press',392,2020,'Schuppli, Susan','null','The evidential role of matter--when media records trace evidence of violence--explored through a series of cases drawn from Kosovo, Japan, Vietnam, and elsewhere. In this book, Susan Schuppli introduces a new operative concept: material witness, an exploration of the evidential role of matter as both registering external events and exposing the practices and procedures that enable matter to bear witness. Organized in the format of a trial, Material Witness moves through a series of cases that [...]','TH175','null','material-witness','2020-12-09 16:59:44','2021-02-01 11:26:12',14,NULL,NULL,NULL,NULL,NULL,'null',3,341.69000000,1099540841,'K5490',106,107,0,'341.69 S383',1,NULL,0,0,NULL),(1953,'null','978604810503','MIŠKO ŪKIS IR MEDŽIOKLĖ MAŽOJOJE LIETUVOJE','null','Klaipėdos universiteto leidykla',343,2019,'Deltuvas, Romualdas','null','null','TH176','null','misko-ukis-ir-medziokle-mazojoje-lietuvoje','2020-12-09 17:02:25','2021-02-03 16:29:36',14,NULL,NULL,NULL,NULL,NULL,'null',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(1954,'1945150815 ','9781945150814','Wood urbanism : from the molecular to the territorial','null','Actar D',492,2020,'Ibañez, Daniel ; Kiel, Moe; Hutton, Jane','null','null','TH177','null','wood-urbanism','2020-12-09 17:04:24','2021-02-03 10:18:16',14,NULL,NULL,NULL,NULL,NULL,'Wood holds a unique and timely lessons for urbanization, yet it remains inadequately characterized in architecture, landscape architecture, and urbanism. From under-considered thermal properties to emerging manufacturing possibilities, from changing forestry regimes to larger carbon cycle dynamics, Wood Urbanism explores the unique material and scalar properties of wood, presenting it as a critical material for design today. It brings into conversation scholars and practitioners who focus on [...]',1,721.00000000,1130884863,'NA4110',62,63,0,'721 I12',1,'undefined',1,0,NULL),(1955,'null','9772256098001','ARTERRITORY CONVERSATIONS 4','null','Arterritory.com',140,2015,NULL,'null','null','TH178','null','arterritory-conversations-4','2020-12-09 17:52:41','2021-02-09 08:50:04',14,NULL,NULL,NULL,NULL,NULL,'‘What would be the perfect or ideal world for you?’– we asked the Austrian artist Erwin Wurm. ‘More freedom, more tolerance, less orthodox structures coming back in politics and relations, more enlightenment; yes – more freedom’, – he said. The subject of freedom of thought and artistic gesture is developed in our conversations with the Polish artist Mirosław Bałka, cult heroes of the British art scene Gilbert and George, the French ‘feminist icon’ ORLAN, as well as Olafur Eliasson, Carolyn Christov-Bakargiev and Lev Manovich. We also present two Baltic stars ‒ Miķelis Fišers and Raul Keller.',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(1956,'null','null','Arterritory Conversations with Collectors No 7','null','Arterritory.com',176,2020,NULL,'null','null','TH179','null','arterritory-conversations-with-collectors-no-7','2020-12-09 17:55:54','2021-02-09 08:50:04',14,NULL,NULL,NULL,NULL,NULL,'Grażyna Kulczyk, Johanna and Friedrich Gräfling, Joop van Caldenborgh, Piotr Bazylko, Sandra Hegedüs, Jean-Louis Haguenauer, Hans Furer, Alexander Ramselaar, Petr Pudil, Stuart Evens, Enzo Enea, Madeleine Bessborough.  Art and art patronage are a fragile matter, one that is clearly affected negatively by crises. In this respect, the role of a collector capable of supporting artists who are spiritually akin and interesting to him at an existentially challenging time becomes more important than ever. For the collectors represented in this issue, it is not the ownership of works by global star artists, valued at seven digit prices, that seems so important. What matters more is art that speaks to them, correlating with their own views on the world and people. It is this kind of art that finds permanent place in their collection, and it is artists capable of creating this kind of art whom they support.  “Collecting for us is not just going to Art Basel, spending money and getting an artwork. It’s really about being involved and getting to the essence of it. It’s not necessary to be friends with the artist, but really having a discourse, an exchange. (…) Art is a kind of key that offers both information and a different perspective on the political, economic and social processes going on in the world,” say German art collectors Johanna and Friedrich Gräfling. By using art as a medium, they are documenting the times they are living in: the thoughts, visions, contradictions, passions, trends and life itself in Europe within the span of their own lifetimes.',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1957,'null','null','Arterritory Conversations with Collectors No 1','null','Arterritory.com',136,2014,NULL,'null','null','TH180','null','arterritory-conversations-with-collectors-no-1','2020-12-09 17:56:48','2021-02-09 08:50:04',14,NULL,NULL,NULL,NULL,NULL,'Petter Stordalen, Dakis Joannou, Christian Rignes, Ingvild Goetz, Dimitris Daskalapoulos, Luciano Benetton, Robert&Nicky Wilson, Isabelle&Jean-Conrad Lemaître, Patrizia Sandretto Re Rebaudengo, Joaquin Diez-Cascón, Harald Falckenberg   This publication offers an insight into some superb art collections as well as conversations about art and how the passion for collecting art has changed the lives and world views of the people linked with these collections. These are conversations about causes and effects, about the process and each individual’s personal path to the collection, about how art can become an integral part of everyone’s life. The people featured in this first issue of Arterritory Conversations with Collectors are united by a result: the creation of a prestigious art collection. These are personalities who, due to their status and investment in art, have become authorities whose opinions are taken into account not only by the art market but by the art world in general.',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1958,'null','9772013019003','apartamento ','null','Apartamento Publishing S.L',0,2020,'Nacho Alegre, Omar Sosa, Marco Velardi','null','null','TH184','null','apartamento','2020-12-09 18:02:49','2021-02-01 11:08:31',14,NULL,NULL,NULL,NULL,NULL,'null',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(1959,'null','0134-3106','KULTŪROS BARAI','null','VšĮ \"Kultūros barų\" leidykla',0,2020,'Ed. Laima Kanopkienė','null','null','TH185','null','kulturos-barai','2020-12-09 18:05:17','2021-02-01 11:08:31',14,NULL,NULL,NULL,NULL,NULL,'null',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(1960,'null','null','Arterritory Conversations with Collectors No 6','null','Arterritory.com',176,2019,'Valeria Napoleone, Stefan von Bartha, Leopold Weinberg, Han Nefkens, Aeneas Bastian, Artemy Troitsky, Ramin Salsali, Christian Kaspar Schwarm, David Roberts, Péter Küllői, Giorgio Fasol, Sebastian Köpcke and Volker Weinhold','null','null','TH186','null','arterritory-conversations-with-collectors-no-6','2020-12-09 18:06:40','2020-12-09 18:06:40',14,NULL,NULL,NULL,NULL,NULL,' There is no doubt that collectors complement and perfect the art world. And art helps them and everybody who is ready for that to become more aware of themselves and everything around them, to expand the boundaries of imagination and perception. ‘Imagine spaces without art. Imagine churches without art. Imagine all the history, all the creative people – without art. It just doesn\'t work’ – believes the Swiss gallerist and collector Stefan von Bartha.',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1961,'null','null','Arterritory Conversations with Collectors No 4','null','Arterritory.com',176,2017,'Robert M. Rubin, Erika Hoffmann-Koenige, Noemi Givon, Frederic de Goldschmidt, Al Shands, Candida Gertler, Amos Schocken, Timo Miettinen, Galila Barzilaï-Hollander, Vilius Kavaliauskas, Patricia Vergaz, Andrew&Christine Hall, Bernar Vene','null','null','TH187','null','arterritory-conversations-with-collectors-no-4','2020-12-09 18:08:23','2020-12-09 18:08:23',14,NULL,NULL,NULL,NULL,NULL,'null',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1962,'null','null','Arterritory Conversations with Collectors No 5','null','Arterritory.com',184,2018,'Thaddaeus Ropac, Joseph Kouli, Wildried and Yannicke Cooreman, Gil Bronner, Valérie Bach, Meda Mládek, Agah Uğur, Roman Babichev, Tony Cragg, Marc&Josée Gensollen, Heidi Goëss-Horten, Dieter and Gertraud Bogner, Viktoras Butkus, Venke and Rolf Hoff','null','null','TH188','null','arterritory-conversations-with-collectors-no-5','2020-12-09 18:10:29','2020-12-09 18:10:29',14,NULL,NULL,NULL,NULL,NULL,'null',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1963,'null','null','Arterritory Conversations with Collectors No 2','null','Arterritory.com',136,2015,'Alain Servais, Giuliano Gori, Isabelle Maeght, Jean Pigozzi, Ryutaro Takahashi, Gilles Fuchs, Igor Tsukanov, Jānis Zuzāns, Julia Stoschek, Egidio Marzona, Takeo Obayashi','null','null','TH189','null','arterritory-conversations-with-collectors-no-2','2020-12-09 18:11:46','2020-12-09 18:11:46',14,NULL,NULL,NULL,NULL,NULL,'null',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1964,'null','9783931435592','ARCH+','null','ARCH+ Verlag',39,2020,'Anh-Linh Ngo','null','null','TH190','null','arch','2020-12-09 18:16:38','2021-02-01 11:08:33',14,NULL,NULL,NULL,NULL,NULL,'null',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(1965,'null','null','CC: No 2 | Magazin  ','null','Akademie der Künste der Welt',46,2020,'Akademie der Künste der Welt','null','null','TH191','null','cc-no-2-magazin','2020-12-09 18:22:44','2020-12-09 18:22:44',14,NULL,NULL,NULL,NULL,NULL,'null',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1966,'null','null','Arterritory Conversations No 2','null','Arterritory.com',104,2013,NULL,'null','null','TH192','null','arterritory-conversations-no-2','2020-12-09 18:39:13','2021-02-09 08:50:04',14,NULL,NULL,NULL,NULL,NULL,'While the first issue was a compilation of our best interviews from 2012, the second one presented the most important conversations that had taken place in 2013. We were lucky to sit down for a chat with Jan Fabre, the Belgian artist expressing himself not only in contemporary visual art but also in the performance genre, with the pioneer of Finnish video art Eija-Liisa Ahtila, the Danish architect Bjarke Ingels, world-class curator Hans-Ulrich Obrist, Estonian artist Raoul Kurvitz, gallerist Andrew Renton (Marlborough Contemporary art gallery), Czech sculptor David Černý, Latvian artist Maija Kurševa and others.',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1967,'null','null','Arterritory Conversations No 1','null','Arterritory.com',104,2012,NULL,'null','null','TH193','null','arterritory-conversations-no-1','2020-12-09 18:40:54','2021-02-09 08:50:04',14,NULL,NULL,NULL,NULL,NULL,'Interviews with artists and curators are more than just condensed summaries of world views. It is an intellectual spark that is born between collocutors and starts the fire of conversation. It is something like a photograph, a snapshot capturing the state of mind of the people talking. The first issue features our ‘pictures’ with the British artist Mike Nelson, Ragnar Kjartansson from Iceland, Henrik Vibskov from Denmark, Marat Gelman and Viktor Misiano from Moscow, as well as Director of the Whitechapel Gallery Iwona Blazwick and Turner Prize winner Martin Creed.',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1968,'null','9783931435608','ARCH+','null','ARCH+ Verlag',0,2020,'Anh-Linh Ngo','null','null','TH194','null','arch-76a16f98-8af9-4678-9d70-661a2e832ba3','2020-12-09 18:44:54','2021-02-01 11:08:34',14,NULL,NULL,NULL,NULL,NULL,'null',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(1969,'null',' 9780999237373','Log 49 Observations on architecture and the contemporary city','null','Anycorp',196,2020,NULL,'null','null','TH195','null','log-49-observations-on-architecture-and-the-contemporary-city','2020-12-09 18:47:38','2021-02-09 08:50:04',14,NULL,NULL,NULL,NULL,NULL,'null',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(1970,'null','null','THE NEW YORKER','null','null',0,2020,NULL,'null','null','TH196','null','the-new-yorker','2020-12-09 18:52:10','2021-02-09 08:50:04',14,NULL,NULL,NULL,NULL,NULL,'The Money Issue',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1971,'1788734424','9781788734424','Feminism for the 99 percent : a manifesto','null','Verso Books',192,2019,'Arruzza, Cinzia | Bhattacharya, Tithi [Author] | Fraser, Nancy [Author] | Arruzza, Cinzia [Author]','null','null','TH197','null','feminism-for-the-99','2020-12-09 19:16:48','2021-02-01 11:11:25',14,NULL,NULL,NULL,NULL,NULL,'Named one of Vogue\'s \"Most Anticipated Books of 2019\" From three of the organisers of the International Women\'s Strike US: a manifesto for when \"leaning in\" is not enough. Unaffordab