ULL,NULL,NULL,NULL,NULL,'Three hundred years ago, intellectuals of the European Enlightenment constructed a mythology of technology. Influenced by a confluence of humanism, colonialism, and racism, this mythology ignored local wisdom and indigenous innovation, deeming it primitive. Today, we have slowly come to realize that the legacy of this mythology is haunting us. Designers understand the urgency of reducing humanity\'s negative environmental impact, yet perpetuate the same mythology of technology that relies on [...]',1,720.00000000,1105872771,'NA208',235,224,0,'720 W339',1,NULL,0,0,NULL),(1981,'1552453901','9781552453902','The Baudelaire fractal','null','Coach House Books',160,2020,'Robertson, Lisa, 1961-','null','null','TH207','null','the-baudelaire-fractal','2020-12-09 19:43:08','2021-02-01 11:11:30',14,NULL,NULL,NULL,NULL,NULL,'The debut novel by acclaimed poet Lisa Robertson, in which a poet realizes she\'s written the works of Baudelaire. One morning, Hazel Brown awakes in a badly decorated hotel room to find that she\'s written the complete works of Charles Baudelaire. In her bemusement the hotel becomes every cheap room she ever stayed in during her youthful perambulations in 1980s Paris. This is the legend of a she-dandy\'s life. Part magical realism, part feminist ars poetica, part history of tailoring, part [...]',1,813.54000000,1091587825,'PR9199.3.R5316',237,172,0,'813.54 R651',1,NULL,0,0,NULL),(1982,'9526939514    ','9789526939513','Seventeen Years of Media Consumption (2002-2018): The books','null','Scarlatti Tilt',288,2020,'Fail, John W.','null','null','TH208','null','seventeen-years-of-media-consumption-2002-2018-the-books','2020-12-09 19:44:49','2021-02-04 14:08:58',14,NULL,NULL,NULL,NULL,NULL,'Seventeen Years of Media Consumption (2002-2018): The books chronicles 875 books started and finished by the author between 1 January 2002 and 31 December 2018. All written material is cross-referenced with the other two volumes.',1,802.00000000,0,NULL,