Lenoir',0,2020,'Glockner, Nina','null','null','TH214','null','building-as-opera','2020-12-09 19:59:26','2021-02-03 17:05:46',14,NULL,NULL,NULL,NULL,NULL,'null',1,720.40000000,0,NULL,NULL,NULL,1,'720.4 G562',1,'undefined',0,0,NULL),(1989,'null','9786094271236','ANARCHIZMAS IR KITOS ESĖ','null','kitos knygos',189,2013,'Emma Goldman','null','null','TH215','null','anarchizmas-ir-kitos-ese-7e48bf07-6e16-489e-965e-644aa6f4ffd4','2020-12-09 20:01:35','2021-02-01 11:08:49',14,NULL,NULL,NULL,NULL,NULL,'null',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(1990,'null','null','Arterritory Conversations No 5','null','Arterritory.com',288,2017,NULL,'null','null','TH216','null','arterritory-conversations-no-5','2020-12-09 20:03:05','2021-02-09 08:50:04',14,NULL,NULL,NULL,NULL,NULL,'How does contemporary art feel in the world of post-truth (according to the Oxford English Dictionary, Word of the Year 2016)? Could we say that it is art that becomes ‘truth’ in this reality ‒ exactly for the reason that it makes no claim to realism? Between the covers of the fifth issue, you will find compiled our conversations on the subject with Tony Oursler, Jake Chapman, Ernesto Neto, Tino Sehgal, Joana Vasconcelos, Wilhelm Sasnal, Hedwig Fijen and a whole range of other important artists, curators and gallerists.',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1991,'null','null','Arterritory Conversations No 7','null','Arterritory.com',0,2019,NULL,'null','null','TH217','null','arterritory-conversations-no-7','2020-12-09 20:05:19','2021-02-09 08:50:04',14,NULL,NULL,NULL,NULL,NULL,'It is important to us to ask our interlocutor the best-aimed question. One that would help them reveal their outlook on the world and the role of art in it. ‘How do you think your work differs from a child’s scribble?’ ‒ we asked the British artist David Shrigley. ‘Do you think as you talk, or have you already thought everything out beforehand?’ ‒ we asked Hans-Ulrich Obrist, one of the best-known curators on the contemporary art scene. This time, we have put a whole variety of different questions to eighteen brilliant personalities, including the painter and filmmaker Julian Schnabel, the art collective Slavs and Tatars, director of Fondation Beyeler Sam Keller and many others.',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1992,'null','null','Arterritory Conversations No 6','null','Arterritory.com',248,2018,NULL,'null','null','TH218','null','arterritory-conversations-no-6','2020-12-09 20:08:46','2021-02-09 08:50:04',14,NULL,NULL,NULL,NULL,NULL,'What and how do we speak about contemporary art? Why are our discussions on the subject important and what do they influence? We talk about it with Artistic Director of PinchukArtCentre Björn Geldhof, the Polish artist Artur Żmijewski, the Flemish Jan Fabre and Belgian Hans Op de Beeck. The Israeli artist Sigalit Landau tells us about her experience of artistic collaboration with the Dead Sea. The issue also features curator of the first Riga International Biennial of Contemporary Art Katerina Gregos, architect Yoshiharu Tsukamoto, Director of Art Cologne Daniel Hug and many others.',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1993,'null','null','THE O-G vol.5','null','null',0,0,NULL,'null','null','TH219','null','the-o-g-vol-5','2020-12-09 20:14:13','2021-02-09 08:50:04',14,NULL,NULL,NULL,NULL,NULL,'null',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1994,'null','null','the All-Over','null','',0,2016,'Sillman, Amy','null','null','TH220','null','the-all-over','2020-12-09 20:16:07','2021-02-09 15:18:41',14,NULL,NULL,NULL,NULL,NULL,'null',1,700.41100000,0,NULL,NULL,NULL,0,'700.411 S584',1,'undefined',0,0,NULL),(1995,'0819564982','9780819564986 ','Impossible dance : improvised social dance as queer world-making','null','Wesleyan',256,2002,'Buckland, Fiona','null','null','TH221','null','impossible-dance-club-culture-and-queer-world-making','2020-12-09 20:20:13','2021-02-01 11:11:31',14,NULL,NULL,NULL,NULL,NULL,'\"Impossible Dance is a highly accessible, original and engaging account of the complex and often heavily theorized debates around the body, identity and community. Focusing on gay, lesbian and queer club culture in the 1990s New York City, this is the first book to bring together vital issues such as dance culture, queer community, sex culture, HIV identity and politics. Based on four years of field work, the book takes readers on a journey from the streets of New York City into the dance [...]',1,305.90664097,47670280,'HQ76.3.U5',3,3,0,'305.90664097 B924',1,NULL,0,0,NULL),(1996,'null','null','Errant Journal WHEN ARE WE? ','null','null',122,2020,'concept by Irene de Craen','null','null','TH222','null','errant-journal-when-are-we','2020-12-09 21:04:57','2020-12-09 21:04:57',14,NULL,NULL,NULL,NULL,NULL,'The first issue of Errant Journal critically examines the concept of the ‘contemporary’ and questions time’s claim to universality. Titled When Are We? this issue is about the politics of time and the way in which we have internalized the idea of the present, of what is modern, contemporary and now, and how these concepts are riddled with contradictions and based on mechanisms of exclusion. ',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1997,'null','null','TEXTE ZUR KUNST','null','null',215,2020,NULL,'null','null','TH223','null','texte-zur-kunst','2020-12-09 21:08:30','2021-02-09 08:50:04',14,NULL,NULL,NULL,NULL,NULL,'Exactly three decades after the inaugural issue of TEXTE ZUR KUNST was published, we return to the question of where the hard-won and still-embattled rights of women* stand. With the December issue, entitled “The Feminist,” we celebrate 30 years of controversial discussions about contemporary art and culture. We have invited 30 artists, critics, curators, and theorists of art and culture to talk about a cultural object that they believe is currently of particular interest from a feminist perspective. In highlighting feminist discourses that are especially relevant to the present moment, this issue should illustrate the plurality of thinkers who contribute to feminist projects today. A gesture to the unity and the alliances that critique grounded in solidarity can build!',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1998,'null','null','klima','null','Klima et Klima mono',238,2019,'Antonine Scali Ringwald, Loucia Carlier','null','null','TH224','null','klima','2020-12-09 21:12:46','2020-12-09 21:12:46',14,NULL,NULL,NULL,NULL,NULL,'This issue is an opportunity for us to respond to the problems inherent in the environmental crisis. Speaking about the environment is a vast undertaking, which can be approached in a pragmatic as well as a poetic, speculative or decolonial way. To respond to this diversity of analysis, we wish to give a voice to individuals from different backgrounds whose practices constantly converge around common issues. Researcher Anna Lowenhaupt Tsing introduces this second issue with her article on Merremia Peltata, a vine that is gradually invading and destroying forests in Southeast Asia. The magazine develops around this parasite, discreetly contaminating the contributions of the various artists and researchers. What if the human being was the image of this voracious vine? As the researcher Yasmine Benabdallah rightly said, \"ecology is about the earth and about people.” We have therefore tried to explore the relationships between humans and the entities that surround them, as well as the relationships between humans. It is indeed impossible to speak of the environmental crisis without mentioning the organizations of different social groups while addressing issues of colonialism and the violence that results from them. Faced with the impending extinction, how can a collaborative survival process be initiated? How can we see the world beyond the Western, and human, perspective? ',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(1999,'null','null','klima','null','Klima et Klima mono',218,2020,'Antonine Scali Ringwald, Loucia Carlier','null','null','TH225','null','klima-7aeff961-171a-48ff-8ba0-dbe31e47963a','2020-12-09 21:14:56','2020-12-09 21:30:38',14,NULL,NULL,NULL,NULL,NULL,'Dedicated to the occult, this issue continues its line of questioning, this time turning its gaze towards the spiritual dimension that emerges from the various encounters and cohabitations of the living with the non-living. Over this edition hangs the figure of the witch. We reveal her deviant and erudite aspects, going against dogmas to reframe her as a secret and magical feminist force. How was the birth of the Western witch induced by the advent of capitalism? What political and symbolic forces arise from this conception? What ambiguous drifts could lead to its mercantile recuperation?   Magic, rituals, spiritualism, and their societal implications: these are the areas that we wanted to investigate, within both the human sciences and contemporary artistic practice. The intersection of these disciplines unlocks a new appreciation of the world beyond the visible and the tangible. These disciplines gravitate around the same questions that link spirituality and politics: how do we resist hegemonic powers? How do we, in these times, combine collaborative survival, re-appropriation of knowledge, and contemporary spirituality? Several points of view cross paths and work together to reveal avenues of reflection and ways to rethink history through the prism of its own mysticism. In the meantime, the witches will remain.  ',1,NULL,NULL,NULL,NULL,NULL,0,NULL,1,NULL,0,0,NULL),(2000,'8867493779 ','9788867493777','History has failed us, but no matter : the Korean Pavilion-58th International Art Exhibition, La Biennale di Venezia : Siren Eun Young Jung, Hwayeon Nam, Jane Jin Kaisen','null','Mousse Magazine and Publishing',143,2019,'Biennale de Venise (58 : 2019)','null','null','TH227','null','history-has-failed-us-but-no-matter','2020-12-09 21:21:13','2021-02-08 15:30:40',14,NULL,NULL,NULL,NULL,NULL,'Gender, nationalism and East Asian identity collide in the work of three Korean artists at the Venice BiennalePublished for the 58th Venice Biennale, History Has Failed Us, but No Matter explores the history of modernization in East Asia through the lens of gender and the agency of tradition, in the work of Siren Eun Young Jung, Jane Jin Kaisen and Hwayeon Nam.',3,709.51900000,1108919057,'N7365.6',33,33,0,'709.519 B588',1,'undefined',0,0,NULL),(2001,'9955640529 ','9789955640523','Alfavilnius, arba Keisti Arnoldo Sputniko nuotykiai','null','kitos knygos',0,2008,'Klimašauskas, Valentinas, 1977-','null','null','TH228','null','alfavilnius-o-kas-buvo-pries-tai','2020-12-09 21:23:28','2021-02-03 16:58:57',14,NULL,NULL,NULL,NULL,NULL,'null',1,891.92000000,243636644,'PG8723.21.L56',NULL,2,0,'891.92 K65',1,'undefined',0,0,NULL),(2002,'1119941288 ','9781119941286','The eyes of the skin : architecture and the senses','null','Wiley',128,2012,'Pallasmaa, Juhani | Pallasmaa, Juhani','null','null','TH229','null','the-eyes-of-the-skin-architecture-and-the-senses','2020-12-09 21:26:05','2021-02-03 10:14:16',14,NULL,NULL,NULL,NULL,NULL,'First published in 1996, The Eyes of the Skin has become a classic of architectural theory. It asks the far-reaching question why, when there are five senses, has one single sense – sight – become so predominant in architectural culture and design? With the ascendancy of the digital and the all-pervasive use of the image electronically, it is a subject that has become all the more pressing and topical since the first edition’s publication in the mid-1990s. Juhani Pallasmaa [...]',3,720.10000000,35154925,'NA2500',1300,806,0,'720.1 P165',1,NULL,0,0,NULL),(2003,'3836514486','9783836514484','The book of symbols : reflections on archetypal images','null','Taschen',810,2010,'Archive for Research in Archetypal Symbolism | Ronnberg, Ami [Editor] | Martin, Kathleen, 1949- [Editor] | Archive for Research in Archetypal Symbolism [Publisher]','nul