596457','Ką manė kamanė','null','Žalias kalnas',56,2019,'Vainius Bakas','null','null','TH253','null','ka-mane-kamane','2020-12-21 17:15:31','2021-02-01 11:09:07',14,NULL,NULL,NULL,NULL,NULL,'Smagu, kai eilėraščiai vaikams prasmingumu ir kalbos grožiu nė kiek nenusileidžia suaugusiųjų poezijai. Tokia yra Vainiaus Bako knyga „Ką manė kamanė\" – švelniai besiliečianti prie mus supančio pasaulio, jaudinanti subtiliu gamtos pajautimu, nuspalvinta žaismingais nutikimais, juokingomis detalėmis, kupina lengvai suprantamų vaizdinių. Kiekvienas poeto eilėraštis – lyg trumpa, jauki ir jautri vaikystės pasaka, kurioje norisi bent mirksnį pagyventi. O kad šiek tiek ilgiau užtruktume, dailininkė Marija Smirnovaitė sukūrė kerinčių vaizdų.',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(2020,'null','9786098232097','Vakaro istorijos Lietuvos mergaitėms: 100 istorijų apie Lietuvos moteris ','null','Dvi tylos',239,2020,'Viktorija Aprimaitė, Viktorija Urbonaitė','null','null','TH254','null','vakaro-istorijos-lietuvos-mergaitems-100-istoriju-apie-lietuvos-moteris','2020-12-21 17:17:45','2021-02-01 11:09:08',14,NULL,NULL,NULL,NULL,NULL,'Pasaulyje gyvena šimtai tūkstančių visuomenei, mokslui bei kultūrai nusipelniusių moterų. Tačiau bendraautorės Viktorija Aprimaitė ir Viktorija Urbonaitė nusprendė pagerbti būtent Lietuvos moteris ir į knygą „Vakaro istorijos Lietuvos mergaitėms: 100 istorijų apie Lietuvos moteris“ įtraukė šimtą jaukių pasakojimų. ',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(2021,'null','9789955811497','Kaip Pelytė Zita žmogumi pavirto','null','Dominicus lituanus',152,2020,'Vytautas V. Landsbergis','null','null','TH255','null','kaip-pelyte-zita-zmogumi-pavirto','2020-12-21 17:19:08','2021-02-01 11:09:08',14,NULL,NULL,NULL,NULL,NULL,'Šioje Vytauto V. Landsbergio knygoje „Kaip pelytė Zita žmogumi pavirto“ susitinka du veikėjai - pelytė Zita ir tarakonas Dzioba.  Pelytė Zita ir tarakonas Dzioba atlieka daugybę žygdarbių: išlaisvina Zitos tėvelius, nugali katiną Mickų ir svarbiausia – išgelbsti pasaulį nuo teroristų bombos.',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(2022,'null','9786098227024','Arklio Dominyko meilė','null','Dominicus lituanus',76,2018,'Vytautas V. Landsbergis','null','null','TH256','null','arklio-dominyko-meile','2020-12-21 17:20:21','2021-02-01 11:09:09',14,NULL,NULL,NULL,NULL,NULL,'Meilės ir kelionių pasaka, kurioje baltas laukinis arklys Dominykas įsimyli šiek tiek išpaikusią rugiagėlę. Tačiau rudenį, artėjant šalnoms, jis yra priverstas paslėpti ją po akmeniu, o pats iškeliauja Afrikon ieškoti rugiagėlės giminių. Ten Dominykas susipažįsta su krokodilu, begemotu, beždžionėle, kupranugariu ir kitais linksmais personažais.',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(2023,'null','9786098227147','Kas tas Pūkis?','null','Dominicus lituanus',108,2020,'V. Landsbergis, Vytautas','null','null','TH257','null','kas-tas-pukis','2020-12-21 17:21:24','2021-02-04 14:34:49',14,NULL,NULL,NULL,NULL,NULL,'null',3,891.92000000,1202046436,NULL,1,NULL,0,'891.92 V99',1,NULL,0,0,NULL),(2024,'null','9786099596433','Istorijos skanėstai. Pažintinė knyga vaikams ir jaunimui','null','Žalias kalnas',68,2018,'Audronė Meškauskaitė, Aurina Venislovaitė','null','null','TH258','null','istorijos-skanestai-pazintine-knyga-vaikams-ir-jaunimui','2020-12-21 17:23:13','2021-02-01 11:09:10',14,NULL,NULL,NULL,NULL,NULL,' Itin smagi pažintinė knyga vaikams ir jaunimui.  Kaip po pietų norisi deserto, taip po rimtų mokslų norisi ko nors lengvesnio. „Istorijos skanėstai“ – tai taip pat istorija, tik ne tokia rimta, lengvai intriguojanti ir kupina smagių detalių, kurias rimtos istorijos knygos nutyli ar tiesiog neskiria joms dėmesio. Knygoje rasite trumpus pasakojimus apie tai, kas netilpo į istorijos vadovėlius. ',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(2025,'null','9786099596464','Nematomi praradimai','null','Žalias kalnas',80,2020,'Rasa Joni','null','null','TH259','null','nematomi-praradimai','2020-12-21 17:24:24','2021-02-01 11:09:10',14,NULL,NULL,NULL,NULL,NULL,'Trys piešiniai viename, o knygoje rasi magiškus akinius-langelius.  Kaip gerai būtų turėti stebuklingus akinius, pro kuriuos galėtume pažvelgti j kito žmogaus vidų - pamatyti, ką jis galvoja, kaip jaučiasi, apie ką svajoja! Šioje knygoje „Nematomi praradimai“ rasite tris spalvotus langelius, pro kuriuos žvelgiant į iliustracijas, ryškėja trys skirtingos tikrovės: vienoje yra tai, ką mes įpratę matyti, kitoje - kaip herojus iš tiesų jaučiasi, o trečioje - ko jis norėtų. Trumpi pasakojimai apie skaudžius vaikų išgyvenimus, kuriuos lydi tokie „stebuklingi\" piešiniai, padės geriau suprasti kitą - kitokį, keistą, neįprastą, nesuprastą, atstumtą. Atvers slaptus nematomus praradimus.',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(2026,'null','9786099596402','Baisiai gražūs eilėraščiai','null','Žalias kalnas',47,2017,'Daiva Čepauskaitė','null','null','TH260','null','baisiai-grazus-eilerasciai','2020-12-21 17:25:46','2021-02-01 11:09:10',14,NULL,NULL,NULL,NULL,NULL,'Galima nugyventi gyvenimą ir visai be poezijos. Bet galima atsiversti knygą ir pajusti, kaip kutena ropojanti auksinė skruzdėlė, darosi žvarbu nuo šalia pritūpusio mėlyno rūko ar į rankovę įlindusio vėjo. Ir nė nepastebėsi, kaip pasiklysi miego karalystėje tarp minkštų kaktusų, atsidursi ant stogo triukšmingame paukščių turguje, o tada užklups toks lietus, kad supelys visas miestas. Čia gali sutikti ir savo baimes – tamsą, didžiulį vorą ar Tą, kuris gyvena po lova. O jei pasidarė per daug baisu, bėk į virtuvę, kur skamba linksmos daržovių operos ir verda kulinarinės dramos',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(2027,'null','9786099596440','Duokit kelią Begemotui!','null','Žalias kalnas',56,2019,'Dainius Gintalas','null','null','TH261','null','duokit-kelia-begemotui','2020-12-21 17:26:59','2021-02-01 11:09:11',14,NULL,NULL,NULL,NULL,NULL,'Šioje knygoje \"Duokit kelią begemotui!!!\" verda linksmas ir smagus gyvenimas: karvė užskrenda į medį, kal