_Kraus.jpg','image/jpeg',24493,NULL,NULL,'\"In his journal, Paul liked to make lists: What he ordered from Commissary (shaving cream, toothpaste, deodorant, the transistor radio he had for a week before the guards took it away). The books he picked off the cart (The Bible, Dean Koontz, Stephen King, Codependent No More.) What phone calls he made and received; also, Bible Study certificates, letters and cards, his workout routines and his moods (Anxious, Nervous, Trusting in God, but mostly Depressed). Paul has a record of every push [...]',1,813.60000000,808733283,'PS3561.R2873',134,140,0,'813.6 K91',1,NULL,0,0,NULL),(2198,'978-1-78607-221-4','978-1-78607-222-1','Slumberland : a novel','null','Oneworld Publications',243,2017,'Beatty, Paul | Detje, Robin, 1964- [Translator] | Kurylak, Witold [Translator] | btb Verlag (TB) [Publisher]','null','null','null','null','slumberland','2020-03-04 14:01:17','2021-02-03 15:03:17',21,'Slumberland.jpg','image/jpeg',94431,NULL,NULL,'The breakout novel from a literary virtuoso about a disaffected Los Angeles DJ who travels to post-Wall Berlin in search of his transatlantic doppelganger.  Hailed by the New York Times and the Los Angeles Times as one of the best writers of his generation, Paul Beatty turns his incisive eye to man’s search for meaning and identity in an increasingly chaotic world. After creating the perfect beat, DJ Darky goes in search of Charles Stone, a little-known avant-garde jazzman, to play over his sonic masterpiece. His quest brings him to a recently unified Berlin, where he stumbles through the city’s dreamy streets ruminating about race, sex, love, Teutonic gods, the prevent defense, and Wynton Marsalis in search of his artistic—and spiritual—other. Ferocious, bombastic, and laugh-out-loud funny, Slumberland is vintage Paul Beatty and belongs on the shelf next to Jonathan Lethem, Colson Whitehead, and Junot Diaz',1,813.54000000,179789518,'PS3552.E19',561,585,0,'813.54 B369',1,NULL,0,0,NULL),(2199,'3596137691',' 9783596137695','Lipstick : Roman','null','Fischer Taschenbuch Verlag GmbH',270,1998,'Fülscher, Susanne, 1961-','null','null','FIC059','null','lipstick','2020-03-04 15:23:26','2021-02-04 14:40:04',21,'51288XWQ0EL._SX300_BO1_204_203_200_.jpg','image/jpeg',34357,NULL,NULL,'null',1,833.91000000,40190517,'PT2666',NULL,9,0,'833.91 F962',1,'undefined',0,0,NULL),(2200,'978-0-9933373-0-7','978-0993337307','Anchor','null','Marmalade Publishing of Visual Theory',120,2015,'Joe Graham','null','null','TH160','null','anchord','2020-03-07 11:59:03','2021-02-03 15:03:19',14,'Joe_Graham.png','image/png',2111885,NULL,NULL,'null',1,741.92430000,1084319128,NULL,3,NULL,0,'741.9243 J64',1,NULL,0,0,NULL),(2201,'0802150101','9780802150103','The Ubu plays : Ubu rex (Ubu roi) ; Ubu cuckolded (Ubu cocu) ; Ubu enchained (Ubu enchaine)','null','Grove Press',148,1994,'Jarry, Alfred, 1873-1907','null','Alfred Jarry is regarded as one of the founders of modern avant-garde theatre? ?Dada, Surrealism, Pataphysics, Theatre of Cruelty, the Absurd?all owe a debt to Jarry.” (Encore) This volume contains his three classic Ubu texts: Ubu Roi, Ubu Cocu and Ubu Enchaîné. Through the lucid translations of Connolly and Taylor, the reader comes to realize that the violent and loathsome Ubu is Jarry\'s dark metaphor for man in the modern age. As Ubu himself said, ?We shall not have succeeded in demolishing everything unless we demolish the ruins as well.”','FIC180','null','the-abu','2020-03-07 12:37:22','2021-02-03 15:03:20',21,'2061553.jpg','image/jpeg',27246,NULL,NULL,'null',1,842.80000000,540692292,'PQ2619.A65',1,1,0,'842.8 J37 Ubu',1,NULL,0,0,NULL),(2202,' 0571328512','978-0571328512','Art sex music','null',' Faber & Faber Social',384,2017,'Tutti, Cosey Fanni','null','null','FM049','null','null','2020-03-07 12:58:04','2021-02-03 15:03:21',19,'art_sex_music.jpg','image/jpeg',21407,NULL,NULL,'null',1,780.92000000,978257129,'ML420.T952',252,230,0,'780.92 T967',1,NULL,0,0,NULL),(2203,'0007160496','978-00071