‘white-cube’ gallery spaces in Askeaton, artists work in public spaces throughout the town. This form of engagement focuses on the existing dynamics of the locale, intending to bring forward the diverse layers of daily life and create a rich framework for subjective encounters. Such an approach is built on a belief that contemporary art can be a form of critique, investigation and celebration where artists are at the center of these dialogues playing a primary and fundamental role.\r\n \r\nTen years on, find out more about how and why art is made in Askeaton in this collected volume with contributions by Valerie Connor, Mike Cooter, Wayne Daly, Steve Maher, Susan MacWilliam, Curt Riegelnegg, Nuno Sacramento and Freek Wambacq, edited by Sean Lynch, Michele Horrigan and Wayne Daly.\r\n','RES097','null','aca-public','2020-03-09 09:26:11','2021-02-05 18:16:20',11,'cover_000.jpg','image/jpeg',25431,NULL,NULL,'null',1,707.80000000,0,NULL,NULL,NULL,1,'707.8 H811',1,'undefined',1,0,NULL),(2208,'null','978-0-995706-22-4','Countercultures, Communities and Indra\'s Net','null','A.C.A. PUBLIC',64,2019,'Hutchinson, John','null','From one of Ireland’s leading curators and writers on visual art, John Hutchinson’s Countercultures, Communities and Indra’s Net unravels an understanding of embodied life, of commonality and sharing.\r\n \r\nBeginning with his lived experience of 1960s counterculture, Hutchinson’s thoughts later move to frontier America and to rural living in nineteenth century Britain. In these times and places, moments of his own family’s history intertwine with multifarious examples of utopian thinking and establishment of new communities and forms of living. Constantly divergent in his approach, Hutchinson’s words oscillate from descriptions of Shaker art to The Beatles, to William Blake and much more, in a process to define a form of deep ecological thought urgently needed today.','TH162','null','countercultures-communities-and-indra-s-net','2020-03-09 09:38:01','2021-02-03 16:32:14',14,'john_book.jpg','image/jpeg',80996,NULL,NULL,'null',1,306.10000000,0,NULL,NULL,NULL,1,'306.1 H976',1,'undefined',0,0,NULL),(2209,'null','978-0-995706-21-7','The Cure','null','A.C.A. PUBLIC',84,2018,'Lozano, Catalina','null','Catalina Lozano, born in Bogotá in 1979, is a Colombian curator and independent writer based in Mexico City. Analyzing colonial narratives and deconstructing the perceived progress of modernity have forcefully acted as departure points for many of her exhibition projects, such as ‘A machine desires instruction as a garden desires discipline’ at FRAC Lorraine, Metz, and MARCO, Museo de Arte Contemporáneo de Vigo in 2013–14, and ‘What cannot be used is forgotten’ at CAPC musée d’art contemporain de Bordeaux in 2015.\r\n \r\nIn The Cure, Lozano writes about encounters and experiences that mediate the boundary between life and death, in order to think about healing as a way of deflating the conflicting relationships between nature and culture, the visible and the invisible, and the material and the sentient. Suspicious of the notion of myth, The Cure is an attempt to vindicate the power of negotiation to dispel such divisions. The structure of the séance, Mexican shamanism, Haitian Vodou, Irish criminal gangs and natural history museums are all implicated into Lozano’s text, developed during her extensive travels and investigations in recent years.','TH163','null','the-cure','2020-03-09 10:08:48','2021-02-08 15:54:44',14,'the_cure.jpg','image/jpeg',86761,NULL,NULL,'',1,700.41100000,0,NULL,NULL,NULL,1,'700.411 L925',1,'undefined',0,0,NULL),(2210,'null','978-3-00-060101-9','Spaces of communication','null','University of Düsseldorf',288,2018,'Gabi Schilling (Hg.)','null','null','ARC032','null','spaces-of-communication','2020-03-09 10:26:40','2021-02-03 15:03:28',12,'Untitled.png','image/png',758185,NULL,NULL,'null',1,720.00000000,1090109819,NULL,7,NULL,0,'720 G113',1,NULL,0,0,NULL),(2211,'null','978-1-907537-11-0','Undercover: A Dialect','null','VISUAL Centre for Contemporary Art, Carlow',32,2013,'Horrigan, Michele','null','Undercover: A Dialect is a group exhibition curated by Michele Horrigan at VISUAL Centre for Contemporary Art, Carlow in 2013. It explores how artists are involved in covert and almost hidden activities, often acting out individual trajectories away from any public attention. Taking the position that artistic work is not about fitting into a consensus or about desiring populist approval, it identifies attitudes that enjoy an undercurrent of improvisation and frugality, haphazard formality, and changeability. Their artworks create a grammar, a particular kind of dialect borne out of the methodologies of visual art, forms of speech that challenge assumptions of the generic, the typecast and the stereotype.\r\n \r\nImages and a series of short essays written by exhibition curator Michele Horrigan detail artworks by Stephen Brandes, Berndnaut Smilde, aiPotu, Jeronimo Hagerman, Magdelena Jitrik, Fiona Larkin, Sean Lynch, Pilvi Takala & Lucy Lippard\'s ‘955,000\'','CAT376','null','undercover-a-dialect','2020-03-09 10:51:44','2021-02-04 08:35:28',20,'005-2.jpg','image/jpeg',7744,NULL,NULL,'null',1,709.41500000,NULL,NULL,NULL,NULL,1,'709.415 H811',1,'undefined',1,0,NULL),(2212,'null','978-0811226158','The rings of Saturn : an English pilgrimage','null','New Directions books',296,1999,'Sebald, W. G. (Winfried Georg), 1944-2001','null','The Rings of Saturn — with its curious archive of photographs — records a walking tour along the east coast of England. A few of the things which cross the path and mind of its narrator (who both is and is not Sebald) are lonely eccentrics, Sir Thomas Browne\'s skull, a matchstick model of the Temple of Jerusalem, recession-hit seaside towns, wooded hills, Joseph Conrad, Rembrandt\'s \"Anatomy Lesson,\" the natural history of the herring, the massive bombings of WWII, the dowager empress Tzu Hsi, and the silk industry in Norwich.','null','null','the-rings-of-saturn','2020-03-09 10:58:25','2021-02-09 17:02:52',21,'434903._SY475_.jpg','image/jpeg',24197,NULL,NULL,'null',1,833.91400000,61131100,'PT2681.E18',32,2,0,'833.914 S443',1,NULL,0,0,NULL),(2213,'null','978-609-96058-0-7','Daugiakampis','null',' Six chairs books',220,2018,'Klimašauskas, Valentinas','null','null','FIC057','null','daugiakampis','2020-03-10 14:28:42','2021-02-04 20:11:34',21,'FILE-20190716-2042Y7HKK3112CNT.jpg','image/jpeg',41695,NULL,NULL,'A foreign investigator lands in Vilnius on April Fool’s Day on a mission to collect all possible information that would help to crack a password and unlock a sensitive dataset. The investigator has only twenty four hours to meet the locals who could be useful in the search of any clues to untangle the hint phrase – a purple city gate. Together with a poet and a retired detective they visit the main landmarks of Vilnius and even find themselves in a former CIA Black Site. They discuss history and art, memorisation techniques, plane spotting and news making. What kind of keywords or facts can they find in a post-truth era, when neither media nor government or one’s own eyes and language can not be trusted? Polygon is firstly a reference to a plot device, but its logic is also used in the character development and structure of language. Imagine the plot as if it was a feed in the social networks where the only thing in common between its posts is that they make a new multifaceted present. The story is augmented with a highly subjective repertoire of the artworks that represent the everyday circumstances where we all often find ourselves struggling. The author’s kaleidoscopic vision draws another perspective on contemporary experience, liquid identity, veering between contrasting values and discourses, and asks what does the truth mean in today’s click driven economy.',1,709.20000000,0,NULL,NULL,NULL,1,'709.2 V156',1,'undefined',0,0,NULL),(2214,'978-83-943112-1-6','978-83-943293-1-0','Garden of Everyday Errors','null','Wyspa Institute of Art Doki',407,2015,'Szyłak, Aneta; Sikorska, Karolina','null','null','FSUS092','null','garden-of-everyday-errors','2020-03-10 15:39:03','2021-02-04 11:13:17',15,'mini_magick20180818-8001-h98b6a.png','image/png',137184,NULL,NULL,'null',1,709.43800000,0,NULL,NULL,NULL,1,'709.438 S999',1,'undefined',0,0,NULL),(2215,'null','978-0262038300','Networking the Bloc : experimental art in Eastern Europe, 1965-1981','null','The MIT press',480,2018,'Kemp-Welch, Klara','null','The story of the experimental zeitgeist in Eastern European art, seen through personal encounters, pioneering dialogues, collaborative projects, and cultural exchanges. Throughout the 1970s, a network of artists emerged to bridge the East-West divide, and the no less rigid divides between the countries of the Eastern bloc. Originating with a series of creative initiatives by artists, art historians, and critics and centered in places like Budapest, Poznan, and Prague, this experimental dialogue involved Western participation but is today largely forgotten in the West. In Networking the Bloc, Klara Kemp-Welch vividly recaptures this lost chapter of art history, documenting an elaborate web of artistic connectivity that came about through a series of personal encounters, pioneering dialogues, collaborative projects, and cultural exchanges. Countering the conventional Cold War narrative of Eastern bloc isolation, Kemp-Welch shows how artistic ideas were relayed among like-minded artists across ideological boundaries and national frontiers. Much of the work created was collaborative, and personal encounters were at its heart. Drawing on archival documents and interviews with participants, Kemp-Welch focuses on the exchanges and projects themselves rather than the personalities involved. Each of the projects she examines relied for its realization on a network of contributors. She looks first at the mobilization of the network, from 1964 to 1972, exploring five pioneering cases: a friendship between a Slovak artist and a French critic, an artistic credo, an exhibition, a conceptual proposition, and a book. She then charts a series of way stations for experimental art from the Soviet bloc between 1972 and 1976-points of distribution between studios, private homes, galleries, and certain cities. Finally, she investigates convergences-a succession of shared exhibitions and events in the second half of the 1970s in locations ranging from Prague to Milan to Moscow. Networking the Bloc, Kemp-Welch invites us to rethink the art of the late Cold War period from Eastern European perspectives.','0E.EUR78','null','networking-the-block-experimental-art-in-eastern-europe-1965-1981','2020-03-11 19:33:26','2021-02-05 17:37:13',7,'51qYYuBEfyL._SX389_BO1_204_203_200_.jpg','image/jpeg',39108,NULL,NULL,'null',1,709.47000000,1019833519,'NX542',227,206,0,'709.47 K32',1,'undefined',0,0,NULL),(2216,'null','978-0-9946251-0-6','An Illustrated Compendium of Notes on Preserving Food + Futures in an Age of Unsettlement','null','Cloudship Press & Frontyard Projects',108,2017,'Tessa Zettel','null','null','FSU093','null','an-illustrated-compendium-of-notes-on-preserving-food-futures-in-an-age-of-unsettlement','2020-03-11 20:01:10','2021-02-03 15:03:33',15,'2.png','image/png',317251,NULL,NULL,'null',1,NULL,NULL,NULL,NULL,NULL,1,NULL,1,NULL,0,0,NULL),(2217,'null','378-83-61156-92-5','On Gravity','null','Foksal gallery',58,2011,'Messner, Philipp','null','null','RES098','null','on-gravity','2020-03-11 20:12:14','2021-02-08 10:22:49',11,'3.png','image/png',550854,NULL,NULL,'null',1,709.20000000,0,NULL,NULL,NULL,1,'709.2 M583',1,'undefined',0,0,NULL),(2218,'null','978-3-8365-5058-1','1000 record covers','null','TASCHEN Bibliotheca Universalis',573,2015,'Ochs, Michael, 1943-','null','null','DES023','null','1000-record-covers','2020-03-12 12:49:12','2021-02-03 15:03:35',13,'5.png','image/png',183377,NULL,NULL,'null',1,741.66000000,1181814700,'NC1882',1,1,0,'741.66 O16',1,NULL,0,0,NU